INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(15, '14273480', '12701348', '2022-05-23', '09:43:05', '00:00:00', 8, 15, 1.63, NULL, 1, 'Se realiza observación de la clase completa: inicio - desarrollo y cierre.\r\n- Se observa una clase organizada, con preparación de recursos a través de la comunicación con apoderados.\r\n- Plantea objetivo y visibiliza con los estudiantes.\r\n- Utiliza diversos espacios para realización de su clase-\r\n- Se destaca la dimensión de responsabilidad profesional.\r\nACUERDOS:\r\n- Aplicar estrategias de clima de aula: \"en sus marcas\" y tiempo asignado.\r\n- Monitorear el trabajo que realizan los estudiantes con el fin de mejorar el proceso de evaluación con sus respectiva retroalimentación.\r\n- Dar instrucciones con paso a paso pero, sobre todo, verificar su comprensión con los estudiantes.\r\n- Realizar cierre de la experiencia de aprendizaje.\r\n'),
(16, '14273480', '14209132', '2022-05-23', '12:35:24', '13:40:24', 7, 27, 2, NULL, 1, '- Se realiza observación de clase completa.\r\n- Se observa un rol participativo durante toda la clase, con conocimiento de rutina diaria.\r\n- Se destaca su proactividad y preocupación por el orden y aplicación de normas.\r\n - Aplica estrategia de umbral al inicio de todas sus clases.'),
(17, '14273480', '18143931', '2022-04-07', '08:15:47', '09:24:47', 7, 34, 1.69, NULL, 1, '- Se observa clase completa.\r\n- Buen clima de aprendizaje.\r\n- Planteamiento de objetivo, buena disposición de la sala, ruta de aprendizaje y trabajo colaborativo.\r\n- Activación de conocimientos previos.\r\n\r\nACUERDOS:\r\n- Revisar estructura metodológica donde se hace necesario ofrecer material concreto a los estudiantes antes de pasar a lo simbólico. \r\n- Verificar instrucciones con los estudiantes-\r\n- Cierre: si bien se utiliza escala de metacognición, lograr que el cierre sea más participativo y focalizado en el objetivo.\r\n\r\n'),
(19, '13769322', '16404386', '2022-06-06', '10:55:16', '11:25:16', 16, 43, 1.96, NULL, 2, 'Profesor organiza filas para ingreso a la sala de clases.\r\nIngresa y luego utiliza las palmas para que los alumnos se organicen.  Les indica que espera el silencio para saludar.\r\nLes indica ¿qué haremos hoy? Recuerda la actividad de la semana anterior (lámpara), hoy les corresponde hacer el circuito eléctrico del aparato.\r\nPregunta ¿Cuántos tipos de circuito existen? ¿Cuál es el primer circuito? ¿Qué particularidad tenía un circuito en serie? Dibuja los símbolos de la electricidad y les consulta por su significado. ¿Qué les falta a los circuitos? ¿Qué pasa si uno falla? ¿Cuál es el segundo circuito?¿Qué particularidad tiene? (explica falla del circuito) ¿Qué pasa si me falla la tercera ampolleta? (alumnos responden)\r\nTrabajo práctico del día de hoy… Objetivo: Circuito en serie\r\nProfesor muestra el kit y les da indicaciones de su cuidado.\r\nHace en dibujo en la pizarra y les indica que es lo dibujado (que lo relacionen con los elementos del kit). Atiende dudas y les indica que pasará por los puestos.\r\nAnota el paso a paso en la pizarra\r\n1)	Separar los cables\r\n2)	Dibujar el diagrama del circuito en el cartón.\r\n3)	Quitar el cable, según el dibujo\r\n4)	Con cuidado pelar ambos extremos del cable cortado.\r\nProfesor indica que grabará un pequeño video indicando como realizarlo para que puedan desarrollarlo en sus hogares ya que la próxima semana es el aniversario del colegio.\r\nPasa por los puestos monitoreando el trabajo\r\nOrganiza las dudas hasta el 5 y las responde según el orden asignado.\r\n11:35 les da las indicaciones finales y les indica que deben guardar los materiales.\r\nACUERDO: Se felicita al profesor por el buen uso de tiempo.'),
(20, '13769322', '11845380', '2022-05-27', '10:05:53', '11:35:53', 11, 35, 2, NULL, 2, 'Profesor toma el curso a la hora. Organiza el curso en su formación. Ingresa a la sala y les da las indicaciones que realizarán en clase (deben anotar objetivo y llevar la hoja de pentagrama) Les hace contar los pentagramas y que los guarden como les enseñó.  Las formas a la salida de la sala y las sube ordenadas a música.\r\nSala de música: Ingresa y recuerda las instrucciones dadas en la sala.  Antes de comenzar recuerda la zona de seguridad de la sala de música.  Les da tiempo para que copien el objetivo de la clase (OA continuar la lectura musical melódica) Monitorea el avance de las alumnas.\r\nPregunta ¿Qué patrón hay en el pentagrama? ¿Qué notas hay en el pentagrama? Les indica las notas y les pregunta al azar que notas son. Les indica que las reconozcan en su pentagrama.  Revisa las notas.  Les hace pronunciar las notas musicales cantándolas. Les pone un “pulso” y lo relaciona con el cuerpo humano.\r\nCantan las notas (les enseña en voz baja para escuchar el sonido del pulso) Toca la guitarra para que las niñas canten al unísono.  Les colocar “secuencias” en la pizarra para que copien y un dictado en blanco del 1 al 7.\r\nMonitorea el trabajo de copiar la tarea para la próxima clase.  \r\nEn el cierre les indica que escriban en la parte final del cuaderno “como un diario de vida” expliquen con sus propias palabras lo que hicieron hoy.\r\nAcuerdos: Se felicita al profesor por la clase desarrollada.'),
(21, '13769322', '18149732', '2022-04-20', '08:15:31', '09:40:31', 18, 34, 1.88, NULL, 2, 'Profesor ingresa a sala y solicita que guarden todo lo que tienen de distractor sobre sus mesas.\r\nLes solicita que saquen el libro Tomo 1.  Pregunta que quien no tenga, lo puede compartir con el compañero.\r\nRetroalimentación ¿Qué hemos estado viendo las últimas clases? Sumas y restas con paréntesis. ¿Qué es el modelamiento matemático? Indica que es cuando se traduce de letras a un ejercicio matemático.\r\n08:25 les pide que abran el libro en la página 10. Solicita a un alumno que lea el ejercicio 3.\r\nEscribe hoy en la pizarra.  (mientras trabajan termina de pasar lista).\r\nExplica los ejercicios vinculándolos con la cotidianeidad.  Indica ejercicios a realizar (coloca tiempo visible).  Resuelve los ejercicios en la pizarra con ayuda de los alumnos. Monitorea el trabajo de los alumnos. Desarrolla ejercicios del Tomo 1 página 5. Monitorea avance e indica que lo que quede pendiente deben terminarlo en la casa como tarea.\r\nNo realiza el cierre de la clase.\r\nAcuerdos: Se felicita al docente por el trabajo ordenado.\r\nse le recuerda hacer un cierre final de las actividades.'),
(22, '13769322', '16161640', '2022-05-15', '11:55:38', '13:25:38', 16, 8, 1.92, NULL, 2, 'Profesor ingresa y saluda a los alumnos. Menú del Día “La sangre”. ¿Qué necesito para la clase?\r\nRealiza quiebre cognitivo mientras escriben (30 segundos). Un alumno lo resuelve.\r\nObjetivo “Conocer los órganos y tejidos involucrados en la circulación”.\r\nRealiza preguntas a los alumnos que indagan sobre el tema.  \r\nProyecta contenido de la sangre, luego de que los alumnos participen leyendo, comenta con preguntas, les indica que sólo deben escribir lo que está demarcado en la diapositiva con color amarillo.\r\nEl docente explica da concepto y lo relaciona con acciones que los alumnos puedan identificar.\r\nPosteriormente, realiza el cierre de la clase con preguntas del contenido entregado.\r\nTarea: Conocer su grupo sanguíneo.\r\nAcuerdos: Se felicita al docente en la clase\r\nDesarrollar una actividad mas lúdica en donde se observe la aplicación de lo aprendido'),
(23, '13769322', '17455726', '2022-04-07', '12:05:13', '13:25:13', 18, 27, 1.96, NULL, 2, 'Profesora entrega la prueba diagnóstica a los alumnos  de la nueva unidad, les explica que deben pegarla en el cuaderno y los felicita por el buen resultado.\r\nRealiza la retroalimentación de la prueba, proyecta ppt para su retroalimentación.\r\nInicia nueva unidad con “Hoy” (lo copan en su cuaderno) Vocabulario y guía.\r\nProyecta diapositivas con imágenes y vocabulario (hace repetir a los alumnos las palabras con su pronunciación)\r\nDocente entrega vocabulario para que lo peguen en el cuaderno. Practica vocabulario con los alumnos.\r\nEntrega guía de trabajo. Les da tiempo para desarrollar guía, monitorea trabajo.\r\nRevisa guía en forma conjunta proyectando en la pantalla, les pide que la peguen en su cuaderno\r\nAcuerdos: Se felicita a la docente por el trabajo realizado en la clase, ya que está organizado y ordenado, se respetan los tiempos de trabajo.\r\nSólo se conversa con la docente sobre el tema de “no hablar” los temas conductuales con todo el curso cuando no lo amerita.\r\n'),
(24, '13769322', '15564292', '2022-04-19', '08:15:21', '09:50:21', 13, 32, 1.42, NULL, 2, 'Profesora saluda a las alumnas.  Indica que guarden sus cosas porque observarán un video (noticia). Mientras observan el video, coloca fecha en la pizarra.  \r\nPregunta ¿Quién se acuerda que era la noticia? ¿Cuáles son las partes de la noticia?. Recuerda lo trabajado en la página 26 y que realizarían una noticia.\r\nEscribe el “Hoy” Escriben una noticia – Pauta C.A página 15 – Corrección de la noticia.\r\nRecuerdan el texto de “Ornicar”, lo comenta con las alumnas de qué se trata. Indica que hay preguntas “claves” para desarrollar una noticia a las cuales deben darle respuesta. (Quien o quienes? Donde? Cómo ocurrió? Cuándo? Por qué? Fecha)\r\nEscribe, en conjunto con las alumnas, una noticia en la pizarra. Va tomando las ideas de las alumnas y redacta un noticia.  Recuerda unas palabras de vocabulario que deben incluir las alumnas (después de mucho rato de instrucciones – algunas niñas ya tenía lista la tarea).\r\nLuego de eso, lee la pauta con la cual deben guiarse (está en la página del libro) Le pide a las alumnas que lean sus textos y que otras alumnas respondan las preguntas claves.\r\nFalta cierre\r\nACUERDOS: Mejorar la organización de la estructura de la clase.\r\nDar instrucciones claras frente al trabajo que deben desarrollar en clases.\r\nSe hace un reflexión sobre lo que se quería lograr y que aspectos ayudaron a esto y otros que estaban demás en la clase\r\n'),
(25, '13769322', '16161668', '2022-05-20', '10:05:51', '11:35:51', 14, 1, 1.32, NULL, 2, 'Profesor llega a la sala y saluda.  Indica que pondrá las notas de la actividad pendiente. Que la otra hora realizará tecnología y trabajará una guía que tiene relación con los patrones. El profesor les pide los trabajos para evaluarlos (los alumnos no tienen instrucciones para desarrollar alguna actividad).\r\n11:05 les solicita que tomen asiento. \r\n11:10 Objetivo: Identificar figuras simétricas y asimétricas para confeccionar un tangrama.\r\nActivación de conocimientos a través de preguntas.\r\nLes entrega una guía de trabajo para marcar simetría.  Desarrolla guía, monitorea trabajo.  Explica en la pizarra la solución\r\nACUERDOS: Completar la información de cada trabajo de Artes y Tecnología en los classroom.\r\nOrganizar los tiempos de clases (sobre todo inicio) ya que debe dar el objetivo, dejar claras las instrucciones de trabajo y posteriormente solicitar los trabajos para revisión.\r\nSe dará monitorea al inicio de la Clase en las próximas observaciones de clases.\r\n\r\n\r\nSe conversa con el docente que las dos clases observadas, presentan dificultad en el inicio ya que saluda e inmediatamente solicita trabajos, sin dar indicaciones de trabajo.  \r\nSe organiza la clase nuevamente con él y se indica que esta situación está ocurriendo también en primer ciclo; por ende, se le indica que se observarán sus próximas clases para ver como está desarrollando las nuevas instrucciones.\r\n'),
(26, '13769322', '11946370', '2022-05-23', '08:15:40', '09:40:40', 16, 22, 1.92, NULL, 2, 'Docente ingresa, saluda y monitorea el trabajo realizado la clase anterior. Les indica a los niños si recuerdan en vídeo visto anteriormente. Les indica que están próximos a una evaluación y que durante esta semana harán un reforzamiento de los aprendizajes para así prepararse para la prueba.\r\nTema: Consecuencias de la conquista.  Realiza preguntas de retroalimentación. Indica las páginas de trabajo que deben reforzar los alumnos. Escribe 7 preguntas del cuestionario dado anteriormente y luego relaciona contenido.\r\nLos alumnos participan leyendo las preguntas, opinando sobre su respuesta.  \r\nTicket de salida. (3 preguntas) Monitorea el trabajo desarrollado por los alumnos (7 preguntas).\r\nAcuerdos: \r\nSugerencia: Falta un apoyo visual para reforzar lo que estaban repasando'),
(27, '13769322', '19758313', '2022-05-04', '10:05:43', '11:35:43', 15, 32, 1.81, NULL, 2, 'Profesora saluda y solicita el cuaderno. ¿Qué vimos la clase pasada? (Poema) Hace una diferencia entre autor y hablante lírico. Comienza a ver partes del poema y pregunta ¿Qué tipos de rima encontramos en un poema? ¿Qué es una rima asonante? ¿Cuáles son las rimas consonantes? Hace diferencia entre autor y hablante lírico. Participa la E.D solicitando que participen en la actividad ejemplificando con rimas en la pizarra. Felicitan a las alumnas constantemente por su participación en clases. Explica que verán rima libre. Educadora solicita poner la fecha del día de hoy en los cuadernos. Trabajan en página 62 ¿de qué creen que trata la rima libre? La profesora monitorea la clase. Dicta “rima libre”: OA: Identificar y analizar los tipos de rimas y figuras literarias en los poemas. (dicta contenido). Escribe ejemplos en la pizarra.\r\nConsulta educadora entre la diferencia entre una rima asonante, consonante y libre. Página 62.\r\nEducadora lee poema “El árbol”\r\nEducadora le indica que si existe algún tipo de rima. Alumnas participan.\r\nLes indica que verán una canción para analizar la próxima clase.\r\nAcuerdos: Reforzar los tres tipos de rima en una canción.\r\nSe hará en aula diversificada. (diversificación de la entrada)\r\nHacer quiz breve que identifiquen los tipos de rima.\r\n'),
(28, '13769322', '19404149', '2022-04-07', '08:15:01', '09:40:01', 14, 34, 1.46, NULL, 2, 'Profesora recuerda las normas de la sala. Indica el “Hoy”. (tiene tiempo)\r\nEntrega el cálculo mental (10 minutos) Revisión de cálculo (coloca música)\r\nRealiza la revisión del cálculo mental. Revisión de cálculo mental (la intercambian con un compañero) La revisa en pizarra.\r\n09:00 Profesora proyecta libro del estudiante y explica desde su puesto lo que deben realizar. (no usa pizarra)\r\nRevisa los problemas con los alumnos. Recuerda los pasos matemáticos.\r\nLes da la explicación oral (no usa pizarra).\r\nDesarrolla los ejercicios de descomposición.  Los alumnos participan en el desarrollo de los ejercicios.  Realiza la misma acción con los ejercicios 4 y 4 de la página 45.  Llama la atención de los alumnos para que se normalicen en clases.  \r\nLes indica que deben trabajar en la página 46, los alumnos se comienzan a levantar de la silla, mientras ella monitorea. \r\nNo realiza el cierre de la clase.\r\nAcuerdos: Disminuir el hoy (con actividades que se realizarán efectivamente en clases)\r\nEnfocar el cálculo mental en la multiplicación.\r\nUtilizar la pizarra para desarrollar los ejercicios uno a uno.\r\nDesarrollar una rutina de trabajo de la clase.\r\n'),
(29, '13769322', '10004488', '2022-05-03', '08:15:23', '09:40:23', 14, 34, 1.92, NULL, 2, 'Se observa clase con modificación de horario. (Clase de Taller de Geometría).\r\n08:20 ingresa a la sala docente y les indica a los alumnos que trabajarán en las guías que no han desarrollado en la asignatura (por ausencia de clase).\r\nLa docente realiza una retroalimentación con los alumnos (breve) sobre lo visto en clases. Los alumnos participan en forma ordenada y aleatoria.  Recuerdan para qué sirven los mapas, las cuadrículas y el sistema de coordinadas.  Los alumnos responden correctamente. Recuerdan los puntos cardinales.\r\nEntrega guía a los alumnos y les dirige las preguntas sobre que lo observan en el plano (se dirige muy bien la actividad).  Invita a los alumnos a participar leyendo las preguntas, guía las respuestas de los alumnos y realiza preguntas de comprensión.\r\n08:55 Realiza un cambio de guía de trabajo.  Les indica que deben aplicar lo que han realizado en la primera guía. Posteriormente dibuja una cuadrícula en la pizarra para trabajar su “propio mapa de su hogar”\r\nRealiza el cierre reforzando la importancia de los planos.\r\nAcuerdos: Se felicita a la docente por el buen aprovechamiento del tiempo y además por el trabajo con los alumnos de retroalimentación de los contenidos'),
(30, '13769322', '19404149', '2022-05-10', '08:15:19', '09:40:19', 14, 34, 1.73, NULL, 2, 'Profesora a las 08:15 y hasta las 08:23 realiza cambios de puesto. Educadora diferencial ingresa a sala a las 08:19. Les pide que guarden sus cosas, que saquen el cuaderno de matemática y el de estudiante (después de estar todos ordenados, se vuelven a desordenar).\r\nPone en la pizarra Sesión Nº 4 \r\nPlan 3 Hoy:\r\nCuaderno de actividades página 56 / Texto estudiante página 75 y 76\r\nCuaderno de actividades página 57\r\nTicket de salida de la página 75\r\nMientras escribe en la pizarra los alumnos hacen cálculo mental y terminan de escribir lo que está en la pizarra. Educadora y profesora pasa por los puestos monitoreando\r\n08:40 Les pide que abran la página 56 del libro. Comienza a ver los ejercicios de la página y les consulta sobre las partes de la división. Explica los ejercicios que proyecta en el televisor. Da 15 minutos para desarrollar la página 56. (Les indica que quien termine la página soliciten una guía breve que deben pegar en el cuaderno)\r\n09:04 Camila da las indicaciones de la actividad.\r\nEducadora le pide a un niño que vaya a la pizarra y que resuelva el primer ejercicios de la página 56. Aleatoriamente elige alumnos para desarrollar ejercicios en la pizarra. Educadora les hace leer el enunciado del problema a un alumno.\r\n09:23 le indica a los alumnos que lean sus problemas una vez que la profesora Camila desarrolla completa la página 56 con los alumnos en la pizarra.\r\n09:25 indica que deben realizar página 75 del texto del estudiante. Realiza revisión con palitos preguntones.\r\nCierre. Realiza ticket de salida\r\nAcuerdos: En coordinación con PIE revisar distintas estrategias del plan (uso de material concreto).\r\nOptimizar los tiempos en aula en referencia al material a utilizar.\r\n'),
(31, '7060271', '17079039', '2022-04-08', '10:05:13', '10:50:13', 9, 32, 1.88, NULL, 1, 'Se observa una clase organizada y dispuesta para trabajar. Al iniciar la clase se establecen las normas y la disposición de las alumnas. Se ve un curso que reconoce las rutinas, hay un trabajo ordenado y activo.\r\nSe sugiere detenerse en el error. Aprovechar la instancia de corregir y asegurar el aprendizaje en la niña que se equivoca. \r\nBien la clase.'),
(32, '7060271', '12604321', '2022-04-08', '09:00:01', '09:45:01', 8, 32, 1.88, NULL, 1, 'Se observa una sala de clases dispuesta al aprendizaje, hay niños de pie, caminan sin rumbo  y en ocasiones molestan a los compañeros. El profesor se mantiene con disposición hacia esos niños. LA asistente interactúa de manera muy activa con el profesor. La clase se realiza con inconvenientes ya que hay niños disruptivos que distraen al resto. Hay un buen manejo de los demás alumnos, se realizan pausas activas y hay buen manejo del contenido. '),
(33, '13769322', '13276799', '2022-06-07', '09:40:53', '10:35:53', 12, 32, 1.63, NULL, 2, 'Profesora toma el curso y realiza el umbral.\r\nLes pide a los alumnos que se ordenen y saquen el cuaderno rojo.\r\nLes indica que hoy estudiarán otro tipo de texto. Les pregunta ¿Cuáles fueron los tipos de texto que han visto? Nombran 10 tipos de textos que han visto en clases.\r\n\r\nLes indica que hoy verán las características de una leyenda.  Observan video de una leyenda, un alumno explica de qué se trata.\r\nLa docente reitera la instrucción de levantar la mano.  Los alumnos comentan leyendas locales como el Tue-Tue.  Los alumnos opinan sobre la leyenda local.  Docente monitorea constantemente al curso.\r\nPregunta: ¿Cuáles son las partes de leyenda? ¿una leyenda que se conoce en Chile, se puede encontrar en otro país?\r\nLes da la descripción y les solicita que saquen el cuaderno y que posteriormente verán una leyenda.\r\nHoy: Reconocer las características de la leyenda.  Escribe en la pizarra la definición. A raíz de la definición pregunta ¿Qué significa de generación en generación?  Les indica que hoy realizarán un desafío de escribir una leyenda “por qué el copihue es rojo”.  Luego de eso observan un video del “Calafate” pregunta ¿Qué explica la leyenda?¿Qué parte de la leyenda es realidad? ¿Qué parte de la leyenda es fantasía? Los alumnos participan en forma aleatoria y responden correctamente.\r\nDesafío. Crea tu propia leyenda “Por qué el copihue es rojo”.\r\nMonitorea el término del trabajo de los alumnos y timbra el cuaderno para salir a recreo\r\nAcuerdos: Coordinar mejor las clases para que la educadora diferencial participe activamente en co-docencia.'),
(34, '13956828', '15614452', '2022-04-06', '11:10:10', '12:20:10', 15, 34, 2, NULL, 1, 'Buen uso de tiempo consensuado, proyectando cronómetro en pantalla para visualizar el tiempo.\r\nExcelente uso de Lenguaje matemático y conceptos de la disciplina.\r\n\r\nAcuerdo:\r\nUtilizar estrategias de \"Rutinas de pensamiento\" como -Gira y Explica- para potenciar el trabajo sincrónico y colaborativo entre pares.'),
(35, '13956828', '13625118', '2022-04-06', '08:15:16', '09:45:16', 14, 22, 1.92, NULL, 1, 'Objetivo;:\r\n\"Ubicar lugares en un mapa, utilizando coordenadas geográficas como referencia\"\r\nClase comienza con motivación acerca de un viaje y qué hacer cuando estamos perdidos y tenemos un mapa ¿Cómo lo uso?\r\nProyecta imágenes audiovisuales relacionadas, marca meridianos y paralelos.\r\nRetroalimentación positiva constante.\r\n\r\nAcuerdo:\r\nVerbalizar la estrategia a utilizar para lograr el desarrollo de la habilidad a trabajar.\r\n'),
(36, '13956828', '17614827', '2022-04-10', '10:45:36', '11:45:36', 11, 32, 2, NULL, 1, 'Objetivo: \"Describir un elemento considerando características de un texto descriptivo\"\r\nClase desarrollada con excelente estructura, marcado Inicio, desarrollo y cierre.\r\nPreguntas de activación de aprendizajes claras, uso de rutinas, estrategias de clima de aula.\r\nExcelente trabajo colaborativo en conjunto con Educadora Diferencial.\r\n\r\nAcuerdos:\r\nMantener el trabajo de instrucciones y rutina diaria antes de comenzar la clase.'),
(37, '13956828', '8359770', '2022-05-23', '09:50:29', '10:30:29', 15, 43, 1.81, NULL, 1, 'Objetivo \"Usar internet en linea para compartir información de diferente carácter con otras personas, considerando la seguridad de la fuente y las normas de privacidad\"\r\nBuen uso de materiales audiovisuales y videos educativos para lograr el objetivo de la clase.\r\n\r\nAcuerdos:\r\nUtilizar estrategias de clima de aula, como 100% y tiempo consensuado.\r\nRecordar tener visible el tiempo para cerrar la clase en el tiempo adecuado y que el cierre efectivamente se haga.\r\n'),
(38, '13956828', '19908644', '2022-05-23', '11:15:17', '12:20:17', 11, 35, 1.15, NULL, 1, 'Clase de música enfocada a cantar de forma oral un repertorio musical nacional.\r\n\r\nAcuerdos:\r\nEstructurar y planificar la clase, marcando sus tres momento: Inicio, Desarrollo y Cierre.\r\nDeclarar el Objetivo y la habilidad a desarrollar en clases y cómo se logrará.\r\nUtilizar estrategias de clima de aula como: Umbral, 100% y hacer silencio.\r\nIncorporar una rutina de pensamiento a su clase.'),
(39, '13956828', '17614827', '2022-05-31', '11:10:18', '12:20:18', 11, 32, 2, NULL, 1, 'Objetivo \"Comparar características de la sociedad griega con la actual\"\r\n\r\nExcelente clase, se observa planificación rigurosa, alta participación de las estudiantes, preparación de la profesora, manejo conceptual, disciplinar y actitudinal.\r\n\r\nAcuerdo:\r\nMantener el nivel de trabajo y clases con las estudiantes y desafiar constantemente en el desarrollo de la habilidad al curso.'),
(40, '14511086', '17456104', '2022-05-25', '08:15:08', '09:15:08', 1, 1, 1.52, NULL, 2, 'Debido a la naturaleza de la asignatura que imparte y los disímiles niveles de conocimiento que evidencian los estudiantes, las mejoras deben enfocarse en optimizar los procesos de acompañamiento individual y de retroalimentación efectiva al 100% de los avances y logros que van adquiriendo. \r\nLas didácticas propuestas son interesantes para los estudiantes y resultan desafiantes sólo para aquellos que demuestran un nivel de conocimientos ajustado al nivel educativo de tercero medio.  \r\nSe debe fortalecer el proceso de cierre de la clase, de forma tal que se pueda verificar el nivel de logro general, pero también el personal, haciendo efectivos procesos de retroalimentación. '),
(41, '14511086', '15839252', '2022-05-26', '08:20:04', '09:15:04', 25, 29, 1.35, NULL, 2, 'Se observa una clase preparada cuyos recursos resultan interesantes para el grupo objetivo, los que bien escogidos facilitan la comprensión de los conceptos trabajados. \r\nDébil se observa la estructura, se comienza con una actividad que no promueve la activación cognitiva como es la entrega de pruebas corregidas. No se realiza un cierre de la clase. Esta concluye en medio de una actividad que siendo muy interesante no permite la interacción con las estudiantes en consecuencia no existe una instancia en que se pueda verificar en qué medida el logro del objetivo propuesto fue alcanzado, por quiénes fue alcanzado y desde ahí proyectar una continuidad del OA fundamentando las decisiones en las evidencias recogidas durante la clase.'),
(42, '14511086', '9141113', '2022-06-07', '08:20:50', '09:20:50', 25, 41, 1.46, NULL, 2, 'La clase observada presenta debilidades desde el espacio físico en que debe implementarse, siendo una actividad práctica se desarrolla en la sala de clases y no en un laboratorio de ciencias. Esto genera que el ambiente físico y las rutinas de trabajo se improvisen, generando con ello una sensación de desorden y desorganización, absolutamente contraria a las habilidades que deben ser fomentadas en este tipo de experiencias de trabajo en el área de ciencias. Esta gran debilidad es una condición ajena a las posibilidades de la profesora, pero que sin embargo inciden directamente en lo acontencido en la clase.\r\nLa experiencia propuesta es interesante, contribuyendo a aclarar los conoicimientos que se espera alcanzar, pero esto podría haberse fortalecido explicitando de forma más clara el para qué se hacia la actividad, más que el cómo. Si bien se pretendía concluir con una tabla de registros obtenidos de manera empírica, los procedimientos debían hacer conscinetes a las estudiantes de los conceptos involucrados durante. Rápidamente se convirtió en un acto automático de medición para llenar la tabla de valores, dejando para la siguiente clase el análisis de los resultados, los procesos de reflexión y por ende, de revisión y retroaliementación de los aprendizajes alcanzados. Si bien se comprende que las condiciones de implementación (no tener laboratorio) y la reducción del tiempo de clases (menos de 1 hora, porque ocuparon un tiempo en celebrar el cumple de su profesora jefe, además del acortamiento de las horas de clases) disminuyeron el potencial formativo de una actividad practica.'),
(43, '11537827', '15221803', '2022-05-17', '12:25:55', '13:14:55', 8, 32, 2, NULL, 1, 'Muy buen manejo de estrategias de  clima de aula y de metodologías activa de enseñanza. \r\n'),
(44, '11537827', '19908644', '2022-05-03', '11:10:27', '12:10:27', 7, 35, 1.4, NULL, 1, 'Falto el trabajo con material concreto que permitiera mayor comprensión por parte de los estudiantes. \r\nMejorar en manejo de la voz \r\nSeguir aplicando estrategias de clima de aula. \r\nUn buen ambiente de trabajó'),
(45, '14511086', '9433399', '2022-06-15', '09:40:40', '10:15:40', 25, 1, 1.85, NULL, 1, 'La clase observada corresponde de acuerdo al ajuste de horario a una clase de 35 minutos. Estas condiciones de implementación resultaron en una debilidad para realizar una clase efectiva, desde la estructura, desde los tiempos para cumplir con un debido inicio y desarrollo, limitando las instancias de participación y el cierre desde la dificultades para la verificación de los logros de aprendizaje.\r\nConsiderando en incierto escenario escolar se sugiere y acuerda considerar ajustes en la planificación para la implementación efectiva de clases en tiempo limitado. Más aún en aquellas donde los estudiantes se trasladan de sus salas a la sala de arte y se juntan dos cursos 2A y 2B. Lo que implica un disminución ya de tiempos limitados. '),
(46, '14511086', '19405021', '2022-05-24', '10:15:41', '11:15:41', 22, 34, 1.85, NULL, 1, 'La clase observada se desarrolla en un clima adecuado para alcanzar metas académicas: No obstante, la profesora quien está en su primer año presencial en el colegio, el anterior fue en contexto de pandemia. No demuestra conocimiento, ni uso de rutinas especifícas de gestión de clima de aula, porque nunca ha participado de capacitaciones que la preparen en las que especificamente hace referencia esta pauta; No obstante, algunas como tiempo visible y chequeo de la comprensión de instrucciones como del aprendizaje han sido trabajadas con la coordinadora académica, aplicando hoy con  pertinencia y eficiencia.\r\nEn cuanto a la estructura de la clase respeta los grandes momentos y cumple con su finalidad, sin emabrago debe avanzar en el cierre desde las estrategias de recogida de evidencias que permita proponer un proceso de retroaliemntación efectivo del aprendizaje para todos los estudiantes de la clase. La retroaliemntación efectiva del proceso de aprendizaje para el 100% de los estudiantes es hoy un desafío grande en la asignatura que imparte, del mismo modo en que lo es la diversificación de estrategias de enseñanza que favorezcan a todos y todas las estudiantes. He aquí los principales desafíos del trabajo en su asignatura.'),
(47, '7060271', '19756598', '2022-04-11', '13:30:30', '14:30:30', 1, 32, 1.77, NULL, 1, 'Se realiza observación de la rutina de la clase, se le solicita acompañamiento de aula entre pares, específicamente a kinder. Buen manejo del grupo curso. Excelente codocencia con la asistente de aula, se nota un trabajo organizado y planificado. Hay niños que circulan por el aula, los que son abordados para lograr su integración al curso.'),
(48, '7060271', '16161542', '2022-04-22', '14:00:55', '15:00:55', 2, 32, 1.95, NULL, 1, 'Se observa la rutina inicial de la clase, es una clase planificada pero que se ve interrumpida constantemente por alumnos disruptivos que general alta distracción de sus profesoras y compañeros, aún así se logra establecer cierto orden y trabajo coordinado. La profesora realiza los esfuerzos para completar la rutina, lo cual logra. Se le sugiere observación entre pares, específicamente kinder. '),
(49, '7060271', '17816865', '2022-04-22', '15:30:06', '16:30:06', 3, 32, 1.95, NULL, 1, 'Se observa una clase ordenada y participativa, existe un excelente clima de aula, la profesora se dirige a los alumnos con un muy buen tono de voz y mantiene la atención de los estudiantes. Se observa una rutina establecida ya que los niños y niñas saben que hacer. Se realiza un trabajo colaborativo con la asistente de aula.'),
(50, '14402737', '17614804', '2022-06-17', '08:51:30', '09:36:30', 19, 36, 1.93, NULL, 1, 'En general presenta un buen manejo de los contenidos, prepara las clases y material de trabajo con las estudiantes. además genera vinculo y trato respetuoso con su curso'),
(51, '7060271', '15086447', '2022-04-18', '08:30:11', '09:30:11', 4, 32, 2, NULL, 1, 'Se acompaña la rutina, la profesora tiene un buen manejo del grupo curso, hay un trabajo organizado y planificado. La profesora da oportunidades diferentes a los alumnos. Hay un trabajo respetuoso entre ellos. Hay niños que deambulan por la sala, siendo redirigidos al trabajo grupal. Se potencia la rutina implementando de manera eficiente la rutina de MAE. Existen estrategias que dan resultado, como el tiempo visible. Ayuda a la organización individual de los alumnos. '),
(52, '7060271', '17801292', '2022-04-18', '09:30:04', '10:05:04', 5, 32, 2, NULL, 1, 'Se observa una clase organizada y planificada, la profesora da oportunidades a todos sus estudiantes, se genera un buen ambiente de trabajo. Hay un buen manejo de las estrategias MAE. Se les da la oportunidad de aprender a través del error. Hay un trabajo de un curso participativo y que demuestra claramente aplicación de las estrategias aplicadas que denota un trabajo previo.'),
(53, '7060271', '15086541', '2022-04-18', '10:30:06', '11:30:06', 6, 32, 1.95, NULL, 1, 'Se observa una clase planificada donde se aplican estrategias de conciencia fonológica, profesora genera un muy clima de aula donde los alumnos se presentan participativos y atentos, se nota un buen trabajo de codocencia. '),
(54, '7060271', '16161542', '2022-05-04', '08:30:35', '09:30:35', 2, 32, 2, NULL, 1, 'Se observa una clase planificada, y un mejor clima de aula ya que favorece la ausencia de alumnos disruptivos, la profesora maneja adecuadamente los contenidos y aplica estrategias de aprendizaje que se aplica a todos los alumnos con dificultades. Se sugiere que se realice observación entre pares.'),
(55, '7060271', '15086541', '2022-05-04', '08:30:41', '09:30:41', 6, 32, 2, NULL, 1, 'Buen clima de aula, clase planificada y organizada, se nota conocimientos previos de los estudiantes, saben que hacer en cada momento de la clase. Buena intervención de la asistente de aula. Trabajo colaborativo. '),
(56, '7060271', '17079039', '2022-05-04', '10:05:48', '10:45:48', 9, 34, 1.95, NULL, 1, 'Se observa un buen trabajo de seguimiento con las alumnas, las estudiantes conocen la rutina y la trabajan demostrando el aprendizaje de manera grupal. Se sugiere el aprovechamiento del error. Alumnas participativas y activas. Clase ordenada. No hay intervención de la educadora diferencial, quien llega tarde a la clase.'),
(57, '9089119', '16274647', '2022-05-31', '09:45:50', '10:55:50', 21, 29, 1.7, NULL, 1, 'Objetivo de la clase: Resumir a través de pictograma un relato de Sherlock H.\r\n\r\nSe desarrolla trabajo interdisciplinario entre artes visuales y plan lector, lo que responde positivamente a sugerencia entregada desde coordinación académica para motivar a los estudiantes a través de este tipo de iniciativa entre docentes. Esta clase es la practica donde la meta de hoy es realizar 5 imágenes y 6 resúmenes de manera individual. Se observa clase preparada y material de apoyo adecuado.\r\n\r\nDocente Inicia presentando el objetivo en la pizarra y mostrando un pictograma con el cual realiza preguntas de conocimientos previos, además lee desde la pizarra punteo de materiales que se requieren para la actividad.\r\n\r\nEn el inicio también se observa intervención de codocencia con la profesora de PIE (María José) quien entrega algunos comentarios para situar el trabajo y luego va monitoreando los trabajos que se desarrollan individualmente.\r\n\r\nDocente conoce a las estudiantes, las indica por su nombre y se vincula positivamente con ellas, manteniendo un buen clima de aula con factor alegría.\r\n\r\nDurante el desarrollo de la clase atiende a cada una, realizando comentarios positivos y revisando avance a través de una pauta, sin embargo, hay estudiantes que se adhieren poco al trabajo, se sugiere realizar sin salida, ya que no todas las estudiantes son participativas.\r\n\r\nNo se observa gestión en la utilización del tiempo consensuado y cierre de la clase muy ajustado sin revisar el logro de la habilidad ni la calidad de los resultados.\r\n\r\n\r\n\r\nFocos de mejora:\r\n\r\nExplicitar e intencionar con las estudiantes que la actividad busca el logro de la habilidad, realizando seguimiento y retroalimentación efectiva del estado de avance y al cierre.\r\n\r\nProcurar trabajo sincronizado, consensuando el tiempo, ya que hay estudiantes que trabajan muy lentamente o con resultados de baja calidad, se sugiere avanzar con metas cortas.\r\n\r\n\r\n\r\nObservación de la docente: Indica que el trabajo fue un proceso que no inicio ella, y que las instrucciones las entrego la docente de reemplazo, lo que ha provocado que las estudiantes estén en distintos estados de avance.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(58, '9089119', '15177877', '2022-06-09', '08:15:36', '09:00:36', 26, 27, 1.96, NULL, 1, 'Objetivo: introducir y aplicar la estructura gramatical en pasado perfecto.\r\n\r\nSe inicia con estrategia en sus marcas, falto explicitarla\r\n\r\nPresenta el objetivo y lo vincula a la clase anterior, falta explicitar la habilidad a desarrollar.\r\n\r\nDurante el desarrollo de la clase los estudiantes se ven muy atentos y participativos creándose un ambiente propicio, todos trabajan motivada y sincronizadamente según ritmo e indicaciones de la docente.\r\n\r\nSe apoya con material visual adecuado y va retroalimentado de manera permanente, escribiendo los puntos claves del contenido en la pizarra, esto impacta positivamente en el clima y ritmo de la clase.\r\n\r\nConoce a sus alumnos a quienes indica por su nombre vinculándose positivamente con ellos\r\n\r\nRealiza preguntas a estudiantes específicos, pero no se realiza sin salida\r\n\r\nUtiliza estrategia de tiempo compartido.\r\n\r\n\r\n\r\n\r\n\r\n\r\nFoco de trabajo:\r\n\r\nPresentar el objetivo de la clase presentando la habilidad e intencionándola como meta compartida.\r\n\r\nRealizar estrategia sin salida para que todos los estudiantes demuestren su aprendizaje\r\n\r\n\r\n'),
(59, '9089119', '19650762', '2022-05-23', '11:10:50', '12:00:50', 23, 29, 1.76, NULL, 1, 'Objetivo: “Conocer y aplicar las características de un debate formal”\r\n\r\nLa docente ingresa a la hora establecida e inicia recordando conocimientos vistos en la clase pasada sobre la estructura del debate.\r\nSe utiliza material audiovisual adecuado y se presenta el objetivo en la pizarra, pero después de iniciada la clase, durante el desarrollo \r\n\r\nSe trabaja sicronizadamente y las estudiantes logran expresar argumentos (¿deben existir los zoológicos?), promoviéndose una buena participación, sin embrago hay estudiantes que se restan del trabajo.\r\n\r\nEl ambiente de trabajo es difícil de crear en principio por falta de estrategias de clima de aula, muchas estudiantes participan activamente, pero a la vez se observa a algunas realizan otras actividades que no son propias de la clase\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\nFocos de trabajo:\r\n\r\nUtilizar estrategias de clima de aula como umbral y en sus marcas para promover el inicio de la clase en un ambiente propicio para el aprendizaje, y cien por ciento para involucrar a mas estudiantes en la participación activa.\r\n\r\nTrabajar de manera sincronizada y con metas cortas.\r\n\r\n\r\n'),
(60, '9089119', '13312214', '2022-05-20', '09:45:48', '10:30:48', 23, 41, 1.8, NULL, 1, '\r\nObjetivo de la clase: “Representar las reacciones químicas”, se presenta el objetivo, falta explicitar la habilidad a desarrollar.\r\n\r\nSe observa una clase con material de apoyo adecuado, se recuerdan conocimientos previos.\r\n\r\nLa primera parte de la clase es expositiva donde la docente explica la ecuación y luego desarrollan una guía de trabajo, la que va monitoreando individualmente.\r\n\r\nSe observa un buen manejo disciplinar conceptual y un vínculo positivo con las alumnas.\r\n\r\nAlgunas estudiantes participan respondiendo preguntas que realiza la docente, se debe promover la participación de todas con una estrategia como un sin salida o cien por ciento.\r\n\r\nVarias estudiantes tienen sus lugares de trabajo con cosas que no son propias de la clase.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nSugerencia de trabajo:\r\n\r\nComenzar la clase con una estrategia como en sus marcas, que permita generar un ambiente propicio y de orden del entorno para el aprendizaje.\r\n\r\nRealizar estrategia como sin salida, para promover la participación de todas las estudiantes. \r\n\r\n\r\n'),
(61, '9089119', '16283844', '2022-06-15', '09:45:53', '10:55:53', 20, 34, 1.78, NULL, 1, 'Objetivo de la clase: reforzar contenidos para evaluación de nivel\r\n\r\n\r\nSe observa una clase en donde se modelan ejercicios en la pizarra, recordando conocimientos previos y reforzando positivamente a los estudiantes que participan, sin embrago hay que comprobar el trabajo de cada uno ya que algunos se retaron del trabajo.\r\n\r\nSe observa un adecuado manejo conceptual disciplinar y docente se vincula positivamente con todos los alumnos.\r\n  \r\nEl clima de aula debe mejorarse en este curso ya que es un ambiente poco propicio, faltan estrategia de silencio, profesora habla por sobre el ruido que se genera en la sala\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nSe sugiere trabajar en dos focos:\r\n\r\nDesarrollar estrategias de clima de aula para crear un ambiente que asegure la participación de todos como por ejemplo sin salida\r\nHacer tiempo visible, avanzar con metas cortas, para desarrollar trabajo sincronizado\r\nUtilización texto del estudiante\r\n'),
(62, '9089119', '19274209', '2022-06-13', '09:45:40', '10:55:40', 29, 29, 1.93, NULL, 1, 'Objetivo Conocer y comprender los tipos de discurso público\r\n\r\nSe motiva la clase con una actividad de entrada en donde docente PIE y de asignatura realizan simulación de discurso, luego se presenta el objetivo y una ruta de trabajo sobre el desarrollo de la clase \r\n\r\nSe observa codocencia en actividad de motivación inicial y en intervenciones regulares que desarrolla la docente, con apoyo de material visual apropiado al tema desarrollado.\r\n\r\n\r\nSe observa un ambiente propicio, las estudiantes se ven atentas e interesadas participando y opinando, las que son reforzadas positivamente por ambas profesoras. Se trabaja sincronizadamente creándose un ambiente de trabajo ordenado.\r\n\r\nSe aplica estrategia sin salida lo que promueve participación activa, la docente conoce a las estudiantes indicándolas por su nombre\r\n\r\n\r\nSe sugiere trabajar.\r\n\r\nFalta explicitar la habilidad como meta compartida\r\nPregunta retórica\r\n\r\n Se felicita a la docente ya que utilizo estrategias de clima de aula logrando activa participación y trabajo sincrónico según sugerencias de acompañamiento realizado anteriormente \r\n\r\n'),
(63, '9089119', '15179215', '2022-05-17', '13:10:37', '13:40:37', 25, 42, 1.94, NULL, 1, 'Clase sobre 9 frutos del espíritu santo\r\n\r\nLa clase comienza a la hora establecida en donde se presenta el tema para desarrollar un trabajo en donde relacionarán a través de un dibujo frutas con los frutos del espíritu santo.\r\n\r\nSe observa un trato amable y alegre de parte de la docente, conoce a las estudiantes las indica con su nombre, vinculándose positivamente con todas las alumnas \r\nSe observa un adecuado manejo conceptual y una clase preparada con material adecuado y un propósito claro.\r\n\r\nFaltó incentivar mayor reflexión sobre el tema a tratar ya que la clase se focalizo mayormente en la lectura y en el dibujo del trabajo a desarrollar, sin embargo, se observa alta participación y compromiso de parte de las estudiantes.\r\n\r\n\r\nSugerencia:\r\n\r\n Explicitar el objetivo a abordar y desarrollar estrategias de clima de aula inicial para promover ambiente de trabajo como umbral y en sus marcar. \r\n\r\n'),
(64, '9089119', '19274209', '2022-04-05', '10:15:28', '10:55:28', 20, 29, 1.59, NULL, 1, 'Se observa una clase bien preparada con material adecuado, recordando conocimientos previos \r\nsistemáticamente refuerza positivamente a los estudiantes.\r\n\r\nSe observa un adecuado manejo conceptual disciplinar y docente se vincula positivamente con todos los alumnos.\r\n  \r\nEl clima de aula debe mejorarse en este curso ya que es un ambiente poco propicio, faltan estrategia de silencio.\r\n\r\nEstudiantes participativas sin embargo algunos no trabajan, los que son invitados a desarrollar la actividad varias veces, se debe comprobar avance de ellos.\r\n\r\n\r\nSugerencia:\r\n\r\n2 focos \r\n\r\nhacer tiempo visible, avanzar con metas cortas\r\ncierre de clase modelamiento de la habilidad que era argumentar\r\n\r\n'),
(65, '14273480', '19811341', '2022-05-26', '09:45:36', '10:54:36', 7, 1, 1.6, NULL, 1, 'Se observa la clase completa.\r\nDestaca el buen trato y clima de aula que genera la docente.\r\nAcuerdos:\r\n- Se solicita escribir el objetivo y desarrollarlo con las estudiantes, reforzarlo durante la clase con las estudiantes.\r\n- Utilizar estrategia de paso a paso para dar instrucciones. verificar su comprensión, a partir de estrategias de clima de aula.\r\n- Realizar cierre de la clase, recordando objetivo de la misma. Intencionar preguntas claves para internalizar y no dejar de hacerlo.\r\n'),
(66, '14273480', '18143931', '2022-05-31', '08:15:56', '09:20:56', 7, 34, 1.77, NULL, 1, 'Se destaca la dimensión de creación de un ambiente propicio para el aprendizaje.\r\nSe observa una clase planificada y organizada, con sus 3 momentos.\r\nAcuerdos:\r\n- Simplificar el objetivo, en relación a la escritura para gestionar de mejor forma el tiempo.\r\n- Revisar estrategia de paso a paso para dar instrucciones, comprobando con las estudiantes y favoreciendo el cumplimiento del objetivo.'),
(67, '14273480', '18412060', '2022-05-23', '12:40:45', '13:42:45', 7, 27, 2, NULL, 1, 'Se observa clase completa.\r\nRealiza clase estructurada en los 3 momentos, enfatizando cada uno de ellos.\r\nVerifica instrucciones con estudiantes.\r\nAcuerdos:\r\n- Implementar estrategias de clima de aula: \"en sus marcas\", \"hacer ahora, 100% u otro.\r\n- Implementar estrategias de rutinas de pensamiento.\r\n- Implementar estrategias para favorecer la evaluación formativa y a su vez la retroalimentación, focalizar monitoreo.\r\n- Coordinación enviará material para que la docente revise y decida implementar 1 rutina de pensamiento en sus clases posteriores.\r\n '),
(68, '14273480', '12701348', '2022-05-23', '09:45:13', '10:55:13', 8, 15, 1.63, NULL, 1, 'Se observa la clase completa.\r\nLa clase es organizada, con preparación de recursos, a través de comunicación con apoderados.\r\nSe destaca la dimensión de responsabilidad docente.\r\nAcuerdos:\r\n- Aplicar estrategias de clima de aula.\r\n- Monitorear el trabajo que realizan los estudiantes con el fin de mejorar el proceso de evaluación formativa y retroalimentación.\r\n- Dar instrucciones con estrategias de paso a paso pero, sobre todo, verificar instrucciones y su comprensión.\r\n- Realizar cierre.'),
(69, '14273480', '14209132', '2022-05-23', '12:35:08', '13:40:08', 7, 27, 2, NULL, 1, 'Se observa clase completa.\r\nPresenta un rol participativo durante toda la clase, con conocimiento de la rutina diaria.\r\nSe destaca su proactividad y preocupación por el orden y aplicación de normas en la sala.\r\nRealiza umbral, para favorecer clima de aula.'),
(70, '14273480', '14209132', '2022-05-26', '09:45:51', '10:54:51', 7, 1, 2, NULL, 1, 'Organiza recursos para el desarrollo de las actividades.\r\nSe mantiene atenta a las necesidades de las estudiantes y docente.\r\nMantiene orden y organización del trabajo.'),
(71, '14273480', '15648517', '2022-06-16', '09:15:27', '10:00:27', 5, 38, 2, NULL, 1, '- Se observa la rutina MAE: calendario matemático y se revisa pauta específica de MAE.\r\n- La docente da cuenta de realizar de forma sistemática la rutina del calendario.\r\n- Realiza todos los puntos del calendario, enfatizando más algunos que otros.\r\n- Los estudiantes participan activamente.\r\n- Se refuerzan constantemente las normas.\r\n- Se trabaja conciencia fonológica durante el calendario.\r\n\r\nAcuerdos:\r\n- Continuar desarrollando el calendario matemático, revisando pauta a seguir según MAE y haciendo consciente lo que menos se trabaja.\r\n'),
(72, '14273480', '13132976', '2022-06-16', '16:00:20', '16:35:20', 3, 38, 2, NULL, 1, '- Se observa una clase organizada y con sus 3 momentos.\r\n- Utiliza estrategia de paso a paso para dar instrucciones, plantea objetivo, utiliza recursos atractivos para lograr el objetivo.\r\n\r\nAcuerdos:\r\n- Aplicar estrategias de clima de aula y rutinas de pensamiento en las experiencias de aprendizaje.'),
(73, '14273480', '14609696', '2022-06-17', '10:30:04', '11:10:04', 2, 31, 2, NULL, 1, '- Participa en lectura compartida, rutina MAE, atentamente y con alegría, invitando a los estudiantes.\r\n- Se mantiene atenta a las necesidades de los estudiantes y la docente.\r\n'),
(74, '14273480', '16059492', '2022-06-16', '09:15:32', '10:05:32', 5, 38, 2, NULL, 1, '- Participa de las actividades con conocimiento acabado de ellas y con proactividad.\r\n- Se mantiene atenta a los estudiantes y sus necesidades.'),
(75, '16009922', '15519211', '2022-06-09', '11:34:02', '12:35:02', 6, 17, 1.9, NULL, 2, '- Adecuado inicio de clases, con dinámica de atención.\r\n- Maneja el clima de aula, con diferentes estrategias.\r\n- Al momento de los grupos, aborda de manera coherente el objetivo, las actividades y el cierre del momento en partiular.\r\n- Se intenciona la metacognición en las preguntas de cierre.\r\n- En el momento de la clase se observaun trabajo de codocencia con la educadora de párvulo.\r\n- Se utilizan rutinas de pensamiento tales como, proponer predicciones.\r\n- Se sugiere dar una breve orientación sobre el trabajo a realizar antes de separar a los niños en los tres grupos.\r\n- Se sugiere conocer el criterio por el cual están agrupados los estudiantes, en la medida de lo posible, participar en la distribución.');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(76, '16009922', '19386893', '2022-06-13', '09:45:15', '10:55:15', 29, 32, 1.88, NULL, 2, '- Se observa un inicio de clase que incluye \"factor sorpresa\", considerando temas de interés de los estudiantes.\r\n- Se observa un trabajo coordinado entre las docentes en la sala, durante toda la clase.\r\n- Se sugiere seguir trabajando en el uso de rutina de clima de aula y habilidades de pensamiento.\r\n- Favorecer preguntas metacognitivas durante el desarrollo o cierre de la clase.\r\n- Considerar que todas las actividades deben ir acorde al logro del objetivo.\r\n- Planificar y/o monitorear el tiempo de clases, ocupando tiempo consensuado para lograr realizar todos los momentos de la clase.\r\n- Favorecer el rol de formadores; considerando la virtud, oración u otro.'),
(77, '9089119', '11972654', '2022-06-16', '08:15:27', '09:00:27', 23, 15, 1.88, NULL, 1, 'Objetivo de la clase: Habilidades motoras en realidad de juego\r\n\r\nSe presenta el objetivo verbalmente, falta explicitar la habilidad y/o destreza a desarrollar, para que sea compartida\r\n\r\nDocente comienza entregando instrucciones del trabajo y recordando trabajo anterior. Posteriormente la clase se desarrollan en el gimnasio\r\n\r\n.Se observa una clase estructurada, con material que se adecua para motivar a las estudiantes   generando un ambiente propicio para el ejercicio  físico , con estudiantes participativas, logrando que disfruten la actividad.\r\n\r\n Hay estudiantes que no se adhieren al trabajo, debido a problemas de salud y que están debidamente justificadas.\r\n\r\nConoce a los estudiantes, los indica por su nombre generando un vínculo positivo y generando factor alegría\r\n\r\n\r\nSugerencia de trabajo:\r\n\r\nPresentar el objetivo, intencionando la habilidad como meta compartida\r\n\r\nVerificar al inicio de la clase antes de la actividad física las justificaciones de aquella que no adhieren por situaciones de salud.\r\n\r\nGenerar trabajo complementario para aquellas que no pueden realizar actividad física.\r\n\r\n'),
(78, '14273480', '19908644', '2022-06-22', '08:45:00', '09:20:00', 10, 35, 1.2, NULL, 2, '- Se observa el desarrollo y cierre de la clase. El docente se encuentra realizando evaluación, por lo cual se focaliza la observación en: clima de aula, responsabilidad profesional y evaluación formativo con sus respectiva retroalimentación.\r\nAspectos a mejorar:\r\n- Clima de aula: uso sistemático de normas de la clase, 5S.\r\n- Retroalimentación del proceso de evaluación.\r\n- Organización de la clase con sus 3 momentos, ofreciendo actividades en los distintos momentos.\r\n- Manejo de la voz y forma de llamar la atención o focalizar la atención de los estudiantes para favorecer el aprendizaje.\r\n- 2do semestre: coordinación informará visitas al aula para observación de pares, generando instancias de colaboración.\r\n'),
(79, '9089119', '19540432', '2022-06-17', '08:15:17', '09:00:17', 22, 8, 1.8, NULL, 1, 'Objetivo de la clase: Comprender el concepto de circuito eléctrico y sus componentes\r\n\r\nSe presenta el objetivo escribiéndolo en la pizarra, falta explicitar la habilidad y la estrategia\r\n\r\nDocente comienza recordando conocimientos previos a través de pregunta clave \r\n\r\nRealiza en sus marcas después de iniciada la clase, se realiza sin explicitar la estrategia para que sea compartida.\r\n\r\nSe observa una clase bien preparada con material adecuado, generando un ambiente propicio para el aprendizaje, con estudiantes participativos, sin embargo, hay estudiantes que no se adhieren al trabajo, se debe verificar el avance de cada uno.\r\n\r\nPromueve la justificación de ideas solicitando fundamentación a las preguntas realizadas, se observa que estas se realizan de manera generalizada, provocando que la participación no sea ordenada ni escuchada por todos.\r\n\r\nSe desarrolla actividad de desafío en la que todos se motivan y participan.\r\n\r\nConoce a los estudiantes, los indica por su nombre generando un vínculo positivo con ellos.\r\n\r\n\r\nSugerencia de trabajo:\r\n\r\nRealizar estrategias cien por ciento o sin salida, para promover participación ordenada de todos y consensuar el tiempo asignado para actividad  \r\n\r\nPresentar el objetivo, intencionando la habilidad como meta compartida\r\n\r\n\r\n'),
(80, '9089119', '17899117', '2022-04-05', '11:10:08', '12:20:08', 30, 34, 1.85, NULL, 1, 'Refuerza positivamente y comprueba comprensión individual de los estudiantes, atendiendo perzonalizadamente a cada uno, y realizando modelamiento del desarrollo de los ejercicios.\r\n \r\nConoce a los alumnos, se dirige a ellos por su nombre.\r\n\r\nSe observa un ambiente propicio, sin embargo, algunos estudiantes no trabajan, los que son invitados a desarrollar los ejercicios varias veces, logrando un avance en ellos.\r\n\r\nLos estudiantes son participativos, y se genera un ambiente de colaboración entre varios.\r\n \r\n No se observa gestión en la utilización del tiempo, algunos estudiantes más avanzados que terminan se aburren y algunos no terminan. \r\n\r\nEl cierre de la clase es muy ajustado, solo 3 minutos.\r\n\r\n\r\n\r\n\r\n\r\nSugerencia:\r\n\r\nGestión del tiempo y avance sincrónico de los estudiantes \r\nMejorar cierre de la clase\r\n\r\n\r\n\r\n'),
(81, '9089119', '18389625', '2022-04-05', '12:40:38', '13:45:38', 29, 34, 1.77, NULL, 1, 'Se observa una clase bien preparada con material adecuado, recordando conocimientos previos y generando un ambiente propicio para el aprendizaje, con estudiantes participativas.\r\n\r\nComprueba comprensión de las instrucciones.\r\npromueve la justificación de ideas solicitando fundamentación.\r\n\r\nConoce a los estudiantes y los indica por su nombre\r\n\r\nSe presenta objetivo falta explicitar la habilidad y la estrategia\r\n\r\nSe observa un buen manejo disciplinar conceptual y un vínculo positivo con las estudiantes\r\n\r\nSugerencia de trabajo:\r\n\r\nPresentar el objetivo, intencionando la habilidad como meta compartida\r\n\r\nElevar desafío de la clase \r\n'),
(82, '9089119', '19596040', '2022-06-06', '09:45:07', '10:20:07', 20, 40, 1.83, NULL, 1, 'Objetivo de la clase: “Crear un afiche para presentación de maqueta de máquina de ejercicios”, \r\n\r\nSe presenta el objetivo, falta explicitar la habilidad a desarrollar.\r\n\r\nSe observa un buen manejo disciplinar conceptual y un vínculo positivo con las alumnas.\r\n\r\nRefuerza positivamente y comprueba comprensión individual de los estudiantes, atendiendo de manera personalizada a cada uno, y realizando retroalimentación, sin embargo cuesta organizar el trabajo de algunos grupos , varias estudiantes tienen sus lugares de trabajo con cosas que no son propias de la clase, evidenciando la falta de estrategias como en sus marcas para iniciar la clase, por lo anterior no se observa gestión en la utilización del tiempo, algunos estudiantes van más avanzados  y algunos no se adhieren al trabajo. \r\n\r\n\r\nFoco de trabajo:\r\n\r\nComenzar la clase con una estrategia como en sus marcas, que permita generar un ambiente propicio para el aprendizaje.\r\n\r\nGestionar el tiempo y avance sincrónico de los estudiantes \r\n\r\n\r\n'),
(83, '9089119', '10042509', '2022-06-09', '09:45:10', '10:55:10', 30, 21, 2, NULL, 1, 'Clase híbrida por cursos en cuarentena \r\n\r\nObjetivo de la clase: Conocer dinámica de presencia de los ríos\r\n\r\nSe inicia con la entrega de trabajo anterior en donde se dan tiempo consensuado.\r\n\r\nUna vez recepcionados los trabajos docente presenta verbalmente el objetivo y propósito de la clase.\r\n\r\nSe comienza recordando conocimientos previos utilizando estrategias de sin salida, realizando preguntas claves a estudiantes presenciales y on line, retroalimentando y vinculándose positivamente con los estudiantes. \r\n\r\nSe observa un ambiente propicio, las estudiantes se ven atentas e interesadas participando y opinando según ritmo e indicaciones que entrega el docente con apoyo de material visual apropiado al tema desarrollado.\r\n\r\nRefuerza positivamente y comprueba comprensión individual de los estudiantes aplicando estrategias como sin salida y cien por ciento.\r\n \r\nConoce a las alumnas, se dirige a ellas por su nombre y se observa factor alegría presente.\r\n\r\n\r\n\r\nSugerencia:\r\n\r\n\r\nComplementar la clase con una actividad desafiante y/o lúdica \r\n\r\nDar más tiempo al cierre de la clase\r\n\r\nObservación del docente. Actividad lúdica está planificada para la próxima clase ya que en esta oportunidad se entregó elementos teóricos. Está de acuerdo con que falto más tiempo para el cierre.\r\n\r\n'),
(84, '9089119', '16139466', '2022-05-09', '11:10:38', '11:50:38', 30, 20, 1.84, NULL, 1, 'Presenta objetivo: “comprender de qué manera se manifiesta la aceleración en un movimiento rectilíneo” \r\n\r\nSe observa una clase bien preparada con material adecuado, recordando conocimientos previos y sistemáticamente refuerza a los estudiantes de manera positiva\r\n\r\nExiste un adecuado manejo conceptual disciplinar y docente se vincula positivamente con todos los alumnos.\r\n\r\n\r\n  Sugerencia:\r\n\r\nPresentar objetivo de la clase como meta compartida y explicitando la habilidad que se desea lograr.\r\nProcurar que el clima de aula sea desde el inicio de la clase para partir con un ambiente propicio.\r\n\r\n\r\n\r\n'),
(85, '9089119', '10072654', '2022-05-30', '09:45:42', '10:55:42', 30, 12, 2, NULL, 1, 'En la clase se desarrolla trabajo de arquitectura en perspectiva, en donde los estudiantes aplican técnicas de dibujo vista aérea.\r\n\r\nSe observa un ambiente propicio, todos los estudiantes trabajan motivada y sincronizadamente según ritmo e instrucciones claras que entrega la docente.\r\n\r\nVa retroalimentado de manera permanente y escribe todos los pasos ya realizados permitiendo la autoevaluación, esto impacta positivamente en el ritmo de la clase.\r\n\r\nRefuerza positivamente y comprueba comprensión individual de los estudiantes, atendiendo perzonalizadamente a cada uno, y realizando modelamiento del trabajo\r\n \r\nConoce a los alumnos, se dirige a ellos por su nombre y refuerza según sus habilidades.\r\n\r\nLos estudiantes son participativos, y se genera un ambiente de colaboración entre varios.\r\n \r\n\r\nSugerencia:\r\n\r\nMejorar cierre de la clase\r\n\r\n'),
(86, '9089119', '17223013', '2022-05-11', '09:45:46', '10:30:46', 29, 19, 2, NULL, 1, 'Se observa una clase preparada con material adecuado, recordando conocimientos previos sobre el tema a abordar que es “la felicidad” dentro de la Unidad: Bien común y la sociedad que espero.\r\n\r\nRealiza preguntas claves que permiten a los estudiantes la reflexión y los refuerza positivamente \r\n\r\nSe observa un adecuado manejo conceptual y la docente se vincula positivamente con todos los alumnos.\r\n\r\nSe crea un ambiente de   trabajo en que muchos estudiantes participan activamente, pero a la vez se observa a algunos sin trabajar, los que son invitados a participar sin lograr el avance con ellos, generando algunas interrupciones\r\n\r\n\r\nSugerencia:\r\n\r\nAplicar estrategias de clima de aula que regule la participación y escucha activa, se sugiere utilizar sin salida.\r\n\r\n'),
(87, '14273480', '10319779', '2022-06-17', '10:30:52', '11:10:52', 6, 31, 2, NULL, 1, '- Se observa clase completa: Lectura compartida, MAE.\r\n- El trabajo de la lectura compartida es sistemático, lo cual se refleja en la adquisición de la rutina en los estudiantes.\r\n- Incluye tarjetas de fluidez lectora, solicitado en observación anterior.\r\n- Implementa todos puntos de la LC, favoreciendo la participación activa de los estudiantes.\r\n- Se solicita continuar aplicando la rutina, siguiendo los puntos solicitados en la pauta con el fin de favorecer.'),
(88, '9089119', '14622138', '2022-06-29', '12:35:56', '13:10:56', 27, 14, 1.76, NULL, 1, 'Clase sobre Justicia y derechos humanos de la unidad 2.\r\n\r\nLa docente ingresa a la hora establecida, se presenta el tema y se entregan lineamientos de futura investigación y disertación\r\n\r\nRealiza preguntas claves que permiten a los estudiantes la reflexión y las refuerza positivamente vincula positivamente con todas las alumnas.\r\n \r\nSe observa un adecuado manejo conceptual y una clase preparada con material adecuado\r\n\r\n  El ambiente trabajo es difícil de crear en principio por falta de estrategias de clima de aula, muchas estudiantes participan activamente, pero a la vez se observa a algunos sin trabajar. \r\n\r\n  \r\nSugerencia:\r\n\r\nUtilizar estrategias de clima de aula como umbral y en sus marcas para promover con mayor rapidez el inicio de la clase en un ambiente propicio para el aprendizaje, y cien por ciento para involucrar a mas estudiantes en la participación activa.\r\n'),
(89, '9089119', '14622138', '2022-06-29', '12:35:56', '13:10:56', 27, 14, 1.76, NULL, 1, 'Clase sobre Justicia y derechos humanos de la unidad 2.\r\n\r\nLa docente ingresa a la hora establecida, se presenta el tema y se entregan lineamientos de futura investigación y disertación\r\n\r\nRealiza preguntas claves que permiten a los estudiantes la reflexión y las refuerza positivamente vincula positivamente con todas las alumnas.\r\n \r\nSe observa un adecuado manejo conceptual y una clase preparada con material adecuado\r\n\r\n  El ambiente trabajo es difícil de crear en principio por falta de estrategias de clima de aula, muchas estudiantes participan activamente, pero a la vez se observa a algunos sin trabajar. \r\n\r\n  \r\nSugerencia:\r\n\r\nUtilizar estrategias de clima de aula como umbral y en sus marcas para promover con mayor rapidez el inicio de la clase en un ambiente propicio para el aprendizaje, y cien por ciento para involucrar a mas estudiantes en la participación activa.\r\n'),
(90, '16009922', '18069305', '2022-06-03', '09:45:16', '10:55:16', 13, 32, 2, NULL, 2, '- Se observa distribución de responsabilidades entre el equipo de aula en la sala clases.\r\n- Las docentes presentan el material a trabajar con los diferentes grupos.\r\n- Se observa el uso de material didáctico en la sala de clases (Kamishibai).\r\n- Se observa una adecuada distribución de las estudiantes en los diferentes grupos.\r\n- La actividad seleccionada es adecuada para cada uno de los 3 grupos.\r\n- Se observa motivación de las estudiantes por participar y terminar la tarea asignada.\r\n- Se respetan los tiempos de trabajo y se logra hacer lo que se tenía planificado.\r\n- Se recomienda incluir alguna estrategia de evaluación formativa o alguna actividad que permita a las docentes tener una visión general del logro alcanzado por las estudiantes.\r\n- Se observa una clase muy participativa por parte de las estudiantes. Se sugiere seguir trabajando en la línea de las clases de \"aula diversificada\" y compartir experiencias con colegas.'),
(91, '16009922', '18069305', '2022-05-30', '11:10:25', '12:20:25', 13, 34, 1.85, NULL, 2, '- Se observa un adecuado clima de aula.\r\n- Se entregan instrucciones claras.\r\n- Todas las estudiantes participan de las actividades.\r\n- Ambos profesores comparten responsabilidades en la sala.\r\n- Es parte importante en nuestro rol de formadores, mencionar la virtud del mes, o relevar valores que estén asociados a la clase y orientar el trabajo en equipo.\r\n- Mencionar a los estudiantes, en el momento de las intrucciones, qué se espera del trabajo colaborativo con las compañeras.\r\n- Se observa que el grupo que trabaja con material concreto, desconoce la manera de trabajar con él. Se sugiere que, siempre antes de ocupar un material, se modele su uso y se motive el buen cuidado de este.\r\n- Se motiva a seguir trabajando en esta estrategia de aula diversificada, a que los profesores puedan seguir trabajando en conjunto y compartiendo la co-responsabilidad en la sala de clases.'),
(92, '16009922', '13134219', '2022-05-26', '11:10:23', '12:20:23', 7, 32, 1.89, NULL, 2, '- Adecuada selcción del modelo de coenseñanza (estaciones de enseñanza), compartiendo roles con profesora de aula y asistente.\r\n- Se utilizan estrategias de clima de aula, comolas 5s, que contribuyen a mantener un adecuado clima durante toda la clase.\r\n- Se observan estrategias de dearrollo del pensamiento, realización de predicciones, conocimientos previos, leo-construyo-escribo y lápiz que habla.\r\n- Se destaca la participación y motivación de todas las estudiantes en la sala de clases.\r\n- Se sugiere no olvidar mencionar y compartir el objetivo de la clase al inicio, De igual manera para compartir los objetivos, ocupar preguntas dirigidas y estrategia sin salida.\r\n- Se invita a seguir trabajando en equipo, compartiendo responsabilidades y seguir implementando el trabajo de aula diversificada.'),
(93, '16009922', '18686997', '2022-05-30', '12:35:19', '13:45:19', 12, 32, 1.9, NULL, 2, '- Clase estructurada de inicio a fin, en relación al objetivo.\r\n- Se utilizan diferentes estrategias de clima de aula, 5s y 100%.\r\n- Adecuado trabajo colaborativo entre doente, yaque comparten responsabilidades.\r\n- Se observa una adecuada selección de los grupos y actividad acorde a su nivel de logro\r\n- Se destaca la participación de todos los estudiantes de la clase.\r\n- Existe refuerzo positivo constante hacia los estudiantes.\r\n- Se mantiene un clima de aula adecuado durante la clase.\r\n- Se sugiere mejorar los tiempos en la organización de la sala. Se entiende que nos encontramos en una fase inicial, por lo que será un elelemtno que progresará.\r\n- Falta dar énfasis al cierre de la clase, para todos los estudiantes, utilizar preguntas dirigidas.\r\n- Incorporar elementos de metacognición.\r\n- Incorporar elementos de evaluación formativa o autoevaluación en el cierre, para monitorear el progreso de los estudiantes.\r\n- Se sugiere revisar el material, para evitar algunos detalles, como la carta de la profesora Fiamma a la profesora Pamela, que le faltaba el lugar.\r\n- Se observa una clase que cumple con las espectativas de aula diversificaa y se motiva a seguir trabajando en esa línea.\r\n'),
(94, '16009922', '18069116', '2022-05-30', '08:15:29', '09:25:29', 11, 32, 1.95, NULL, 2, '- Clase estructurada de inicio a fin en relación al objetivo.\r\n- Se utilizan diferentes estrategias de clima de aula, 5S, 100% y tiempo consensuado.\r\n- Adecuado trabajo colaborativo entre docentes. Comparten responsabilidades.\r\n- Se observa una adecuada selección de los grupos y ctividad acorde a su nivel de logro.\r\n- Se destaca la participación de todos los estudiantes en la clase.\r\n- Existe refuerzo ppositivo constante hacia los estudiantes.\r\n- Se mantiene un clima de aula adecuado durante la clase.\r\n- Adecuado uso del tiempo. Se trabajan todos los momentos de la clase.\r\n- Se sugiere revisar el material, para evitar algunos detalles como la carta de la profesora Sonia a la profesora Pamela, donde faltaba el lugar.\r\n- Se observa una clase que cumple con las expectativas de aula diversificada y se motiva a seguir trabajando en esta línea.'),
(95, '13769322', '15564292', '2022-06-14', '08:20:14', '09:15:14', 13, 32, 1.32, NULL, 2, 'Profesora ingresa a la sala a las 08:20 horas, las niñas están leyendo.   08:25 les pide que saquen el cuaderno de lenguaje.  (envia a una alumna a buscar el estuche olvidado) Escribe el Hoy: Hechos y detalles. Pregunta: ¿Cómo encontrar la idea principal? En la primera y en la última oración. Repasa ppt de hechos y detalles ¿Cómo puedes hallar hechos y detalles?\r\n¿cómo se llama hasta el primer punto? Lee texto que vienen con alternativas correctas marcadas.\r\nProyecta nuevo texto “Eva y Marco”. Lee las instrucciones. Pregunta por idea principal. Marca las respuestas en el texto. Lee texto, lee preguntas y consulta ¿quién dice que es la letra “A”, “B”, “C”? cuenta a las niñas y muestra respuesta. Realiza la misma acción con las otras preguntas.\r\nNo realiza cierre de la clase.\r\nAcuerdos: Tener las guías impresas (textos) para trabajar en clases.\r\nProfundizar en el porqué de las respuestas de las alumnas y marcarlas en el texto (subrayado)\r\n\r\n\r\n'),
(96, '13769322', '18448344', '2022-06-16', '09:38:46', '10:35:46', 13, 15, 1.76, NULL, 2, 'Profesora realiza el umbral. Ingresa a la sala y saluda al curso.  Ordena al curso para que escuchen las instrucciones.  Indica que trabajarán locomoción (indica los materiales que deben usar) Explica cómo se salta, pregunta ¿Qué pasa si caemos con el pie completo en el suelo? ¿Qué se ve afectado en el cuerpo? Indica que es importante traer zapatillas que no sean planas y explica el porqué.\r\n¿Qué haremos el día de hoy? Explica. Instrucción: “dejen ordenado y se forman afuera de la sala” Baja a las niñas en orden al segundo patio. Les da instrucciones de cómo deben correr. Posteriormente, hace un círculo con las alumnas y hace movimientos de cabeza hombros y brazos (calentamiento previo)\r\n10:00 indica a un par de alumnas que suban a buscar los materiales a la bodega de EFI.  \r\nCon los materiales crea estaciones para las niñas.  Profesora modela los ejercicios y los explica.  Las alumans se forma en fila y realizan los ejercicios.  \r\nDespués de los ejercicios, les da tiempo para tomar agua e ir al baño.\r\nRealiza cierre de la clase y las sube a la sala de clases con las alumnas.\r\nAcuerdos: Continuar con la entrega de instrucciones en sala, bajar a las alumnas en orden y posteriormente organizar la clase.'),
(97, '11537827', '18389625', '2022-06-08', '08:15:29', '08:40:29', 26, 34, 1.74, NULL, 1, '- Debe trabajar el manejo del tiempo.\r\n-Preguntas mas dirigidas a los estudiantes.\r\n-Instrucciones claras y verificar la compresión. \r\n- Aplicar la estrategia del 100% para evitar hablar en ruido y que impide que todos los estudiantes escuchen las instrucciones y que se distraigan.     '),
(98, '14273480', '14604335', '2022-06-08', '08:15:18', '09:25:18', 9, 34, 2, NULL, 1, '-	Se observa clase completa. Excelente!!\r\n-       Las estudiantes realizan lectura de oración y peticiones.\r\n-	Se revisa calendario de anticipación de asignaturas.\r\n-	Recuerdan 5s.\r\n-	Virtud y consigna.\r\n-	Menciona objetivo de la clase, trabajándolo con las estudiantes.\r\n-	Se observa una clase completa, donde cada momento contiene o favorece el desarrollo de habilidades en las estudiantes.\r\n-	Se destaca, también, el ambiente propicio para el aprendizaje.\r\n-	Aplica estrategias de clima de aula y rutinas de pensamiento.\r\nAcuerdos:\r\n-	Continuar aplicando estrategias de rutinas de pensamiento, como hasta ahora.\r\n'),
(99, '14273480', '15178747', '2022-04-26', '16:30:31', '17:01:31', 1, 31, 2, NULL, 1, '- Se observa rutina de Lectura compartida, MAE.\r\nAcuerdos:\r\n1. La rutina de lenguaje debe comenzar con la lectura del ABC, realizarla cada día de diferentes manera. 			\r\n2. A continuación de la lectura del ABC, se deben realizar preguntas para ampliar el pensamiento. No solo basta con memorizarlo sino trabajarlo en profundidad para el desarrollo de la CF.						\r\n3. A continuación de la lectura del ABC, se realiza el juego de CF. Durante el I semestre trabajar mucho la conciencia prefonológica que tiene como objetivo agudizar la audición para no confundir los sonidos de las letras.					\r\n4. Al trabajar los sonidos de las letras mostrar la ubicación de los labios y lengua para decir el sonido de cada letra, en especial aquellas que tienden a confundir (B, D, P).			\r\n5. Al estar trabajando con las normas de prevención de contagios de COVID, pedirle a los niños que se bajen la mascarilla para mostrar la posición de labios y lengua y luego se la vuelvan a colocar la mascarilla correctamente.			\r\n			\r\n6. Para el juego que realizaste de cazar sonido, es recomendable colocarlas en un lugar sin distractores (pizarra), ya que el objetivo es buscar el sonido inicial que le pides y no buscar las trajetas.			\r\n			\r\n7. Las tarjetas tambien sirven para el juego de \"PULGAR HACIA ARRIBA\", las muestras 1 a 1 y le indicas al niños que si comienza con el sonido que le indicas, debe mostrar el pulgar hacia arriba, de lo contrario mostrar el pulgar hacia abajo.			\r\n			\r\n8. En el juego \"SUSURRA EL NOMBRE\", los niños deben susurrar. Tratar de lograr que el niño escuche el nombre de su compañero en forma de susurro para agudizar su audición.			\r\n			\r\n'),
(100, '14273480', '13132976', '2022-04-26', '15:30:16', '16:00:16', 2, 31, 2, NULL, 1, '- Se observa rutina de conciencia fonológica completa, del MAE.\r\nAcuerdos.\r\n1. La rutina de lenguaje debe comenzar con la lectura del ABC, realizarla cada día de diferentes manera. 			\r\n2. A continuación de la lectura del ABC, se deben realizar preguntas para ampliar el pensamiento. No solo basta con memorizarlo sino trabajarlo en profundidad para el desarrollo de la CF.					\r\n3. A continuación de la lectura del ABC, se realiza el juego de CF. Durante el I semestre trabajar mucho la conciencia prefonológica que tiene como objetivo agudizar la audición para no confundir los sonidos de las letras.						\r\n4. Al trabajar los sonidos de las letras mostrar la ubicación de los labios y lengua para decir el sonido de cada letra, en especial aquellas que tienden a confundir (B, D, P).			\r\n5. Al estar trabajando con las normas de prevención de contagios de COVID, pedirle a los niños que se bajen la mascarilla para mostrar la posición de labios y lengua y luego se la vuelvan a colocar la mascarilla correctamente.						\r\n6. Incorporar un segundo juego de CF conectado con la LC.			\r\n'),
(101, '14273480', '13103451', '2022-04-27', '14:00:33', '14:30:33', 3, 38, 1.94, NULL, 1, '- Se observa rutina de Calendario Matemático, MAE\r\nFORTALEZAS			\r\n1. Comenzar el trabajo recordando las normas de disiplina (5), siempre en forma colaborativa.			\r\n2. Trabaja CF mientras realiza el calendario, muy bien!!			\r\n3. Hay trabajo colaborativo en todo momento. Hace participar a los alumnos.			\r\n						\r\nPUNTOS A MEJORAR			\r\n1. En cada uno de los puntos del calendario, trabajar 1 o 2 preguntas para ampliar el pensamiento.  Planificar 1 punto del calendario para trabajarlo con mayor profundidad.						\r\n2. El período de adaptación de los alumnos es 1 mes en épocas normales. 2 meses para niños post pandemia ya debería ser suficiente. Trata de incorporar pronto todos los puntos del calendario.			\r\n			\r\n'),
(102, '14273480', '15648517', '2022-04-26', '09:30:26', '10:00:26', 5, 31, 2, NULL, 1, '- Se observa rutina de Lectura en Voz Alta, MAE.\r\nFORTALEZAS		\r\n1. Al trabajar las estrategias de comprensión, muestra la imagen de la estrategia.		\r\n2. Monitorea la lectura a través de preguntas mientras va contando la historia.		\r\n3. .Trabaja las estrategias de comprensión en forma muy explícita		\r\n4. Da responsabilidades a un alumnos para dar estímulos positivos a los alumnos.		\r\n		\r\nASPECTOS A MEJORAR		\r\n1. Integrar estrategias que no se trabajaron.		\r\n2. Corregir la estrategia de visualizar.		\r\n3. Puede trabajar la palabra de vocabulario con la CF (sonido inicial y separación silábica).		\r\n4. Conectar el cuento con las virtudes.		\r\n		\r\nMuy buen trabajo Carol, las estrategias de comprensión estuvieron muy bien aplicadas.		\r\nMe pareció excelente que a medida que las trabajabas fueras mostrando las imágenes que representaban cada una de ellas.		\r\nFuiste monitoreando su comprensión en todo momento con preguntas.		\r\nHiciste participar en el trabajo a los niños con mayores dificultades ayudando a si a su autocontrol		\r\n'),
(103, '14273480', '10319779', '2022-04-27', '10:31:44', '11:00:44', 6, 31, 2, NULL, 1, '- Se observa rutina de Lectura compartida, MAE.\r\nASPECTOS POSITIVOS			\r\n1. Los puntos desarrollados en la LC estuvieron  muy bien trabajados.			\r\n2. Desarrolló la LC en forma secuenciada y explicitando cada uno de los puntos trabajados.			\r\n3. Realiza un trabajo colaborativo de manera que lo que se pregunta salga de los conocimientos aprendidos por los niños.			\r\n			\r\nASPECTOS A MEJORAR			\r\n1. Utilizar tarjetas de fluidez lectora para que los niños visualicen el paso correcto.			\r\n2. Trabajar vocabulario nuevo en forma secuenciada durante todos los días que se trabaje la LC.			\r\n3. Al trabajar una letra, mostrarla en el ABC y realizar un ejercicio para que los niños identifiquen otras palabras que empieven con ese sonido.			\r\n4. Una vez a la semana realizar una actividad de extensión con el tema de la poesía, de esta forma familiarizamos a los niños con la froma de trabajar la LC con 1° básico.			\r\n					\r\nMuy buen trabajo Marisol, hiciste un excelente trabajo con  la LC. Los puntos trabajados estuvieron muy bien desarrollados. 			\r\nHaces permanentemente un trabajo colaborativo con los niños, dando oportunidad para que ellos expresen lo que han aprendido.			\r\nCada punto que desarrollas, lo trabajas en forma muy explícita, de manera de enfocarte en un grupo diferenciado.			\r\n'),
(104, '14273480', '16137474', '2022-04-27', '11:30:11', '12:00:11', 4, 38, 2, NULL, 1, '- Se observa rutina de Calendario matemático, MAE.\r\nFORTALEZAS			\r\n1. Excelente el uso de señas para no interrumpir el trabajo colaborativo.			\r\n2. Utiliza palitos preguntones para la participación de los niños.			\r\n3. hace uso de la CF mientras trabaja en el calendario.			\r\n4. Excelente forma de trabajar el problema. Enumera y explica los pasos, da estrategias para solucionar, agregar o quitar.			\r\n			\r\nPUNTOS A MEJORAR			\r\n1. Al sacar un palito preguntón, preguntar si quiere participar.			\r\n2. Al hacer conteo \"pinocho\", tocar las cabecitas de los niños para mostrar conteo uno a uno.			\r\n3. Mostrar mejor el volumen de la estimación..			\r\n4. Incorporar 2 o 3 preguntas para ampliar el pensamiento en los puntos del calendario.			\r\n5. Planificar uno de los puntos para extenderse en la metacognición.			\r\n		\r\nMuy buen trabajo Natacha, desarrollaste muy bien los puntos del calendario, haces un buen trabajo colaborativo con los alumnos permitiendo obtener la información que necesitas de parte de los niños.			\r\n			\r\nCada punto que desarrollas, lo trabajas en forma muy explícita, de manera de enfocarte en un grupo diferenciado.			\r\nIntegras CF aprendida, de manera de favorecer el desarrollo lecto escritor.			\r\n'),
(105, '14273480', '18143931', '2022-04-26', '08:15:12', '09:25:12', 7, 32, 1.72, NULL, 1, '- Se observa rutina de Lectura compartida, MAE.\r\nASPECTOS POSITIVOS			\r\nBuen trabajo Carolina. 			\r\n			\r\nASPECTOS A MEJORAR			\r\n1. Con esta pauta de trabajo, puedes planificar una LC y seguir el orden lógico de las actividades.			\r\n2. Trabajar estrategias de comprensión: Primer día activar conocimientos previos, predicciones y preguntas después de modelar la lectura. Los siguientes días trabajar otras estrategias de comprensión, pero siempre 1 diaria.						\r\n3. Siempre el primer día trabajar una palabra de vocabulario con el diccionario. Los otros días recordarla y trabajarla con la CF.			\r\n4. Antes de modelar trabajar las características de fluidez lectora. Elegir 1 diaria y expliciatr cual es la correcta. Modelar con ella.			\r\n5. Diariamente trabajar una estrategia de fluidez lectora con los alumnos.			\r\n6. Diariamente trabajar 1 minilección extraida del texto (observa la pauta algunas ideas)			\r\n7. Trabajar CF con la letra de la semana, y realizar juegos de CF con ella. Todos los días una actividad diferente.			\r\n8. Conecta la actividad con alguna actividad. Explica las instrucciones, escríbelo en el pizarrón, corrobora las instrucciones con los alumnos, escribe el paso a paso y da la orden de comenzar a trabajar.			\r\n			\r\n'),
(106, '14273480', '15221803', '2022-04-26', '11:10:08', '12:25:08', 8, 32, 1.83, NULL, 1, '- Se observa rutina de Lectura compartida, MAE.\r\nASPECTOS POSITIVOS			\r\n1. Me parece muy bien que proyectes el texto y además lo tengas expuesto.			\r\n					\r\nASPECTOS A MEJORAR			\r\n1. Sentar a los niños en grupos de trabajo de acuerdo al nivel. Esto te ayudará a monitorear a los que más lo necesitan.		\r\n2. Comenzar la clase de lenguaje con la lectura del ABC y a continuación trabajar habilidades del pensamiento.			\r\n3. La LC debe comenzar el día lunes y se repite durante toda la semana en la clase de lenguaje.			\r\n4. La rutina de la LC se planifica toda la semana con actividades diferentes de cada punto a desarrollar: Recordar tipo de texto, conocimientos previos, actividades con el vocabulario nuevo, característica de fluidez, fluidez lectora, mini lección, CF con la letra nueva, juegos de CF con la letra \"L\"					\r\n5. No realizar más de una actividad en cada punto de la LC.			\r\n6. Trabajar estrategias de comprensión: Primer día activar conocimientos previos, predicciones y preguntas después de modelar la lectura. Los siguientes días trabajar otras estrategias de comprensión, pero siempre 1 diaria.			\r\n7. Siempre el primer día trabajar una palabra de vocabulario con el diccionario. Los otros días recordarla y trabajarla con la CF.			\r\n8. Antes de modelar trabajar las características de fluidez lectora. Elegir 1 diaria y explicitar cual es la correcta. Modelar con ella.			\r\n9. Diariamente trabajar una estrategia de fluidez lectora con los alumnos.			\r\n10. Diariamente trabajar 1 minilección extraida del texto (observa la pauta algunas ideas)			\r\n11. Trabajar CF con la letra de la semana y realizar juegos de CF con ella. Todos los días una actividad diferente.			\r\n12. Conecta la actividad con alguna actividad. Explica las instrucciones, escríbelo en el pizarrón, corrobora las instrucciones con los alumnos, escribe el paso a paso y da la orden de comenzar a trabajar.			\r\n			\r\n'),
(107, '14273480', '14604335', '2022-07-26', '10:30:55', '11:00:55', 9, 32, 1.82, NULL, 1, '- Se observa rutina de Lectura compartida, MAE.\r\nASPECTOS POSITIVOS			\r\n1. Lee las normas de disciplina \"5 S\" y las recuerda durante la clase si es necesario.			\r\n2. Identifica el objetivo de la clase, \"Grupo consonántico BR\", da ejemplos y pide otros a las alumnas			\r\n3. Trabaja en forma colaborativa lo que es un sustantivo propio y da ejemplos.			\r\n4. Revisa en forma colaborativa algunos errores cometidos en el segundo desfío.			\r\n			\r\nASPECTOS A MEJORAR			\r\n1. Ubicar a las alumnas en grupos de trabajo diferenciados. Jugar con la ubicación espacial de los grupos cada cierto tiempo. Nunca en forma individual.			\r\n2. El primer día se realizan conocimientos previos y se predice de que se va a tratar y el título. Luego se lee el título y se corrobora.			\r\n3. Al comenzar la LC el primer día  siempre iidentificar tipo de texto y revisar si tiene autor. Los otros días se recuerda.			\r\n4. Seleccionar 1 palabra para trabajar durante toda la semana. El primer día se clarifica con el diccionario y se ubica en un panel especial. Los otros días puedes planificar una actividad diferentes con ella para cada día. Sería muy bueno incorporar la actividad del anillo de palabras nuevas. Cada niña recibe una tarjeta para escribir la palabra, su significado y una oración con ella.			\r\n5. Antífona es una lectura que lee una frase la profesora y luego otra frase las alumnas.			\r\n6. Incorporar siempre una mini leccion. Planificar una diferente para cada día. En este caso podría haberse reforzado los sustantivos propios y su característica.			\r\n7. Las actividades de desafío se deben revisar. Pasearse por los puestos e ir revisando si las niñas están haciendo bien el desafío. Si hay errores aclararlos en forma colaborativa. Tal como se hizo con los sustantivos propios.				\r\n8. Esta pauta te servirá para organizar y llevar a cabo tu planificación.			\r\n'),
(108, '14273480', '15616161', '2022-04-26', '12:35:10', '13:20:10', 10, 32, 1.9, NULL, 1, '- Se observa rutina MAE: lectura compartida.\r\nASPECTOS POSITIVOS			\r\n1. Revisa las normas de disciplina en forma colaborativa y las explicita.			\r\n2. Recuerda la virtud y la consigna. Ejemplifica.			\r\n3. Trabaja el objetivo de la clase. Lo lee en forma coral. Da ejemplos y pide otros. Forman oraciones con una palabra que tenga ese GC.			\r\n			\r\nASPECTOS A MEJORAR			\r\n1. El primer día de la LC, activar conocimientos previos, predecir el tema, título. Luego corroborar.			\r\n2. El primer día de la semana de la LC, seleccionar 1 palabra de vocabulario, trabajarla con el diccionario y ubicarla en un panel especial.			\r\nEl resto de los días de la semana recordarla y realizar diferentes actividades de CF con ella. También pueden crear oraciones con ella.			\r\nLos niños pueden trabajar las palabras de vocabulario y guardarlas en una argolla			\r\n3. La lectura en antífona es una frase tu la otra la continúan los alumnos. A medida que se trabaja la LC se trabajan estrategias de lectura más complejas.			\r\n4. Todos los días que trabajas la LC debes incorporar una estategia de comprensión diferente.			\r\n5. Incorporar siempre una mini leccion. Planificar una diferente para cada día. En este caso podría haberse reforzado los sustantivos propios y su característica.			\r\n6. En el ticket de salida, revisar la instrucción en forma colaborativa. Puedes proyectarla y explicar. Luego corroborar la instrucción e ir escribiendo en el pizarrón la idea prinipal de cada ejercicio y clarificar el paso a paso. Dar la órden para comenzar el trabajo todos juntos.						\r\n7. Esta pauta te servirá para organizar y llevar a cabo tu plaificación.			\r\n			\r\n'),
(109, '14273480', '13622429', '2022-06-22', '08:15:09', '09:20:09', 10, 35, 2, NULL, 1, '- Destaca la preocupación constante en sus estudiantes, promoviendo la participación activa en las experiencias de aprendizaje.\r\n- Apoya a los docentes, mantenidneo las normas de la sala, orden, limpieza y promoviendo la participación en las actividades.\r\n- Aplica sus conocimientos en situaciones de conflictos, realizando un buen abordaje de los mismos.\r\n- Esta atenta a los accidentes y/o situaciones de riesgo, realizando las acciones pertinentes.\r\n\r\nAcuerdos:\r\n- Informar a coordinación situaciones que ocurran en asignaturas, con el fin de buscar remediales en pro del proceso de aprendizaje del curso.\r\n'),
(110, '13956828', '16036651', '2022-06-07', '12:35:43', '13:45:43', 1, 22, 1.96, NULL, 1, 'Acompañamiento de aula realizado a la clase completa.\r\nExcelente manejo de rutinas de pensamiento.\r\nEstudiantes motivados y trabajando activamente en la clase.\r\nSe observa manejo conceptual específico que demuestra la preparación de la clase.\r\n\r\nSUGERENCIAS:\r\nBuscar estrategias que permitan administrar el tiempo de inicio de la clase de mejor manera, en beneficio del tiempo a invertir en el desarrollo y cierre.\r\n'),
(111, '13956828', '17614827', '2022-06-13', '08:10:10', '09:25:10', 11, 32, 2, NULL, 1, 'Clase de Lenguaje - Aula Diversificada.\r\nPamela Toledo y Sonia Barra\r\nObservación clase Completa\r\n\r\nExcelente clase, con una coordinación y comunicación de la clase de principio a fin muy fluida.\r\nSe cumplen los objetivos planteados y las estrategias realizadas son atingentes y coherentes con el objetivo de la clase y la etapa del desarrollo de los estudiantes.\r\n\r\nFelicitaciones.'),
(112, '13956828', '10016368', '2022-06-14', '09:45:39', '10:55:39', 16, 32, 2, NULL, 1, 'Lenguaje.\r\nClase completa\r\n\r\nObjetivo: Redactar de forma escrita una autobiografía.\r\n\r\nSe observan claramente los tres momentos de la clase y el énfasis en la redacción y ortografía, acompañada del apoyo de diccionario.\r\nLos estudiantes leen sus autobiografías al finalizar la clase, de forma voluntaria, tomando la clase un clima íntimo y emotivo.\r\n\r\nExcelente clase.\r\n\r\n\r\n'),
(113, '13956828', '13312214', '2022-06-15', '09:45:16', '10:55:16', 18, 32, 2, NULL, 1, 'Clase Lenguaje - Observada clase completa\r\n\r\nObjetivos: Textos narrativos\r\n\r\nLos estudiantes trabajan en la la lectura y análisis de diversos textos narrativos y luego responden de forma verbal y escrita algunas preguntas al respecto, a través de rutinas de pensamiento.\r\n\r\nSugerencia:\r\nVisibilizar el tiempo de trabajo en un temporizador digital.'),
(114, '13956828', '10016368', '2022-05-30', '13:24:39', '14:09:39', 18, 32, 1.96, NULL, 1, 'Clase completa - Desarrollo estrategias de Comprensión Lectora Biblioteca\r\n\r\nTrabajo colaborativo entre profesora de Lenguaje y Bibliotecaria.\r\nSe observa un trabajo preparado, escogieron los textos a usar en conjunto y de acuerdo a los intereses de los jóvenes.\r\nEstudiantes trabajan motivados, en silencio y adaptan las estrategias presentadas para el desarrollo de sus habilidades.\r\n\r\nBuen trabajo colaborativo.\r\n\r\n'),
(115, '13769322', '10004488', '2022-08-17', '10:05:54', '11:35:54', 13, 22, 1.84, NULL, 2, 'Profesora da indicaciones sobre la alianza roja. (porque gana en aniversario)\r\n10:25 solicita libro de historia y cuaderno, abre classroom y lo proyecta en el televisor. Retroalimentación de contenido ¿Qué me pueden comentar de los aztecas? ¿En qué lugar se situó esta civilización? ¿Cómo estaba organizada políticamente? ¿Quién era el líder de los aztecas? Alumnas mencionan que han trabajado en clases. Realiza una pirámide en la pizarra y les va consultado a las alumnas el orden.\r\nSolicita texto de estudio página 74 y 75.  10:42 Muestra un video visto en la clase anterior. Hace consultas al respecto. \r\n10:55 Les indica que harán lectura de las páginas, define que alumnas leen y extrae, junto con las niñas, las ideas principales de los textos (les pide que la subrayen).\r\nLee los textos breves y nuevamente pregunta lo anterior (que salía en el video) ¿dónde estaban hechas las chinampas? ¿cómo las hacían? ¿de qué estaban hechas? Utiliza estrategia del 100%\r\nPágina 75 pregunta ¿Qué es lo que hoy no se comercializa?   Realiza un cuadro comparativo “Técnicas de Cultivo Azteca y Maya” Finaliza el cuadro con las alumnas y les pregunta que si vivieran “en una parte específica” ¿Qué técnica utilizarían hoy en día?\r\nCierre:  Realiza preguntas ¿Qué características tenía la economía azteca? Qué podrías contar de esta economía? En qué se basaba?\r\nAcuerdos :Utilizar el tiempo visible para las actividades\r\nEscribir el objetivo en la pizarra, para relacionarlo con el cierre.\r\n'),
(116, '13769322', '18149732', '2022-08-25', '10:05:04', '11:35:04', 17, 34, 1.7, NULL, 2, 'Profesor realiza el umbral. Acompaña en clases Educadora Diferencial (Isabel Margarita).\r\nSaluda y les indica que harán un reforzamiento para el control del día mañana. Proyecta el libro “Sumo Primero” Les indica que harán un control de ángulos.\r\nCuaderno de actividades Tomo 1, Página 29.  Coloca en el borde derecho de la pizarra los tipos de ángulos. – Educadora repasa los ángulos con los brazos. Preguntan ¿entre que gradosº se mueve el ángulo….? Se monitorea el trabajo de los alumnos en sala – mantienen una co-docencia con el profesor -.\r\nAlumnas se levantan constantemente a buscar los libros para trabajar en las páginas solicitadas por el docente. Isabel M. Saca copia de las páginas del libro a las niñas que no lo han traído.  \r\nRealizan ejercicios página 30. Profesor utiliza tiempo visible para que resuelvan los ejercicios. Se monitorea el trabajo en sala. Profesor resuelve los ejercicios en la pizarra.\r\nAl finalizar realiza resumen de lo visto.  Les explica control del día de mañana.\r\nAcuerdos: Aplicar estrategias como “en sus marcas” para dejar los materiales ordenados antes de iniciar la clase\r\nPara dar las instrucciones debe estar todo el curso en silencio.\r\nHablar con vocabulario matemático.\r\n'),
(117, '13769322', '15564292', '2022-08-16', '10:05:47', '11:35:47', 14, 32, 1.19, NULL, 2, 'Docente desarrolla “Umbral” y entrega “Hacer Ahora” de Escritura. Marca en el televisor  5 minutos para realizarlo.  Indica en el pizarrón el Hoy: “Revisión prueba DIA” “En sus marcas”.\r\nHace a dos lecturas del Hacer Ahora y luego indica “en sus marcas” para pegar la actividad en el cuaderno.\r\nNuevamente realiza “en sus marcas” para que vayan a buscar la Prueba DIA al casillero.  La profesora realiza la dinámica de indicar en el pizarrón Nº de pregunta, Alternativa Correcta, Nº de Párrafo y Línea del Párrafo.  Desarrolla alrededor de 11 preguntas con la misma dinámica.  Un alumno lee el texto y realiza la misma acción que con el trabajo anterior. \r\n11:28 Realiza el cierre de la clase desarrollando preguntas\r\nAcuerdos: Consistencia entre el objetivo que plantea, las actividades que realizará y la evaluación\r\nSe realicen dos o tres actividades que apunten al mismo objetivo (debido a la brevedad que tienen los alumnos para concentrarse)\r\n'),
(118, '13769322', '13276799', '2022-08-30', '10:05:55', '11:35:55', 12, 32, 1.81, NULL, 2, 'Docente ingresa a los alumnos a la sala sin “umbral”.  Les pide que saquen el cuaderno rojo. Hace que los alumnos estén atentos a las instrucciones (movimiento de brazos) mientras la profesora Mary le hace entrega de una guía de trabajo.\r\nDocente retroalimenta ¿para qué sirven los adjetivos? Docente responde.  Hace división de sustantivos (comunes y propios) alumnos dan ejemplos.  Corrigen error en palabra. \r\nProfesoras hacen pausa para que todo el curso esté en silencio y puedan dar las instrucciones. Constantemente están solicitando silencio y corrigiendo a los alumnos.\r\nHacen revisión de la guía de trabajo en colaboración con los alumnos, profesora Mary va revisando puesto por puesto el avance de cada uno.  La revisión se hace consultando a los niños.\r\nLes indica un temporizador de 10 minutos para desarrollar lo que tienen pendiente de la guía. Pasado el tiempo, vuelven a revisar la guía con todo el curso.  \r\nLos alumnos participan leyendo texto, respondiendo las preguntas de la profesora, etc. Les indican dónde están las respuestas (párrafos que deben destacar o subrayar).\r\nLes recuerda sobre la prueba de la clase siguiente. Coloca temporizador de 7 minutos para ordenar sus cosas (carpeta) antes de salir a recreo.\r\nAcuerdos: Realizar “actividades extra” para los alumnos que terminan las actividades como (sopa de letras, puzles, pintar que tengan relación con el contenido)\r\nAplicar estrategias como umbral, hacer ahora y en sus marcas en todas las clases.\r\n\r\n**Se felicita a las profesoras porque se nota la codocencia, además a pesar que el curso es inquieto desarrollan la actividad como corresponde y según las indicaciones de las docentes.\r\n'),
(119, '13769322', '15564292', '2022-08-30', '08:15:04', '09:40:04', 13, 32, 1.33, NULL, 2, 'La profesora (jefe) utiliza la estrategia “en sus marcas” para que las alumnas saquen el cuaderno de la asignatura.  Mientras las alumnas leen , docente proyecta la lista del curso y pasa asistencia.\r\n08:23 Inicio clase: Los tiempos verbales – coloca el hoy - . Explica lo que harán hoy. Pregunta ¿alguna vez han escuchado que son los tiempos verbales? ¿Qué podría ser? ¿Qué es un tiempo? (las alumnas no responden) Muestra diapo que indica “Los tiempos verbales son la forma en que una acción expresa su temporalidad, es decir, si sucede en el pasado, presente o futuro”\r\nPregunta ¿Qué es un verbo? Les indica que son acciones que hacen las personas.  Les muestra un video de los tiempos verbales. En la última diapo hay 6 verbos en distintos tiempos verbales y, junto a las niñas, reconocen los tiempos en que están conjugados.\r\n08:31 Trabajan en el T.E pág 50. Reconoce los verbos en las oraciones. Lee cada oración y les hace reconocer el verbo. Luego, les indica que utilicen su cuaderno de actividades Act. Nº2 página 29. Les da 15 minutos para resolver la página (tiempo visible). Monitorea el trabajo de las alumnas. 08:47 Luego 7 minutos antes que finalice, les pide a las alumnas que participen respondiendo en la pizarra.  \r\n08:58 Da tarea: Escribe 15 oraciones con los siguientes verbos. (da 15 verbos conjugados en los 3 tiempos verbales pasados) – jugar, saltar, reír, caminar, hablar- Monitorea el trabajo de las alumnas.  Para finalizar a las 09:30 les pide a las alumnas que lean las oraciones.\r\nAcuerdos: Repasar el tiempo verbal conjugando los verbos con los pronombres personales.\r\nConjugar verbos en los tres tiempos verbales.\r\nReformular la clase en el 4ºB cuando se realice la clase.\r\nDebido a la poca participación de las niñas en clases, se enviará una comunicación indicando al apoderado que se evaluará dicha participación como nota extra al finalizar el semestre.\r\n'),
(120, '13769322', '18149732', '2022-08-25', '10:05:14', '11:35:14', 17, 34, 1.7, NULL, 2, 'Profesor realiza el umbral. Acompaña en clases Educadora Diferencial (Isabel Margarita).\r\nSaluda y les indica que harán un reforzamiento para el control del día mañana. Proyecta el libro “Sumo Primero” Les indica que harán un control de ángulos.\r\nCuaderno de actividades Tomo 1, Página 29.  Coloca en el borde derecho de la pizarra los tipos de ángulos. – Educadora repasa los ángulos con los brazos. Preguntan ¿entre que gradosº se mueve el ángulo….? Se monitorea el trabajo de los alumnos en sala – mantienen una co-docencia con el profesor -.\r\nAlumnas se levantan constantemente a buscar los libros para trabajar en las páginas solicitadas por el docente. Isabel M. Saca copia de las páginas del libro a las niñas que no lo han traído.  \r\nRealizan ejercicios página 30. Profesor utiliza tiempo visible para que resuelvan los ejercicios. Se monitorea el trabajo en sala. Profesor resuelve los ejercicios en la pizarra.\r\nAl finalizar realiza resumen de lo visto.  Les explica control del día de mañana.\r\nAcuerdos: Aplicar estrategias como “en sus marcas” para dejar los materiales ordenados antes de iniciar la clase\r\nPara dar las instrucciones debe estar todo el curso en silencio.\r\nHablar con vocabulario matemático.\r\n');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(121, '11537827', '19386893', '2022-10-19', '08:15:37', '09:45:37', 29, 29, 1.88, NULL, 2, 'Se Observa un trabajo coordinado con la docente de aula \r\nBuen manejo de los contenidos \r\nSe resalta el uso de ticket de salida \r\nPor Mejorar \r\nTrabajar con ejemplos más concretos para los diferentes estilos de aprendizaje \r\nOperacionalización del objetivo \r\nDistribución  del tiempo en cada momentos  de clase '),
(122, '11537827', '18412060', '2022-10-04', '08:15:27', '09:25:27', 10, 23, 1.18, NULL, 2, 'Debe mejorar \r\nImplementación rutinas que potencien la habilidad en los estudiantes.  \r\nReforzar vocabulario y mejorar aspectos técnicos  gramatical y de pronunciación\r\nDesapego y revisión de los libros ministeriales como apoyo \r\nImplantación de actividades mas practicas y material concreto adecuado para el nivel. \r\nAspecto positivo\r\nUtiliza buena estrategia para mantener la tención de los estudiantes ( levantar la mano) \r\n\r\n'),
(123, '11537827', '18389625', '2022-06-06', '08:21:06', '09:25:06', 26, 34, 1.77, NULL, 2, 'Fortaleza \r\nEstructura de la clase clara y marcada \r\nPresenta el objetivo y habilidad a desarrollar\r\nAplica Estrategias de clima de aula. \r\n\r\nDebe Mejora \r\nManejo del tiempo,  en desarrollo de los ejercicios 9:10 y sólo desarrollo en inicio de la clase  \r\nPreguntas directas a las estudiantes - No retoricas\r\nDar  instrucciones claras y verificación de la compresión, ayuda a mejorar los tiempos y no se tenga que pasar  por los puestos para explicar uno a uno. \r\nAplicar estrategias de 100%  , evitar hablar sobre el ruido.    '),
(124, '11537827', '12701348', '2022-10-18', '12:00:21', '12:34:21', 6, 15, 1.79, NULL, 2, 'Seguimiento de la instrucciones por parte de los estudiantes , mejorar la verificación de comprensión. \r\nEvitar focalizarse en un estudiante.  \r\nAutocontrol que  potencie la escucha de los estudiantes.\r\nAplicar estrategias de seguimiento del trabajo de los estudiantes.  '),
(125, '11537827', '15614452', '2022-11-14', '14:55:55', '15:40:55', 1, 34, 1.75, NULL, 2, 'Mejoras \r\nContextualización de los contenidos para potenciar la destreza \r\n100 en la oración \r\nMejorar la estrategia de tiempo visible \r\nFortaleza \r\nBuen manejo del clima de trabajo y estrategia de clima de aula\r\nTicket de salida , buena estrategia de cierre\r\nBuena  estructura de clase   \r\n'),
(126, '7060271', '17479376', '2022-11-17', '10:05:35', '11:35:35', 10, 32, 1.94, NULL, 3, 'Se realiza un buen trabajo en la clase de lenguaje, se inicia con Abecedario. Se observa lectura compartida. Niños regulados, participan activamente. Trabajo sistemático, Se nota los avances. Buena Metodología de trabajo. Se integra MAE.\r\nSe sugiere que en el Menú se indiquen los momentos de la clase, no así las asignaturas del día ya que eso está en el horario.'),
(127, '7060271', '15408841', '2022-11-17', '10:05:03', '11:35:03', 9, 31, 2, NULL, 1, 'Se realiza un muy buen trabajo de apoyo a la clase. Establece dialogo constante con la profesora para favorecer el aprendizaje. Apoyo constante a los estudiantes que requieren apoyo. '),
(128, '7060271', '11224381', '2022-11-17', '08:15:35', '09:30:35', 9, 31, 2, NULL, 1, 'Se realiza un muy buen trabajo de apoyo a la clase. Establece dialogo constante con la profesora para favorecer el aprendizaje. Apoyo constante a los estudiantes que requieren apoyo. \r\nSe preocupa de la fecha. Apoyo individual a las estudiantes que lo requieren.'),
(129, '13546298', '17079039', '2022-11-17', '08:15:52', '09:30:52', 9, 31, 2, NULL, 1, 'Se realiza un buen trabajo en la clase de lenguaje, se inicia con Abecedario. Se observa lectura compartida. Niños regulados, participan activamente. Trabajo sistemático, Se nota los avances. Buena Metodología de trabajo. Se integra MAE'),
(130, '7060271', '16510260', '2022-11-15', '14:10:25', '12:40:25', 3, 31, 2, NULL, 1, 'Se realiza un muy buen trabajo de apoyo a la clase. Establece dialogo constante con la profesora para favorecer el aprendizaje. Apoyo constante a los estudiantes que requieren apoyo.'),
(131, '7060271', '17816865', '2022-11-15', '14:10:30', '15:55:30', 1, 31, 2, NULL, 1, 'Se realiza un buen trabajo en la clase de lenguaje, Diario de Vida. Niños regulados, participan activamente. Trabajo sistemático, Se nota los avances. Buena Metodología de trabajo. Se integra MAE. Trabajo vocabulario. Bien la clase.'),
(132, '9089119', '17899117', '2022-08-23', '13:25:25', '14:10:25', 28, 34, 1.88, NULL, 2, 'La profesora comienza presentando el  objetivo de la clase que es repasar contenidos anteriores y entregando instrucciones del trabajo a realizar, falta explicitar la habilidad y los tiempos a utilizar.\r\n\r\nSe observa una clase con material adecuado y un buen ambiente de colaboración entre pares, , con estudiantes participativos y factor alegría generando un vínculo positivo con los estudiantes.\r\n\r\nMonitorea el trabajo aclarando dudas y observando avances de manera individual.\r\n\r\nSe observa que los estudiantes más avanzados terminan su actividad antes por lo que se sugiere avanzar con ellos de manera diversificada.\r\n\r\nDebido al bajo ritmo de un grupo de estudiantes la clase tiene una exigencia menor a la esperada\r\n \r\nSugerencia de trabajo:\r\n\r\nUn grupo de estudiantes logra el objetivo de la clase antes, por lo que en estos casos se sugiere implementar una nueva actividad que permita elevar el desafío de la clase y/o avanzar en la cobertura curricular.\r\n\r\n\r\n\r\n'),
(133, '9089119', '17899117', '2022-08-09', '11:55:19', '13:25:19', 30, 34, 1.7, NULL, 2, 'Se presenta el objetivo de la clase verbalmente, falta explicitar la habilidad y la estrategia\r\n \r\nSe inicia recordando conocimientos previos\r\n\r\nEstudiantes participativos, docente los indica por su nombre y se vincula positivamente con ellos\r\nObservándose momentos con factor alegría\r\n\r\nMonitorea y retroalimenta individualmente y de manera positiva.\r\n\r\nSi bien es cierto realiza consenso del tiempo, este no se cumple rigurosamente\r\n\r\nProfesora realiza esfuerzo levantando la voz al hablar sobre el ruido de la conversación, lo que evidencia la falta de estrategia para crear un ambiente propicio como por ejemplo en sus marcas y la entrega instrucciones claras o ruta del desarrollo de la clase.\r\n\r\nSe sugiere realizar estrategia sin salida y no realizar preguntas retóricas\r\n\r\nSe observa codocencia muy acotada con profesora PIE quién realiza un inicio con falta de actividad motivacional que prepare el ambiente para la enseñanza.\r\n\r\nEl cierre de la clase es muy ajustado, solo 5 minutos.\r\n\r\n\r\n\r\n\r\nSugerencias de mejora:\r\n\r\nIntencionar el objetivo PAES como meta compartida.\r\n\r\nGestión del tiempo y avance sincrónico de los estudiantes, elevando la exigencia en el ritmo de trabajo.\r\n\r\nDesarrollar estrategias que permitan por un lado optimizar el tiempo y además entregar más oportunidades a los estudiantes más avanzados.\r\n\r\nImplementar estrategias motivadoras y desafiantes que inviten a desarrollar el gusto por las matemáticas.\r\n\r\nImplementar estrategias de clima de aula como 5S\r\n\r\nMejorar el cierre de la clase con estrategias como ticket de salida\r\n\r\n'),
(134, '9089119', '16274647', '2022-11-15', '10:10:36', '11:40:36', 21, 32, 1.89, NULL, 2, 'Objetivo de la clase: Escribir crítica literaria sobre Sub Terra \r\n\r\nPresenta objetivo de forma escrita y presenta habilidades: Persuadir – Argumentar\r\n\r\nEntrega indicaciones y las escribe lo que ayuda al clima de aula, el que se mantuvo durante toda la clase, generando un ambiente participativo.\r\n\r\nUtiliza estrategia para solicitar a estudiantes que compartan las ideas de lo que realizaron en la clase pasada.\r\n\r\nSe observa una clase preparada con material adecuado y a través de una guía de trabajo comienzan a desarrollar la crítica literaria\r\n\r\nSe observa gestión en la utilización del tiempo consensuado \r\n\r\nMaterial estaba con errores de ortografía, se solicita revisar de material\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nFocos de mejora:\r\n\r\n\r\nVisualizar la vinculación entre la habilidad y el objetivo redactándolo nuevamente.\r\n\r\nVerificación de la comprensión de las instrucciones\r\n\r\nAvance sincrónico en el trabajo de las estudiantes\r\n\r\n\r\n\r\n'),
(135, '9089119', '18389625', '2022-10-05', '11:55:45', '13:25:45', 24, 34, 1.96, NULL, 2, 'Objetivo de la clase:  Construir figuras homotéticas considerando la homotecia directa o inversa. Se realiza trabajo practico evaluado\r\n \r\nLa docente utiliza estrategia en sus marcas y presenta objetivo de la clase.\r\n\r\nModela el trabajo a realizar presentando el trabajo a realizar\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\n Se observa un buen ambiente de trabajo y colaboración entre pares, generando un ambiente propicio para el aprendizaje, con estudiantes participativos y factor alegría generando un vínculo positivo con los estudiantes.\r\n\r\nMonitorea el trabajo aclarando dudas y observando avances\r\n\r\nDurante el cierre de la clase la docente retoma la habilidad planteada en el objetivo, evidenciando el logro y reconocimiento de parte de los estudiantes\r\n\r\n\r\n\r\n\r\n\r\n\r\nSugerencia de trabajo:\r\n\r\n\r\nEl objetivo de la clase se logró antes de finalizar la etapa de desarrollo de esta, por lo que en estos casos se sugiere implementar una nueva actividad que permita elevar el desafío de la clase y/o avanzar en la cobertura curricular.\r\n\r\nSe utilizó estrategias de gestión del tiempo de manera visible y consensuada.  Se sugiere no reasignar sistemáticamente este tiempo que ya está consensuado para no perder el propósito de la estrategia\r\n\r\n\r\n'),
(136, '9089119', '10363571', '2022-10-28', '10:10:07', '11:00:07', 30, 42, 1.96, NULL, 2, 'Clase “La iglesia y el mundo de la economía” \r\n\r\nLa clase comienza a la hora establecida en donde se presenta el tema a desarrollar y un texto como base para desarrollar una guía de trabajo en grupos.\r\n\r\nSe observa un trato amable por parte del docente, conoce a los estudiantes los indica con su nombre, vinculándose positivamente con todos los ellos.\r\n\r\nEl docente motiva y monitorea de manera permanente comprobando el trabajo de los estudiantes y retroalimentando el avance. Incentiva la reflexión sobre el tema a tratar cuando realiza el monitoreo, se sugiere que en el cierre también se den estos espacios para poder compartir las conclusiones.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nSugerencia:\r\n\r\nDesarrollar estrategias de clima de aula inicial para promover ambiente de trabajo como umbral y en sus marcas. \r\n\r\n\r\n\r\n'),
(137, '9089119', '15176982', '2022-10-05', '08:15:40', '09:45:40', 20, 8, 1.85, NULL, 2, 'Objetivo de la clase: Identificar los mecanismos humanos que participan ante la protección de microorganismos\r\n\r\nPresenta rutina el puente modelando con tema conocido los hongos que consta en 3 ideas 2 preguntas y 1 metáfora o antología\r\n\r\nEstudiantes participan y utiliza estrategia de tiempo consensuado\r\n\r\nSe genera un ambiente propicio, en una clase sincrónica y estructurada\r\n\r\nSe observa trabajo de codocencia donde profesora PIE quien trabaja activamente\r\n\r\nSe entrega material adecuado para identificar componentes\r\n \r\nEn la participación de los estudiantes falta diversificar a otros estudiantes\r\n\r\n\r\nSugerencias de mejora:\r\n\r\nIncorporar estrategias para comprobar comprensión: Verificación de comprensión con sin salida\r\nRecuperación de atención del 100% \r\nRegular los tiempos mejorando el de cierre\r\n\r\n'),
(138, '9089119', '10072654', '2022-10-18', '08:15:39', '09:45:39', 29, 12, 2, NULL, 2, 'Objetivo: Crear un módulo y diseñar aplicando diferentes movimientos para componer una red modular simple.\r\n\r\nRealiza en sus marcas, verificando su cumplimiento.\r\nActiva conocimientos previos sobre patrones y formas sobre un diseño modular realizando una pregunta de inicio.\r\nEscribe y comparte una ruta de trabajo, lo que permite que se trabaje sincronizadamente\r\nConecta la  materia con la asignatura de  matemática, específicamente con el eje de geometría y motiva trabajo interdisciplinario que van a realizar entre ambas asignaturas.\r\n\r\nSe observa a la docente animada, disfrutando de la clase y el contenido disciplinar que transfiere a las estudiantes. \r\nVerifica la comprensión realizando preguntas y revisa cuadernos con registro de la materia reforzando positivamente \r\n\r\nSe observa que algunas estudiantes se distraen fácilmente y les cuesta mantener silencio interrumpiendo la clase, la profesora pide silencio, pero siguen conversando, se deben acordar estrategias de mejora.\r\n\r\nAl finalizar, revisa cumplimiento de objetivo de manera conceptual, logrando que las estudiantes den cuenta de lo aprendido, por lo que la profesora cumple con mejora sugerida en retroalimentación anterior, sobre mejorar cierre de la clase.\r\n\r\n\r\n\r\n\r\nSugerencia de mejora:\r\n\r\nRealizar estrategia del 100% para mejorar la comprensión y potenciar clima de trabajo, enmarcado en disciplina 5S sobre el silencio para escucha activa\r\nUtilizar estrategia para entregar instrucciones claras y precisas\r\n'),
(139, '9089119', '17614804', '2022-11-03', '08:15:45', '09:45:45', 20, 23, 1.93, NULL, 2, 'Objetivo de la clase: To use Zero conditional to form sentences\r\n\r\nLa docente utiliza estrategia umbral, creándose un ambiente propicio   y presenta el objetivo de la clase.\r\n\r\nSe observa una clase preparada con material adecuado, recordando conocimientos previos sobre el tema a abordar.\r\n\r\nEntrega instrucciones claras y verifica la comprensión con estrategia sin salida y preguntas claves reforzando positivamente.\r\n\r\nSe observa un adecuado manejo conceptual y la docente se vincula positivamente con todos los alumnos a quienes indica por su nombre.\r\n\r\nUtiliza estrategia de tiempo consensuado al realizar los ejercicios y monitorea el avance de los retroalimentando y comprobando la comprensión  \r\n\r\nSugerencias de mejora:\r\n\r\nGestionar los tiempos de trabajo \r\nDiversificar la actividad a realizar para los estudiantes que terminan antes \r\nVerificar aprendizaje en el cierre \r\n\r\n'),
(140, '9089119', '16283844', '2022-10-05', '10:10:33', '11:40:33', 20, 34, 1.84, NULL, 2, 'Objetivo de la clase: Inicio 4° unidad “organizar la información obtenida a través de tablas de frecuencia”\r\n\r\nLa docente utiliza estrategia en sus marcas y presenta objetivo de la clase, modelando el trabajo a realizar a través de un ejemplo. \r\n\r\nExplica ruta de trabajo de la clase, la que genera mejor comprensión del desarrollo de esta, se sugiere dejarla de manera visible hasta el final para realizar evaluación de los avances en los diferentes momentos de la clase.\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nUtiliza tiempo consensuado y visible \r\n\r\nRealiza cierre de la clase utilizando rutina “crear el titular de una noticia”, la que presenta gráficamente y modela.\r\n\r\n\r\nSugerencias de trabajo:\r\n\r\n\r\nMonitoreo del trabajo a todos los estudiantes, verificando la comprensión y participación del 100%.\r\n\r\nCrear ambiente propicio\r\n\r\nSeguir implementando y mejorando la estrategia de clima de aula para crear un ambiente propicio\r\n\r\nMejorar la estrategia en sus marcas al inicio de la clase, lográndola completamente\r\n\r\n'),
(141, '9089119', '10387845', '2022-11-02', '10:10:42', '11:40:42', 25, 35, 2, NULL, 2, 'Objetivo: Construir secuencias melódicas en escalas blues\r\n\r\nLa clase comienza con la entrega del objetivo y la activación de conocimientos previos sobre conceptos que se utilizarán para desarrollar en un trabajo grupal.\r\n\r\nEscribe y comparte una ruta de trabajo, lo que permite que se avance de manera sincronizada.\r\nRealiza modelamiento y entrega instrucciones del trabajo a realizar lo que ayuda a la comprensión.\r\n\r\nSe observa a la docente animada, incentivando el contenido disciplinar que transfiere a las estudiantes. \r\n\r\nVerifica la comprensión realizando preguntas con las estrategias sin salida y cien por ciento \r\nMonitorea permanentemente el trabajo grupal retroalimentando los avances, y al finalizar, revisa el cumplimiento del objetivo de cada grupo, quienes explican el cómo desarrollaron la actividad y luego tocan las secuencias creadas.\r\n\r\nSugerencia de mejora:\r\n\r\nResguardar el tiempo necesario para el cierre de la clase, ya que faltó tiempo para escuchar a todos los grupos\r\n\r\n\r\n'),
(142, '9089119', '19274209', '2022-10-19', '08:15:40', '09:45:40', 29, 29, 1.93, NULL, 2, 'Objetivo:\r\n\r\nConocer y desarrollar estrategias para preparar la prueba PAES a través de la aplicación y corrección de un mini ensayo.\r\n\r\nBuen clima de aula propicio para el aprendizaje, estudiantes participativas, factor alegría presente\r\nPresentan el objetivo y ruta de trabajo incorporado en PPT al inicio.\r\nMaterial audiovisual claro con instrucciones claras y precisas.\r\n\r\nSe observa codocencia con la docente PIE con trabajo preparado y bien logrado\r\nRealizan cierre con actividad de ticket de salida de manera muy motivadora logrando compromiso por participar y logra evaluar el aprendizaje.\r\n\r\nOperacionalización del objetivo, que sea observable por el estudiante como:  Aplicar estrategias de comprensión lectora en un mini ensayo\r\n\r\nDocente entrega TIPS para resolver las preguntas como:  Estrategia de ojeo, identificar respuestas, palabras claves, uso del plural y singular. En lo anterior se sugiere modelamiento a través de los ejemplos para lograr mayor comprensión antes de la aplicación.\r\n\r\nPresenta diapositiva con niveles de lectura: nivel literal, nivel inferencial, nivel crítico y se recuerdan los tres conceptos, lo mismo se realiza con estrategias de lectura, esto también se pudo ir aplicando inmediatamente en un texto entregado al estudiante\r\n \r\nRealizan mini ensayo con un texto y 6 preguntas, con 20 minutos, \r\n\r\n\r\nSe sugiere trabajar:\r\n\r\nOperacionalizar objetivo dirigido a que el estudiante pueda visualizarlo y revisarlo de parte de las estudiantes evaluando si logro el objetivo\r\n\r\nModelar a través de ejemplos concretos los elementos teóricos que se presentan.\r\n\r\nSe felicita a la docente ya que utilizo estrategias de clima de aula logrando activa participación y trabajo sincrónico y no usar preguntas retóricas según sugerencias de acompañamiento realizado anteriormente.\r\n\r\n'),
(143, '9089119', '13312214', '2022-10-26', '10:10:56', '11:15:56', 30, 41, 1.79, NULL, 2, 'Se presenta objetivo de la clase, falta explicitar la habilidad a desarrollar,  indicando que es la continuidad de disertaciones.\r\n\r\nLos grupos realizan presentaciones con apoyo audiovisual, experimentos y tríptico que entregan a la docente, evidenciando un trabajo anterior\r\n\r\nLa docente realiza preguntas claves e intervenciones que motivan la participación y la reflexión de los estudiantes, generándose un buen clima de aula\r\n\r\nLos estudiantes demuestran comprensión e  interés  en los diferentes temas, realizando preguntas referentes a los experimentos realizados.\r\n\r\nSe observa falta de estrategias de clima de aula al inicio lo que produce demora en comenzar la clase.\r\n\r\nSe entregó pauta de evaluación antes de las presentaciones\r\n\r\n\r\nSugerencia clase anterior:\r\n\r\nComenzar la clase con una estrategia como en sus marcas, que permita generar un ambiente propicio para el aprendizaje.\r\n\r\nSe sugiere que ante este tipo de actividades se pueda ir retroalimentando inmediatamente al grupo que expone.\r\n\r\n\r\n\r\n'),
(144, '9089119', '14622138', '2022-11-22', '08:15:10', '09:00:11', 28, 22, 1.83, NULL, 2, 'Profesora ingresa a la hora establecida y realiza umbral y en sus marcas\r\n\r\nDocente presenta tema libre mercado y aplica estrategia: Pensar, inquietar, explorar, invitando a los estudiantes a reflexionar y participar activamente de la clase.\r\n\r\nPresenta el objetivo que es: Evaluar las características del libre mercado a través de fuentes y opiniones. \r\n\r\nSe vincula positivamente con los estudiantes y refuerza positivamente\r\n\r\nSe observa un adecuado manejo conceptual y una clase preparada con material adecuado\r\n\r\nSe trabaja de manera sincrónica, verifica comprensión realizando sin salida y recoge inquietudes y opiniones creando un espacio de reflexión y argumentación de parte de los estudiantes.\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nSugerencia:\r\n\r\nDiversificar la participación de los estudiantes involucrando a más estudiantes en las reflexiones y fomentar la escucha activa, sobre todo entre pares. \r\n\r\nPresentar habilidad al entregar el objetivo y ruta de trabajo\r\n\r\n\r\n'),
(145, '9089119', '18356281', '2022-10-25', '11:55:17', '13:25:17', 25, 29, 1.92, NULL, 1, 'Objetivo:\r\n\r\nReforzar contenidos referentes a género dramático para evaluación sumativa.\r\n\r\nSe observa una clase bien estructurada, activa con buena participación de parte de un grupo de estudiantes.\r\nDocente con buen manejo conceptual y disciplinar, utiliza ejemplos claros y de interés de las estudiantes (películas y libros).\r\nRealiza la conexión de la materia con el libro correspondiente al plan lector intencionadamente despertando el interés por la lectura.\r\n\r\nSe observa un buen clima de aula propicio para el aprendizaje, estudiantes participativas, factor alegría presente\r\nMaterial audiovisual adecuado y claro\r\n\r\n\r\nSe sugiere trabajar:\r\n\r\nLa verificación de la comprensión de todos los estudiantes con estrategias como “sin salida” u “cien por ciento”\r\n\r\n.\r\n'),
(146, '14273480', '15178747', '2022-11-18', '15:00:28', '15:30:28', 1, 38, 1.95, NULL, 1, 'Fortalezas:\r\n- Implementación de rutina de calendario matemático con todas sus partes.\r\n- Participación activa de estudiantes.\r\n- Las interacciones realizadas fomentan el pensamiento divergente en los estudiantes.\r\nAcuerdos:\r\n- Contar con probelam matemático impreso o dibujar en pizarra, de tal forma que sea visible para los estudiantes.\r\n- Intencionar lenguaje y signos matemáticos, a través del problema.\r\n- Al escribir nombres de estudiantes ausentes, intencionar juego para desarrollo de conciencia fonológica.'),
(147, '14273480', '13132976', '2022-11-18', '14:05:28', '14:50:28', 2, 31, 2, NULL, 1, 'Fortalezas:\r\n- Excelentes interacciones cognitivas con los estudiantes, promueve el pensamiento divergente.\r\n- Implementación de lectura compartida, acogiendo sugerencias dadas por experta.\r\nAcuerdos:\r\n- Verbalizar estrategias de clima de aula, \"sin salida\", mencionar con el nombre.'),
(148, '14273480', '18143931', '2022-11-17', '14:10:04', '15:35:04', 7, 8, 1.87, NULL, 1, 'Fortalezas:\r\n- Se observa avances en la metodología utilizada en clase.\r\n- Implementa estrategias de clima de aula.\r\nAcuerdos:\r\n- Si bien las estrategias utilizadas contribuyeron al cumplimiento del objetivo, en su totalidad debe centrarse más específicamente en el logro de este.\r\n- Aplica \"sin salida\" pero es necesario mencionar con nombre correcto y revisar su correcta aplicación.'),
(149, '14273480', '14604335', '2022-11-03', '08:20:23', '09:45:23', 9, 32, 2, NULL, 1, 'Fortalezas:\r\n- Incorpora juegos para principio alfabético en lectura compartida.\r\n- Interacciones efectivas que promueven el pensamiento.\r\n\r\nAcuerdos:\r\n- Trabajar estrategias de comprensión lectora en lectura compartida.'),
