(151, '7060271', '17079039', '2022-11-17', '08:15:10', '12:09:11', 9, 32, 1.88, NULL, 1, '1. Es importante modelar el uso del diccionario para clarificar palabras. 			\r\nEn esta actividad, se puede incorporar el uso de la tecnologÃ­a y buscar el significado en el celular.			\r\n2. Diferenciar el uso del panel de vocabulario y el panel de la PdP. 			\r\nEl panel de vocabulario se usa para incorporar las palabras de vocabulario.			\r\nLa PdP se utiliza para colocar las palabras de uso frecuente y ayudar a los niÃ±os a mejorar la ortografÃ­a.			\r\n'),
(152, '7060271', '12958246', '2022-11-15', '13:40:04', '14:10:04', 2, 32, 1.56, NULL, 1, 'Se sugiere estar atenta a las necesidades de los niÃ±os, es un curso complejo y debe ser apoyo constante en todo momento, si se enfoca en un niÃ±o pierde la visiÃ³n del resto del curso'),
(153, '7060271', '16161542', '2022-11-15', '14:59:04', '15:41:04', 2, 32, 1.85, NULL, 1, '1. No olvidar trabajar los puntos que faltaron en el calendario: ESTIMACIÃ“N - ESTACIONES DEL AÃ‘O - PROBLEMA MATEMÃTICO.			\r\n2. No olvidar revisar a rutina del dÃ­a  ANTES DE COMENZAR LA ACTIVIDAD. Revisar la rutina varias veces durante el dÃ­a, lo que han hecho, marcando en el momento que estÃ¡n y lo que les falta por hacer..			\r\n			\r\n3. Simplificar el trabajo de asistencia			\r\nPasar la lista no genera aprendizaje y se ocupa tiempo valioso de trabajo con los niÃ±os.			\r\n1. Identificar a los ausentes y escribir su nombre o apellido.			\r\n2. Tener marcado en forma fija la cantidad de alumnos del curso.			\r\n3. Desde el nÃºmero total de alumnos, contar saltitos para atrÃ¡s tantos como alumnos ausente. La cifra da el numero de presentes. Contar para comprobar.			\r\n4. Utilizar la recta numÃ©rica para identificar el nÃºmero de asistentes y ausentes.			\r\n5. Contar el nÃºmero de hombre y de niÃ±as.			\r\nTodos estos ejercicios generan el desarrollo de habilidades matemÃ¡ticas.			\r\n'),
(154, '7060271', '15086541', '2022-12-15', '08:15:33', '09:00:33', 6, 32, 1.9, NULL, 1, '1. Modelar el uso de la regla.			\r\n2. La historia del DV se debe contar en la medida que se estÃ¡ dibujando.			\r\n3. Al terminar la historia se invita a los niÃ±os a pensar en la idea principal de la historia, resumir es mÃ¡s que ina idea principal.			\r\n4. Antes de comenzar a escribir el DV de la profesora, repetir la idea principal que se negociÃ³, de manera que los niÃ±os sepan lo que se va a escribir y puedan vitorear con la profesora mientras escribe.			\r\n	\r\n5. Al enviar a los niÃ±os a trabajar en su DV, recordar el uso de la Pdp. Nombrar algunas que ellos puedan copiar en sus historias.			\r\n3. NO olvidar incentivar la formulaciÃ³n de preguntas.			\r\n'),
(155, '7060271', '12605223', '2022-11-15', '08:15:19', '09:00:19', 6, 32, 2, NULL, 1, 'Participativa, se antepone a la actividad, permanentemente pendiente de la necesidad de los niÃ±os y de la profesora. Felicitaciones!\r\n'),
(156, '7060271', '26323365', '2022-11-15', '10:05:41', '10:50:41', 7, 32, 1.91, NULL, 1, '1. Identificar y distinguir la lectura repetitiva y la coral.			\r\nRepetitiva: los niÃ±os repiten despuÃ©s de la profesora.			\r\nCoral: todos los niÃ±os leen juntos.			\r\n3. Incluir en el trabajo de \"Fluidez lectora\" la HOMOGENEIDAD y el FRASEO.			\r\n4. Diferenciar la PdP de las palabras de vocabulario. Deben haber 2 paneles que las diferencien,.			\r\n'),
(157, '7060271', '10861499', '2022-11-15', '10:05:53', '10:50:53', 7, 32, 2, NULL, 1, 'PArticipaiva, atenta a las necesidades de las estudiantes. Se establece diÃ¡logo entre las profesoras que aportan al aprendizaje.'),
(158, '13769322', '16161640', '2023-03-29', '08:15:00', '09:45:00', 18, 8, 1.87, NULL, 7, 'Docente ingresa en el horario correspondiente, los alumnos estÃ¡n en lectura silenciosa.   Solicita materiales. Proyecta menÃº del DÃ­a. Â¿QuÃ© necesito? Indica los materiales que utilizarÃ¡n en clases.\r\nRealiza un quiebre cognitivo. Los alumnos participan de la actividad.\r\nObjetivo; OA16 â€œConocer los usos del agua en la Tierraâ€\r\nRealiza retroalimentaciÃ³n de la clase anterior â€œEl efecto invernaderoâ€ Pregunta sobre conceptos tratados. Utiliza estrategia del 100%. Observan dibujos animados sobre el efecto invernadero.  Luego del video, realiza preguntas sobre la comprensiÃ³n del mismo.\r\nPregunta Â¿En quÃ© utilizamos el agua? (coloca temporizador) los alumnos responden. Realiza preguntas dirigidas. Copian â€œLa importancia del Aguaâ€ (el ppt indica que deben copiar) â€“ utiliza el tiempo con el reloj de la sala â€“ (se pierde un poco) Pregunta por concepto â€œHidrosferaâ€ (relaciona con lenguaje y matemÃ¡tica).\r\nLeen contenido de las diapositivas (alumnos se turnan) Pregunta, a partir del texto Â¿Es mucha el agua que rodea el planeta en comparaciÃ³n con la Tierra? (pasa asistencia) Relaciona contenido con lugares cercanos.\r\nFalta cierre final de la clase.\r\n'),
(159, '13769322', '18047397', '2023-04-11', '14:10:00', '15:40:00', 18, 34, 1.41, NULL, 7, '14:15 Realizan la fila y educadora diferencial entrega Hacer Ahora.\r\nObjetivo â€“ lo indica verbal â€œDecimalesâ€\r\nLes dan 15 minutos para desarrollar el Hacer Ahora, profesora indica el Hoy â€œControl de tablas, Pagina 70 y 72) Problemas. Educadora monitorea el trabajo y dudas de las alumnas. Acaba el tiempo y le indica que deben pasar la hoja hacia delante.\r\nFocaliza con aplauso para que los alumnos mantengan el silencio (no dura mucho su atenciÃ³n y son algunos que lo hacen).\r\nTrabajo en pÃ¡gina 70, les pide a los alumnos que trabajen en el texto e interpreten lo que indica la actividad.  Los alumnos participan leyendo los problemas y participando.\r\n14:55 continÃºan con el trabajo de la pÃ¡gina en el ejercicio 1.\r\nFinaliza clase (ticket de salida) con 2 problemas.\r\nRevisan ticket de salida parcialmente.\r\n'),
(160, '13769322', '19404149', '2023-04-10', '08:15:00', '09:45:00', 13, 34, 1.64, NULL, 7, 'Profesora saluda y solicita los materiales para la clase.  Escribe el hoy: Revisar pÃ¡gina 15, Cuaderno pÃ¡g 16 y 17, ticket de salida nÂº 20.\r\nInicia la retroalimentaciÃ³n de la clase anterior; comienza explicando lo que deberÃ­an saber (numeraciÃ³n). Inicia la actividad, utiliza palos, revisando la pÃ¡gina 15 en la pizarra.\r\nLa actividad finaliza a las 08:55 horas; realiza consultas sobre las buenas o malas que tuvieron al revisarlo.\r\nTrabajan en cuadernillo en pÃ¡gina 16. Docente realiza el primer ejercicio como ejemplo. Indica que tienen 20  minutos para desarrollar las pÃ¡ginas 16 y 17.  Mientras trabajan la docente pasa la lista.  Coloca como temporizador el celular.\r\n09:20 revisa los ejercicios de la pÃ¡gina 16.  La primera parte la realiza la docente y la segunda parte â€œCalculaâ€ la realizan las alumnas al azar.  Solo alcanza a revisar la pÃ¡gina 16.\r\nFinaliza revisando el ticket de salida nÂº20.\r\n'),
(161, '11537827', '17899117', '2023-04-13', '12:00:22', '13:25:22', 1, 34, 1.42, NULL, 7, 'Utilizar estrategias que potencien  las habilidades del grupo y desafiar sus aprendizajes \r\nEvitar preguntas retoricas , que sean mÃ¡s dirigidas  \r\nEvitar potenciar a un solo genero \r\nMejorar y trabajar los conceptos diciplinar ( Vocabulario tÃ©cnico) \r\nMejorar los tiempos asignados en las actividades. '),
(162, '13769322', '13276799', '2023-04-14', '08:15:00', '09:45:00', 14, 32, 1.85, NULL, 7, '08:15 Profesora indica que realizará clases de escritura (sacar cuaderno)\r\nAsiste Educadora Diferencial para realizar la clase de Aula Diversificada.\r\nHoy: Texto informativo y texto instructivo. Actividad: Comparación  - Aplicación de ambos textos.\r\nInician con un video sobre el texto Informativo,  (dura 4.45) luego, observan video de texto instructivo (2:30). Una vez que lo comentan, educadora les entrega una hoja con las características principales de cada tipo de texto.\r\nActividad: Les muestran un libro grande con diferentes tipos de texto. Comentan sobre el primer texto que es un cuento.\r\nOrganiza la actividad por fila con un encargado, las filas serían “Texto instructivo” y “Texto  Informativo” muestra el texto (en grande) y les consulta ¿qué tipo de texto es? ¿por qué es ese tipo de texto? Profesora les pregunta por fila porqué era ese texto y sus características. Lo realizan con otro tipo de texto y lo ven por filas (características). Los alumnos participan y logran regularlos durante lapsos de tiempo (realizan estrategia del 100%).\r\nMientras educadora avanza, la profesora reparte los ticket de salida.  Trabajan en ticket con temporizador y en silencio.  Se monitorea el trabajo en aula.\r\nSe revisa la actividad en la pizarra, mientras profesora la copia en un cuadro.\r\nLos alumnos participan activamente.\r\nCierre\r\nAl término de la actividad pregunta ¿Qué aprendimos hoy? ¿somos capaces de clasificar los tipos de texto? Se revisan ticket de salida en el cuaderno.\r\n'),
(163, '13769322', '19404149', '2023-04-20', '12:00:00', '12:40:00', 12, 34, 1.81, NULL, 7, 'Profesora realiza el Umbral entregando a los niños “Hacer Ahora”. Coloca temporizador (5’) para desarrollar el trabajo. Mientras coloca el Hoy en la pizarra. (Hoy: Hacer ahora nº 5, Aula diversificada nº1, ticket nº 19).\r\nSe revisa el ticket de salida (compañero y pizarra) -  según la sugerencia dada en la reunión anterior – y luego lo solicitan a los alumnos. 5N.\r\nAula: Dan indicaciones de actividad.  (1º parte trabajo práctico, 2º parte trabajo teórico donde aplicarán lo aprendido). Retroalimentación ¿Qué valores posicionales hemos aprendido?  Presentan ppt con instrucciones de la 1º parte. (realizan la actividad práctica de formar 2 grupos de 20 alumnos en la cual deben representar el grupo el número que la profesora indica en la pizarra) para ellos les hacen entrega de una hoja representando una “unidad” “decena” o “centena”.\r\nActividad 2: Desarrollar guía de valor posicional.  Entregan guía, profesora monitorea el trabajo de los alumnos. Quienes entregan la hoja, se las solicita y luego les entregan ticket de salida nº19. (temporizador 8’) Revisan ticket de salida en la pizarra.\r\n'),
(164, '14273480', '14209132', '2023-05-03', '08:15:00', '09:45:00', 7, 32, 2, NULL, 7, '- Se observa preparación de recursos para el desarrollo de la clase.\r\n- Presta apoyo a estudiante con NEP, utilizando estrategias efectivas.\r\n- Se preocupa de mantener sala ordenada y limpia, favoreciendo formación de hábitos.\r\n- Promueve y aplica estrategias de clima de aula de forma sistemática.'),
(165, '14273480', '18143931', '2023-05-09', '08:00:00', '09:45:00', 9, 32, 1.8, NULL, 7, 'Observaciones:\r\n- Buen clima de aula: uso de rutinas de clima de aula y se observa que los estudiantes las manejan, estan habituados.\r\n- La clase cuenta con los 3 momentos establecidos.\r\n\r\nAcuerdos:\r\n- Implementar estrategias de rutina de pensamiento declaradas en planificación.\r\n- Revisar que las estrategias a utilizar potencien el desarrollo de habilidades y contenidos.\r\n- Implementar \"sin slaida\" u otro para verificar comprensión.\r\n- Implementr lectura compartida y conciencia fonológica.\r\n'),
(166, '14273480', '18684795', '2023-05-09', '08:00:00', '09:45:00', 10, 32, 1.93, NULL, 7, 'Observaciones:\r\n- Atenta al orden y normas de la sala.\r\n- Se preocupa de que los estudiantes esten atnetos a las diferentes actividades de l clase.\r\n- Apoya trabajo con estudiantes con NEEP. De igual forma, apoya al resto de los estudiantes.\r\n\r\nAcuerdos:\r\n- Apoya en las instrucciones a los estudiantes para la realización de actividades: si bien se mantiene atenta a apoyar a ls estudiantes, se solicita apoyar de forma visual u otra, por ejemplo: escribir en pizarrón el número de página o palabras nuevas u otro. \r\n- Elaborar panel de palabras asombrosas para ffavorcer el vocabulario en los estudiantes.'),
(167, '14273480', '14604335', '2023-05-03', '08:15:00', '09:45:00', 7, 32, 1.96, NULL, 7, 'Observaciones:\r\n- Clase con los 3 momentos, donde se observa concienca de cada uno de ellos.\r\n- Muy buen clima de aula.\r\n- Atenta a necesidades del grupo.\r\n- Incorporación en avance de estudiante con NEEP.\r\n- Realiza lectura compartida y ABC.\r\nAcuerdos:\r\n- Implementar \"sin salida\" u otro para verificar instrucciones.\r\n- Implementar rutinas de pensamiento declaradas en planificación.\r\n- Dar mayor uso a pared de palabras y pared de palabras asombrosas, en especial en clases de lenguaje.'),
(168, '13769322', '15452931', '2023-05-03', '08:25:00', '09:40:00', 16, 32, 0.85, NULL, 7, 'Docente les pide que lean en silencio el libro del plan lector, segÃºn rutina, que realizan y luego comentarÃ­an lo leÃ­do,\r\nHoy: Lectura comprensiva de un artÃ­culo informativo indicando sus ideas principales.\r\nFinaliza tiempo. Realiza preguntas sobre lo leÃ­do Â¿alguien tiene algo que comentar del inicio de la historia? Â¿por quÃ©\r\nse llama fiebre? Un alumno da la respuesta acertada.\r\nRetroalimenta clase anterior; comenta texto leÃ­do la clase anterior. Muestra imagen de Mafalda. Realizan preguntas\r\nrelacionadas con lo tratado, pero el tema se dispersa.\r\nLes pide que abran sus libros en la pÃ¡gina 46-47. Texto â€œAnimales amenazados en un mundo cada vez mÃ¡s\r\nrepleto de plÃ¡sticoâ€.\r\n08:47 Ingresa educadora diferencial. Les indica que leerÃ¡n aleatoriamente Â¿QuiÃ©nes leen bien de acÃ¡?\r\nPreguntan Â¿QuÃ© nos quiere decir el texto? Leyendo el tÃ­tulo Â¿CuÃ¡l es la idea principal?\r\nLes pide silencio. (utilizando la mesa) El alumno lee y el resto escucha la lectura. Pregunta Â¿QuÃ© significa\r\ningiere?\r\n08:55 educadora, monitorea el trabajo de los alumnos.\r\nEducadora presenta un pequeÃ±o texto â€œIdea principal y secundariaâ€ para que los alumnos lo peguen en el\r\ncuaderno.\r\nEducadora proyecta hoja que les entregÃ³ a los alumnos, el docente trata de vincular el texto con lo que\r\nindica la educadora; luego de que la educadora explique el cuadro escribe en la pizarra un resumen sobre la\r\nvinculaciÃ³n de ideas. Les pide que las anoten en el cuaderno.\r\nLuego el profesor escribe 3 preguntas en la pizarra.1.Â¿QuÃ© seres vivos se ven afectados con la contaminaciÃ³n\r\ndel plÃ¡stico.? 2. Â¿QuÃ© especies si son afectadas por la contaminaciÃ³n de plÃ¡sticos? 3. Con respeto al pÃ¡rrafo\r\n8 Â¿QuÃ© mensaje nos entrega el patÃ³logo veterinario Andrew Borownlow?\r\nProfesor hace preguntas sobre el texto. No hay cierre de la clase.'),
(169, '13769322', '11946370', '2023-05-05', '11:55:00', '13:25:00', 15, 22, 1.96, NULL, 7, 'Profesor realiza el umbral. Ingresando a la sala les indica que se coloquen sus cotonas, cuenta las botellas para que las guarden en los casilleros, etc.\r\nProfesor saluda y les indica que abran el cuaderno y coloquen la fecha. Solicita los materiales sobre la mesa.\r\nActividades de hoy: Observo – Pienso – Me pregunto.\r\nLas invita a abrir el cuaderno en la última actividad (página 80) Explica actividad.  Pasa la lista.\r\nInvita a observar las imágenes “Fuente A” y “Fuente B”.\r\nObservo  - pienso – me pregunto. (observan imágenes del libro) Introducción a la creación de un comic.\r\nTicket de salida ¿Cuál es la diferencia entre observar y pensar? ¿Para qué me sirve esta actividad? ¿Cómo puedo mejorar mi trabajo?\r\n'),
(170, '13769322', '17455726', '2023-05-10', '08:15:00', '09:40:00', 11, 27, 1.96, NULL, 7, 'Profesora ingresa a la sala de clases. Saluda. Da indicaciones que mientras escriba el “Today” retirará los trabajos, los cuales deben presentar frente a sus compañeros.\r\nToday: “Rutinas diarias” (Unidad II, Busy morning) Mientras escriben, pasa la lista.\r\nRetroalimentación ¿Qué es una rutina diaria? Las alumnas responden que realizan ellas diariamente.\r\nMuestran imágenes con ppt (escritura + pronunciación).  Realiza diferencia en fonética y la importancia de la buena pronunciación. Participan en forma aleatoria respondiendo preguntas de la docente. Finalizan las rutinas.\r\nToday: “The Time” – a tiempo – media hora.\r\nProfesora les enseña el tiempo.  Tarea: Crear una rutina con: I + rutina + at + hora (les entrega a cada una de ellas el material con rutinas).  Modela tarea.  Da tiempo para que las realicen.  Revisa tarea solicitando 2 ejemplos a las alumnas.\r\nLes indica que harán la próxima clase y organiza los materiales de la próxima hora.\r\n'),
(171, '17335579', '19449801', '2023-06-02', '12:40:00', '13:25:00', 30, 34, 1.5, NULL, 7, 'Las estrategias de apoyo en el aula no pueden ser exclusivas para los estudiantes del programa, sino que deben extenderse a todos los estudiantes que presenten una necesidad educativa o que evidencien dificultades para adquirir el contenido presentado. \r\nApoyar la creaciÃ³n de un clima de aula propicio para el aprendizaje (Estructura de la clase, recordar las reglas de la sala, motivar la ejecuciÃ³n de las actividades, brindar material de apoyo a todos los estudiantes, enfatizar en la utilidad del contenido mayor dinamismo en las estrategias utilizadas).  No obviar a los estudiantes que no estÃ¡n atendiendo ni participando. \r\nSe observa muy buen manejo del contenido por parte de la educadora, un trabajo de coordinaciÃ³n favorable. Profesional muy aplicada en la atenciÃ³n de los estudiantes del programa y en la elaboraciÃ³n de material pertinente. '),
(172, '17335579', '15892082', '2023-06-02', '08:15:00', '09:40:00', 16, 29, 1, NULL, 7, 'No se observa un trabajo de codocencia coordinado, por tanto se solicita centrar los esfuerzos en las instancias de planificaciÃ³n conjunta, determinando efectivamente roles dentro del aula y la distribuciÃ³n de las tareas. Recordar que las reuniones de planificaciÃ³n son de carÃ¡cter tÃ©cnico y facilitan la respuesta a NEE dentro del aula. \r\n\r\nSe solicita cuidar de la convivencia escolar y centrar esfuerzos en lograr un clima de aula propicio para el aprendizaje (tarea que corresponde a ambos docentes). Es importante apoyar a todo el curso recordando reglas y normas, lo importante del valor del respeto con los pares y adultos y motivar constantemente el trabajo, puesto que se observÃ³ estudiantes que desistÃ­an de la tarea y no eran estimulados a continuar. \r\n\r\nRecordar que la tarea de la docente PIE no es de asistencia. '),
(173, '17335579', '15088008', '2023-06-05', '10:05:00', '11:35:00', 5, 1, 1.79, NULL, 7, 'Se requiere ocupar un espacio horizontal con la educadora del curso en la sala de clases, con el objetivo de favorecer el desarrollo efectivo de codocencia.\r\n\r\n'),
(174, '17335579', '19551473', '2023-06-05', '11:55:00', '13:25:00', 29, 34, 1.58, NULL, 7, 'No descuidar la relevancia que tiene estructurar a clase y dialogar las normas de convivencia. \r\nResguardar el plan de apoyo individual de las estudiantes, considerando las adecuaciones de acceso que requieren, principalmente de tiempo para finalizar las tareas. '),
(175, '11537827', '16283844', '2023-05-16', '12:00:55', '13:00:55', 21, 34, 1.2, NULL, 7, 'Una clase con guía y que se trabaja en forma individual. \r\nDocente monitorea por puestos. realizando las retroalimentación. \r\nSe aprecia un buen clima de aula, pero poco trabajo por parte de los estudiantes.  \r\nNo se observa la aplicación de estrategias   para poder verificar y potenciar  el proceso de aprendizaje de los estudiantes. \r\nDebe mejorar el proceso de retroalimentación mas efectiva  y con tiempos adecuados.  \r\n '),
(176, '9089119', '16139466', '2023-05-22', '10:10:48', '11:00:48', 26, 20, 1.8, NULL, 3, 'Objetivo: Analizar y calcular la aceleración en situaciones cotidianas.\r\n\r\nSe comienza con contenidos clase anterior vinculándolos con los que se trabajaran durante la clase.\r\n\r\nSe entrega guía de trabajo con problemas y evaluación formativa.\r\n\r\nDocente resuelve los dos primeros ejercicios en la pizarra y los estudiantes participan activamente.\r\n\r\nAtiende las dudas de manera individual, y se vincula positivamente con los estudiantes.\r\n\r\nSe realizan preguntas retóricas.\r\n\r\nSe observa buen manejo conceptual disciplinar.\r\n\r\nSugerencias:\r\n\r\nSe dejan planteadas las mismas sugerencias de acompañamiento anterior para que sea trabajado\r\n\r\nPresentar habilidad a desarrollar como meta compartida.\r\n\r\nEntregar indicaciones claras verificando su comprensión.\r\n\r\nImplementar estrategias como 100% y sin salida evitando las preguntas retóricas, para poder verificar la comprensión.\r\n\r\nTrabajar el uso de la voz implementando estrategias de clima de aula que le permita la escucha activa de los estudiantes.\r\n\r\n'),
(177, '9089119', '18389625', '2023-05-22', '13:25:36', '14:10:36', 24, 34, 1.81, NULL, 7, 'Se inicia presentando el objetivo que es: “Conocer la suma por su diferencia en productos notables” \r\n\r\nComienza con guía de trabajo iniciada en clase anterior recordando el trabajo realizado\r\n\r\nSe observa un buen ambiente de trabajo y colaboración entre pares, con estudiantes participativos.\r\n\r\nMonitorea el trabajo aclarando dudas y observando avances, durante la clase.\r\n\r\nSe implementa estrategia sin salida falta se  consensua el tiempo \r\n\r\nRefuerza positivamente motivando el trabajo.\r\n\r\nSugerencias de trabajo:\r\n\r\nExplicitar la habilidad del objetivo a trabajar.\r\n\r\nSe recuerda entregar instrucciones para el trabajo a realizar y verificar la comprensión de estas.\r\n\r\n  Implementar, al menos dos rutinas o estrategias como: Hacer ahora, 100%, ruta de trabajo, consensuar el tiempo, etc. \r\n\r\n Crear e implementar estrategias activas participativas.\r\n\r\n\r\n'),
(179, '9089119', '19274209', '2023-05-11', '08:15:15', '08:50:15', 29, 29, 1.88, NULL, 3, 'Se observa una clase de continuidad de trabajo individual sobre plan lector \r\n\r\nDocente les recuerda aspectos a considerar en el trabajo a realizar y la pauta de evaluación que ya estaba entregada.\r\n\r\nEl clima de aula es propicio para el trabajo a excepción de un pequeño grupo que se adhiere tarde al trabajo\r\n\r\nLa docente se vincula positivamente con las estudiantes, las motiva y monitorea de manera permanente.\r\n\r\n Sugerencias: \r\n\r\nEntregar instrucciones claras y precisas y verificar su comprensión a través de estrategias como sin salida o 100% para fomentar la escucha activa entre ellos.\r\n\r\n'),
(180, '9089119', '19274209', '2023-05-24', '08:15:25', '09:15:25', 29, 29, 2, NULL, 3, 'Se comienza con extracto de la película “El discurso del rey”\r\n\r\nObjetivo: “Relacionar los factores de la comunicación con el discurso público”. Se evidencia la habilidad realizando preguntas claves y ejemplos cotidianos.\r\n\r\nSe presenta ruta de aprendizaje en PPT muy rápido, se sugiere escribirlo en la pizarra y verificar su comprensión para relevar su importancia.\r\n\r\nEl clima de aula es propicio para el aprendizaje y se observa un trabajo coordinado de codocencia.\r\n\r\nSe observa a la docente con actitud motivadora y estudiantes atentas. \r\n\r\nVerifica la comprensión al terminar la presentación del contenido con estrategia sin salida.\r\n\r\nInvita a las estudiantes a reflexionar al realizar lectura del discurso, a través de rutina de pensamiento.\r\n\r\nClase estructurada con material adecuado.\r\n\r\nTiempo visible sólo falto consensuarlo.\r\n\r\n Sugerencias: \r\n\r\nVisibilizar ruta de trabajo verificando su comprensión.\r\n\r\nFomentar la escucha activa entre ellos.\r\n\r\nSe felicita a la docente por el trabajo realizado en cuanto a las sugerencias realizadas en acompañamiento anterior.\r\n\r\n\r\n\r\n'),
(181, '9089119', '18356281', '2023-05-22', '11:55:52', '12:25:52', 23, 29, 1.88, NULL, 3, 'Docente inicia recordando el trabajo que está en proceso: guía evaluada de plan lector\r\n\r\nPresenta lineamientos de clima de aula para promover un ambiente de trabajo propicio.\r\n\r\nFalta retomar el objetivo y las habilidades a desarrollar. \r\n\r\nA pesar de ser continuidad de trabajo se sugiere que igualmente se debe entregar instrucciones y conceptos claves, dando continuidad a la clase anterior y recordando la etapa ya realizada.\r\n\r\nSe observa una clase planificada con material adecuado y participación activa de las estudiantes.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo un buen clima de aula .\r\n\r\nSugerencias:\r\n\r\n      Se mantienen las sugerencias del acompañamiento anterior para seguir siendo trabajadas: \r\n\r\nAl presentar el objetivo explicitar la habilidad que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes.\r\n\r\n Presentar ruta de trabajo para potenciar el desarrollo de la clase.\r\n\r\nA pesar de la alta participación se sugiere diversificar el trabajo para generar mayor   \r\noportunidades aprendizaje y para mantener la atención durante toda la clase.\r\n\r\n\r\n'),
(182, '9089119', '17614804', '2023-05-16', '14:55:01', '15:30:01', 19, 27, 2, NULL, 7, 'Docente presenta objetivo y habilidades a desarrollar: To identify and use healthy routines (identificar y utilizar rutinas saludables)\r\n\r\nSe comienza con estrategia hacer ahora generando un excelente clima de aula\r\n\r\nSe continua recordando conocimientos previos, realizando preguntas claves lo que genera mejor comprensión y activa participación con estrategia 100% y sin salida\r\n\r\nEstudiantes atentas y con clima de aula propicio para el aprendizaje\r\n\r\n\r\nSe observa una clase estructurada con material adecuado, se trabaja en una guía\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo el interés y trabajo de ellos.\r\n\r\nSugerencias:\r\n\r\n       Al presentar el objetivo explicitar la habilidad que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes.\r\n\r\n      Presentar ruta de trabajo para potenciar el desarrollo de la clase.\r\n\r\n');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(183, '9089119', '13312214', '2023-05-10', '08:15:03', '09:10:03', 30, 7, 1.85, NULL, 3, 'La docente ingresa a la hora y presenta el objetivo que es: “Analizar en base a investigación los factores que afectan nuestra salud”, explicita la habilidad y entrega retroalimentación de última evaluación invitándolos a reflexionar sobre el nivel de logro de la habilidad mencionada y entrega instrucciones de trabajo a realizar indicando la modalidad.\r\n\r\nSe observa un buen ambiente de trabajo y colaboración entre pares, con estudiantes participativos.\r\n\r\nMonitorea el trabajo aclarando dudas y observando avances, durante la clase.\r\n\r\nRefuerza positivamente motivando el trabajo.\r\n\r\nSugerencias de trabajo:\r\n\r\nSi bien se entrega instrucciones para el trabajo a realizar se debe verificar la comprensión de estas.\r\n\r\n  Implementar, al menos dos rutinas o estrategias como: Hacer ahora, sin salida, 100%, ruta de trabajo, consensuar el tiempo, etc.\r\n'),
(184, '9089119', '14622138', '2023-04-13', '10:10:15', '11:15:15', 21, 22, 1.8, NULL, 3, 'La docente ingresa a la hora y presenta el objetivo que es: “Crear una infografía con los temas humanismo, renacimiento y estado moderno”\r\n\r\nEntrega las instrucciones de trabajo a realizar en grupos indicando la modalidad de trabajo.\r\n\r\nSe observa un buen ambiente de trabajo y colaboración entre pares, con estudiantes participativas.\r\n\r\nMonitorea el trabajo aclarando dudas y observando avances, durante la clase.\r\n\r\nRefuerza positivamente motivando el trabajo en los grupos, sin embrago existen estudiantes sin trabajar.\r\n\r\nSugerencias de trabajo \r\n\r\n  Implementar dos rutinas o estrategias que potencien el aprendizaje y verificación de la comprensión, como: Hacer ahora, sin salida, 100%, ruta de trabajo, consensuar el tiempo, etc.\r\n\r\nVerificar la comprensión de las instrucciones con estrategias como sin salida, evitando las preguntas retóricas para motivar la escucha activa\r\n\r\nSe sugiere estrategias más dinámicas para motivar a las estudiantes en su aprendizaje y en trabajos formar los equipos de manera intencionada con roles. \r\n\r\n  \r\n'),
(185, '9089119', '16139466', '2023-04-17', '11:55:47', '12:55:47', 27, 48, 1.8, NULL, 3, 'Objetivo: Ley de gravitación universal\r\n\r\nSe comienza con la entrega de guía de trabajo con problemas, el primero es resuelto en la pizarra y los estudiantes van indicando con participación activa \r\n\r\nAtiende las dudas de manera individual, y se vincula positivamente con los estudiantes\r\n\r\nMotiva la clase con preguntas claves y monitoreo permanente.\r\n\r\nSe observa buen manejo conceptual disciplinar.\r\n\r\nSugerencias:\r\n\r\nPresentar habilidad a desarrollar como meta compartida.\r\n\r\nImplementar estrategias como 100% y sin salida evitando las preguntas retóricas, para poder verificar la comprensión.\r\n\r\nTrabajar el uso de la voz implementando estrategias de clima de aula que le permita la escucha activa de los estudiantes.\r\n'),
(186, '9089119', '15176982', '2023-05-11', '10:15:22', '11:00:22', 22, 8, 2, NULL, 3, 'Docente presenta objetivo y habilidades a desarrollar: Recordar y reforzar los contenidos relacionados a número atómico, masa atómica, iones y enlaces.\r\n\r\nSe comienza con estrategia hacer ahora generando un excelente clima de aula\r\n\r\nSe comienza recordando conocimientos previos a través de estrategia de 100%\r\n\r\nEstudiantes muy participativos y con clima de aula propicio para el aprendizaje\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión y activa la participación en la pizarra\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo el interés y trabajo de los ellos\r\n\r\nSugerencias:\r\n\r\n      \r\nSe sugiere seguir implementando actividades experimentales y estrategias de clima de aula y desarrollo de habilidades.\r\n\r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, intencionado como meta   compartida.\r\n\r\nVerificar permanentemente la comprensión de todos los estudiantes\r\n\r\n'),
(187, '9089119', '16283844', '2023-04-12', '10:10:25', '11:30:25', 22, 34, 1.92, NULL, 7, 'Se realiza la primera clase de agrupaciones flexibles, con entrega de lineamientos claros de trabajo y de expectativas sobre logros y clima de aula.\r\n\r\n Se interviene constantemente con la docente para el logro de la motivación por parte del grupo con su participación activa en la pizarra, dando la oportunidad de demostrar su aprendizaje y generar confianza para realizar ejercicios que no comprenden.\r\n\r\n Se realiza una clase recordando conocimientos previos sobre operatoria con decimales, se logra generar un ambiente propicio para el aprendizaje, con estudiantes participativos.\r\n\r\nLa docente promueve la participación y justificación de ideas solicitando fundamentación.\r\n\r\nConoce a los estudiantes y los indica por su nombre\r\n\r\nSe observa un buen manejo disciplinar conceptual y un vínculo positivo con las estudiantes\r\n\r\n       Sugerencias: \r\n\r\n\r\n       Explicitar la habilidad que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes y la estrategia de aprendizaje   o ruta de trabajo que potencia el desarrollo de la clase\r\n\r\n\r\n'),
(188, '9089119', '18356281', '2023-04-20', '11:55:40', '13:00:40', 26, 29, 1.88, NULL, 3, 'Docente presenta objetivo: Recordar estructura de la narración y focalización.\r\n\r\nSe comienza con conocimientos previos y con motivación generada por codocente de PIE \r\n\r\nRealiza preguntas claves lo que genera mejor comprensión y activa participación con estrategia 100%\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo un buen clima de aula con factor alegría.\r\n\r\nMantiene la atención de los estudiantes conectando permanentemente la materia con películas, libros y experiencias personales, despertando el interés de los alumnos\r\n\r\nSugerencias:\r\n\r\n       Al presentar el objetivo explicitar la habilidad que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes.\r\n\r\n      Presentar ruta de trabajo para potenciar el desarrollo de la clase.\r\n\r\n      A pesar de la alta participación se sugiere diversificar el trabajo para generar mayor   \r\n      oportunidades aprendizaje y para mantener la atención durante toda la clase.\r\n\r\n'),
(189, '9089119', '17899117', '2023-04-19', '08:15:45', '09:10:45', 27, 34, 1.8, NULL, 7, 'Docente presenta objetivo: Conocer las medidas de dispersión\r\n\r\nSe comienza con un problema, las estudiantes resuelven la primera parte de manera participativa.\r\n\r\nExplica ruta de trabajo de la clase, la que genera mejor comprensión del desarrollo de esta, se observa una clase estructurada con material adecuado.\r\n\r\nDocente conoce a las estudiantes, se vincula positivamente con ellas, manteniendo un buen clima de aula con factor alegría.\r\n\r\nVerifica la comprensión realizando monitoreo individual por los puestos de trabajo, sin embargo, hay estudiantes que se adhieren poco al trabajo, se sugiere realizar sin salida, ya que no todas las estudiantes son participativas.\r\n\r\nSugerencias:\r\n\r\nImplementar estrategias como sin salida y 100%, evitando realizar preguntas retóricas\r\nConsensuar tiempos de trabajo.\r\n'),
(190, '9089119', '19334195', '2023-05-10', '11:55:52', '13:15:52', 24, 34, 1.88, NULL, 3, 'Se comienza con conocimientos previos los estudiantes participan activamente en la pizarra.\r\n\r\nExplica ruta de trabajo de la clase, la que genera mejor comprensión del desarrollo de esta, se observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo un buen clima de aula con factor alegría.\r\n\r\nResuelven problemas fomentando la participación y motivando a desarrollar en la pizarra aun asi hay estudiantes que no trabajan. \r\n\r\nUtiliza estrategia de modelamiento matemático que promueve la comprensión del ejercicio \r\n\r\nVerifica la comprensión realizando monitoreo individual por los puestos de trabajo, sin embargo, hay estudiantes que se adhieren poco al trabajo, se sugiere realizar sin salida, ya que no todas las estudiantes son participativas.\r\n\r\nSugerencias:\r\n\r\nPresentar el objetivo explicitando la habilidad, intencionándola como meta compartida con los estudiantes.\r\nVerificar la comprensión y adhesión al trabajo con estrategias como 100% y sin salida\r\nAplicar estrategias de clima de aula como Hacer ahora al inicio\r\n\r\n\r\n'),
(191, '17335579', '16758658', '2023-06-15', '10:15:00', '11:35:00', 11, 34, 1.76, NULL, 7, 'Mediar las instrucciones y preguntas de la docente podrÃ­a favorecer la participaciÃ³n, comprensiÃ³n y motivaciÃ³n de las estudiantes (diversificaciÃ³n). Adoptar esta estrategia. \r\n\r\nVoz. El tono de voz de la profesional no favorece el desempeÃ±o del rol dentro del aula, puesto que no logra conseguir la atenciÃ³n del grupo. Se sugiere trabajar en la optimizaciÃ³n de la voz, herramienta fundamental de las y los docentes. '),
(192, '14273480', '18404503', '2023-06-19', '10:10:00', '11:30:00', 9, 1, 1.86, NULL, 7, 'Observaciones:\r\n- Se observa un buen clima de aula, donde se negocian acuerdos con los estudiantes, reforzando su cumplimiento.\r\n- Implementa estrategias de clima de aula, tales como: 100%, hacer ahora, factor alegría. Solo se recuerda mencionar el nombre de estas, (salvo factor alegría9, para que los estudiantes vayan aprendiendo y recordando.\r\n- Si bien la clase estaba destinada al termino de un trabajo y cumolimiento de OA, es importante retomar a partir de los saberes, verificando la adquisición de conceptos y reforzando el desarrollo de las técnicas.\r\n\r\nACUERDOS:\r\n- Presentar y/o recordar obejtivo de la clase, con los estudiantes e ir recordando durante toda la clase. \r\n- Monitorear el trabajo de los estudiantes, revisnado objetivo y verificando la comprensión de lo enseñado.\r\n'),
(193, '11537827', '14622138', '2023-06-13', '12:00:14', '13:25:14', 1, 22, 1.58, NULL, 7, 'Se mantiene un buen clima de aula\r\nMejorar los tiempos asignados en la actividad \r\nInstrucciones falto verificar la comprensión de esta.   \r\nTrabajar el 100% cunado se este revisando \r\nQue las alumnas anoten en el cuaderno las respuestas , las que aun no terminaban  ( verificar el trabajo ) \r\nUtilizar estrategias que permita retroalimentar a todas y verificar  los aprendizaje\r\n'),
(194, '9089119', '15177877', '2023-06-22', '10:06:20', '10:51:20', 1, 1, 1.93, NULL, 7, 'Docente presenta objetivo y habilidades a desarrollar: Unit 2 Past Perfect / Simple Past \r\n\r\nSe comienza preparando a los estudiantes y generando un buen clima de aula\r\n\r\nSe comienza recordando conocimientos previos con preguntas claves\r\n\r\nEstudiantes muy participativos, sin embargo, se sugiere que en este curso se utilice estrategia para generar escucha activa\r\n\r\nConsensua el tiempo en cada ejercicio logrando una actividad sincronizada y clara en las instrucciones.\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes.\r\n\r\nSugerencias:\r\n\r\n      \r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, intencionado como meta   compartida.\r\n\r\nVerificar permanentemente la comprensión de todos los estudiantes\r\n\r\n'),
(195, '13956828', '9464924', '2023-06-08', '12:00:00', '13:25:00', 18, 1, 1.71, NULL, 7, 'Clase de Arte que se desarrollar de manera efectiva, se marcan los 3 momentos de la clase. \r\nProfesor verifica constantemente el avance del trabajo de los estudiantes.\r\n\r\nEspacio de crecimiento, sugerencias y acuerdos:\r\nTrabajar en estrategias de clima de aula, 5S y estrategias que potencien habilidades de pensamiento.\r\n\r\n'),
(196, '13956828', '17614804', '2023-05-23', '10:10:00', '11:40:00', 16, 27, 1.77, NULL, 7, 'Objetivo: To identify parts of house and objective\r\n\r\nObjetivo e instrucciones claras, profesora verifica constantemente las actividades.\r\nUtiliza apoyo audiovisual y materiales de librería para que los niños armen un mapa de una casa, sus partes y mobiliario.\r\n\r\nEspacio de crecimiento, sugerencias y acuerdos:\r\nUtilizar al menos una estrategia de clima de aula.\r\nUtilizar tiempo consensuado visible, a través de una aplicación que exponga cronómetro, para que los estudiantes se focalicen en cuándo deben ter,inar y avanzar en sus actividades.'),
(197, '13956828', '18813869', '2023-05-16', '12:00:00', '13:25:00', 14, 22, 1.96, NULL, 7, 'Objetivo: Conocer y localizarlos recursos naturales de América a través de a lectura de mapas temáticos.\r\n\r\nSe observan claramente los tres momentos de la clases.\r\nEstudiantes observan mapas en la pantalla e identifican recursos que hay en común en el continente.\r\nSe trabajan habilidades de análisis y comprensión.\r\nLocalizan recursos naturales en el mapa.\r\nExcelente cierre utilizando la escalera de metacognición.\r\n\r\nEspacio de crecimiento, sugerencias, acuerdos:\r\nSe sugiere agregar una actividad más participativa desde el uso de material didáctico concreto, como \"Cada niño recibe un set variado de recursos naturales, los cuales deben ubicar en un mapa, en la zona que corresponda.\r\n\r\n'),
(198, '13956828', '17614827', '2023-05-31', '10:10:00', '11:40:00', 13, 32, 2, NULL, 7, 'Objetivo: \"Reconocer principales características de un poema\"\r\n\r\nNiñas desarrollan lectura silenciosa.\r\nNiñas observan diversas imágenes y se hacen preguntas respecto a qué temas para escribir poemas podrían salir de ahí.\r\nLeen poemas y van descifrando sus características y las enuncian, luego construyen un panel de características del poema en conjunto.\r\n\r\nOportunidad de crecimiento, sugerencias y acuerdos:\r\nUtilizar organizadores gráficos o la estrategia de conversación sobre papel.'),
(199, '13956828', '17614827', '2023-05-31', '10:10:00', '11:40:00', 13, 32, 2, NULL, 7, 'Objetivo: \"Reconocer principales características de un poema\"\r\n\r\nNiñas desarrollan lectura silenciosa.\r\nNiñas observan diversas imágenes y se hacen preguntas respecto a qué temas para escribir poemas podrían salir de ahí.\r\nLeen poemas y van descifrando sus características y las enuncian, luego construyen un panel de características del poema en conjunto.\r\n\r\nOportunidad de crecimiento, sugerencias y acuerdos:\r\nUtilizar organizadores gráficos o la estrategia de conversación sobre papel.'),
(200, '16009922', '17224388', '2023-05-24', '08:15:00', '09:45:00', 20, 34, 1.95, NULL, 7, '- Se observa una clase coordinada entre docente y profesora diferencial.\r\n- Hay monitoreo constante de los estudiantes, de forma individualizada.'),
(201, '16009922', '18069305', '2023-05-23', '08:15:00', '09:45:00', 14, 34, 2, NULL, 7, '- Se observa un trabajo coordinado entre las docentes.\r\n- Mantienen la atención constante de los estudiantes, propiciando un clima adecuado para el aprendizaje.\r\n- Utilizan diversas estrategias de enseñanza (ppt., guía, palitos preguntones, entre otros.).\r\n- División de los estudiantes en dos grupos en el contexto de aula diversificada.\r\n- Realizan retroalimentación constante a los estudiantes, motivándolos con comentarios destinados a fortalecer su autoestima.\r\n- Utilización de estrategia de \"tutor\", finalizando la clase.\r\n- Se cierra la clase preguntando a los estudiantes sobre lo aprendido.'),
(202, '16009922', '18069116', '2023-05-25', '08:15:00', '09:45:00', 1, 32, 2, NULL, 7, '- Se observa un trabajo coordinado con la docente, donde además participa la asistente de aula en un momento de la clase.\r\n- Mantención de clima de aula adecuado.'),
(203, '16009922', '15519211', '2023-04-29', '11:10:00', '11:40:00', 4, 32, 1.95, NULL, 7, '- Se observa coordinación y trabajo en equipo entre educadora de párvulos y profesora diferencial.\r\n- Estudiantes atentos a la clase en todo momento, por utilización de material concreto dinámico (clima de aula adecuado).\r\n- Estudiantes expresan oralmente lo aprendido.\r\n'),
(204, '16009922', '19386893', '2023-05-25', '10:10:00', '10:55:00', 16, 32, 1.85, NULL, 7, '- Se realiza aula diversificada dividida en 3 grupos.\r\n- Cada grupo con un profesor (Caterina, Valentina y Alicia).\r\n- Se realiza cierre con ticket de salida.'),
(205, '13956828', '16036651', '2023-05-04', '08:15:01', '09:45:01', 11, 32, 2, NULL, 7, 'Clase de Comprensión Auditiva.\r\n\r\nClase centrada en la participación activa de las estudiantes.\r\nCrean y responden preguntas de comprensión auditiva.\r\nParticipan apoderados lectores en la clase.\r\nUsan el espacio de la biblioteca para participar de distintos momentos de lectura compartida.\r\n\r\nESPACIO DE CRECIMIENTO, SIGERENCIAS Y ACUERDOS\r\nUtilizar un micrófono para no desgastar tanto la voz.\r\n\r\n'),
(206, '13956828', '17614827', '2023-05-09', '08:15:13', '09:45:14', 13, 32, 2, NULL, 7, 'Excelente manejo del curso.\r\nSe observan claramente los 3 momentos de la clase.\r\nEstudiantes reconocen en el objetivo la habilidad a trabajar, identificando cómo lograrán desarrollar la habilidad.\r\nCierran utilizando la escala de metacognición.\r\n\r\nESPACIO DE CRECIMIENTO, SUGERENCIAS Y/O ACUERDOS\r\nSe discute con la profesora el poder trabajar ne equipos, grupos grande y/o pequeños, para que aprendan a organizarse y repartirse el trabajo.'),
(207, '13956828', '13625118', '2023-05-09', '10:10:51', '11:40:51', 11, 34, 2, NULL, 7, 'Objetivo: Calcular sustracciones utilizando el algoritmo abreviado.\r\n\r\nProfesor presenta a los estudiantes, a través de diversos medios, variadas estrategias y actividades.\r\nLa clase se desarrolla de forma activa y participativa de parte de los estudiantes.\r\nSe cierra la clase con un excelente material, \"Nubes preguntonas\", que desarrollan la metacognición en nuestros estudiantes.\r\n\r\nESPACIO DE CRECIMIENTO, SUGERENCIAS Y/O ACUERDOS\r\nVerbalizar la rutina de pensamiento.'),
(208, '13956828', '16767380', '2023-05-10', '10:10:13', '11:40:13', 16, 8, 1.93, NULL, 7, 'Objetivo: Reconocer funciones y niveles de organización de los seres vivos.\r\nLa clase se desarrolla con algunos inconvenientes, debido a que cuesta mucho mantener la atención, silencio y participación de los estudiantes en un clima adecuado para el aprendizaje.\r\n\r\nLos estudiantes desarrollan una actividad activo participativa, donde se logra el objetivo pero el clima continúa siendo un problema, a pesar de las estrategias utilizadas por la profesora.\r\n\r\nESPACIO DE CRECIMIENTO, SUGERENCIAS Y/O ACUERDOS\r\nImplementar un set de rutinas de clima de aula especificas para el curso.\r\n '),
(209, '13956828', '15614452', '2023-05-10', '14:10:29', '15:39:29', 16, 34, 2, NULL, 7, 'Objetivo: Aplicar propiedades de la multiplicación.\r\n\r\nLos estudiantes se muestran más dispuestos al trabajo en aula. \r\nProfesora mantiene reglas y normas claras respecto al clima de aula y el ambiente beneficioso para el aprendizaje.\r\nProfesora ejemplifica y explica diversas estrategias para desarrollar los ejercicios, utilizando la pizarra y pantalla digital.\r\n\r\nESPACIO DE  CRECIMIENTO, SUGERENCIAS Y/O ACUERDOS\r\nPermitir una participación más activa de los estudiantes.'),
(210, '13956828', '10016368', '2023-05-18', '10:10:56', '11:40:56', 16, 32, 2, NULL, 7, 'Objetivo: Comprender las acciones de un relato, consecuencias y opinar argumentando sobre ello.\r\nTrabajan en el libro de la asignatura, leen un cuento.\r\nTrabajan guía post lectura del cuento, en conjunto con el video del libro.\r\nContestan preguntas en forma oral.\r\nCierran la clase, consultando lo que hicieron en clases.\r\n\r\nESPACIO DE CRRECIMIENTO, SUGERENCIAS Y/O ACUERDOS\r\nUtilizar un verbo más concreto para el objetivo de la clase, así puede ser más medible al momento de evaluar y retroalimentar a los estudiantes.'),
(211, '16896799', '19386893', '2023-05-24', '08:20:00', '09:40:00', 29, 29, 1.81, NULL, 7, 'Se observa una ruta de trabajo definida y compartida al  inicio de la clase.\r\nObjetivo: Relacionar los factores de la comunicaciÃ³n con el discurso pÃºblico. \r\nSe da conocer el objetivo, y se explica la habilidad, realizando preguntas para que las estudiantes se interioricen de Ã©l. Se sugiere Invitar a las estudiantes a escribirlo.  \r\nLa guÃ­a presenta la misma informaciÃ³n y formato del ppt, quizÃ¡ ppt debiÃ³ ser mÃ¡s esquemÃ¡tico y la guÃ­a con mayor informaciÃ³n. (DUA)\r\nTiempo visible. Pudieron haber consensuado el tiempo luego de haber otorgado los 3 minutos.\r\nFalta retroalimentaciÃ³n de las respuestas, para aportar mayor informaciÃ³n o parafrasear sus respuestas.\r\nEnfatizar en la estrategia del 100% de atenciÃ³n.\r\nVerificar las respuestas de los estudiantes PIE.\r\nProponer la participaciÃ³n de todos, para compartir sus respuestas.\r\nCierre de clases, con preguntas PAES y pregunta Â¿quÃ© aprendimos hoy? Â¿tipos de discurso?, se sugiere focalizar las preguntas en relaciÃ³n a la habilidad que se querÃ­a desarrollar.\r\n\r\n'),
(212, '16896799', '16287284', '2023-05-23', '14:55:00', '16:00:00', 23, 22, 1.78, NULL, 7, 'Se observa una preocupaciÃƒÂ³n de la docente para que las estudiantes registren informaciÃƒÂ³n en su cuaderno, monitoreando, ofreciendo alternativas y apoyos adicionales, de manera especial a la estudiante que presenta discapacidad visual.\r\n\r\nSe  observa la planificaciÃƒÂ³n de la actividad a partir de una guÃƒÂ­a de trabajo, donde se entregan conceptos claves, en un formato amigable, como un medio adicional de representaciÃƒÂ³n de la informaciÃƒÂ³n.\r\n\r\nSe mantiene un clima de aula, propicio para el aprendizaje.\r\n\r\nSe sugiere a la docente, evidenciar de mejor manera el trabajo de coordinaciÃƒÂ³n realizado con el profesor de asignatura, buscar los momentos en que pueda intervenir para reforzar, aclarar conceptos, ofrecer un ejemplo, etc.\r\n\r\nEs importante recordar la ruta de trabajo en la clase, empezando por compartir la habilidad a trabajar y las acciones que se realizaran para abordarlo.\r\n\r\nSe recomienda incluir alguna estrategia de rutina del pensamiento  en el trabajo con guÃƒÂ­as o durante la clase.\r\n'),
(213, '16896799', '13135675', '2023-05-31', '08:15:00', '09:15:00', 27, 34, 1.8, NULL, 3, 'Se inicia la clase comentando la ruta de trabajo, se sugiere mostrar o escribir en la pizarra, se sugiere que cuando la docente de asignatura comente como se organizará la clase, la educadora diferencial pueda dejar registro de ello en la pizarra.\r\nSe indica el objetivo que se trabajará en la clase, “cálculo de varianza”. De igual manera, la docente puede indicar el objetivo de manera escrita en la pizarra.\r\nSe presenta una actividad de kahoot, a través de esta, se logra motivación e interés de las estudiantes por participar. \r\nSe observa mediación de las docentes en las actividades.\r\nSe sugiere mediación en la evaluación de proceso para todas las estudiantes del PIE\r\nSe sugiere incorporar estrategias de clima de aula, que permitan optimizar el inicio de la clase. \r\n\r\n'),
(214, '14273480', '12701348', '2023-06-14', '08:30:00', '09:45:00', 10, 15, 1.9, NULL, 6, 'Observaciones:\r\n- Se observa la clase, centrada en el desarrollo y cierre.\r\n- Los estudiantes participan activamente de la clase, siguen instrucciones y disfrutan de los ejercicios. \r\n- Docente aplica estrategias de clima de aula, generando un ambiente propicio para el aprendizaje.\r\n- Se observa trabajo colaborativo con docentes varios.\r\n- Organización del espacio y tiempos.\r\n\r\nAcuerdos: considerar los siguientes indicadores;\r\n- Verifica la comprensión de las instrucciones entregadas con estrategias como “sin salida” u otra: utilizar estrategia sin salida, mencionando el nombre a los estudiantes para que vayan reconociendo.\r\n- Verifica la comprensión de conceptos en los diferentes momentos de la clase: ir realizando pausas durante la clase, recordando objetivo con los estudiantes y las habilidades que estan trabajando.\r\n\r\n'),
(215, '14273480', '13310869', '2023-05-30', '08:15:00', '09:00:00', 7, 35, 1.9, NULL, 3, 'Observaciones: Se observa y inicio y desarrollo de la clase.\r\n- Se preocupa del estado emocional de sus estufiantes, generando vínculo antes de iniciar su clase. Asociado al umbral, como estrategia de  clima de aula.\r\n- Destaca el ambiente que promueve, contribuyendo al aprendizaje.\r\n- Utiliza videos educativos, los cuales son significativos para los estudiantes.\r\n\r\nAcuerdos: considerar los siguientes indicadores para próximos acompañamientos;\r\n- Utiliza estrategias de clima de aula para señalar instrucciones claras y precisas: usar el paso a paso, utilizando la pizarra y recirdando con los estudiantes las instrucciones.\r\n- Implementa en forma efectiva, al menos dos rutinas o estrategias que potencian la gestión de un buen clima de aprendizaje (Hacer ahora, factor alegría, 100%, otros): utilizar 100%, en sus marcas u otro. Aplicar aquellas estrategias declaradas en su planificación. '),
(216, '18639869', '26323365', '2023-05-04', '14:55:36', '15:40:36', 7, 36, 1.95, NULL, 7, 'Durante la retroalimentación se conversa con Profesora Heidy sobre algunos aspectos  a mejorar, tales como : \r\n-Cambiar el foco cuando queremos que los estudiantes se comporten de alguna manera en particular, donde se recomienda evitar llamar la atención a quienes se están \"equivocando\" e inclinarse por felicitar a aquellos que lo están haciendo bien. \r\n- Se llega al acuerdo de cambiar el horario en que se dicta la clase de orientación, ya que se estaba tornando un desafío el poder propiciar un ambiente de escucha y respeto, ya que justo antes tenían música y orientación era la ultima clase de la jornada escolar, estando muchos niños y niñas cansados y poco disponibles mentalmente para las actividades que se les proponía. \r\n-Como fortaleza se observa que la Profesora aplica diferentes metodologías y técnicas para mantener la atención, establecer un buen clima de aula lo que lleva como consecuencia el fortalecimiento de los aprendizajes, motivación y actitud de los y las estudiantes.  '),
(217, '18639869', '18047397', '2023-05-24', '13:25:43', '14:10:00', 15, 36, 1.79, NULL, 7, 'Durante la retroalimentación con la Profesora Ivonne se conversa sobre algunos aspectos a mejorar, los cuales tienen que ver con el clima de aula, llegando a acuerdo que es importante reforzar esta área ya que las niñas durante la clase les costó mantener el silencio y la atención. Ligado a esto es importante con el curso recordar hábitos de limpieza, y orden de la sala, como herramienta que nos propicia un grato ambiente para llevar a cabo el aprendizaje. \r\nLa gestión del tiempo se torna un desafío, ya que muchas veces todas quieren participar. Se felicita a profesora en una segunda instancia de observación donde ella toma lo conversado y aplica técnicas y metodologías que  permiten que la mayoría de las estudiantes participen, con un muy buen clima de aula y sin perder el control del tiempo, logrando llevar a cabo todas las actividades planificadas. \r\n'),
(218, '18639869', '18448695', '2023-04-28', '14:55:24', '15:40:24', 10, 36, 1.95, NULL, 7, 'Antes de ingresar a la sala, durante la formaciÃ³n de los y las estudiantes ocurre una dificultad donde un estudiante TEA es pasado a llevar, quejÃ¡ndose de que lo saltaron el fila. Esto genera que el estudiante se enoje, necesitando expresar sus emociones, y solicitando aclarar lo ocurrido. Se destaca la capacidad y disponibilidad tanto del Profesor como de su asistente por brinda un espacio seguro al niÃ±o para que resuelva el conflicto,  donde tambiÃ©n todos sus compaÃ±eros/as acogieron la necesidad de manera empÃ¡tica y respetuosa. \r\nEn relaciÃ³n a la ejecuciÃ³n de la clase de orientaciÃ³n se valora la importancia que le otorga el Profesor al proceso donde se retoma lo aprendido anteriormente, presentando imÃ¡genes que facilitan el repaso, generando un puente entre los aprendizajes. Se observa una buena capacidad para crear espacios de reflexiÃ³n y pensamiento crÃ­tico, acogiendo todas las respuestas de sus estudiantes, y el buen uso de interacciones positivas. '),
(219, '18639869', '10004488', '2023-05-22', '13:25:55', '14:10:55', 11, 36, 2, NULL, 7, 'Se evidencia una excelente clase de orientación, donde la Profesora se toma el tiempo adecuado para normalizar las estudiantes, recordar 5N, y hábitos de aseo, logrando establecer un ambiente favorable para el aprendizaje. \r\nSe preocupa de retomar lo aprendido anteriormente a través de preguntas que ayudan a las niñas a recordar y profundizar, generando un puente entre aprendizajes. \r\nPromueve la participación de todas sus estudiantes, reforzando positivamente a cada una de ellas. \r\nLa relación entre la Profesora y las niñas es cálida, amable y respetuosa. \r\nSe evidencia un buen manejo de los contenidos y preparación de la clase. \r\n'),
(220, '18639869', '16404386', '2023-05-08', '08:15:02', '09:00:02', 18, 36, 1.95, NULL, 7, 'Se destaca el tono de voz y el uso de interacciones positivas. Observando un buen vínculo entre Profesor y estudiantes lo que trae como consecuencia que los estudiantes se mantengan atentos, respetuosos, sigan instrucciones y normas de la clase con facilidad y buena disposición, lo que se traduce en un excelente clima de aula. \r\nProfesor está disponible atendiendo a las preguntas de sus estudiantes. Cuando es necesario recurre a metodologías y técnicas efectivas para que los estudiantes participen y también para que se regulen en relación al ruido de la sala mientras trabajan. \r\nProfesor reconoce y valora el trabajo y participación de sus estudiantes, los felicita constantemente. \r\nDurante la retroalimentación ambos concluimos que el desafío es en torno al uso efectivo del tiempo ya que en ocasiones es complejo generar un cierre que evalúe lo aprendido por los estudiantes.  \r\n\r\n'),
(221, '18639869', '16161640', '2023-05-05', '11:55:34', '12:40:35', 16, 36, 1.9, NULL, 7, 'Se reconoce como fortaleza la importancia que le da el Profesor para conversar e invitar a reflexionar al grupo curso sobre situaciones relacionadas a la convivencia escolar ocurridas en días anteriores antes de comenzar la clase. \r\nDurante el desarrollo de la clase si bien existió dificultades para mantener el orden, la mayoría de los estudiantes estaba atento y con ganas de participar.  Existe un momento de la clase donde un estudiante comete una falta, Profesor se da el tiempo para conversar de manera individual con él, y luego retoma la clase con facilidad.  \r\nProfesor reconoce y valora el trabajo de sus estudiantes, el trato es cordial y los felicita constantemente. \r\nSe valora la capacidad del Profesor de poner en practicar ciertas sugerencias y acuerdos acordados en la retroalimentación, pudiendo observar en una segunda instancia una clase donde los estudiantes lograron mantener el orden, respetar turnos, y participar activamente. \r\n'),
(222, '18639869', '17801292', '2023-04-21', '10:50:21', '11:35:21', 4, 36, 1.95, NULL, 7, '-Profesora realiza un inicio formal de la clase a través de una canción que capta la atención de sus estudiantes. \r\n-Propicia un buen ambiente, los pone a disposición, monitorea constantemente que los niños y niñas estén atentos y motivados. \r\n-Utiliza el refuerzo positivo como herramienta. \r\nSe observa una Profesora cariñosa, respetuosa con la infancia, genera adecuaciones cuando algún estudiante lo requiere, logrando un buen vínculo con sus estudiantes, lo que genera un impacto positivo en el aprendizaje de contenidos, normas y hábitos. '),
(223, '18639869', '11842983', '2023-04-27', '08:15:27', '09:00:28', 17, 36, 2, NULL, 7, '-Profesora se preocupa por lograr un buen ambiente de clases, recordando normas, hábitos, monitoreando constantemente que las estudiantes estén atentas, dispuestas a escuchar activamente, a reflexionar y participar respetándose mutuamente. \r\n-Conecta lo aprendido anteriormente con lo actual, generando un puente entre los aprendizajes, logrando que las estudiantes hagan comentarios y respondan a las preguntas planteadas. \r\n-Se evidencia una buena actitud del curso en general frente a la clase de orientación, esto se ve directamente relacionado con la capacidad de la profesora de poner limites y normas desde un trato afectivo, donde las trata a todas por su nombre, destaca cualidades positivas en ellas constantemente, y se toma el tiempo para agradecerles por su participación y trabajo. \r\n-Se observa como fortaleza la capacidad de generar espacios de reflexión y profundización de contenidos, sacando provecho de las actividades propuestas. \r\n-Profesora utiliza como recurso un cronómetro, lo que permite que las niñas sean consciente del paso del tiempo y aprendan a gestionar su uso de manera más autónoma y efectiva. \r\n- Se destaca la capacidad de generar pausas en el paso de contenidos cuando ocurre una situación \"imprevista\" , valorando las instancias de corrección conductual como una oportunidad de mejora y aprendizaje para el curso en general. '),
(224, '18639869', '17816865', '2023-04-27', '14:10:53', '14:55:05', 3, 36, 2, NULL, 7, '-Profesora inicia la clase a través de una canción, con lo que logra generar un buen ambiente para iniciar el paso de contenidos, motivando a sus estudiantes. \r\n-Da a conocer los objetivos de la clase en un lenguaje simple y comprensible para la etapa del desarrollo de niños y niñas. \r\n-Dispone de un tiempo adecuado para que niños y niñas recuerden contenidos pasados y conecten lo aprendido con lo que están por aprender. \r\n-Se destaca la creatividad y dedicación tanto para elaborar el material de la clase, como para el desarrollo de esta, utilizando un lenguaje adecuado, despertando la curiosidad y asombro de sus estudiantes en todo momento. \r\n-Utiliza el error, o las situaciones imprevistas como oportunidad de aprendizaje, reaccionando con calma frente a estas, brindando seguridad a los niños y niñas de estar en una sala de clases en la que se permite equivocarse, donde serán acogidos cálidamente si ocurre algún \"accidente\".  ( Se rompe un globo con arena, cuando una estudiante lo toca, material el cual era parte de la actividad). \r\n- Profesora logra generar un cierre que evalúa lo aprendido por sus estudiantes.'),
(225, '18639869', '19404149', '2023-04-28', '14:55:15', '15:40:00', 12, 36, 2, NULL, 7, '- Profesora Francisca inicia su clase con una excelente transición de la clase de matemáticas, donde ella también es quién la dicta a la de orientación, donde les dice a los estudiantes que \"la Profesora de matemáticas\" se despide, saliendo de la sala, y volviendo a entrar como \"la Profesora de orientación\", esto para generar un quiebre mental y cambio de disposición , actitud de los estudiantes frente a lo que se les proponga durante orientación. \r\n- Da a conocer el objetivo de la sesión de manera clara y precisa. \r\n-Se toma el tiempo para repasar contenidos anteriores, generando un puente entre aprendizajes. \r\n-Se preocupa que el ambiente físico de la sala de clases esté limpio y ordenado. \r\n-Reconoce y valora el trabajo de sus estudiantes, se toma el tiempo para agradecer su participación. \r\n-Utiliza temporizador visible para hacer conscientes a los estudiantes del uso eficaz del tiempo. \r\nSe destaca la capacidad de la Profesora para tomar en cuenta y poner en practica las sugerencias y lo conversado durante las coordinaciones de orientación, su responsabilidad y dedicación para preparar sus clases . \r\nSe observa una mejoría significativa en la cantidad y calidad de interacciones positivas con sus estudiantes, logrando mantener un trato amable, cariñoso, equilibrado con la capacidad de establecer limites claros y estables. '),
(227, '18639869', '17079039', '2023-05-02', '14:55:57', '15:40:58', 9, 36, 1.79, NULL, 7, '-Profesora cuenta con el material necesario para la realización de la clase \r\n-Se sugiere durante la retroalimentación recordar retomar los aprendizajes adquiridos previamente para conectarlos con lo que aprenderán en la nueva clase. \r\n-El espacio físico de la sala se encuentra limpio y ordenado, a pesar de ser la ultimo hora de la jornada. \r\n-Se destaca la habilidad de la Profesora de reforzar positivamente a sus estudiantes. \r\n-Cabe señalar que es importante dar mayor espacio a la reflexión. \r\n'),
(228, '18639869', '11522411', '2023-04-28', '16:10:40', '16:50:40', 1, 36, 2, NULL, 7, '-Profesora realiza un buen inicio de clases, y con transiciones fluidas. \r\n-Los y las estudiantes se mantienen atentos, participan, responden a las preguntas e interactúan constantemente con la Profesora. \r\n-Genera espacio para retomar lo aprendido anteriormente, a través de una actividad donde los niños recuerdan lo conversado anteriormente a través de materiales didácticos. \r\n- Se destaca la creatividad, la capacidad de asombrar y despertar la curiosidad de sus estudiantes. \r\n-Se observa una buena comunicación y coordinación entre Profesora y asistente. \r\n-Profesora promueve la participación de todos y todas. '),
(229, '13567342', '9141113', '2023-05-26', '11:55:00', '12:40:00', 25, 36, 1.95, NULL, 7, 'Profesora muestra un trato cordial y cercano con las estudiantes.  Preocupación constante por procurar un ambiente adecuado para la clase.\r\nSe recomienda utilizar los aportes de las estudiantes, instándolas a cuestionar y reflexionar sobre sus propias ideas, para fortalecer el espíritu crítico.'),
(230, '13567342', '9433399', '2023-06-01', '14:55:00', '15:40:00', 26, 36, 1.95, NULL, 7, 'Profesora muestra preocupación por generar un ambiente propicio para el desarrollo de la clase, procurando que, en el inicio, los estudiantes limpien y ordenen la sala.  Luego los invita a disponerse favorablemente hacia el trabajo planificado.\r\nSe recomienda aprovechar los aportes de los estudiantes para desarrollar el pensamiento crítico, instándolos a profundizar sus comentarios o respuestas.'),
(231, '13567342', '10521666', '2023-05-26', '13:25:00', '14:10:00', 30, 36, 1.9, NULL, 7, 'Se destaca la disposición de los estudiantes al desarrollo de la clase.  Profesor promueve un ambiente acogedor y de respeto.\r\nSe recomienda utilizar estrategias que promuevan una participación más activa de todos los estudiantes.  También, sería conveniente aprovechar los aportes de los estudiantes para profundizar la reflexión sobre el tema trabajado.'),
(232, '13567342', '15898402', '2023-06-01', '12:40:00', '13:25:00', 29, 36, 1.95, NULL, 7, 'Profesora muestra cercanía y conexión con sus estudiantes, logrando que se mantengan atentas y comprometidas con las actividades de la clase.\r\nSe sugiere hacer partícipes a las estudiantes a la hora de recordar lo que se ha trabajado previamente y, a partir de sus aportes, puedan evidenciar lo aprendido.'),
(233, '13567342', '12826448', '2023-06-01', '13:25:00', '14:10:00', 28, 36, 1.9, NULL, 7, 'Se destaca el orden y disposición a trabajar de los estudiantes, lo que refleja una conexión y cercanía con el profesor.\r\nLos tiempos de la clase están claramente definidos y preparados.\r\nSe sugiere trabajar el pensamiento crítico a partir de los aportes de los estudiantes, contrapreguntando y/o cuestionando, por ejemplo.  También se sugiere utilizar estrategias que promuevan la participación de aquellos estudiantes que habitualmente no lo hacen.'),
(234, '13567342', '18759843', '2023-06-01', '10:50:00', '11:35:00', 20, 36, 1.86, NULL, 7, 'Profesor se muestra cercano con los estudiantes, los llama por su nombre y constantemente los felicita por sus aportes.  En este ÃƒÂºltimo punto, se sugiere que se contrapregunte a los estudiantes, con el fin de que reflexionen sobre lo que plantean y profundicen sus ideas.\r\nSe sugiere, tambiÃƒÂ©n, regular los tiempos de las actividades (reducirlos si es necesario), para evitar que los estudiantes deban quedarse en la sala tras el timbre.'),
(235, '13567342', '11737897', '2023-05-25', '13:25:00', '14:10:00', 24, 36, 1.95, NULL, 7, 'Profesora muestra un buen manejo de grupo.  Promueve y refuerza positivamente la participación de los estudiantes, llevándolos a cuestionarse y reflexionar sobre lo planteado, lo que facilita una mayor comprensión de lo trabajado.\r\nSe sugiere controlar los tiempos de las actividades, con el fin de asegurar un espacio para realizar un cierre de la clase, que dé cuenta del logro del objetivos.'),
(236, '18639869', '16161542', '2023-04-28', '10:50:40', '11:35:40', 5, 36, 1.95, NULL, 7, '-Profesora logra un buen inicio de de la clase, reforzando constantemente las 5 N, explica con un lenguaje adecuado y acorde a la etapa del desarrollo de sus estudiantes los objetivos de la clase y presentación de lo que serán las clases PASOS. \r\n-Enriquece el material para realizar la clase a través de una creativa actuación  y entusiasmo, estimulando la curiosidad y asombro de sus estudiantes.\r\n-El ambiente físico de la sala es adecuado y favorece el desarrollo de las actividades. \r\n- Genera espacio de reflexión, donde los y las niñas se muestran motivados y participativos. \r\n-Se observa como aspecto a mejorar la realización de un cierre de la clase con el tiempo adecuado que permita evaluar lo aprendido. '),
(237, '18639869', '15086447', '2023-04-28', '12:40:42', '13:00:42', 6, 36, 1.95, NULL, 7, '-Profesora inicia la clase con una canciÃ³n que motiva a sus estudiantes. \r\n-Logra un buen clima de aula, niÃ±os y niÃ±as participan atentamente. \r\n-Retoma lo aprendido anteriormente, utilizando recursos como los monstruos de colores para facilitar el repaso, y el \"mapa pasos\". \r\n-Refuerza positivamente a sus estudiantes.\r\n-Permite la participaciÃ³n de todos y todas. \r\n-Utiliza mÃºsica para el momento en que los niÃ±os y niÃ±as trabajan autÃ³nomamente. \r\n-Logra un buen cierre de la clase '),
(238, '18639869', '13276799', '2023-04-27', '11:55:04', '12:40:04', 14, 36, 1.95, NULL, 7, 'Profesora logra realizar un buen inicio de la clase, formulando preguntas que captan la atención de sus estudiantes. Pese a las características de su curso, donde para ellos es un gran desafío mantener el silencio, e interactuar de manera ordenada, la Profesora logra que participen, estén atentos, y vuelvan al foco cuando aplica metodologías y técnicas para un buen clima de aula. Se observa como una fortaleza la capacidad de la Profesora de comprender y respetar las diferencias entre sus estudiantes, permitiendo mayor tiempo de respuesta, posibilidad de movimiento a aquellos que lo necesiten. \r\nSe observa como un aspecto a mejorar el momento del cierre de la clase, ya que en esta clase en particular faltó tiempo para realizarlo, por lo que se sugiere utilizar el tiempo con un cronómetro visible. '),
(239, '18639869', '17479376', '2023-06-30', '09:54:35', '10:39:35', 8, 36, 0, NULL, 7, 'No se pudo realizar observaciÃ³n durante este semestre debido a licencias mÃ©dicas de la Profesora. '),
(240, '14273480', '16137474', '2023-06-16', '08:50:00', '09:30:00', 4, 17, 1.95, NULL, 7, 'Observaciones:\r\n- Reactiva conocimientos previos a partir de preguntas claves, recordando los saberes de sus estudiantes sobre los animales vertebrados.\r\n- Realiza juegos y ofrece distinas estrategias que favorecen el clima de aual y la concentración y participación de los estudiantes.\r\n- Destaca el clima de aula y cómo genera un ambiente propicio para el aprendizaje desde el reconocimiento de emociones y promviendo virtudes.\r\n- Utiliza rutina de pensamiento: 3X2\r\n\r\nAcuerdos:\r\n- Presenta el objetivo donde se explicita la habilidad/destreza que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes: si bien utiliza varias estrategias para trabajar el ciclo de vida de la rana, al inicio no se deja tan en claro el objetivo de la clase, reforzando con el video, dibujo de los estudiantes y actividad de cierre. '),
(241, '14273480', '15648517', '2023-06-20', '08:30:00', '09:25:00', 5, 38, 2, NULL, 7, 'Observaciones:\r\n- Se observa una clase donde los estudiantes estan habituados a la rutina y la docente utiliza estrategias de clima de aula y ejercicios de neruoplasticidad, para mejorar concentración y, a su vez, favorece el principio del juego.\r\n- Realiza rutina del calendario, revisando todos los pasos y donde los estudiantes son los protagonistas.\r\n- En el problema matemático se sugiere profundizar y/o aprovechar más la estrategia, por ejemplo: que busquen y/o anoten los datos del problema, que puedan desarrollarlo en sus pizarras, además de lo que ya hacen. Ello porque se observa que los estudiantes manejan lenguaje matemático, como quitar y/o agregar y sería ideal potenciar aún más sus saberes.\r\nMuy buen trabajo.'),
(242, '14273480', '13132976', '2023-06-22', '14:00:00', '14:45:00', 2, 31, 1.95, NULL, 7, 'Observaciones:\r\n- Clase estructura, con sus 3 momentos.\r\n- Aplica estrategias de clima de aula y rutinas de pensamiento.\r\n- Excleente lenguaje que promueve la participación de los estudiantes.\r\n- Preparación de la experiencia.\r\n- Promueve la participación de todos los estudiantes.\r\n\r\n\r\nAcuerdos:\r\n- Comprueba con los estudiantes si el objetivo de aprendizaje planificado fue logrado. (cierre): realiza cierre realizando preguntas claves y generales, lo cual está muy bien. Se invita, además, a realizar preguntas más específicas, que apunten a lo trabajado con los estudiantes, de tal forma de verificar el aprendizaje, sobretodo con aquellos estudiantes que sabes que son estan más  descendidos y requieres evaluar,  por ejemplo: nombra 2 palabras que inician con la vocal \"U\", muestrame la palabra que comienza con la vocal \"u\", (puedes tener imágenes adicionales). }\r\n\r\nMuy buen trabajo!!'),
(243, '14273480', '15178747', '2023-06-27', '16:00:00', '16:30:00', 1, 30, 2, NULL, 3, 'Observaciones: se observa inicio y desarrollo de la clase.\r\n- Docente organiza experiencia de aprendizaje en conjunto con los otros niveles, donde se observa una preparación del espacio educativo y recursos que potencien el aprendizaje.\r\n- Los estudaintes observan video educativo, dialogan, responden preguntas, observan y manipulan instrumento musical de la cutlura mapuche y danzan con sus pares y adultos.\r\n- Se felicita por estar constantmente, creando este tipo de actividades de correlación, significativas y lúdicas.\r\n'),
(244, '14273480', '15221803', '2023-05-10', '10:10:00', '10:55:00', 9, 32, 2, NULL, 7, 'Observaciones:\r\n- Realiza una clase con los 3 momentos y reforzando cada uno de ellos.\r\n- Muy buen clima de aula.\r\n- Utiliza estrategias de clima de aula, las cuales los estudiantes tienen adquiridas.\r\n- Favorece la lectura de los estudiantes en la experiencia ofrecida.\r\n\r\nAcuerdos /Sugerencias:\r\n- En el cierre, se observa que los estudiantes tienen el hpabito de realizarlo, respondiendo a las preguntas generales. Se sugiere profundizar el objetivo y/o ofrecer desafios al término de la clase e incluso realizar preguntas específicas para verificar y evaluar el aprendizaje, ejemplo: dame 1 ejemplo de grupos consonánticos con los que trabjamos hoy, un ticket de salida donde seleccionen palabras con grupo consonántico trabajado, entre otros. De esta forma, te quedas con la evidencia de evaluación.\r\n- Utilizar estrategia \"sin salida\": se observa la intención de usar esta, solo fakta dar el nombre para que los estudiantes la conozcan.\r\n\r\nMuy buen trabajo!!\r\n'),
(245, '14273480', '18143931', '2023-05-23', '08:15:00', '09:45:00', 10, 32, 1.77, NULL, 7, 'Observaciones.\r\n- Se observa implmentación de Diario de Vida.\r\n- Modela DV con estudiantes, con algunas consideraciones a mejroar, tales como: hacer línea, no colocar título, negociar con estudiantes, entre otros.\r\n- Buen clima de aula.\r\n- Utiliza factor alegría y 100%\r\n\r\nAcuerdos:\r\n- Utilizar tiempo visible y asignado en sus clases.\r\n- Las estrategias utilizadas potencian el desarrollo de la destreza: se requiere dar un mayor sentido al uso del diario de vida, enfatizando la escritura de los estudiantes, más que el dibuja.\r\n- Verifica la comprensión de conceptos en los diferentes momentos de la clase: retomar palabras de uso frecuente, usando pared de palabras.\r\n- Realiza preguntas claves y/o demostraciones al estudiante promoviendo el logro del objetivo: intencionar las preguntas de tal forma que favorezcan la comprensión del objetivo.\r\n-Monitorea y supervisa permanentemente el trabajo de los estudiantes: profundizar en el monitoreo que realiza.  '),
(246, '14273480', '14604335', '2023-05-23', '10:15:00', '10:55:00', 7, 32, 2, NULL, 7, 'Observaciones:\r\n- Destaca la creación del ambiente para el aprendizaje.\r\n- Exclente clima de aprendizaje, utilizando diferentes estrategias.\r\n- Realiza diario de vida: se observa conocimiento de la estrategia.\r\n- Monitorea a sus estudiantes.\r\n- Ocupa los errores como oportunidades para aprender.\r\n- Utiliza pared de palabras .\r\nMuy buen trabajo!'),
(247, '14273480', '15221803', '2023-06-13', '08:15:00', '09:00:00', 9, 32, 2, NULL, 3, '- Observa implementación de Diario de vida del docente y de los estudiantes.\r\n- Los estudiantes estan habituados al trabajo de DV.\r\n- Realiza ejercicios de conciencia fonológica y juegos.\r\n- Modela DV.\r\n- Monitorea el trabajo de estudiantes, recogiendo errores y/o palabras de uso frecuetne.\r\n- Se observa inicio y desarrollo.\r\n');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(248, '14273480', '15616161', '2023-06-13', '10:15:00', '11:00:00', 8, 32, 2, NULL, 3, '- Se observa implementación de Diario de Vida.\r\n- Crea espacio de aprendizaje que promueve la participación.\r\n- Utiliza factor alegria.\r\n- Negocia con los estudiantes qué escribir.\r\n- Modela DV y monitorea el trabajo de los estudiantes.\r\n- Utiliza el pizarron para anotar y aprovechar las palabras frecuentes.\r\n- Realiza preguntas claves.\r\n- Se observa que los estudiantes estan habituados al trabajo del DV.\r\n\r\nMuy buen trabajo.'),
(249, '9089119', '18389625', '2023-06-15', '11:55:05', '12:55:18', 27, 34, 1.81, NULL, 7, 'Se inicia presentando el objetivo: Determinar el número de muestras de tamaño y de una población en n elementos.\r\nAnalizar la relación entre el promedio de las medias muéstrales con la media de la población\r\n\r\nComienza activando conocimientos previos\r\nRealiza estrategia sin salida y ruta de trabajo en la clase\r\n\r\nClima de aula propicio para el aprendizaje con factor alegría y buena participación de los estudiantes \r\n\r\nRealiza preguntas sobre problemas a solucionar, pero falta verificar la comprensión de los que no participan.\r\n\r\n\r\nSugerencias de trabajo:\r\n\r\nExplicitar la habilidad del objetivo a trabajar.\r\n\r\nElevar la exigencia en el ritmo de trabajo de los estudiantes.\r\n\r\nSe recuerda verificar la comprensión de las instrucciones entregadas.\r\n\r\n  Crear e implementar estrategias activas participativas y de evaluación formativa\r\n'),
(250, '9089119', '15176982', '2023-06-15', '13:25:54', '14:10:54', 21, 8, 2, NULL, 7, 'Se presenta objetivo y habilidades a desarrollar: Retroalimentar prueba de nivel de Ciencias Naturales\r\n\r\nDocente comienza realizando estrategia umbral y se prepara el clima de aula limpiando la sala y motivando el silencio y escucha activa\r\n\r\nSe comienza revisando conocimientos previos recorriendo las materias abordadas durante el semestre.\r\n\r\nSe revisa la prueba proyectada por pregunta, recordando los temas con alta participación de las estudiantes y realizando estrategias sin salida y 100%\r\n\r\n\r\nSugerencias:\r\nSe continua con las sugerencias del acompañamiento anterior que son:\r\n      \r\nSeguir implementando actividades experimentales y estrategias de clima de aula y desarrollo de habilidades.\r\n\r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, intencionado como meta   compartida.\r\n\r\nVerificar permanentemente la comprensión de todos los estudiantes\r\n'),
(251, '13567342', '13567342', '2023-05-29', '13:25:00', '14:10:00', 27, 36, 1.9, NULL, 7, ''),
(252, '13567342', '18448695', '2023-05-26', '10:50:00', '11:35:00', 23, 36, 1.86, NULL, 7, 'Se observa un buen clima de clase, donde la profesora muestra una relación positiva con sus estudiantes, siendo cercana y respetuosa.  Constantemente está monitoreando la actividad de la clase, procurando implementarla según lo previsto.\r\nSe sugiere flexibilizar los tiempos planificados, con el fin de evitar distracciones que deriven en desorden, y que produzcan la extensión de la clase, impidiendo hacer un cierre que nos permita corroborar el logro del objetivo.'),
(253, '13567342', '19405021', '2023-05-26', '08:55:00', '09:40:00', 21, 36, 1.95, NULL, 7, 'Profesora demuestra buen manejo de grupo, es cercana y afectuosa con los estudiantes, y a la vez exigente.  Entrega instrucciones claras, lo que ayuda a que las alumnas tengan claridad de lo que deben realizar y se mantengan más concentradas y motivadas, facilitando la fluidez de las actividades.\r\nSe sugiere orientar a los estudiantes a reflexionar sobre sus respuestas, volviendo a preguntarles, planteándoles situaciones alternativas o solicitándoles explicar su postura.'),
(254, '13567342', '18161466', '2023-05-26', '08:55:00', '09:40:00', 22, 36, 1.86, NULL, 7, 'Profesor se muestra acogedor, recibe y no juzga las opiniones de los estudiantes.\r\nSe recomienda entregar las instrucciones de forma más precisa, en momentos en que los estudiantes estén más atentos y confirmando su comprensión (por ejemplo, pedir a un estudiantes que explique lo que hay que hacer o que repitan las instrucciones).  Esto puede contribuir a mantener el orden y concentración, favoreciendo la fluidez de las actividades, lo que puede permitir contar con el tiempo suficiente para comprobar el logro de los objetivos planteados durante el cierre de la clase.'),
(255, '13567342', '11224199', '2023-05-25', '14:10:00', '14:55:00', 19, 36, 1.95, NULL, 7, 'Profesora muestra buen manejo de grupo, es cercana y respetuosa, constantemente entrega refuerzos positivos a las estudiantes, procurando un ambiente de escucha y respeto.\r\nSe sugiere dar tiempo a que los estudiantes reflexionen sobre sus respuestas, contrapreguntando, solicitando que explique su postura o planteando alguna situación alternativa.'),
(256, '11537827', '16767380', '2023-09-07', '14:10:04', '15:30:04', 16, 22, 1.81, NULL, 7, 'Fortaleza :\r\nUn buen manejo del clima de clase , alumnos manifiestan mucho interés y participación durante toda la clase  \r\nRealiza preguntas en forma permanente para promoviendo la comprensión del contenido. \r\nSe ve un trabajo colaborativo  con la educadora diferencial \r\nEstudiantes escuchan con mucho respeto  a sus compañeros.   \r\nPor mejorar:\r\nEnfatizar en la habilidad a potenciar durante la clase. \r\nInstrucciones claras y que sean comprendidas por todos. \r\nSupervisar el trabajo de los estudiantes en forma más rigurosa.  \r\n\r\n'),
(257, '11537827', '17899117', '2023-09-08', '10:10:22', '10:30:22', 28, 34, 1.84, NULL, 7, 'Contenido de la clase : Suma y resta de fracciones con igual y distinto denominador. \r\nFortaleza \r\nUn clima de aula y trabajo adecuado \r\nAlumnos que trabajan durante la clase . solo algunos se distraen en algunos momento del a clase. \r\nLogra mantener la atenciÃ³n de los estudiantes \r\nDebilidades \r\nMejorar los tiempos en los distintos momentos ( tiempos en anotar , realizar la actividad ) \r\nVerificar la comprensiÃ³n de todos \r\nGenerar masâ€š desafÃ­os  ya  que genera monotonÃ­a por lo fÃ¡cil  de la actividad ( altas expectativas) \r\n'),
(258, '11537827', '15648128', '2023-09-11', '14:01:41', '14:46:41', 18, 34, 1.73, NULL, 7, 'Unidad de GeometrÃ­a : Contenido: Calcular Ã¡rea de cubos y paralelepÃ­pedos \r\n\r\nFortaleza \r\nSe nota un a clase preparada por la docente  y con material acorde al contenido.  \r\nBuen manejo de los conceptos  de Ã¡rea basal y lateral \r\n \r\nPor mejorar \r\nTiempos asignados a cada actividad \r\nRevisiÃ³n por parte de los estudiantes, la compresiÃ³n de todos ( muchos no entendieron y no lo manifiestan ) \r\nLograr 100 % de atenciÃ³n por parte de los estudiantes ( no hablar si no hay silencio )     \r\n\r\n\r\n\r\n \r\n '),
(259, '16009922', '18069762', '2023-08-21', '08:15:00', '09:45:00', 22, 32, 2, NULL, 7, 'Se comienza la clase recordando lo visto en clase anterior y luego se plantea el objetivo de la clase.\r\nClase estructurada de comienzo a fin.\r\nCoordinación entre las docentes, con roles claros.\r\nEstudiantes concentrados, atentos y con clima de aula positivo.\r\nUtilización de diversas estrategias de enseñanza.\r\nUtilización de estrategias de clima de aula y habilidad de pensamiento.\r\nPalos preguntones para el cierre de la clase.'),
(260, '16009922', '17540502', '2023-06-23', '11:55:00', '13:00:00', 17, 34, 1.45, NULL, 7, 'La clase se retrasa varios minutos, comenzando a las 12:15 horas (20 minutos más tarde).\r\nSe observa una falta de utilización de estrategias de clima de aula (mucho ruido y escasa focalización de los estudiantes en el trabajo indicado).\r\n12:36 se logra mantener silencio en la sala de clases.\r\n'),
(262, '13769322', '11946370', '2023-10-12', '10:05:00', '11:35:00', 16, 22, 1.92, NULL, 7, '- Completar las planificaciones en LIRMI\r\n- Reforzar el concepto de material e inmaterial (en la retroalimentaciÃ³n de la evaluaciÃ³n acumulativa).\r\n- Conversar con el PIE para que durante las clases de Historia no los saquen de la sala (ha pasado en otras ocasiones, hoy no fue el caso). Se enviarÃ¡ mail desde coordinaciÃ³n.'),
(263, '13769322', '11842983', '2023-10-06', '11:55:00', '13:25:00', 17, 34, 1.74, NULL, 7, '- Incluir en las clases trabajo con material concreto\r\n- Desarrollar alguna estrategia de desarrollo del pensamiento'),
(264, '13769322', '15452931', '2023-10-04', '10:05:00', '11:35:00', 17, 32, 1.16, NULL, 7, '- Se tomará a Leonor Vera para que realice trabajo en biblioteca (afiche pendiente).\r\n- Poner al día la plataforma LIRMI ya que, si bien tiene dividida las unidades, no están completas los OAS.\r\n- Desarrollar un trabajo de normalización.\r\n- Realizar un trabajo paralelo a las presentaciones (en próxima oportunidad) para tener a las alumnas concentradas en las presentaciones de las compañeras.'),
(265, '13769322', '18047397', '2023-10-06', '10:05:00', '11:35:00', 16, 34, 1.48, NULL, 7, '- Mostrar un video explicativo sobre el orden de los decimales\r\n- Tener siempre el tiempo visible en el desarrollo de la clase\r\n- Dividir la pizarra en ejercicios para los alumnos que comprendieron para los alumnos que comprendieron para que avancen y quienes deben continuar reforzando\r\n- Completar las planificaciones pendientes en LIRMI'),
(266, '13769322', '18047397', '2023-10-13', '12:40:00', '13:20:00', 17, 34, 1.77, NULL, 3, '- Evitar los tiempo \"muertos\" de las alumnas.\r\n- Realizar más actividades a las alumnas que finalizaron los ejercicios, para enfocarse en aquellas alumnas que no comprenden.\r\n- Asignar una alumna que le ayude (en caso de no tener codocente) a monitorear el avance en los cuadernos.'),
(267, '13769322', '11845380', '2023-06-13', '10:05:00', '11:30:00', 13, 35, 1.96, NULL, 3, '- Se felicita al profesor por el trabajo desarrollado; ya que se nota la normalización que tiene en clases y su forma de trabajar.'),
(268, '16896799', '19386893', '2023-08-30', '08:30:00', '09:45:00', 16, 32, 1.95, NULL, 7, '-La clase cuenta con diferentes estrategias de evaluación formativa que permiten a las docentes monitorear el aprendizaje de los estudiantes, principalmente al inicio con la indagación de aprendizajes y al fin de la clase con un ticket de salida. ¿Qué reflexión realizan de la información obtenida en los tickets de salida?\r\n-Se observa que todos los estudiantes participan y realizan las actividades que se proponen en el tiempo propuesto. Todos logran completar el trabajo que se les propone, por lo que se evidencia una correcta distribución de los grupos.\r\n-Las docentes ofrecen una actividad complementaria relacionada con los conceptos de la clase, para los estudiantes que terminan las actividades propuestas.\r\n-Se observa un aula diversificada, cuyo objetivo era comprender información de un texto dramático con diferentes actividades. Tanto como para el grupo de los iniciales y los intermedios, se observan actividades acordes al objetivo. ¿podrías explicar cómo las actividades del grupo avanzado se relacionan con el objetivo?\r\n-Se sugiere ofrecer retroalimentación que complemente los aprendizajes en la actividad inicial de la trivia, para reforzar las respuestas, sobre todo en las que los estudiantes tenían más dudas.\r\n-Es importante contar con todo el material necesario, previo al inicio de la clase ¿còmo poder mejorar al respecto?\r\n-Se observa manejo de rutinas de clima de aula para el trabajo, por ejemplo, 100%, puntajes por fila, uso de las 5S'),
(269, '16896799', '17842898', '2023-09-04', '10:15:00', '10:50:00', 25, 34, 1.86, NULL, 3, '\r\n-En el inicio, se entrega retroalimentación sobre el desempeño en una evaluación, en la cual, las estudiantes desconocían conceptos matemáticos y se les presenta un material que les servirá para favorecer sus aprendizajes conceptuales de la asignatura.\r\n-Se reconoce la proactividad en la sala de clases, por parte de la docente diferencial, al proponer este material, que las estudiantes comentan que está lindo y bien preparado.\r\n-Se entregan orientaciones detalladas sobre el uso del material llamado “diccionario matemático”.\r\n-Para una próxima observación, se sugiere utilizar alguna estrategia de clima de aula, ¿qué estrategia de clima se podría haber ocupado en esta clase? \r\n-Si se asigna tiempo, ojalá hacerlo de manera visible, para que las estudiantes regulen su trabajo en el tiempo indicado. \r\n-Se sugiere proporcionar un ejemplo de concepto para dar un lineamiento concreto de lo que se espera.\r\n- ¿Cómo evaluarán el trabajo del diccionario? ¿Se compartirá la pauta con las estudiantes?\r\n'),
(270, '16896799', '13135675', '2023-09-07', '15:44:00', '16:25:00', 27, 29, 1.86, NULL, 6, '\r\n-Ambas profesoras, comparten los diferentes momentos de la clase. Se presentan con los materiales necesarios. Se logra la participación de las estudiantes y la realización de las actividades propuestas. Las actividades planificadas, se logran en los tiempos establecidos, además de evaluación formativa a través de ticket de salida.\r\nSe consulta a la profesora ¿Cuál era el objetivo de la clase?, probablemente se compartió en el inicio, pero no se retoma en el momento del acompañamiento.\r\n-Se observa que se utiliza tiempo consensuado y visible, lo que se valora, como una estrategia útil para el trabajo a realizar.\r\n-Se observa al momento de dar las explicaciones las estudiantes siguen conversando y en momentos no se logra escuchar las instrucciones, por lo que en ese momento se observa la necesidad de ocupar alguna estrategia ¿Cuál crees que sería una estrategia adecuada para corregir esto?\r\n-Otra estrategia que se observa es el uso de palitos preguntones, que de igual manera sirven para optimizar la participación de diferentes estudiantes en la clase, sin embargo, se sugiere profundizar la participación o proponer una alternativa para la estudiante que menciona no saber la respuesta. - ¿Qué estrategia se pudo haber ocupado para lograr alguna participación con ella? ¿Qué apoyos otorgar para que logren hacerlo?\r\n- ¿Qué reflexión hacen del ticket de salida?\r\n'),
(271, '13769322', '13756235', '2023-05-03', '10:05:00', '11:35:00', 15, 22, 1.12, NULL, 7, '- Dar las instrucciones claras en cualquier momento de la clase\r\n- Tener el instrumento de evaluación impreso antes de que se realiza la clase, y de no tenerlo copiarlo en pizarra.'),
(272, '13769322', '13276799', '2023-10-17', '08:28:00', '09:40:00', 11, 32, 1.68, NULL, 7, '- Imprimir la hoja para realizar la tarea del comics con 3°B.\r\n- Pautear las características del superhéroe, entregar tipos de ambiente, problemas, lugares, etc., para guiar mejor el trabajo de los alumnos.\r\n- Se pudo aplicar alguna estrategia de rutina de pensamiento, antes de crear su comics.'),
(273, '17335579', '12264275', '2023-10-10', '11:55:00', '13:20:59', 15, 34, 1.83, NULL, 7, '- Antes de entregar instrucciones, propicia un clima de aula favorable. Se observa estructura y rigurosidad. \r\n- 100%. Supervisa permanentemente la comprensión de las instrucciones. \r\n- Modela. Utiliza la pizarra para evidenciar claramente el contenido y guiar la resolución de problemas. \r\n- Se mueve estratégicamente dentro de la sala, estimulando la persistencia en el trabajo. \r\n- Estrategia \"comparta su error\". Excelente iniciativa. Favorece la participación y la metacognición. \r\n\r\nAcuerdos de mejora: \r\n-La estructura de la clase debe ser presentada a las estudiantes antes de iniciar. Se sugiere vincular el contenido con alguna situación cotidiana o explicar por qué es importante adquirirlo. Recordar las 5 N. \r\n- Considerar la curva atencional de las estudiantes. Generar un quiebre durante la clase para hacer una pregunta interesante relacionada con el contenido, una actividad práctica competitiva, un juego de ingenio u otro (siempre breve) que permita el descanso o el movimiento y que permita luego retomar la clase con mayor disponibilidad. \r\n- Recordar que es importante el refuerzo positivo. \r\n\r\n\r\n'),
(275, '17335579', '18162394', '2023-10-16', '11:55:00', '13:25:00', 21, 32, 1, NULL, 7, '- Actividad de inicio: Bingo de la autoestima. Recordar la importancia de brindar instrucciones claras para conseguir un clima propicio y eficacia en las actividades.  Hubo falta de claridad en la instrucciÃ³n y ante eso las estudiantes no sabÃ­an que hacer con el material entregado. Ambas docentes recorrieron la sala explicando banco por banco la actividad. Se sugiere implementar TÃ©cnica  QuÃ© Hacer Hacer/100%. Siempre verificar que la instrucciÃ³n fue comprendida por todas las estudiantes. Recordar que incluso un estudiante brillante puede mermar su rendimiento si no comprendiÃƒÂ³ lo que debe hacer. (hacer preguntas sobre lo que se debe hacer, un estudiante explica los pasos, usar \"Sin Salida\"). Se utiliza estrategia de tiempo visible, sin embargo, no es eficiente si las estudiantes no saben quÃ© hacer. \r\n- Recordar que el apoyo en aula es para todo el curso. Ubicar estratÃ©gicamente a las estudiantes del programa para favorecer el monitoreo pero NO quedarse en un solo sector de la sala enfocada exclusivamente en ellas. \r\n- Potenciar el trabajo autÃ³nomo de las estudiantes del programa (se observa trabajo de monitoreo permanente a SofÃ­a Pino y SofÃ­Â­a RamÃ­rez). \r\n- El grupo no alcanza el objetivo de la clase propuesto. Curso con amplias necesidades de apoyo en tanto conducta y clima. \r\n- La relaciÃ³n de asimetrÃ­Â­a entre docente y estudiantes DEBE ser evidente. '),
(276, '13769322', '16161640', '2023-10-17', '10:05:00', '11:35:00', 15, 8, 1.62, NULL, 7, 'Antes de iniciar la clase el docente deberá:\r\n- Observar la imagen de los circuitos y realizar rutina VPD para que las alumnas puedan conversar sobre el contenido.'),
(277, '13769322', '13195888', '2023-10-10', '08:15:01', '09:40:53', 13, 32, 1.8, NULL, 7, '- Profundizar más el contenido en cuanto a conceptos a través de preguntas que logren demostrar el aprendizaje.\r\n- Revisión de tarea pendiente.'),
(278, '17335579', '19449801', '2023-10-17', '10:10:00', '11:35:59', 23, 34, 1.85, NULL, 7, 'Para iniciar, comprueba que todos los estudiantes cuenten con los materiales básicos necesarios y estimula la responsabilidad. Diálogo formativo. 5N\r\nSe desplaza de forma estratégica por la sala, apoyando  con esto la gestión del clima. \r\nBrinda instrucciones claras y verifica la comprensión permanentemente. \r\nSe observa una clase coordinada, equilibrada. Se evidencia un trabajo de codocencia planificado, donde ambas docentes saben perfectamente qué y cuándo hacer. La clase fluye de manera eficiente. \r\nSugerencias: \r\n- Recordar la diversidad de estudiantes dentro del aula. Se sugiere otorgar a algunos estudiantes que lo requieran (TDA-H con sintomatología severa presentes en este curso) algún rol o responsabilidad que ofrezca movimiento puesto que según lo observado, no son capaces de mantenerse en su puesto durante los 90 minutos de la clase. \r\n- Revisar la organización de la sala y distribuir a los estudiantes de manera que favorezca el trabajo entre pares. \r\n'),
(279, '17335579', '11842983', '2023-06-19', '10:05:00', '11:35:00', 17, 32, 2, NULL, 7, 'Estrategia de clima de aula: Umbral. Estrategia ya instaurada. Las estudiantes la conocen y ajustan su comportamiento para iniciar la clase. \r\nLa docente lidera el desarrollo de la clase. Docente de asignatura desempeña un rol secundario, siendo guiado por la profesional PIE. \r\nBuen manejo de grupo. Soledad conoce al curso y las necesidades de éste. Supervisa permanentemente el trabajo, estimula la participación y las estudiantes no pierden el tiempo. \r\nUtiliza estrategia de tiempo visible, con buena estimación del tiempo de trabajo. \r\nBrinda instrucciones claras, no obstante, se sugiere siempre verificar la comprensión. '),
(280, '9089119', '19274209', '2023-09-29', '15:40:11', '16:25:11', 24, 29, 1.95, NULL, 6, 'Objetivo de la clase: Exponer un monólogo elaborado por los estudiantes en trabajo interdisciplinario en base a plan lector de Edipo Rey\r\n\r\nEstudiantes presentan sus monólogos ante el curso representando su personaje con máscaras realizadas en la clase de arte, como parte de un trabajo interdisciplinario.\r\n\r\nSe observa gran motivación y participación de los estudiantes, quienes pueden a través de esta estrategia demostrar su aprendizaje e interés. Se mantiene la atención de los estudiantes con escucha activa y respeto hacia los que se presentan.\r\n\r\nSe observa que la actividad genera mejor comprensión y activa participación \r\n\r\nDocente, se vincula positivamente con los estudiantes, se mantiene un buen clima de aula con factor alegría.\r\n\r\n\r\nSugerencia:\r\n\r\nRecoger retroalimentación de los estudiantes y verificar la comprensión realizando el cierre de la clase.\r\n\r\n\r\n'),
(281, '9089119', '12978138', '2023-09-29', '11:55:54', '12:45:54', 23, 42, 1.91, NULL, 3, 'Unidad 3: El centro del mensaje de Jesús es el amor y respeto al próximo\r\nTema: Principio de la solidaridad\r\nObjetivo: Relacionar el concepto de solidaridad con la amistad y el bien común.\r\n\r\nPresenta objetivo con habilidad a desarrollar realizando preguntas claves, explicitándola y motivando el trabajo a realizar \r\n\r\nRealiza recuperación de conocimientos previos con preguntas claves invitando a las estudiantes a la \r\nreflexión en torno al tema de la solidaridad y conectándolo a su vida cotidiana.\r\n\r\nDocente con actitud motivadora que se vincula positivamente con los estudiantes, manteniendo un buen clima de aula, con factor alegría. \r\n\r\nEstudiantes presentan sus acciones solidarias realizadas a través de disertaciones de manera grupal dando oportunidad a la reflexión sobre las experiencias vividas por las estudiantes.\r\n\r\n\r\n Sugerencia:\r\n\r\n      \r\nImplementar estrategias como una ruta de trabajo o gestión del tiempo, que potencian el desarrollo de la clase, intencionándola como meta compartida.\r\n'),
(282, '14273480', '8092009', '2023-06-19', '10:10:00', '11:50:00', 9, 1, 1.92, NULL, 7, 'Observaciones.\r\n- La docente, en general, apoya a los estudiantes en las actividades planteadas por la docente.\r\n\r\nAcuerdos:\r\n- Establece o propicia interacciones afectivas que favorecen al aprendizaje: poner atención en el momento oportuno para llamar la atención de los estudiantes, evitando interrumpir las actividades, escuchando a los estudiantes.'),
(283, '14273480', '15221803', '2023-10-25', '14:10:00', '15:10:00', 9, 32, 2, NULL, 3, 'Observaciones:\r\n- Se observa estrategia de Taller Escritor, en conjunto con capacitadora María Paz Larraín.\r\n- La docente utiliza el taller escritor asociando con contenido revisado con anterioridad; La carta.\r\n- Activa conocimientos previos, realiza preguntas desafiantes.\r\n- Se observa conocimiento por parte de los estudiantes.\r\n- Utiliza estrategia de 100% y factor alegría.\r\n- Monitorea a los estudiantes.\r\n\r\nAcuerdos:\r\n- Dar mayor uso a la pared de palabras, intencionando su uso pedagógico.'),
(284, '16896799', '13135675', '2023-10-24', '08:15:00', '09:15:00', 27, 29, 1.78, NULL, 3, '-Se trabaja en la clase una forma diversificada de evaluación, que consiste en un trabajo colaborativo, para luego dar paso a una evaluación individual, previa revisión y conversaciones donde se socializa la comprensión de lo leído.\r\n-Existe una secuencia de actividades y pasos que son presentados al inicio de la clase y recordados a medida que se avanza.\r\n-La clase cuenta con materiales didácticos que apoyan la motivación por aprender, tales como, pizarras borrables individuales, palitos preguntones y resúmenes en material plastificado.\r\n-Se observa una coordinación en el trabajo de ambas profesoras en el desarrollo de la clase, compartiendo la dirección de esta\r\n-Las profesoras logran un clima de aula, propicio para el aprendizaje. Sin embargo, se observa que, al momento de dar las instrucciones, la profesora diferencial, pudo haber aplicado algunas estrategias de clima de aula, tales como ojos en mí o 100%. Se sugiere ocupar una voz que llegue a todos los lugares de la sala.\r\n-También se sugiere que cada vez que se ocupe una rutina o estrategia de pensamiento, se debe explicar en qué consiste. Debido a que se observa que las estudiantes cometen errores confundiendo las frases con las oraciones en la estrategia de oración-frase-palabra.\r\n'),
(285, '16896799', '16863303', '2023-11-02', '13:30:00', '14:30:00', 1, 31, 1.8, NULL, 7, 'No se observa el trabajo coordinado con la docente, puesto que se encuentra ausente, sin embargo, logra trabajar de manera coordinada con las asistentes de aula presentes.\r\nSe observa que la docente dirige todas las actividades, manteniendo la participaciÃƒÂ³n y motivaciÃƒÂ³n de la mayorÃƒÂ­a de los estudiantes. AdemÃƒÂ¡s se observa un manejo de todas las rutinas de trabajo utilizadas por los estudiantes.\r\nEl material utilizado, es atractivo para los estudiantes y permite la participaciÃƒÂ³n de ellos.\r\nComo aspectos a mejorar se observa el uso de rutinas de aula, establecidas en el colegio, trabajadas en las CAP. \r\nDe igual manera, se observa que al final del trabajo con el cuento, se realizan 2 preguntas que apuntan a la meta cogniciÃƒÂ³n, (se te ha perdido alguna vez algÃƒÂºn objeto? Ã‚Â¿te gustÃƒÂ³ el cuento? sin embargo, se debiÃƒÂ³ permitir a los estudiantes ahondar en sus respuestas y su pensamiento crÃƒÂ­tico.\r\nSe sugiere poder trabajar en retroalimentar las respuestas de los estudiantes de manera constructiva, que le permita avanzar en el conocimiento, siendo consistente en su uso.'),
(286, '16896799', '16287284', '2023-10-26', '15:40:00', '16:25:00', 24, 29, 1.88, NULL, 6, 'Se observa el objetivo escrito en la pizarra durante la clase, lo que favorece la visualización tanto para la persona que acompaña, como para los estudiantes. (Reconocer las funciones del lenguaje en la publicidad).\r\nLa docente menciona de manera detallada las instrucciones del trabajo a realizar.\r\n-Menciona que tiene altas expectativas de los estudiantes, cuando ellos le plantean algunas consultas. \r\n-Hace entrega de material complementario a modo resumen para que pueda ser ocupado en el desarrollo de la actividad, favoreciendo múltiples maneras de presentar la información (presentación ppt, guía de trabajo y resumen impreso).\r\n-Se observa una adecuada planificación de los tiempos y las actividades que se realizan. \r\n-Se observa trabajo de metacogniciòn y evaluación formativa en el ticket de salida. \r\n-En el uso del tiempo, definir de mejor manera si es tiempo consensuado o tiempo visible, puesto que, si le planteas un tiempo inicial, y lo quieres consensuar, debes estar dispuesta a ceder algunos minutos, en el caso que los estudiantes lo soliciten.\r\n-También se observa que algunos de los ejercicios de la guía, o del ticket de salida, no se relacionan con la publicidad, que es el objetivo de la clase.\r\n- ¿Qué análisis realizan sobre la información recogida en el ticket de salida?, como se realizará la retroalimentación de esta evaluación? \r\n'),
(287, '16896799', '17540502', '2023-10-31', '08:40:00', '09:45:00', 18, 32, 1.72, NULL, 7, 'Se observa una clase donde las docentes apuntan a diversificar el trabajo de aula, apuntando a un pensamiento creativo de los estudiantes, favoreciendo el desarrollo de habilidades.\r\nSe observa un trabajo coordinado por parte de ambas docentes durante toda la clase.\r\nSe observa una buena participaciòn de los estudiantes a pesar de ser la primera vez que realizan un trabajo de dramatizaciòn\r\nSe sugiere ahondar en la retroalimentación inmediata de los grupos y complementar las respuestas de los estudiantes en el momento.\r\nPara reflexionar se sugiere: ¿podrían haber revisado el ticket en la próxima clase?  ¿Qué estrategias se pudieron usar para mantener el clima de aula? \r\nSe observa que este acompañamiento fue realizado por Caterina, y luego se compartió la grabación para realizar la pauta con Katherine'),
(288, '14273480', '12701348', '2023-11-06', '10:15:00', '11:30:00', 10, 15, 1.95, NULL, 3, 'Observaciones:\r\n- El docente inicia su clase en la sala, donde recuerda objetivo y trabajo que se encuentran desarrollando.\r\n- Se observa conocimiento por parte de los estudiantes, respondiendo las preguntas realizadas por el docente.\r\n- Establece normas, las recuerdas y menciona lo importante que son respetar, haciendo parte a los estudiantes.\r\n- Realiza nexo con los juegos panamericanos, recogiendo saberes culturales y reales a nuestro país.\r\n- Aplica estrategias de clima de aula para el silencio y la escuha.\r\n- Monitorea a los estudiantes, pese a lo complejo del escenario en el que trabaja, (patio donde hay otros estudiantes)\r\n\r\nAcuerdos:\r\n- Avanzar en el uso de estrategias de clima de aula, utilizando nombre oficial, por ejemplo: sin salida. Se aplica sin embargo, es necesario mencionar el nombre.\r\n- Se sugiere, cuando se a posible, realizar cierre de la clase en sala para llamar a la puesta en común y la calma.'),
(289, '16896799', '15589458', '2023-11-06', '08:20:00', '09:45:00', 16, 32, 1.74, NULL, 7, 'Como fortalezas, se observa la participación de la profesora en todos los momentos de la clase, evidenciando un trabajo colaborativo y coordinado con las otras docentes.\r\nDe igual manera se observa un aula diversificada, atendiendo a las características de todos los estudiantes y logrando el interés y  la participación durante toda la clase. Se considera como positivo el material de apoyo ocupado, demuestra preocupación y trabajo.\r\nComo sugerencias, se observa tener un rol de autoridad dentro de la sala, utilizando voz fuerte.  \r\n Se observa una secuencia de clases, sin embargo no fue compartida con los estudiantes, por lo que se sugiere incluir esta práctica, sobre todo pensando en los estudiantes TEA y TDA.\r\nSe igual manera se sugiere aprovechar la instancia de juego dentro de la clase, para reforzar valores y conductas sanas de competición.\r\nSi bien se observa el uso de un ticket de salid como estrategia de evaluación formativa, lo interesante seria revisar y retroalimentar a los estudiantes, puesto que hubo varios que respondían cosas que no se relacionaban con la clase. \r\n'),
(290, '13769322', '16404386', '2023-11-07', '12:00:00', '13:00:00', 18, 42, 1.85, NULL, 7, '- Aclarar conceptos que los alumnos no manejan en profundidad\r\n- Entregar impresos los textos a los alumnos (no solo proyectarlos) para que así puedan aplicar estrategias como: subrayado, resumen, marcar conceptos, etc.'),
(291, '16896799', '17224388', '2023-11-07', '13:25:00', '14:10:00', 20, 32, 1.72, NULL, 7, 'Como positivo, se valora el uso de una estrategia de desarrollo de habilidad del pensamiento, color-sÃ­mbolo-imagen, a travÃ©s de un ticket de entrada para activar conocimientos previos, utilizando recursos tecnolÃ³gicos. TambiÃ©n se observa, de estrategias de clima de aula como el uso de tiempo visible para el trabajo. La docente entrega material de apoyo que les servirÃ¡ a los estudiantes a contar con mÃºltiples medios de presentaciÃ³n de la informaciÃ³n. \r\nComo aspectos a mejorar, se considera, presentar la estrategia a los estudiantes, para informar o recordar en que consiste de manera detallada.  De igual manera se sugiere hacer uso de la informaciÃ³n o retroalimentaciÃ³n del ticket de entrada. Procurar que cuando se ocupe un material de apoyo sea visible para todos los estudiantes de la sala. De igual manera considerar una ruta de aprendizaje y mencionar el objetivo a abordar . \r\nA modo de reflexiÃ³n siempre ocupar un registro de habla formal'),
(292, '16896799', '14208493', '2023-11-08', '10:11:00', '10:50:00', 10, 32, 1.87, NULL, 7, 'Se observa como positivo el uso de estrategias de clima de aula como uso de las 5S al inicio, y factor sorpresa. Se observa una ruta de aprendizaje compartida con el estudiantes a lo largo de la clase. Retroalimenta de manera constante al estudiante, asegurÃƒÂ¡ndose de los aprendizajes que se estÃƒÂ¡n trabajando. Las actividades propuestas, invitan a la participaciÃƒÂ³n del estudiantes comprometiÃƒÂ©ndolo con su aprendizaje. Uso de material concreto  atractivo, acorde a los intereses de los estudiantes. Se observa una dinÃƒÂ¡mica que esta interiorizada por parte del estudiante.\r\nComo aspectos a mejorar .se considera, el incorporar alguna estrategia o material  que permita en una prÃƒÂ³xima instancia poder retroalimentar al estudiante y/o dejar constancia de sus avances.  De igual manera su sugiere proponer alguna estrategias o actividad que permita avanzar en trabajo autÃƒÂ³nomo del estudiante.\r\nEsta clase fue observada por Caterina Vivanco'),
(293, '13769322', '16161640', '2023-11-07', '10:05:00', '11:40:00', 15, 8, 1.69, NULL, 3, '- Fortalecer la normalización en la sala de clases (ponerse de pie sin permiso, jugar con algo).\r\n- Evitar elementos que sirven de distracciones a la clase, preocupándose que solo tengan el material necesario para la clase.'),
(294, '14273480', '18404503', '2023-11-09', '10:15:00', '11:00:00', 8, 1, 1.89, NULL, 3, 'Observaciones:\r\n- Se realiza observación del inicio y parte del desaroollo de la clase.\r\n- La docente aplica sugerencias realizadas en acompañamiento anterior, tales como: utilizar paso a paso y verificar las instrucciones con los estudiantes.\r\n- Presenta objetivo y recuerdo técnicas trabajadas con los estudiantes.\r\n\r\nAcuerdos:\r\n- Se observa uso de \"sin salida\" pero es necesario hacer más conciente la estrategia, tanto para ella como para los estudiantes.\r\n- Se solicita continuar revisando estrategias de clima de aula, como por ejemplo \"en sus marcas\" y \"tiempo asignado\" y aplicar en sus clases.'),
(295, '14273480', '13310869', '2023-11-08', '08:15:00', '09:35:00', 8, 35, 1.96, NULL, 7, 'Observaciones:}\r\n- El docente aplica sugerencias dadas en acompañamiento anterior.\r\n- Realiza una clase participativa, deteniendose cuando es necesario realizar aclaraciones, responde a preguntas de estudiantes.\r\n- Utiliza diferentes métodos para lograr la comprensión de los contenidos, se observa que los estudiantes han aprendido lo que ha ido enseñando.\r\n- Aplica trabajo colaborativo, lo cual va guiando y recoge ideas de los propios estusiantes.\r\n\r\nAcuerdos:\r\n- Aplicar \"sin salida\" para recoger conocimientos previos u otro. '),
(296, '14273480', '15178747', '2023-11-16', '16:10:00', '16:40:00', 1, 31, 2, NULL, 7, 'Observaciones:\r\n- La docente, en conjunto con asistente, realizan umbral antes de ingresar a la sala de clases.\r\n- Utiliza estrategias de clima de aula para la escucha activa e iniciar la expereincia de aprendizaje.\r\n- Trabaja abecedario, donde se observa manejo y conocimiento por parte de los estudiantes. \r\n- Aplica estrategia MAE: Lectura copartida donde se observa:\r\n      - Uso de paso\r\n      - Direccionalidad al leer\r\n      - Realiza aclaraciones entre volumen y paso.\r\n      - Estudiantes leen la poesía, identifican frutas, cantidad de sílabas y sonido inicial de palabras.\r\n- Al momneto del cierre, realizan juego, el cual se observa que también es conocido por los estudiantes.\r\n\r\nAcuerdos:\r\n- Cuando solicite a un estudiante leer, se sugiere que salgan de a dos, teniendo en cuenta que uno de ellos se sepa la poesía, considerando el estado emocional de los estudiantes.'),
(297, '17335579', '15088008', '2023-10-17', '08:25:00', '08:25:00', 9, 34, 1.89, NULL, 7, '- Se observa un trabajo equilibrado entre ambas docentes, la clase fluye. \r\n- Dinamiza las actividades mediante modelaje, utilizando material concreto \r\n- Se mueve estratégicamente por la sala. supervisando el trabajo e identificando necesidades. Explica nuevamente y confirma que la actividad de desarrolla correctamente. \r\nObs. 1- Se observa dificultad al momento de explicar la actividad que fue acordada liderar. La explicación es muy extensa y no se verifica que fue comprendido. Se sugiere dar ejemplos de lo que se debe hacer y parcelar el avance en la tarea (dividirla en dos partes y revisar el resultado antes de continuar). Considerar la edad de los estudiantes. Una vez que pierden el foco atencional deambulan y distraen al resto. \r\nObs. 2- Cuidar el tiempo destinado a la actividad. En esta ocasión finaliza sin cierre. '),
(298, '17335579', '15892082', '2023-10-30', '12:00:00', '13:30:00', 16, 34, 0.79, NULL, 7, 'Obs. Objetivo de la ubicación de los estudiantes?\r\n- Se observa un desempeño severamente afectado por la falta de disciplina. \r\n- La docente PIE asiste a los estudiantes en el desarrollo de actividades prácticas, más, no participa en el desarrollo de la clase. Adopta un rol asistencial y control. \r\n1-  Se sugiere utilizar material concreto, realizar modelaje de las instrucciones, verificar la comprensión, acordar ubicación estratégica para el control del clima. \r\n2- ¿Qué habilidad se trabaja? ¿el hacer ahora podría ser una actividad de estimulación cognitiva relacionada con el contenido? Se requiere dinamizar la clase (monótona, los estudiantes pierden interés y se genera desorden). \r\n3- Aplicar al aula al menos una estrategia de clima de aula. \r\n4- Para la actividad de cierre \"resolver\", se sugiere utilizar tiempo visible y parcializarla, revisando paulatinamente la ejecución. \r\n'),
(299, '17335579', '19756902', '2023-10-10', '10:05:00', '11:35:00', 7, 34, 1.11, NULL, 7, '1- Definir ubicación dentro de la sala, procurando desplazamiento estratégico para mantener la atención y motivación de los estudiantes (definir claramente roles y funciones de ambas docentes).\r\n2- La actividad modelada con Colhomba podría haber resultado óptima para todo el curso como activación de aprendizajes.\r\n3- Si va a explicar algo de manera individual, procurar que sea en el banco de cada estudiante. \r\n3- Trabajar la comunicación con la docente de aula, de forma que su intervención no parezca una interrupción. '),
(300, '17335579', '19756902', '2023-10-10', '10:05:00', '11:35:00', 7, 34, 1.11, NULL, 7, '1- Definir ubicación dentro de la sala, procurando desplazamiento estratégico para mantener la atención y motivación de los estudiantes (definir claramente roles y funciones de ambas docentes).\r\n2- La actividad modelada con Colhomba podría haber resultado óptima para todo el curso como activación de aprendizajes.\r\n3- Si va a explicar algo de manera individual, procurar que sea en el banco de cada estudiante. \r\n3- Trabajar la comunicación con la docente de aula, de forma que su intervención no parezca una interrupción. '),
(301, '13956828', '16036651', '2023-08-21', '08:15:04', '09:45:04', 11, 1, 2, NULL, 7, 'Objetivos: Estrategias de comprensión lectora\r\n\r\nLa clase se desarrolla con una alta participación de las estudiantes, de forma dinámica y con un manejo técnico de la profesora.\r\nLa motivación de las niñas es un aporte a realizar la clase de forma efectiva de acuerdo a la Planificación, la profesora permite la participación de todas guiando y manejando el ritmo y tiempo de la clase.\r\n\r\nSe acuerda junto a la profesora hacer visible el tiempo asignado como espacio de desarrollo a cada actividad.'),
(302, '13956828', '13625118', '2023-08-21', '14:15:50', '15:40:50', 12, 34, 2, NULL, 7, 'Las estudiantes trabajan ejercicios de multiplicación, que el profesor proyecta en base a ejercicios donde deben aplicar lectura conmprensiva.\r\nBuen trabajo con ticket de salida y revisión y retroalimentación.\r\n\r\nLas estudiantes reciben monitoreo constante del docente y retroalimentación positiva de su trabajo.\r\n\r\nUtiliza diversas estrategias para trabajar la multiplicación.\r\n'),
(303, '9089119', '10363571', '2023-09-29', '10:10:35', '10:55:35', 30, 42, 2, NULL, 3, 'Objetivo: Descubrir que la actividad económica es una respuesta agradecida al llamado de Dios para colaborar con la construcción de un mundo más justo y solidario.\r\n\r\nProfesor entrega ruta de trabajo a realizar en este periodo de termino considerando que es cuarto medio. \r\n\r\nRecoge conocimientos previos sobre economía y realiza clase expositiva iniciando nueva unidad, los estudiantes son muy participativos y con un clima de aula propicio para el aprendizaje\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión utilizando estrategia sin salida y factor alegría, generando un espacio de reflexión y de respeto ante las opiniones de los estudiantes.\r\n\r\nRealizan trabajo en donde asocian característica económica con un principio de la doctrina social de la iglesia\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo el interés y trabajo de ellos.\r\n\r\n\r\nSugerencias:\r\n             \r\n      A pesar de la alta participación por parte de los estudiantes se sugiere generar mayor   \r\n      oportunidades a los estudiantes más descendidos.\r\n\r\n'),
(304, '9089119', '16274647', '2023-10-18', '10:35:26', '11:10:26', 27, 37, 1.96, NULL, 2, 'Objetivo: Dialogar argumentativamente contrayendo argumentación en equipo \r\n\r\nEstrategia metodológica: desarrollo de debates en equipos.\r\n\r\nSe observa excelente clima de aula, propicio para un buen desarrollo de la actividad.\r\n\r\nLos estudiantes demuestran interés y respeto hacia los compañeros que participan en el debate.\r\n\r\nSe observa una clase estructurada donde al final de cada presentación la docente retroalimenta a los equipos con conocimientos claves y previos para ir mejorando el proceso de los siguientes.\r\n\r\nTres docentes van evaluando el desempeño de los equipos creando un ambiente de participación seria y relevante para el aprendizaje.\r\n\r\n\r\nSugerencias:\r\n\r\n        Se mantienen sugerencias del acompañamiento anterior debido a que la actividad no permitió poder observarlos    \r\n\r\nPresentar el objetivo explicitando la habilidad que orientará el desarrollo de la clase.\r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase.\r\n'),
(305, '9089119', '17223013', '2023-10-06', '10:15:42', '11:10:42', 27, 18, 2, NULL, 3, 'Objetivo: Conocer las corrientes epistemológicas que surgen en la época moderna para ayudar a comprender los pensamientos de nuestra conciencia.\r\n\r\nDocente presenta objetivo y habilidades a desarrollar, comienza con estrategia hacer ahora generando un excelente clima de aula.\r\n\r\nSe comienza recordando conocimientos previos a través de estrategia sin salida.\r\n\r\nEstudiantes muy participativos y con clima de aula propicio para el aprendizaje.\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión, a través de la proyección de un juego  lúdico, donde realizan competencia sobre la materia revisada\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nLa docente se vincula positivamente con los estudiantes, manteniendo el interés y trabajo de  ellas, se observa a la profesora muy activa, con factor alegría, invitando permanentemente al análisis crítico a través de preguntas y reflexión, lo que motiva la alta participación.\r\nSugerencias:\r\n      \r\nSe reconoce positivamente a la docente el haber llevado acabo sugerencias realizadas en retroalimentación anterior. Se mantiene la sugerencia del buen uso de la voz, cuidar el volumen ya que por el clima generado no es necesario.\r\n'),
(306, '9089119', '15177877', '2023-09-28', '11:55:50', '12:40:50', 24, 23, 2, NULL, 3, 'Objetivo: Identify informatión\r\nFrom Unit 4 trough a written text\r\n\r\nDocente comienza procurando un clima de aula adecuado a para el aprendizaje y presenta el objetivo indicando la estrategia de trabajo a desarrollar.\r\n\r\nVerifica la comprensión de las indicaciones.\r\n \r\nRealiza preguntas claves, los estudiantes participan activamente dando ejemplos de la vida real a través de un PPT que presenta momentos de vivencias familiares y amistades\r\n\r\nRealizan trabajo en grupo con guía de análisis y vocabulario la que comienza con lectura en voz alta, terminada se comparte con el resto de los grupos.\r\n\r\n\r\nSugerencias:\r\n\r\n       Verificar la comprensión, evitando las preguntas retóricas, intencionándolo de manera personalizada en cada grupo.      \r\n'),
(307, '9089119', '10387845', '2023-09-05', '11:16:45', '12:01:45', 21, 35, 2, NULL, 7, 'Docente presenta el objetivo: Cantar y tocar repertorio folclórico “La Mazamorra” intencionándolo como meta compartida y generando altas expectativas sobre el trabajo a realizar.\r\n\r\nRealiza actividad de conocimientos previos realizando lectura musical en pentagrama y estrategia 100%. Varias estudiantes participan solfeando y tocando instrumentos.\r\n \r\nExplicita estrategia claramente, generando motivación e interés por parte de las estudiantes quienes se muestran dispuestas a participar activamente.\r\n\r\nSe observa una clase estructurada con material audiovisual adecuado.\r\n\r\nDocente se vincula positivamente con los estudiantes, manteniendo un buen clima de aula con factor alegría y gran adherencia al trabajo.\r\n\r\nMantiene la atención de los estudiantes durante toda la clase, realizando actividades que despiertan su interés, sin embargo, dos de ellas no participan durante toda la clase.\r\n\r\nObservaciones y sugerencias: \r\n\r\nSe felicita a la docente reconociendo una clase activa y bien estructurada con adherencia de casi el 100% de las estudiantes.\r\n\r\nSe sugiere poder visibilizar y verificar la participación de todas las estudiantes menos participativas.\r\n\r\n\r\n\r\n\r\n'),
(308, '9089119', '10042509', '2023-09-29', '08:15:27', '09:15:27', 26, 22, 2, NULL, 3, 'Docente presenta objetivo: Retroalimentación de: guerra fría y segunda guerra mundial\r\n\r\nSe comienza con conocimientos previos y con motivación generada por docente a través estrategia participativa dando oportunidad a los estudiantes de demostrar su conocimiento e interés. Mantiene la atención de los estudiantes conectando permanentemente la materia con materias vista y despertando el interés de los alumnos.\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión y activa participación.\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo un buen clima de aula con factor alegría y trasmitiendo la pasión por la disciplina.\r\n\r\nSe felicita al profesor por generar diversas estrategias participativas y activas hacia los estudiantes.\r\n\r\n\r\n'),
(309, '9089119', '15192979', '2023-09-05', '10:10:01', '11:30:01', 29, 4, 2, NULL, 3, 'Objetivo de la clase:\r\n\r\nAnalizar los componentes de un sistema de comunicación celular.\r\nIdentificar los tipos de comunicación celular\r\n\r\nPresenta habilidad a desarrollar realizando preguntas claves, explicitándola y motivando el trabajo a realizar.\r\n\r\nComparte ruta de trabajo y comienza la clase con rutina de pensamiento veo- pienso- pregunto\r\n \r\nSe observa una clase planificada con material adecuado y participación activa y atenta de las estudiantes.\r\n\r\nDocente con actitud motivadora que se vincula positivamente con los estudiantes, manteniendo un buen clima de aula, con factor alegría. \r\n\r\nVerifica la comprensión realizando preguntas claves durante el desarrollo y cierre de la clase.\r\n\r\nSe cierra reflexionando acerca de la habilidad de pensamiento trabajada con la estrategia utilizada y realizando preguntas de PAES, con participación activa de los estudiantes\r\n\r\n      Sugerencias.\r\n\r\n      A pesar de la participación por parte de los estudiantes se sugiere generar mayor   \r\n      oportunidades a los estudiantes que tienen baja adherencia.\r\n\r\n'),
(310, '9089119', '16274647', '2023-09-06', '14:55:22', '15:45:22', 25, 29, 1.92, NULL, 3, 'Docente presenta objetivo\r\n\r\nSe comienza con la lectura de un cuento y con conocimientos previos despertando alto interés y motivación general para comenzar la clase\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión y activa participación e interés de las estudiantes\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con las estudiantes, manteniendo un buen clima de aula con factor alegría.\r\n\r\nMantiene la atención de las estudiantes conectando permanentemente la materia con situaciones de la vida real y experiencias personales.\r\n\r\nRetroalimenta guía de trabajo realizando el análisis del proceso  de comprensión lectora y se aplica estrategia de gestión del tiempo \r\n\r\nSugerencias:\r\n\r\n       Presentar el objetivo explicitando la habilidad que orientará el desarrollo de la clase.\r\n\r\n       Presentar ruta de trabajo para potenciar el desarrollo de la clase.\r\n\r\n'),
(311, '9089119', '18389625', '2023-09-06', '08:20:05', '09:00:05', 20, 34, 1.68, NULL, 3, 'Objetivo: Reforzar operatoria con fracciones\r\n\r\nComienza escribiendo una ruta de trabajo en la pizarra y recordando conceptos previos.\r\n\r\nEl clima de aula es propicio para el aprendizaje, los estudiantes en general participan activamente pasando a la pizarra. Docente motiva la clase con factor alegría y se vincula de manera positiva con todos.\r\n\r\nRealiza preguntas claves promoviendo la participación, sin embargo, falta verificar la comprensión de algunos estudiantes que no se adhieren al trabajo\r\n\r\n\r\nSugerencias de trabajo:\r\n\r\nPresentar el objetivo a trabajar explicitando la habilidad a desarrollar\r\n\r\nVerificar la comprensión después de responder las dudas de los estudiantes\r\n\r\nEvitar preguntas retóricas e implementar estrategias activas participativas.\r\n\r\n\r\n');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(312, '9089119', '17223013', '2023-09-07', '08:15:59', '09:40:59', 28, 18, 1.92, NULL, 3, 'Objetivo: Analizar y conocer la realidad a partir del concepto de phisis dado por Aristóteles para comprender el mundo en que vivimos.\r\n\r\nProfesora realiza clase expositiva iniciando nueva unidad, los estudiantes son muy participativos y con un clima de aula propicio para el aprendizaje\r\n\r\nRealiza preguntas claves lo que genera mejor comprensión utilizando estrategia sin salida y factor alegría, generando reflexión de parte de los estudiantes.\r\n\r\nDocente realiza preguntas a los estudiantes con menos adherencia verificando la comprensión\r\n\r\nSe observa una clase estructurada con material adecuado.\r\n\r\nDocente, se vincula positivamente con los estudiantes, manteniendo el interés y trabajo de ellos\r\n\r\nSugerencias:\r\n      \r\n\r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, apuntando a marcar el tiempo y  a la diversificación de actividades.\r\n\r\nUso de la voz, cuidar el volumen ya que por el clima generado no es necesario.\r\n\r\n'),
(313, '9089119', '15178038', '2023-09-28', '10:10:02', '11:00:02', 29, 28, 1.9, NULL, 3, 'Objetivo de la clase: Desarrollar la introducción de un ensayo personal de reflexión respeto a su proyecto de vida.\r\n\r\nLa docente ingresa a la hora y comienza retroalimentando un trabajo escrito.         \r\n\r\nEntrega las instrucciones para que los estudiantes puedan continuar la actividad iniciada en la clase anterior y proyecta guía de desarrollo de este.\r\n\r\nRevisa los escritos de manera individual aclarando dudas y observando avances, durante la clase, sin embargo, se observan estudiantes sin trabajar o desinteresados.\r\n\r\nSe observa un adecuado manejo disciplinar e invita a que los estudiantes tengan una visión crítica y de opinión frente al tema con preguntas claves durante el desarrollo de la actividad.\r\n\r\n\r\n\r\nSugerencias de trabajo \r\n\r\n  Presentar el objetivo de la clase intencionándolo como meta compartida y con ruta de trabajo\r\n\r\nVerificar la comprensión de las instrucciones, para motivar la escucha activa.\r\n\r\n'),
(314, '13956828', '18412060', '2023-11-06', '12:00:43', '13:20:43', 11, 27, 1.96, NULL, 7, 'Profesora utiliza apoyo audiovisual para trabajar su clase.\r\nClase bien estructurada, organizada, se observa tiempo invertido y planificado para realizar el material de trabajo presentado. \r\nNiñas participativas y excelente clima de aula.\r\n\r\nProfesora emplea más inglés que en otras ocasiones donde por otros motivos ingresé al aula.\r\n\r\n'),
(315, '12226961', '12826448', '2023-11-24', '10:10:00', '11:25:00', 24, 15, 1.44, NULL, 7, 'El desafío de oportunidades de evaluación que apunten a la inclusión de intereses distintos en loes estudiantes y más diversificación de los deportes. '),
(316, '12226961', '19405021', '2023-11-30', '08:25:00', '09:31:00', 21, 34, 1.96, NULL, 7, 'Se logra evidenciar una práctica consolidada que es proyectable como exitosa y transferible en mentorías. Se acuerda '),
(317, '13567342', '18448695', '2023-10-12', '14:10:00', '14:55:00', 1, 36, 2, NULL, 7, 'Profesora mantiene un trato cercano y respetuoso con las estudiantes, estimulÃ¡ndolas constantemente a participar y mantenerse conectadas en la clase, pese al ruido del patio.  Estudiantes responden favorablemente, evidenciando compromiso con su profesora y el objetivo de la clase.\r\nSe sugiere seguir potenciando la capacidad reflexiva de las estudiantes, planteÃ¡ndoles nuevas interrogantes o nuevos contextos.'),
(318, '13567342', '18448695', '2023-10-13', '11:55:00', '12:40:00', 23, 36, 1.81, NULL, 7, 'Profesora muestra un trato cercano con las estudiantes, lo que permite que exista un espacio de confianza para las estudiantes, en el que pueden plantear comentarios e interrogantes. \r\nSe sugiere disponer al momento de la clase de informaciÃƒÂ³n complementaria que refuerce el contenido que presenta el material Pasos, para asÃƒÂ­ responder a las interrogantes de las estudiantes, quienes se mostraron muy interesadas en el tema trabajado.\r\nPor otro lado, es importante tomar los aportes de las estudiantes y hacer las correcciones pertinentes, con el fin de evitar confusiones.'),
(319, '13567342', '18448695', '2023-10-12', '09:00:19', '09:40:00', 22, 36, 1.81, NULL, 7, 'Profesor desarrolla la clase segÃºn lo planificado, conectando la clase actual con lo ya trabajado, haciendo preguntas que permitan a los estudiantes recordar lo aprendido.\r\nMantiene trato amable con los estudiantes.  Sin embargo, es necesario seguir trabajando en estrategias que favorezcan un buen clima de aprendizaje, en donde los estudiantes se involucre activamente en la clase, dejando de lado distracciones como el celular, conversar con el compaÃ±ero, pararse sin permiso, etc.\r\nSe sugiere realizar cierre que permita evidenciar lo aprendido por los estudiantes.'),
(320, '13567342', '19405021', '2023-10-13', '10:05:00', '10:50:00', 21, 36, 2, NULL, 7, 'Profesora muestra un trato cariñosos con las estudiantes, generando un clima de respeto y propiciando la conexión con la clase.\r\nLas estudiantes participan activamente, corrigiendo de manera asertiva el comportamiento de quienes muestran alguna actitud disruptiva.  Esto permite que la clase se desarrolle sin inconvenientes y que las estudiantes participen activamente.\r\n'),
(321, '13567342', '9433399', '2023-10-12', '14:55:00', '15:40:00', 26, 36, 1.95, NULL, 7, 'Profesora mantiene un trato cercano y respetuoso con sus estudiantes, generando un espacio de confianza y motivador para participar.\r\nSe destaca el esfuerzo de la profesora por generar un ambiente adecuado para la clase, preocupándose que los estudiantes limpien su espacio, se sienten adecuadamente y se dispongan a escucha.  Durante la clase, cuando nota alguna distracción, profesora utiliza estrategias para recuperar la atención.\r\nSe sugiere seguir trabajando en la profundización de las peguntas, invitando a los jóvenes a cuestionarse y plantearse nuevos contextos.'),
(322, '13567342', '15898402', '2023-10-13', '11:55:00', '12:40:00', 29, 36, 1.95, NULL, 7, 'Profesora acogedora y cercana con sus estudiantes, quienes responde de manera favorable, comprometiéndose con el desarrollo de clase, participando activamente.\r\nSe sugiere gestionar los tiempos de mejor manera, con el fin de contar con el tiempo suficiente para realizar un cierre adecuado de la clase.'),
(323, '13567342', '9141113', '2023-11-14', '13:25:00', '14:10:00', 25, 36, 1.95, NULL, 7, 'Profesora se muestra cercana con las estudiantes.  Se destaca el manejo del contenido y el contar con información complementaria, que ayuda a mantener el interés de sus alumnas.\r\nSe sugiere manejo del tiempo, con el fin de realizar un cierre que permita evaluar los aprendizajes de las estudiantes durante la clase.'),
(324, '13567342', '13567342', '2023-10-30', '13:25:00', '14:10:00', 27, 36, 1.9, NULL, 7, 'Profesora con un trato cercano y respetuoso.  Preocupación por generar un clima propicio para el aprendizaje.\r\nSe sugiere gestionar los tiempos, con el fin de asegurar realizar un cierre de la clase que evalúe los aprendizajes adquiridos.  Además, se invita a seguir trabajando la generación de espacios de reflexión y pensamiento crítico.'),
(325, '13567342', '18448695', '2023-10-03', '13:25:00', '14:10:00', 30, 36, 1.81, NULL, 7, 'En general se observa un conocimiento del curso, se genera un buen ambiente de aprendizaje, ademÃ¡s se enriquece la sesiÃ³n con contenido histÃ³rico y cultural. Se sugiere dar mÃ¡s espacio a la participaciÃ³n de los estudiantes promoviendo una reflexiÃ³n mÃ¡s profunda logrando fundamentar sus respuestas. '),
(326, '13567342', '18448695', '2023-10-12', '13:25:00', '14:10:00', 24, 36, 1.9, NULL, 7, 'Una muy buena clase, preparada y organizada para el logro del objetivo, a pesar de que los estudiantes son inquietos logran estar atentos y responder a la clase. Se sugiere una actividad para el cierre de la sesiÃ³n.'),
(327, '13567342', '11737897', '2023-10-12', '13:25:00', '14:10:00', 24, 36, 1.76, NULL, 7, 'A pesar de las dificultades técnicas mantiene la calma. Realiza las actividades planificadas, se sugiere involucrar a todos los estudiantes en la clase. '),
(329, '13567342', '12826448', '2023-10-12', '14:55:00', '15:40:00', 28, 36, 1.76, NULL, 7, 'Durante el desarrollo del plenario se observa una atención e interés por parte de los estudiantes, logrando su participación y reflexión con respecto al tema. Se sugiere que, para lograr un mejor clima de aprendizaje desde el inicio de la clase, expresar los que se espera de los estudiantes y que guarden teléfono y audífonos. '),
(330, '12226961', '17456104', '2023-11-23', '10:10:06', '11:33:00', 29, 34, 1.96, NULL, 7, 'Profesional docente con desarrollo y proyección. Se orienta a la mejora permanente comprendiendo la enseñanza como una acción continua y desafiante con foco en los aprendizajes de los estudiantes.  Planteamos en entrevista la importancia de inclusión educativa como un  desafío a diseñar desde la planificación de aula. \r\nSe felicita a profesora y se anima a seguir aportando en el desarrollo de mentorías pares con los colegas. '),
(331, '12226961', '15898402', '2023-11-23', '08:17:00', '09:43:00', 27, 29, 2, NULL, 7, 'Profesional docente con desarrollo y proyección. Se orienta a la mejora permanente comprendiendo la enseñanza como una acción continua y desafiante con foco en los aprendizajes de los estudiantes.  Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe felicita a profesora y se anima a seguir aportando en el desarrollo de mentorías pares con los colegas. '),
(333, '12226961', '18161466', '2023-11-24', '08:35:00', '09:43:00', 22, 34, 1.84, NULL, 7, 'Profesional docente con desarrollo y proyección. Planteamos en entrevista la importancia de inclusión educativa como un  desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. \r\nBuen clima de retroalimentación docente. '),
(334, '12226961', '19016511', '2023-11-28', '10:15:00', '11:35:00', 19, 29, 1.63, NULL, 7, 'Profesional docente con proyección. Planteamos en entrevista la importancia de inclusión educativa como un  desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes. Diferenciar los tiempos de instrucciones y de aplicación. Eliminar pausas de silencio al dar instrucciones.  Además, el uso de manejo de técnica de voz. \r\nBuen clima de retroalimentación docente. '),
(335, '12226961', '17231028', '2023-11-28', '12:01:00', '13:30:00', 26, 3, 1.68, NULL, 7, 'Profesional docente con proyección. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada, en busca de un ritmo de clase más activo. \r\nBuen clima de retroalimentación docente. '),
(336, '12226961', '20310888', '2023-11-29', '08:35:00', '09:40:00', 19, 34, 1.73, NULL, 7, 'Profesional docente con proyección. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Planteamos la mejora del primer semestre y el avance del manejo de aula. Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal.  \r\nBuen clima de retroalimentación docente. '),
(337, '12226961', '10521666', '2023-11-29', '10:10:00', '11:35:00', 26, 22, 1.92, NULL, 7, 'Profesional docente desarrollado y con proyección. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. Si bien, la enseñanza es efectiva y muy motivadora, no todos los estudiantes son capaces de estar al ritmo de la clase. Diversificar las estrategias para verificar comprensión.  \r\nBuen clima de retroalimentación docente. '),
(338, '12226961', '17816380', '2023-12-07', '10:00:00', '11:35:00', 20, 14, 0.6, NULL, 7, 'Profesional docente en formación. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Planteamos la posibilidad de incorporar nuevas metodologías activas que movilicen la atención. Muchos estudiantes distraídos.  Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal. Se aclara que fue visible que 40 minutos antes del cierre de clase , no hubo actividad para trabajar. \r\nBuen clima de retroalimentación docente y aceptación de sugerencias.'),
(339, '12226961', '17541556', '2023-05-23', '10:15:00', '11:33:00', 20, 23, 1.08, NULL, 7, 'Profesional docente con licencia médica reiteradas en el año. Se registra de bitácora su desempeño en espera de retroalimentación. '),
(340, '12226961', '9433399', '2023-05-24', '10:13:00', '11:30:00', 19, 1, 1.54, NULL, 7, 'Profesional docente desarrollado. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal. Se utiliza bitácora del primer semestre de toda la clase observada. \r\nBuen clima de retroalimentación docente. '),
(341, '12226961', '12268200', '2023-11-21', '15:00:00', '16:25:00', 24, 29, 0.52, NULL, 7, 'Profesional docente en desarrollo. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. Falta acoger la diversidad. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Planteamos la mejora del primer semestre, aún se mantienen dificultades de manejo de aula. Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal. Se insta a revisar metodologías activas en contextos desafiantes. Se aclara que el aporte de su especialidad en taller de teatro es visible, falta desarrollo de trabajo de aula para motivar a los estudiantes y logro de compromiso para el aprendizaje. \r\nBuen clima de retroalimentación docente y acogida a las sugerencias.'),
(342, '12226961', '18448695', '2023-05-24', '12:40:07', '14:10:07', 30, 15, 1.31, NULL, 7, 'Profesional docente con proyección. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Planteamos la mejora del primer semestre y el avance del manejo de aula. Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal.  \r\nBuen clima de retroalimentación docente y acogida de sugerencias. '),
(343, '12226961', '18760349', '2023-11-27', '08:15:00', '09:40:00', 26, 34, 1.58, NULL, 7, 'Profesional docente con proyección. Planteamos en entrevista la importancia de inclusión educativa como un desafío a diseñar desde la planificación de aula. \r\nSe plantea inquietud sobre una mayor participación consciente de los estudiantes, más allá de la didáctica empleada. Planteamos la mejora del primer semestre y el avance del manejo de aula. Se orienta sobre dar tiempos claros asignados de instrucciones y de ejecución de la tarea. Tiempos de preguntas y tiempos de trabajo grupal. Incorprar nuevos recursos de silencio que active positivamente la atención de los estudiantes.  \r\nBuen clima de retroalimentación docente y aceptación de sugerencias.'),
(344, '12226961', '11224199', '2023-06-01', '14:40:00', '15:40:00', 19, 42, 1.38, NULL, 6, 'Profesional docente desarrollado. Se usa bitácora de medio tiempo por las dificultades horarias y licencias médicas, se asigna tiempos horarios fijos para colaboraciones litúrgicas.\r\nSe espera retroalimentación. Visualiza mayor trabajo de pastoral.  '),
(345, '14273480', '18412060', '2023-11-28', '08:15:00', '09:00:00', 1, 23, 1.9, NULL, 3, 'Observaciones:\r\n- Docente genera un buen clima de aula, aplicando estrategias atingentes.\r\n- Se observa una clase preparada donde utiliza recursos auidovisuales, necesarios para el aprendizaje del idioma.\r\n- Se observa aprendizaje por parte de los estudiantes.\r\n- Realiza monitoreo de los estudiantes.\r\nAcuerdos:\r\n- Aplicar \"sin salida\", dando el nombre técnico con el fin de que los estudiantes reconozcan la estrategia.\r\n- Implementar estrategia de \"tiempo visible o asignado\".\r\n- Implementar rutinas de pensamiento.'),
(347, '12226961', '9141113', '2023-11-21', '11:56:00', '13:30:00', 27, 51, 1, NULL, 7, 'Profesional docente con dificultades metodológicas atribuibles a la falta de laboratorio de ciencias. Se establece comprensión conjunta del diseño de las prácticas y cómo abordar la inclusión educativa sin bajar las expectativas con los estudiantes. Se acoge disenso de la profesora en 3 aspectos a evaluar, corregidos y se aclara que la interpretación de estos puntos no es en base a prejuicios. Se invita a comprender la evaluación como una instancia de mejora profesional. Buen clima de diálogo y apertura de la retroalimentación.'),
(348, '18639869', '16404386', '2023-10-12', '10:27:28', '11:12:28', 18, 36, 1.89, NULL, 7, 'Se destaca el tono de voz y el uso de interacciones positivas. Pese a que los estudiantes se mostraron algo inquietos, el profesor logra mantenerlos motivados y atentos. \r\nProfesor reconoce y valora el trabajo y participaciÃ³n de sus estudiantes, los felicita constantemente.\r\nEl desafÃ­o es en torno al uso efectivo del tiempo ya que en ocasiones es complejo generar un cierre que evalÃºe lo aprendido por los estudiantes.'),
(349, '9089119', '19425852', '2023-10-20', '13:25:40', '14:00:40', 27, 22, 1.85, NULL, 3, 'Se observa una clase estructurada, en que equipos presentan la simulación de una corte de justicia con casos que han sido previamente analizados y preparados por los grupos, implementando así una metodología que favorece el aprendizaje y participación activa.\r\n\r\nEl docente refuerza positivamente motivando el trabajo en los grupos evaluando su desempeño y entregando retroalimentación que vincula con las materias previas abordadas.\r\n\r\nDocente se dirige a las estudiantes de manera respetuosa y se vincula positivamente con ellas\r\n\r\nSe observa un buen ambiente de trabajo y colaboración entre pares, con estudiantes participativas y respetuosas mientras los equipos se presentan, sin embargo hay estudiantes que no mantienen una escucha activa realizando otra actividad y otras que no prepararon su espacio para generar un ambiente propicio para el aprendizaje.\r\n\r\n\r\nSugerencias de trabajo \r\n\r\nPresentar objetivo de la clase y la habilidad o destreza a trabajar.\r\n\r\nAplicar estrategias de clima de aula al iniciar la clase.\r\n\r\n  Implementar dos rutinas o estrategias que permitan verificar la comprensión, como sin salida o 100%.\r\n'),
(350, '9089119', '19334195', '2023-11-27', '10:15:31', '11:05:31', 25, 34, 1.92, NULL, 3, 'Objetivo: Reforzar contenidos prueba de nivel\r\n\r\nComienza preparando clima de aula revisando los puestos y promoviendo el orden.\r\n\r\nEscribe temario en la pizarra, recordando conceptos previos.\r\n\r\nEl clima de aula es propicio para el aprendizaje, las estudiantes en general participan activamente pasando a la pizarra. Docente motiva la clase con factor alegría y se vincula de manera positiva con todas.\r\n\r\nUtiliza estrategia de gestión del tiempo y sin salida.\r\n\r\nRealiza preguntas claves y ejercicios en la pizarra promoviendo la participación, sin embargo al escribirlos en el cuaderno se torna más lento perdiendo en momentos el ritmo de la clase.\r\n\r\nSugerencias:\r\n\r\nPresentar el objetivo explicitando la habilidad, intencionándola como meta compartida con los estudiantes.\r\nUtilizar estrategias que desafíen a las estudiantes en su proceso de aprendizaje\r\nCuidar el uso de la voz ya que no era necesario subir el tono, puesto que la clase se realizó con un buen clima de aula.\r\n'),
(351, '13956828', '18412060', '2023-11-16', '12:00:00', '13:20:38', 11, 27, 1.92, NULL, 7, 'Buen material de apoyo audiovisual.\r\nSe observa estructura y planificación de la clase.\r\nPermite la participación activa de las niñas con retroalimentación constante.\r\n'),
(352, '13956828', '15648128', '2023-06-15', '10:32:10', '11:17:40', 17, 34, 1.7, NULL, 7, 'Profesora con \"Brain Storming\"\r\nDesarrolla ejercicios en la pizarra con las estudiantes, sin antes explicarlos. Los niños ubicados en grupo trabajan resolviendo ejercicios apoyándose entre ellos, pero sin explicación previa del paso a paso.\r\nEl cierre de la clase se desarrolla con el \"Qué aprendí\"'),
(353, '13956828', '15648128', '2023-05-18', '12:00:43', '13:24:43', 16, 34, 1.88, NULL, 7, 'Objetivo: Resolver Divisiones\r\nInicia clases con una lluvia de ideas acerca de las divisiones.\r\nSe observa una clase bien organizada.\r\nProfesora centrada en el estudiante y sus necesidades.\r\nParticipación activa de los niños en clases.\r\n\r\n'),
(354, '13956828', '15614452', '2023-08-23', '08:20:16', '09:40:17', 15, 34, 2, NULL, 7, 'Clase de perímetro y área.\r\nTrabajan con Laboratorio de computación móvil en Kahhoot matemático.\r\nClase interactiva, niñas participativas, aplican ensayo y error al comienzo.\r\nClase preparada y trabajada en aula  en conjunto con Educadora Diferencial.\r\n\r\n\r\n'),
(355, '18639869', '16161640', '2023-10-11', '11:55:30', '12:40:30', 1, 36, 1.4, NULL, 7, 'Profesor reconoce y valora el trabajo de sus estudiantes, el trato es cordial y los felicita constantemente. \r\nSe presenta como desafío la normalización de la clase, es decir, que el profesor dedique tiempo para que los estudiantes respeten y apliquen las normas de la clase, donde puedan recordar de manera concreta cuales son por ejemplo las 5N, los acuerdos del 5 básico B para una sana convivencia, entre otras estrategias que son necesarias de aplicar, incluso si se requiere hacer un \"PARE\" en el paso de contenidos, ya que si bien, existían algunos estudiantes motivados en participar, el clima de aula era ruidoso, desordenado e irrespetuoso, existiendo distintos focos de conversaciones paralelas, estudiantes jugando a otras cosas y deambulando sin permiso por la sala. \r\n'),
(356, '13956828', '10723960', '2023-08-20', '12:00:43', '13:20:44', 11, 15, 2, NULL, 7, 'Profesora trabaja en conjunto con Educadora Diferencial Unidad de folklor.\r\nLas niñas participan de la clase, sin embargo cuesta organizarlas en grupos por problemas en sus relaciones interpersonales.\r\nLa profesora logra sensibilizar el trabajo, motivarlas y organizarlas para avanzar en su trabajo.\r\n\r\n'),
(357, '18639869', '18447397', '2023-10-11', '13:25:32', '14:10:32', 15, 36, 1.72, NULL, 6, 'Profesora retoma los contenidos anteriores consultando a las estudiantes por una tarea de la clase anterior, y da espacio para que las niñas comenten sus respuestas, luego de esto escribe en la pizarra el \"hoy\" : \"factores de riesgo\", con esto ayuda a las estudiantes a entender cual será el objetivo de esta sesión. Luego antes de comenzar hace una pausa a los contenido y actividades, situación que se destaca, y ayuda a las estudiantes a darse cuenta el estado de la sala, del desorden y suciedad, dándoles unos minutos para remediarlo, luego solicita silencio y orden para continuar. \r\nSi bien la hora de la clase es compleja, es la ultima del día, después de almuerzo por lo que la disposición de algunas estudiantes no es la mejor, la profesora insiste en recordar hábitos y normas de convivencia, y refuerzas sus interacciones de manera positiva. '),
(358, '13956828', '16767380', '2023-08-09', '08:20:12', '09:40:12', 17, 22, 1.96, NULL, 7, 'La clase se desarrolla en un ambiente cordial y respetuoso.\r\nSe observa una clase con los 3 momentos definidos.\r\nLa motivación de las niñas debe trabajarse con variadas estrategias ya que se presentan no muy dispuestas a querer trabajar en clases.\r\n'),
(359, '13956828', '15648128', '2023-06-22', '10:10:49', '11:35:49', 17, 34, 1.85, NULL, 7, 'Profesora trabaja con las niñas organizadas en grupo dentro de la sala de clases.\r\nSe observa muchas inquietudes respecto del conocimiento previo a los ejercicios a realizar.\r\n\r\nSe sugiere a la profesora partir por los aprendizajes previos que las niñas necesitan para lograr el objetivo propuesto para la clase.\r\n'),
(360, '18639869', '13276799', '2023-09-28', '11:55:51', '12:40:52', 14, 36, 1.95, NULL, 7, 'Al iniciar la clase existe un inconveniente donde uno de los estudiantes presenta una desregulación emocional, frente a esto la Profesora para poder comenzar con la clase y tomar el curso, es que solicita ayuda al equipo de apoyo pertinente, pese a esto, no acude nadie a ala sala, por lo que me mantengo al cuidado y acompañamiento del estudiante, mientras realizo la observación.  Pese a las dificultades, se destaca la habilidad de la profesora de organizar la sala, donde se puede dar cuenta del alto conocimiento que tiene Claudia de las particularidades de cada uno de sus estudiantes y sus necesidades especificas, pudiendo \"adecuar\" cada momento de la clase a ellos, manteniéndose activa, motivando a los niños a participar, y ayudándolos a cumplir con las normas de la sala, logrando un ambiente apto para el aprendizaje de contenidos. '),
(361, '18639869', '12604321', '2023-10-01', '14:55:29', '15:40:29', 10, 36, 1.9, NULL, 7, 'Se destaca la capacidad de ir haciendo pausas durante la clase, cuando por ejemplo, estaban leyendo un cuento, el Profesor pausaba la historia e iba chequeando si los niños y niñas iban comprendiendo la historia, y si estaban atentos. Otro aspecto a destacar es el uso de \"la ruleta\", la cual tiene el nombre de todos los y la estudiantes y así se puede asignar, dar la palabra de manera aleatoria para que participen. Un aspecto a mejorar es el lenguaje o manera en que se entregan las instrucciones ya que muchos niños y niñas quedaron con dudas, pudiendo ser necesario ser más concretos, y dar más ejemplos, asegurándose de que todos comprendieran. '),
(362, '13956828', '15648128', '2023-08-08', '14:15:54', '15:35:54', 18, 34, 1.92, NULL, 7, 'El foco del acompañamiento de aula está centrado en cómo la profesora explica, responde y atiende las necesidades, inquietudes y dudas de los niños respecto al objetivo de aprendizaje, como también la dinámica de aula de la profesora con los estudiantes, respecto a los temas a conversar y cómo se relaciona con los estudiantes.\r\n\r\nSe observa que la intención de la profesora es que los estudiantes trabajen de manera autónoma, siendo una guía para los niños y un facilitador del aprendizaje, permitiéndoles que se desafíen para el lograr alcanzar el objetivo de aprendizaje.\r\n\r\nSe acuerda con la profesora que si bien, el camino que adopta en la clase es una buena estrategia, la clase debe comenzar modelando el cómo, el paso a paso y luego permitir a los niños que realicen las actividades por si solos, para posteriormente revisar en conjunto y retroalimentar.\r\n\r\n'),
(363, '13956828', '15176982', '2023-09-28', '08:20:55', '09:40:55', 18, 8, 2, NULL, 7, 'Trabajo en Laboratorio de Ciencias!\r\n\r\nProfesora trabaja Guía de laboratorio con los estudiantes de 6°B.\r\n\r\nSe ubican en sus mesas de trabajo y profesora entrega el material y la guía de trabajo, que fue previamente explicada en aula tradicional.\r\nEstudiantes motivados, ordenados, participativos y trabajadores durante el desarrollo del laboratorio.\r\n\r\nSe acuerda con la profesora que para un próximo laboratorio debe contar con alguna ficha de Comprensión relacionada al Objetivo del laboratorio, donde los estudiantes puedan desarrollar reflexión del trabajo realizado, de forma que trabajen la habilidad de análisis.\r\n\r\n'),
(364, '18639869', '17079039', '2023-10-10', '14:55:45', '15:40:45', 9, 36, 1.9, NULL, 7, 'Se destaca la creatividad y ganas que muestra la Profesora durante este segundo semestre para lograr que la sala de clases se torne un espacio seguro, agradable y con un  clima que les permita aprender nuevos contenidos a los niños y niñas, esto a través de diferentes herramientas y metodologías, reforzando técnicas aplicadas en intervenciones con el equipo de familia como la respiración consciente,  introduciendo la \"canción del silencio\" , espacios para agradecer y el uso de la imaginación. '),
(365, '14273480', '15616161', '2023-10-25', '08:15:00', '09:00:00', 8, 32, 2, NULL, 7, 'Acuerdos:\r\n- Ordenar 3 o 4 hechos significativos de la historia como estrategia de comprensión.\r\n- Aplicar estrategias en diferentes asignaturas.\r\n\r\nSe observa un excelente trabajo, aplicando estrategias MAE.'),
(367, '14273480', '18143931', '2023-10-25', '09:00:00', '09:45:00', 10, 32, 1.55, NULL, 7, 'Acuerdos:\r\n- Revisar disposición de la sala al momento de realizar la lectura en voz alta.\r\n- Utilizar accesorios motivadores.\r\n- Seleccionar el cuento con propósito más significativo, aplicando las estrategias que faltaron: aprendizjaes previos, predecir y inferir.\r\n- Secuenciar no más de 3 hechos.\r\n\r\nObservaciones:\r\n- Se observa un trabajo planificado.\r\n- Hay mejoramiento notorio, en relación al acompñamiento anterior.\r\n'),
(368, '18639869', '13195888', '2023-12-19', '13:37:00', '14:22:00', 13, 36, 1.65, NULL, 7, 'Se destaca la capacidad de crear y mantener un buen clima de aula, el cual permite que las niñas puedan atender y participar de la sesión con entusiasmo y alegría.  Se observa como desafío el poder explicar los conceptos claves de manera más concreta, y como sugerencia poder realizar dinámicas que permitan corroborar si las niñas comprendieron o no. '),
(369, '18639869', '19404149', '2023-10-13', '14:55:07', '15:40:07', 12, 36, 1.74, NULL, 7, 'Fortaleza:\r\n Hace una recapitulación al inicio y los niños recuerdan lo visto anteriormente.\r\nPunto de mejora:\r\n Se quedó solo en el trabajo en equipo. La profesora dice las conclusiones. Falto quizás una actividad\r\npara profundizar estas ideas.'),
(370, '18639869', '10004488', '2023-10-12', '13:25:05', '14:10:06', 11, 36, 2, NULL, 7, 'Profesora se toma el tiempo adecuado para normalizar las estudiantes, recordar 5N, y hábitos de aseo, logrando establecer un ambiente favorable para el aprendizaje. La relación entre la Profesora y las niñas es cálida, amable y respetuosa.\r\nSe evidencia un buen manejo de los contenidos y preparación de la clase.\r\n'),
(371, '18639869', '11842983', '2023-12-19', '14:13:32', '14:58:32', 17, 36, 2, NULL, 7, 'Profesora se preocupa por lograr un buen ambiente de clases, recordando normas, hábitos, monitoreando constantemente que las estudiantes estén atentas, dispuestas a escuchar activamente, a reflexionar y participar respetándose mutuamente. Se pudo dar cuenta de los grandes avances que han tenido las estudiantes en relación a los contenidos y estilos de clases PASOS, donde is bien no avanzaron con gran velocidad, si lo hicieron en profundidad, permitiendo que las niñas puedan generar reflexiones profundas y realizar preguntas interesantes que enriquecen la sesión.'),
(372, '18639869', '17479376', '2023-10-13', '10:35:19', '11:55:19', 8, 36, 1.35, NULL, 7, 'Fortalezas:\r\n Es acogedora y cercana con los niños.\r\n Felicita a los bien portados.\r\n Hace que participen todos llamándolos por su nombre\r\nDebilidad:\r\n No tenía la sala preparada hubo que mover las sillas. Los niños se desordenan bastante.\r\n Instrucciones poco claras\r\nSugerencias\r\n Organizar las actividades, apoyándose en el cronograma, para utilizar mejor el tiempo.'),
(373, '18639869', '26323365', '2023-10-12', '15:01:58', '15:46:58', 7, 36, 2, NULL, 7, 'Fortalezas:\r\n Muy buen manejo de curso.\r\n La profesora muy empatiza cuando un niño pide no hacer ruidos fuertes.\r\n Da muy bien las instrucciones y los niños la siguen.\r\n Trata a todos los niños por su nombre.\r\nSugerencias\r\n Lograr un cierre más sólido donde quede muy claro y reforzado el objetivo de la clase.'),
(374, '14273480', '12701348', '2024-03-19', '10:15:00', '11:00:00', 8, 15, 1.71, NULL, 1, 'Observaciones:\r\n- La observación se focaliza en el inicio de la clase.\r\n- Si bien informa los ejercicios a realizar y modela, no se observa presentación de objetivo.\r\n- El docente aplica estrategias de clima de aula.\r\n- Plantea instrucciones y las recuerda con los estudiantes.\r\n- Modela, incorporando a estudiante, los ejercicios a realizar.\r\n\r\nAcuerdos:\r\n- Incorporar tiempo asignado, por ejemplo, para prepararse para la clase y/o registro de asistencia.\r\n- Reforzar silencio, al momneto de bajar al patio, formando virtudes como el respeto. \r\n- Utilizar el recurso de las 5S, aprovechando que los estudiantes las manejan, para reforzar normas.\r\n- Antes de el desarrollo, informar el objetivo, de forma adecuada a los estudiantes y preguntar para verificar su comprensión.\r\n'),
(375, '14273480', '18412060', '2024-03-18', '08:15:23', '09:25:00', 7, 27, 1.55, NULL, 7, 'Observaciones:\r\n- Inicia la clase con activación, a través de uso de recursos audiovisuales y ejercicios que tributan al logro del objetivo.\r\n\r\nAcuerdos:\r\n- Trabajar objetivo de la clase, en los 3 momentos, verificando comprensión, a través del uso de estrategias de clima de aula, rutinas de pensamiento y 5S.\r\n- Realizar cierre de la clase, gestionando el tiempo y reforzando lo aprendido durante la clase.'),
(376, '13769322', '19404149', '2024-04-03', '08:15:15', '09:40:27', 14, 34, 1.77, NULL, 7, 'Realizar las planificaciones en LIRMI (poner su trabajo al día)\r\nDesarrollar un trabajo de Co-docencia con la educadora diferencial: se indica que se observará la próxima semana ya sea por la Coordinadora del PIE o del Ciclo.\r\n'),
(380, '13769322', '13276799', '2024-04-02', '08:15:53', '09:40:53', 13, 32, 1.76, NULL, 7, 'o	Verificar que los alumnos estén todos trabajando cuando se da una instrucción.\r\no	Desarrollar las planificaciones en Lirmi.\r\no	Trabajar con tiempo visible.\r\no	Reforzar el contenido de los pronombres personales. (coordinación creará los hacer ahora para la próxima semana)\r\n'),
(381, '13769322', '18447397', '2024-04-05', '08:15:57', '09:40:57', 12, 32, 1.32, NULL, 7, '•	Siempre este el respaldo del texto en el cuaderno y/o libro del estudiante.\r\n•	Trabajar desde lo básico en comprensión de lectura (estrategias)\r\n•	Respetar el tiempo visible – El Hoy sea más detallado (indicando texto y página)\r\n•	Dejar las planificaciones al día como plazo hasta el viernes 12 de Abril\r\n'),
(382, '13769322', '13268741', '2024-04-05', '14:10:22', '15:40:22', 16, 42, 1.38, NULL, 7, '•	Escribir en la planificación de LIRMI lo que realmente trabajará en clases\r\n•	Leer y aplicar el manual de autoprendizaje de Ligia.\r\n'),
(383, '17335579', '18161807', '2024-04-09', '08:15:00', '08:22:24', 12, 32, 1.41, NULL, 7, 'Sugerencias: \r\nCorroborar siempre la comprensiÃ³n de las instrucciones antes de dar inicio a las actividades.\r\nColaborar en la creaciÃ³n de un clima de aula propicio al inicio de la clase (encuadre, normas)\r\n-Hacer ahora nÂ°5: Si el objetivo es que los y las estudiantes puedan seguir instrucciones e inferir informaciÃ³n, sugiero permitir primero la ejecuciÃ³n de la actividad y luego dar retroalimentaciÃ³n (no otorgar la respuesta antes de que los estudiantes trabajen). \r\n-Idea principal e ideas secundarias: utilizar ejemplos podrÃ­a resultar un buen andamiaje (utilizar un pequeÃ±o fragmento con pistas de cÃ³mo identificar estas ideas. En niÃ±os y niÃ±as de tercero bÃ¡sico, resulta eficiente que ellos puedan contar con material concreto, guÃ­as, ilustraciones, colores, otros)\r\n- Clase lineal. Utilizar material de trabajo concreto podrÃ­a ayudar a generar una clase mÃ¡s dinÃ¡mica, desafiante, colaborativa y con ello motivar y estimular el interÃ©s de los estudiantes.  Recordar que la curva de atenciÃ³n no permite a estudiantes de tercero bÃ¡sico perseverar en actividades extensas que requieran de esfuerzo cognitivo sostenido. \r\n- PodrÃ­a ser un buen recurso implementar ticket de salida (Fragmento donde los estudiantes deban destacar idea principal o secundarias, para luego pegarlo en su cuaderno). De esta manera, utilizar esto como evaluaciÃ³n formativa, asegurar un buen cierre de la clase y estimular el repaso del contenido. \r\n\r\nDestaca: \r\nDocente PIE evidencia buen vÃ­nculo con el curso, denota buenas habilidades para resolver situaciones atingentes relacionadas con dificultades conductuales o desregulaciones. \r\nSe observa un buen vÃ­nculo profesional entre los docentes. Denotan habilidad para el trabajo colaborativo, se les observa cÃ³modos compartiendo el rol en el aula. \r\n'),
(384, '13769322', '16404386', '2024-04-03', '11:55:55', '12:40:55', 16, 43, 1.92, NULL, 7, 'Verificar el cumplimiento de las normas al ingreso a sala.'),
(385, '7060271', '15086447', '2024-04-09', '10:05:00', '11:35:00', 4, 38, 1.92, NULL, 7, 'Clase organizada y participativa, los estudiantes están dispuestos y ordenados durante la clase, se observa una rutina ya conocida por los estudiantes. \r\nAcuerdos: Después de ocupar el pase de salida tratar de volver a solicitar su participación para asegurar su comprensión del contenido o al finalizar la clase, solicitar que expliquen a los compañeros las tarjetas de atributos matemáticos.\r\nClase: Atributos con figuras geométricas, clase grupal y participativa. Trabajo en el libro del estudiante. Instrucciones claras, asegurando la comprensión de estas. '),
(386, '13769322', '11879515', '2024-04-04', '08:15:14', '09:40:14', 1, 22, 1.08, NULL, 7, 'En la planificación de Lirmi dejar escrito los 3 momentos de la clase en la descripción.\r\nLeer y aplicar el Manual de Ligia que está en classroom.\r\n'),
(387, '13769322', '79569488', '2024-04-09', '14:10:00', '15:40:00', 16, 34, 1.42, NULL, 7, '•	Aplicar guías (como prueba con nota acumulativa reforzando contenidos)\r\n•	Trabajar con el texto escolar como apoyo a los estudiantes que ya finalizaron las actividades.\r\n'),
(388, '13769322', '13195888', '2024-04-09', '10:05:00', '11:35:00', 18, 32, 2, NULL, 7, 'Se felicita a la docente por el trabajo realizado en clases.'),
(389, '9089119', '19425852', '2024-04-05', '10:10:05', '11:15:05', 26, 22, 1.84, NULL, 3, 'Objetivo de la clase: Analizar las causas de la segunda guerra mundial.\r\n\r\nSe comienza preparando el clima de aula, invitando a los estudiantes al silencio y a guardar los celulares, falta verificar si todos siguen la instrucción.\r\n\r\nEl docente presenta el objetivo y la habilidad a desarrollar. Recuerda conceptos previos relacionados al tema despertando el interés de los estudiantes.\r\n\r\nEstudiantes participan activamente en el desarrollo de la clase y el profesor realiza estrategia sin salida (sugerencia realizada en acompañamiento anterior)\r\n\r\nEl docente se vincula positivamente y con factor alegría. Considera todas las opiniones, promoviendo el aprendizaje, sin embargo, falta verificar la comprensión de algunos estudiantes.\r\n\r\nSe termina con un trabajo practico, con indicaciones claras de su desarrollo, los estudiantes lo realizan con entusiasmo.\r\n\r\nAl finalizar el acompañamiento se felicita al curso por el buen clima de aula y la participación.\r\n\r\nSugerencias de trabajo:\r\n\r\nAplicar estrategia en sus marcas de clima de aula al iniciar la clase.\r\n\r\n Seguir implementando rutina o estrategia que permita verificar la comprensión de todos los estudiantes, como sin salida o 100%.\r\n\r\n Implementar ruta de trabajo que oriente a los estudiantes y gestione el tiempo de la clase.\r\n\r\n Se reconoce al docente por desarrollar sugerencia de acompañamiento anterior realizado por directora sobre evitar preguntas retóricas y mejorar clima de aula.\r\n\r\n\r\n  \r\n\r\n\r\n'),
(390, '9089119', '17223013', '2024-04-11', '08:10:48', '09:10:48', 28, 18, 1.79, NULL, 3, 'Docente inicia la clase preparando el clima de aula a través del orden de puestos y materiales a utilizar.\r\n\r\nSe continua con trabajo interdisciplinario (ABP) “entrevista con el extranjero” realizado entre filosofía con el tema: dialogo filosófico y lenguaje con plan lector “El extranjero”\r\n\r\nNo se presenta el objetivo de la clase\r\n\r\nEntrega instrucciones sobre el trabajo a realizar, falta tiempo consensuado\r\n\r\nDocente se vincula positivamente y realiza revisión a cada pareja de trabajo, generando reflexión de parte de los estudiantes.\r\n\r\nSe observa una clase estructurada con material adecuado\r\n\r\nSugerencias:      \r\n\r\nPresentar el objetivo de la clase y su habilidad, aunque sea continuidad de la anterior y consensuar los tiempos destinados al trabajo.\r\n\r\nVerificar que todos los estudiantes estén adheridos al trabajo.\r\n\r\nUso de la voz, cuidar el volumen ya que por el clima generado no es necesario.\r\n'),
(391, '9089119', '15192979', '2024-04-02', '14:55:30', '16:25:30', 25, 3, 1.92, NULL, 7, 'Objetivo de la clase: “Niveles de organización de la materia viva”\r\n\r\nDocente inicia con estrategia en sus marcas preparando el clima de aula para desarrollar la clase.\r\n\r\nEntrega instrucciones claras sobre el trabajo a realizar en parejas y presenta pauta de evaluación, reforzando algunos conocimientos previos.\r\n\r\nRegistra en la pizarra momentos de la clase, falta consensuar el tiempo \r\n\r\nSe vincula positivamente con las estudiantes, con factor alegría.\r\n\r\nVerifica la comprensión realizando preguntas claves y supervisando el trabajo que se está desarrollando, aun así, se observan algunas estudiantes que se adhieren al trabajo tardíamente.\r\n\r\nEl cierre de la clase se realiza de manera muy breve, con la revisión de los trabajos \r\n\r\nAl terminar la docente motiva positivamente el realizar la oración de despedida.\r\n\r\nSugerencias.\r\n\r\nAnte trabajos prácticos presentar ruta de trabajo de la clase con tiempo visible y consensuado de manera de generar un trabajo sincronizado de parte de los estudiantes.\r\n'),
(392, '9089119', '15176982', '2024-04-05', '08:45:02', '09:25:02', 19, 8, 2, NULL, 3, 'Objetivo de la clase: “Aplicar los conceptos de clasificación de la materia”\r\n\r\nDocente inicia con estrategia en sus marcas preparando el clima de aula para desarrollar la clase.\r\n\r\nPresenta el objetivo explicitando la habilidad a desarrollar\r\n\r\nRefuerza conceptos claves realizando repaso de contenido, verifica la comprensión aplicando estrategia 100% y sin salida\r\n\r\nEntrega instrucciones claras sobre el trabajo a realizar a través de una guía de aplicación para la que entrega tiempo consensuado\r\n\r\nSe vincula positivamente con las estudiantes, con factor alegría y las motiva con estrategia de competencia de logros por fila.\r\n\r\nVerifica la comprensión realizando preguntas claves y supervisando el trabajo que se está desarrollando, aun así, se observan algunas estudiantes que se adhieren al trabajo tardíamente.\r\n \r\nSugerencias:\r\n\r\nImplementar estrategia para poder verificar la comprensión de las estudiantes más descendidas.\r\n\r\nSeguir aplicando estrategia de motivación a la participación y diversificarla con nuevas propuestas, para no perder el interés de los estudiantes.\r\n\r\n'),
(398, '11537827', '13625118', '2024-03-22', '11:55:11', '12:55:11', 14, 34, 1.96, NULL, 7, 'Supervision alumnos que se encuentran en los últimos puestos\r\nFelicitaciones por estrategias trabajadas y buen clima de aula'),
(399, '11537827', '18813869', '2024-04-02', '11:56:20', '12:56:20', 11, 34, 1.85, NULL, 7, 'Especificar la habilidad\r\nVerificar la comprensión de todos los estudiantes\r\nEvitar distractores (hoja plastificada), es una buena estrategia, pero en la actividad produjo que los estudiantes no comprendieran su utilidad\r\nBuen clima de aula\r\nTrabajo de co docencia organizado y participativo'),
(400, '11537827', '10042509', '2024-04-05', '09:09:33', '10:09:33', 30, 7, 2, NULL, 7, 'Se recomienda realizar glosario\r\nRecordar las instrucciones\r\nFelicitaciones por su clase'),
(401, '13769322', '20326728', '2024-04-04', '10:05:00', '11:35:00', 18, 22, 1.17, NULL, 7, '•	En la planificación de Lirmi dejar escrito los 3 momentos de la clase en la descripción.\r\n•	Leer y aplicar el manual de autoprendizaje de Ligia.\r\n'),
(402, '9089119', '19334195', '2024-04-02', '10:10:44', '10:55:44', 27, 39, 1.83, NULL, 3, 'Objetivo:” Resolución de problemas sobre medidas de tendencia central y análisis de datos”\r\n\r\nSe comienza con la retroalimentación de guía realizada en clase anterior dando la oportunidad de reforzar contenidos y resolver dudas.\r\n\r\nLos estudiantes se muestran muy participativos pasando a la pizarra, sin embargo, hay estudiantes que no se adhieren inmediatamente al trabajo.\r\n\r\nVerifica la comprensión a través de los ejercicios realizados, pero no se consigue un trabajo sincrónico lo que no permite verificar la comprensión de todos.\r\n\r\nDocente se vincula positivamente y promueve la motivación por la asignatura.\r\n\r\nResponde de manera clara y precisa a las consultas realizadas.\r\n\r\nSugerencias:\r\n\r\nPresentar el objetivo explicitando la habilidad, intencionándola como meta compartida con los estudiantes\r\n\r\nComenzar la clase utilizando estrategias de clima de aula como en sus marcas y monitorear el respeto a las normas.\r\n\r\n'),
(403, '9089119', '12978138', '2024-04-09', '14:55:30', '15:40:30', 21, 42, 1.69, NULL, 7, 'Objetivo de la clase: Conocer las celebraciones del año litúrgico, con sus etapas, significado y colores\r\n\r\nSe prepara el clima de aula con limpieza de la sala y ubicación de las estudiantes.\r\n\r\nPresenta y motiva con conceptos claves y previos al trabajo a realizar que consiste en la construcción de un calendario litúrgico que les permite recordar los momentos, significados y colores \r\n\r\nRefuerza contenido clase anterior como base del trabajo practico a realizar.\r\n\r\nDocente se vincula positivamente, con factor alegría, motivando la participación y el trabajo de las estudiantes, manteniendo un buen clima de aula\r\n\r\nFalta tiempo para realizar cierre de la clase\r\n\r\n Sugerencias:\r\n\r\nImplementar estrategia de tiempo consensuado en este tipo de trabajo.\r\n\r\nPotenciar el desarrollo de la clase con una ruta de trabajo, intencionándola como meta compartida. \r\n\r\nEvitar preguntas retóricas y verificar la comprensión de todas las estudiantes\r\n\r\nProcurar dejar el espacio para el cierre de la clase\r\n'),
(404, '9089119', '20255628', '2024-04-09', '10:10:45', '10:55:45', 21, 34, 1.95, NULL, 3, 'Docente presenta objetivo: “Transformar números decimales a fracción y viceversa”\r\n\r\nSe comienza reforzando a través de la retroalimentación de guía realizada en clase anterior, las estudiantes resuelven de manera participativa, realiza preguntas dirigidas y monitoreo individual por los puestos de trabajo, pudiendo de esta manera verificar la comprensión de los estudiantes\r\n\r\nSe observa una clase estructurada con material adecuado y la docente se vincula positivamente, manteniendo un buen clima de aula propicio para el aprendizaje.\r\n\r\nEn el segundo momento de la clase la docente realiza presentación con ejemplos del contenido.\r\n\r\nEsta clase se realiza en biblioteca por ser de agrupaciones flexibles, con participación de profesora Yorsi, quién tiene una participación activa.\r\n\r\nSugerencias:\r\n\r\nImplementar estrategias como sin salida y 100%, para asegurar la comprensión de todos y en sus marcas al inicio de la clase.\r\nPromover la participación con estrategia activa.\r\nSe entregan indicaciones sobre estas estrategias por ser docente nueva.\r\n'),
(407, '17335579', '19756902', '2024-04-17', '08:15:00', '08:41:58', 9, 32, 1.36, NULL, 7, 'Profesora de asignatura lidera permanentemente el desarrollo de la clase.\r\nDocente PIE supervisa a los estudiantes en sus puestos de trabajo, colaborando con el orden, la comprensión de instrucciones, motivando el trabajo y orientando las actividades.\r\nNo se advierte con claridad una planificación conjunta.\r\nSe sugiere utilizar material concreto o recursos audiovisuales para las intervenciones. (Preguntas de comprensión lectora).\r\n\r\nSugerencias:\r\n- Docente PIE debe intervenir en la planificación de la docente de asignatura, con el objetivo de lograr una clase diversificada.\r\nSe espera observar una dinámica colaborativa entre docentes en el aula. Cualquier duda referente a las actividades que se realizarán en sala debe ser resulta en reunión de planificación.');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(408, '9089119', '19521434', '2024-04-04', '10:10:48', '11:00:48', 29, 28, 1.91, NULL, 3, 'Objetivo de la clase: “Conocer los tipos de preguntas y las diversas estrategias de comprensión lectora”\r\n\r\nDocente inicia presentando el objetivo y promueve un clima de aula que resguarda durante todo el desarrollo de la clase, creando un ambiente propicio para el aprendizaje.\r\n\r\nEstudiantes participativos e interesados en las actividades desarrolladas.\r\n\r\nSe observa una clase planificada con material adecuado, trabajan sincrónicamente y se retroalimenta formativamente en todos los momentos, con oportunidad de emitir opiniones en un contexto de respeto ante las reflexiones propias de la clase. \r\n\r\nSe observa estrategia metodológica adecuada al tipo de asignatura promoviendo la escritura y reflexión.\r\n\r\nSugerencias:\r\n\r\n       Al presentar el objetivo explicitar la habilidad que orientará el desarrollo de la clase, intencionándolo como meta compartida con los estudiantes.\r\n\r\n      Verificar la comprensión de todos a través de estrategias como sin salida o 100%.\r\n\r\n'),
(409, '13769322', '13276799', '2024-04-16', '10:05:00', '11:35:00', 14, 32, 1.63, NULL, 7, 'Dejar al día LIRMI en cuanto a las planificaciones a más tardar el día miércoles 24 de Abirl.\r\nLas instrucciones al curso se deben entregar en silencio (respetar normas)\r\n'),
(410, '13769322', '16161640', '2024-04-16', '11:55:00', '13:25:00', 16, 8, 1.88, NULL, 7, 'Buscar una estrategia de disciplina durante los trabajos en clase.\r\nRealizar el cierre de la clase en forma general.\r\n'),
(411, '13769322', '18447397', '2024-04-17', '10:05:00', '11:35:00', 12, 32, 1.81, NULL, 7, 'Realizar un cierre más centrado en cumplir el objetivo de la clase\r\nRealiza las planificaciones en LIRMI – completar pendientes incluyendo los últimos días del mes de abril – a más tardar el jueves 25 de abril.\r\nPIE: Tener el material concreto para los alumnos en las diferentes clases.\r\n'),
(412, '7060271', '12604321', '2024-04-11', '10:05:05', '11:35:00', 8, 32, 1.74, NULL, 7, 'Se sugiere realizar pausas activas, Curso inquieto hay que realizar cambio de actividades para lograr la atención de los estudiantes. se realiza una buena rutina de la clase. Instrucciones claras, se asegura que todos entiendan la instrucción.\r\nSe sugiere verbalizar las estrategias de clima de aula, Se utiliza: Pase de salida, en sus marcas. \r\nEn la clase está presente Francisca González. Interrumpe la clase con una observación que no tiene que ver con el contenido. Reforzar trabajo con Ed diferencial.'),
(413, '7060271', '17816865', '2024-04-11', '09:00:00', '09:45:00', 6, 32, 1.96, NULL, 7, 'Presenta una excelente estrategia en la manera de realizar el círculo para la hora del cuento. Uso de estrategias de clima de aula.  Reforzar levantar la mano. Instrucciones claras, se asegura que los estudiantes hayan entendido la instrucción. Uso del pase de salida, se sugiere verificar el aprendizaje del contenido a la estudiante que lo requirió (Florencia)\r\nSe usa diferentes estrategias durante la clase. En sus marcas- Tiempo consensuado - Pase de salida. En sus marcas.\r\nSe sugiere reforzar el tomar la silla correctamente.'),
(414, '7060271', '26323365', '2024-04-16', '08:15:00', '09:40:00', 9, 34, 2, NULL, 7, 'Clase dinámica, estudiantes participativos, atentos y concentrados. Se aplica pausa activa en diferentes momentos de la clase. Se realiza trabajo con material concreto, pictórico y simbólico. Buena realización de clase. Trabajo organizado. Sala de clases ordenada y dispuesta. Felicitaciones.'),
(415, '7060271', '15086541', '2024-04-17', '08:15:00', '09:00:00', 5, 32, 1.93, NULL, 7, 'Clase dinámica, lúdica, estudiantes participativos. Rutina de calendario. Durante la rutina los niños/as saben lo que hay que hacer. Niños inquietos, se sugiere no dar permiso para el baño en ese momento ni para tomar agua. Excelente organización de la sala . Muy buen trabajo de diálogo con la asistente. Se observa material preparado y listo. Sala limpia y ordenada. Se sugiere aplicar estrategias de refuerzo positivo en el momento de la alfombra.'),
(416, '7060271', '17079039', '2024-04-18', '08:15:00', '09:30:00', 10, 32, 1.73, NULL, 7, 'Buen ambiente aprendizaje, magnífico logro en poco tiempo. Se observa curso organizado y dispuesto para el aprendizaje. Buena intervención de material de la educadora diferencial. Excelente participación de la asistente de aula, se nota un trabajo consensuado y organizado previamente. Trabajo en texto escolar. \r\nSe sugiere trabajar el objetivo de la clase y estrategias de clima de aula. \r\nRevisar uso de paneles. Panel de vocabulario - Panel de palabras de uso frecuente.\r\nMomento del calendario sugiero  uso del tablero del 100. '),
(417, '7060271', '16509065', '2024-04-09', '10:05:00', '10:50:00', 4, 34, 1.89, NULL, 7, 'Buen acompañamiento en aula, se preocupa de la atención y concentración de los estudiantes. Se sugiere mayor participación e intervención en la clase previa conversación con la educadora.\r\nVerificar foco de atención de la clase a niños que se distraen'),
(419, '7060271', '12605223', '2024-04-11', '09:00:00', '09:45:00', 6, 32, 2, NULL, 7, 'Trabajo colaborativo que demuestra conocimiento de la clase, hay participación activa y diálogo constante con la educadora. Excelente ambiente aprendizaje. Sala ordenada, organizada y limpia. Materiales listos para el desarrollo de la clase. Felicitaciones'),
(420, '7060271', '12958246', '2024-04-16', '08:15:00', '09:30:00', 9, 34, 1.79, NULL, 7, 'Excelente ambiente para el aprendizaje, sala limpia, ordenada. Paredes con material educativo. Incentivo de asistencia.  Se realiza un trabajo matemático con bolsas ziploc con mucha dedicación para la preparación del material. \r\nSe sugiere mayor intervención en el desarrollo de la clase. Generara diálogos conversados previamente con la profesora. '),
(421, '7060271', '15408841', '2024-04-11', '10:05:00', '11:35:00', 8, 32, 1.76, NULL, 7, 'Durante la observación la asistente no se encuentra en óptimas condiciones de salud. Sugiero buscar estrategias para que los niños comiencen a autorregularse, muchos niños distraídos con pocas intenciones de poner atención. Sugiero conversar con el profesor jefe para implementar estrategias de autorregulación a través de refuerzos positivos'),
(422, '7060271', '15713713', '2024-04-17', '08:15:00', '09:00:00', 5, 32, 1.89, NULL, 7, 'Excelente disposición durante la clase, intervención constante como apoyo de la profesora, se establecen diálogos espontáneos que enriquecen la dinámica de la clase. Se sugiere establecer estrategias que regulen la ida al baño y a tomar agua durante el proceso de la clase'),
(423, '7060271', '12604359', '2024-04-18', '08:15:00', '09:30:00', 10, 32, 2, NULL, 7, 'Excelente intervención con pausas activas en el inicio de la clase que se encontraba sin internet en el momento del inicio de la observación. Colabora con la participación y concentración de los estudiantes, se nota un diálogo constante con la profesora que favorece el aprendizaje. La sala cuenta con mural de asignaturas y panel de vocabulario y panel de palabras frecuentes (sin uso)\r\nRecordar mencionar incentivo de asistencia diariamente.\r\nModelar uso de confort para sonarse y para llevar al baño. ( una niñita sacó por lo menos dos metros de papel para ir al baño)'),
(424, '13769322', '13268741', '2024-04-18', '11:55:00', '14:10:00', 13, 42, 1.33, NULL, 7, 'Observar clase de una docente de Lenguaje'),
(425, '13567342', '11946370', '2024-04-18', '08:30:00', '09:40:00', 19, 22, 1.83, NULL, 6, 'Profesor muestra buen manejo de grupo, propicia un ambiente de escucha y respeto de los alumnos tanto hacia el profesor como hacia los compañeros que están hablando.\r\nEn general el curso presenta un buen comportamiento.  Todas las estudiantes tienen su cuaderno sobre la mesa, y varias de ella se ponen de pie para mostrarle el cuestionario desarrollado al profesor.  Si bien unas pocas alumnas no cuentan con el libro en ese momento, profesor hace observación sobre este punto, advirtiendo que dicha falta de responsabilidad se registrará desde la próxima clase.\r\nSe destaca, la preocupación del profesor por hacer el contenido más cercano a las estudiantes. Explora conocimiento y experiencias previas, generando aprendizaje significativo en sus estudiantes.\r\nSe sugiere supervisar el espacio de trabajo de las estudiantes, solicitando ubicar mochilas en el lugar adecuado.  Junto a lo anterior, observar el cumplimiento del uniforme por parte de las estudiantes.\r\nSi bien en el curso hay una buena participación, existe un grupo de estudiantes que no lo hace.  '),
(426, '13567342', '19016511', '2024-04-18', '13:25:00', '14:10:00', 25, 29, 1.16, NULL, 7, 'Profesora evidencia una relación cercana y acogedora con las estudiantes, mostrando un trato cariñoso y respetuoso.\r\nRefuerza positivamente a las estudiantes que le muestran sus avances y las motiva a seguir esforzándose.\r\nSe sugiere:\r\n-	Utilizar rutinas que permitan asegurar la disposición a escuchar instrucciones y la comprensión de estas. \r\n-	Supervisar el espacio de trabajo de las estudiantes, disponer los materiales necesarios en la mesa, despejar aquello que no corresponde a la clase.\r\n-	Monitorear el trabajo de las estudiantes, comprobando el tener los materiales y que han destinado el tiempo a realizar la actividad asignada por la profesora. '),
(427, '13567342', '18161466', '2024-04-16', '08:50:00', '09:40:00', 20, 34, 1.6, NULL, 6, 'En general, el curso mantiene un buen comportamiento, aunque hay estudiantes que no avanzan al ritmo del profesor o que dedican su tiempo a otra cosa y se retrasan.  Un grupo importante de estudiantes se muestra interesados en realizar las actividades, queriendo responder constantemente las preguntas del profesor.\r\nProfesor se muestra cercano y respetuoso, lo que genera un ambiente de confianza para que los estudiantes puedan consultarle y participar.\r\n\r\nSe sugiere:\r\n-	Utilizar rutinas que permitan asegurar la disposición a escuchar instrucciones y la comprensión de estas. \r\n-	Monitorear el trabajo de todos los estudiantes, comprobando que han destinado el tiempo a realizar la actividad asignada por el profesor. \r\n-	Procurar que los estudiantes respeten turno a la hora de responder preguntas, con el fin de permitir a todos poder participar.'),
(430, '13567342', '12268200', '2024-04-09', '08:46:00', '09:40:00', 26, 29, 1.56, NULL, 6, 'El curso se muestra atento en gran parte de la clase, particularmente con los videos.  Participan y una parte importante trabaja muy bien.\r\nProfesor muestra manejo conceptual y un trato respetuoso con los estudiantes.  La clase es interesante y el material motiva el trabajo.\r\n\r\nSe sugiere:\r\n-	Utilizar rutinas que permitan asegurar la disposición a escuchar instrucciones y la comprensión de estas. Asegurar el silencio y atención antes de dar indicaciones.\r\n-	Monitorear el trabajo de todos los estudiantes, particularmente el grupo más disruptivo. \r\n-	Procurar que los estudiantes respeten turno a la hora de responder preguntas, con el fin de permitir a todos poder participar. Exigir silencio.'),
(432, '13769322', '14003208', '2024-04-22', '08:15:00', '09:40:00', 14, 34, 0.95, NULL, 7, 'Se observa clase y se solicita un trabajo de Co-docencia con la educadora diferencial; se indica que se observará clase en la próxima semana ya sea por la Coordinadora del PIE o del Ciclo.'),
(433, '13769322', '18161807', '2024-04-17', '10:05:00', '11:35:00', 12, 32, 1.77, NULL, 7, 'Preparar el material concreto para los alumnos que pertenecen al Programa en las diferentes clases.'),
(434, '13769322', '17455726', '2024-04-22', '11:55:00', '13:25:00', 15, 27, 1.75, NULL, 7, '•	Monitorear al trabajo en la clase (fichas pegadas, contenidos escritos) verificando por los puestos\r\n•	Mantener el orden durante todos los momentos de la clase.\r\n'),
(435, '14273480', '18404503', '2024-04-11', '10:15:00', '11:25:00', 7, 1, 1.83, NULL, 7, 'Observaciones:\r\n- Clase organizada, con uso de recursos audiovisuales y preparación de material lúdico y atractivo.\r\n- Genera un buen ambiente para el aprendizaje, con refuerzos positivos y constante, en relación al objetivo.\r\n- Los estudiantes participan y realizan trabajo en tiempo esperado.\r\n- Se preocupa de orden y limpieza de la sala, lo cual es una meta en común de los diferentes equipos.\r\n\r\nAcuerdos:\r\n- Implementar sin salida y hacer ahora de forma efectiva.\r\n- Al momento de monitorear, retroalimentar a os estudiantes considerando el objetivo que quieres lograr. Para ello, es necesario realizar un trabajo en conjunto con asistente, por la cantidad de estudiantes. \r\n- En el cierre se sugiere profundizar más, abordando el objetivo en sí y recordando los tipos de líneas con las que trabajaron.\r\n- Para procurar la participación de todos los estudiantes, se sugiere utilizar pizarras donde ellos puedan ir dibujando y/o respondiendo.\r\n'),
(436, '14273480', '13310869', '2024-04-09', '08:15:00', '09:34:00', 7, 35, 1.64, NULL, 7, 'Observaciones:\r\n- Realiza refuerzo positivo y desafíos con altas expectativas.\r\n- Se observa una clase organizada, donde los estudiantes participan y se observa adquisición de conocimiento.\r\n- Promueve comprensión lectora, a partir de la canción presentada y escritura de figuras musicales. Sugiero que, al momento de solicitar escribir o copiar del pizarrón, dar una meta , por ejemplo: escribir 1 ejercicio o 2 según el curso y dejar abierto a que el que pueda escribir los 4 será maravilloso pero también procuramos que los mas descendidos en esto tengan al tarea de por lo menos escribir 1 pero bien.\r\n\r\nAcuerdos:\r\n- Cierre: realizar preguntas más específicas y concretas con el fin de verificar comprensión del objetivo.\r\n- Implementar tiempo visible.\r\n- Sin salida y 5s, utilizar con nombres de las mismas y durante la clase en general.\r\n- Mejorar implementación de 100% y para dar instrucciones y de esta forma cuidar el uso de voz, por su bienestar.'),
(437, '13769322', '20326728', '2024-04-23', '08:15:00', '09:40:00', 16, 22, 1.32, NULL, 7, 'Explicar la clase más pausada y con voz más baja.\r\nRespetar las indicaciones que se dan en el ppt (tiempo visible, en sus marcas, etc)\r\nMonitorear el trabajo de los alumnos (as)\r\n'),
(438, '11537827', '20255628', '2024-04-24', '08:20:51', '09:20:51', 20, 34, 1.54, NULL, 7, 'Buen manejo del clima de aula del curso, micrófono ayuda para exportar la voz \r\nBuen manejo conceptual y diciplinar \r\nSe realiza repaso de conocimientos previos de multiplicación de números enteros\r\nDebe mejorar \r\nDar tiempo consensuado para resolver ejercicios para mejorar el ritmo de la clase y evitar tiempos que generen desorden.\r\nUtilizar estrategias para generar la atención de todos los estudiantes. \r\nSe debe explicar el objetivo y la habilidad desarrollar. \r\n \r\n '),
(439, '13769322', '11845380', '2024-04-24', '10:05:00', '11:35:00', 15, 35, 2, NULL, 7, 'Se felicita al docente por la clase realizada.\r\n\r\n'),
(440, '13956828', '20156541', '2024-04-03', '10:10:04', '11:40:04', 16, 1, 2, NULL, 7, 'Se observa estructura de la clase.\r\nUn inicio con el foco en la habilidad y cómo la van a desarrollar.\r\nProfesora utiliza mucho el recurso juego dentro del desarrollo de la clase, lo que provoca que los niños pierdan un poco el foco de la clase. En base a este punto se desarrollan las sugerencias para las clases posteriores.\r\n\r\nSugerencia/Acuerdo:\r\nProfesora debe utilizar el recurso de juego, siempre y cuando todos los estudiantes estén trabajando de manera adecuada y atentos a la clase y una vez que aplicada la estrategia, retomar inmediatamente el hilo conductor de la clase.\r\n\r\nSe acuerdan algunas preguntas como ticket de salida para utilizarlos en el cierre de la clase.\r\n\r\n'),
(441, '13956828', '17647933', '2024-04-09', '08:15:15', '09:40:52', 17, 34, 1.93, NULL, 7, 'Se observa que las normas de clima y estrategias de aula son inconsistentes para el curso.\r\n\r\nPor lo anterior, se sugiere y acuerda con la profesora continuar las normas que se trabajaron el 2023 y escoger las 3 más efectivas, recibiendo retroalimentación de los colegas del año anterior, para que estas normas sean conocidas y las más trabajadas con el curso.'),
(442, '13956828', '16036651', '2024-04-25', '12:00:26', '13:00:26', 13, 32, 2, NULL, 7, 'Se observa una clase de Lenguaje en Biblioteca, donde la profesora en conjunto con la Ed. Diferencial (Claudia Lavanderos) y la encargada de CRA, realizaron una clase de Comprensión de un cuento con una ficha lectora donde debían resumir el inicio, desarrollo y cierre del cuento.\r\n\r\nLa estructura de la clase estaba muy clara, se observa un trabajo cohesionado y estudiantes con apertura al aprendizaje.\r\n\r\nProfesora monitorea y repasa el desarrollo de la actividad todo el tiempo con los estudiantes.\r\n\r\nSe acuerda transmitir esta modalidad de trabajo a otros docentes, para que puedan trabajar en esta misma linea de acción pedagógica de Comprensión de textos y su estructura.'),
(443, '13956828', '20156541', '2024-04-09', '10:10:10', '11:40:10', 18, 43, 2, NULL, 7, 'Se observa una clase bien organizada y estructurada.\r\nPresenta la destreza y la estrategia para su desarrollo de forma efectiva. Durante todo el desarrollo de la clase monitorea las actividades y mantiene un clima de aula adecuado.\r\n\r\n'),
(446, '11537827', '19334195', '2024-04-25', '08:15:46', '09:45:46', 23, 34, 1.7, NULL, 7, 'Un buen clima de aula \r\nRealiza preguntas reflexivas a los estudiantes\r\nEsta contantemente aclara dudas de los estudiantes y   les indica los posibles errores que se pueden cometer al aplicar alguna propiedad de las potencias. \r\nHace que todos los estuantes pasen a la pizarra. \r\nAcuerdos de mejora: \r\n- Parcializar la Guia al revisar y poder dar los tiempos adecuados para que resuelvan.  \r\n- Generar estrategias para los estudiantes más visuales (anotar las propiedades de las potencias) \r\n- Monitorear el trabajo de los estudiantes, para verificar que si realizaron la actividad y no sólo se dediquen a copiar de la pizarra. \r\n\r\n\r\n '),
(447, '14273480', '15648517', '2024-04-30', '08:30:00', '09:35:00', 5, 38, 2, NULL, 7, 'Observaciones.\r\n- Se realiza acompañamiento en rutina MAE: calendario matemático.\r\n- La docente realiza la rutina siguiendo los pasos, de forma lúdica y donde se observa conocimiento por parte de los estudiantes.\r\n- Realiza:\r\n Saludo, días de la semana, meses del año, asistencia, conciencia fonológica, estimación, tablero del 100, rutina diaria, entre otros.\r\n- Además, se observa el momento de la oración, donde participan los estudiantes y logran mantener actitud de respeto . También, juegos de neuroplasticidad que permite que los estudiantes, se conecten de mejor forma y estén listos para el aprendizaje.\r\n\r\nAcuerdos:\r\n- Continuar realizando calendario matemático, de forma sistemática y con la intención pedagógica que este contempla.'),
(448, '11537827', '16274647', '2024-04-30', '10:15:27', '11:40:27', 25, 29, 1.72, NULL, 7, 'Realizar quebré durante las clases para hacer metacognition \r\nUtilización adecuada de las normas (celulares)  \r\nUtilizar material diversificado para estudiantes NEE (Antonia Tapia) \r\n'),
(449, '11537827', '16137474', '2024-04-30', '09:05:00', '09:45:00', 4, 38, 2, NULL, 7, 'Felicitaciones por su trabajo, bien implantadas la rutinas y calendario Matematica\r\nMantiene la atención de los estudiantes durante toda la clase, logrando aprendizajes efectivos. '),
(450, '11537827', '16155987', '2024-04-30', '11:55:27', '13:25:27', 18, 34, 1.04, NULL, 7, 'Utilizar estrategias para dar instrucciones claras y compression de todos los estudiantes.\r\nReforzar tres elementos conceptuales: División de partes iguales, lo que representa un entero y denominador como elemento de division del entero. \r\nUtilizar estrategias del 100 %, para evitar forzar la voz al realizar la clase. \r\nVer si las estrategias generan el aprendizaje esperado \r\nUtilización de los tiempos.       \r\n'),
(451, '13567342', '9433399', '2024-04-22', '12:40:00', '13:25:00', 29, 56, 1.83, NULL, 6, 'Profesora muestra buen manejo de grupo, con normas claras con respecto al espacio y forma de trabajo.  Recorre constantemente los puestos para supervisar avances y entregar orientaciones a los estudiantes. \r\nEn general los estudiantes presentan un buen comportamiento, saben lo que tienen que hacer.\r\n\r\nSe sugiere utilizar estrategias que ayuden a los estudiantes a controlar de manera autónoma su tiempo de trabajo. También, hacer más frecuente y consciente la práctica de corroborar la comprensión de instrucciones y conceptos, lo que a su vez promueve la participación de los alumnos. '),
(452, '13567342', '18760349', '2024-04-24', '10:20:00', '11:35:00', 21, 34, 1.62, NULL, 6, 'Profesora muestra un trato cercano y acogedor con las estudiantes.  Realiza actividades que facilitan la participación del grupo curso.  Gran parte de las estudiantes se muestran interesadas en participar. \r\n\r\nSe sugiere utilizar controlar los tiempos que faciliten el trabajo autónomo de las estudiantes y que permitan asegurar la realización de cierre de la clase, con el fin de verificar el logro del objetivo de la clase. También, hacer más frecuente y consciente la práctica de corroborar la comprensión de instrucciones, lo que a su vez promueve la participación de los alumnos. \r\nSupervisar que las estudiantes cuenten con los materiales sobre su escritorio y que vayan avanzando de acuerdo a lo indicado por la profesora.'),
(454, '17335579', '14003208', '2024-05-06', '08:20:00', '08:30:02', 13, 32, 1.32, NULL, 7, 'Utilizar el tiempo de planificación conjunta de forma eficiente. Organizar en detalle los contenidos, habilidades y actividades a desarrollar en cada clase como co-docentes. \r\nAmbas profesoras deben tener claridad de lo se abordará en la clase. No resolver dudas durante el desarrollo de la misma. \r\nFortalecer el rol docente dentro del aula (mayor participación en el desarrollo de la clase). \r\nBuen monitoreo y buen vínculo con los estudiantes (preguntan, acogen positivamente el apoyo y regulan la conducta con sus intervenciones).  \r\nUtilizar recursos adaptados a las necesidades de apoyo del curso, que evidencien una planificación diversificada y colaborativa. \r\nConoce las necesidades de apoyo de sus estudiantes y se mantiene atenta para monitorear, estimular y apoyar el trabajo persistente y la correcta ejecución de tareas. \r\n\r\n'),
(457, '13769322', '19404149', '2024-05-02', '10:05:00', '11:35:00', 14, 34, 1.93, NULL, 7, 'Se debe realizar un cierre en todas las clases.\r\nSe propone hacer un cálculo de tablas (multiplicaciones) como “Hacer Ahora” y el “hacer ahora de coordinación” – que es de tablas – quedará como tickets de salida.\r\nSe trabajará en junio con los cuadernillos para trabajo SIMCE en los 4º básicos.\r\n'),
(459, '16896799', '19386893', '2024-05-06', '08:15:00', '09:45:00', 18, 32, 1.95, NULL, 7, 'Se observa un buen clima de aula ,sin embargo. se sugiere ocupar las estrategias de aula establecidas en el colegio de manera especial en el uso del tiempo utilizando tiempo consensuado o establecido y de manera visible .\r\nSe observa una estructura de clase considerando una aula diversificada ,que favorece la participación de todos los estudiantes.\r\nRecordar a los Alumnos en que se convierte su refuerzo Positivo (firma)\r\nVisualizar el avance de la estructura de la clase por medio de alguna estrategia\r\nEn la Evaluación Formativa se sugiere ocupar una estrategia que permita a los estudiantes autoevaluarse con respecto al trabajo realizado en clases(LIBRO)\r\nEl material concreto utilizado es adecuado para los intereses de los Estudiantes\r\nSe sugiere que el material ppt sea mas esquemático con la información utilizada en clases anteriores.\r\nSe observa positivamente tener material complementario al termino de la actividad principal (hacer ahora)\r\nSe observa un avance positivo en la capacidad de retroaliementación en la clase.'),
(461, '16896799', '13135675', '2024-05-07', '11:55:47', '13:25:47', 29, 29, 1.71, NULL, 7, 'Maria S.\r\nUso de estrategia ¿Que necesito? Alternativa para en sus marcas\r\nObjetivo de la clase: Comparar textos literarios. Clase alineada con el objetivo. Se realiza una explicación para que los estudiantes comprendan qué deben lograr hacer.\r\nSe hace un recordatorio participativo de los cuentos trabajados en la clase anterior, para indagar conocimientos previos\r\nSe sugiere a la docente, verificar si se entendió las instrucciones dadas.\r\nSe usa tiempo consensuado para realizar la actividad. No hay un seguimiento del tiempo que llevan. Solo se pone en la pizarra.\r\n¿Cuál es el apoyo diferenciado para la estudiante NEEP? ¿Cómo se pudo abordar las necesidades\r\n¿Adecuación para estudiantes PIE? Se podría incluir preguntas más especificas\r\n'),
(462, '17335579', '19449801', '2024-05-08', '08:15:00', '08:31:02', 26, 34, 1.95, NULL, 7, 'Debe ingresar puntualmente a la clase. 08:15 hrs. con el curso en la sala de clases. \r\nCuidar la NO interrupción entre ambas docentes. Atender necesidades individuales de forma silenciosa con los estudiantes o abordar situaciones atingentes fuera de la sala de clases si es estrictamente necesario.\r\nOptimizar los tiempos de manera efectiva, resguardando que estudiantes del programa con mayores necesidades siempre reciban el apoyo que requieren.\r\nInteresante presentación de técnicas de estudio para abordar la problemática detectada junto a la profesora (Los jóvenes no estudian de forma \"inteligente\", no evidencian rutina, estructura u organización). \r\nElabora un decálogo de técnicas de estudio con información concreta, ejemplos claros y pasos a seguir para estudiar de forma eficiente. \r\nDiscurso alentador para motivar el estudio y la experiencia de aprendizaje entre pares. \r\nVerificar la comprensión de la información (realizar preguntas confirmando que el silencio significó también estar disponibles y atentos). \r\n'),
(463, '17335579', '19404965', '2024-05-07', '08:15:00', '09:25:00', 7, 34, 1.82, NULL, 7, 'Clase motivadora, uso de material concreto atingente, interesante. Los y las estudiantes participan activamente, todos atentos, responden con rapidez, están involucrados en la actividad. \r\nParticipación de la docente PIE durante todo el desarrollo de la clase. Destaca la utilización de material diverso que responde a las distintas necesidades dentro de la sala. \r\nSugerencia: pausa activa, considerando la curva atencional de los estudiantes. Ofrecer una instancia de movimiento que permita distención y volver a conectar con la actividad. \r\nConoce a los estudiantes y brinda apoyos específicos a quienes requieren mayores apoyos. \r\nRealiza evaluación formativa al final de la clase. Buen cierre, con ejemplos concretos del contenido, facilitando la consolidación del aprendizaje. \r\nFortalecer la comunicación con la docente dentro del aula. \r\n'),
(464, '9089119', '15177877', '2024-05-02', '10:10:10', '10:50:10', 23, 27, 2, NULL, 7, 'Docente presenta objetivo: Identificar y aplicar estructura gramatical. \r\n\r\nSe comienza preparando clima de aula y organización de las estudiantes.\r\n\r\nSe recuerdan conocimientos previos, se observa a las estudiantes participativas y motivadas al responder preguntas claves.\r\n\r\nSe observa una clase estructurada con material adecuado, avanzan a través de la lectura hacia la formación de frases con las estructuras gramaticales aprendidas. Segunda parte de la clase se genera trabajo autónomo a través de guía de aplicación.\r\n\r\nDocente, se vincula positivamente con las estudiantes las que conoce por su nombre. Desarrolla estrategia sin salida, verificando así la comprensión.\r\n\r\nSugerencias:\r\n      \r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, intencionado como meta   compartida.\r\n'),
(465, '9089119', '13312214', '2024-05-06', '11:55:33', '12:40:33', 27, 51, 1.92, NULL, 7, 'Objetivo: Identificar ácidos y bases según teoría de Bronsted y Lowry\r\n\r\nSe inicia aplicando test de entrada con contenido anterior con el que se ve motivación por participar.\r\n\r\nDocente recuerda contenidos clase anterior y los vincula con nuevas aplicaciones, realiza preguntas claves y  desarrolla varios ejemplos en la pizarra.\r\n\r\nLa docente desarrolla la clase con factor alegría y se observa motivación de parte de los estudiantes, los que participan respondiendo las preguntas, falta aplicar una estrategia con sin salida o 100%.\r\n\r\nLa segunda parte de la clase aplican lo aprendido en una guía. Atiende las dudas de manera individual, y se vincula positivamente con los estudiantes.\r\n\r\nSe observa buen manejo conceptual disciplinar.\r\n\r\nSugerencias:\r\n\r\n\r\nImplementar estrategias como 100% y sin salida evitando las preguntas retóricas, para poder verificar la comprensión.\r\n \r\nImplementar estrategias de clima de aula que mejoren la escucha activa.\r\n\r\n'),
(466, '9089119', '10387845', '2024-04-17', '10:10:16', '10:50:16', 26, 35, 1.96, NULL, 7, 'Objetivo: Reconocer diferentes elementos del lenguaje musical, presentes en la composición\r\n\r\n\r\nComienza preparando clima de aula revisando uso de celulares y promoviendo el orden.\r\n\r\nSe inicia la clase con actividad motivadora, que consiste en sopa de letras y con actualización de conceptos previos\r\n\r\nDocente logra que los estudiantes se adhieran al trabajo, después de recordarles en todo momento las normas de forma clara.\r\n\r\nEl clima de aula es propicio para el aprendizaje, los estudiantes en general participan activamente respondiendo preguntas claves. \r\n\r\nRealiza preguntas claves, utiliza estrategia sin salida y ejercicios en la pizarra promoviendo la participación.\r\n\r\nSe realiza un segundo momento con trabajo practico que consiste en construir escala musical destacando sus principales grados.\r\n\r\nSugerencias:\r\n\r\nPresentar habilidad al momento de entregar el objetivo.\r\n\r\nRetomar trabajo practico en la medida de que los estudiantes se comprometan a mantener un buen clima de aula.\r\n\r\n\r\n'),
(467, '17335579', '18162394', '2024-05-08', '10:05:00', '11:20:00', 20, 34, 1.36, NULL, 7, 'Antes de comenzar, corroborar que las estudiantes están disponibles y atentas. No comenzar antes de orientar el trabajo y conseguir la atención del curso. \r\nEjemplificar siempre de manera concreta. No interactuar con las estudiantes mientras la profesora explica el contenido. \r\nCuidar NO interrumpirse entre docentes. La explicación se torna confusa cuando se interrumpen e intentan explicar ambas a la vez. \r\nEstructurar la clase de tal manera que ayude a estimular funciones ejecutivas esenciales: organizar la pizarra (visualmente un contenido clasificado, ordenado), exigir permanentemente una conducta apropiada al aula, el exceso de ruido dificulta la participación y concentración de todas las estudiantes y asimismo entorpece las intervenciones de las profesoras (potenciar la autorregulación, inhibición y control de la conducta).\r\nSugerencia: resúmenes del contenido, con ejemplos concretos, paso a paso en la resolución de problemas u otros. \r\nRecordar y aplicar estrategias de clima de aula y rutinas de pensamiento. \r\n'),
(469, '13954385', '15519211', '2024-05-09', '11:00:38', '11:55:00', 5, 32, 1.95, NULL, 7, 'Reforzar el nivel de expectativa para establecer metas alcanzables y mantener una actitud positiva frente al aprendizaje \r\nPromover el rol activo en los niños.'),
(475, '16896799', '18069762', '2024-05-09', '13:25:00', '14:10:00', 22, 32, 1.95, NULL, 7, 'Se da a conocer el objetivo de la clase y la ruta a seguir de manera visible para todos los estudiantes.\r\nSe comentan los aprendizajes previos que sirve de insumo para el trabajo de la clase y favorece la comprensión de los constituyentes de la obra poética.\r\nSe sugiere asegurarse de la comprensión de las instrucciones por parte de los estudiantes para evitar que los estudiantes demanden del apoyo de las profesoras en todo momento y de esta manera favorecer el trabajo autónomo.\r\nSe presenta una diversificación de textos que favorecen el trabajo de los estudiantes con necesidades educativas especiales transitorias y permanentes. También se observa una ficha de trabajo diversificada para estudiantes NEEP.\r\nSe mantiene un clima de aula acorde, para el desarrollo de los aprendizajes, recordando la importancia de la limpieza y el orden en la sala.\r\nSe sugiere definir los conceptos que pudiesen desconocer los estudiantes, tales como superlativa, alquitara, rictus. \r\nLa clase cuenta con procesos de retroalimentación de lo trabajado y preguntas metacognitivas que permiten procesos de autoevaluación a los estudiantes.\r\n\r\n'),
(477, '13954385', '18069116', '2024-05-08', '14:00:06', '14:37:09', 2, 34, 1.9, NULL, 7, 'En la Evaluación Formativa se sugiere ocupar una estrategia que permita a los estudiantes plasmar en un actividad lo aprendido en clases. (aprendizaje kinestésico)\r\nEl material concreto y visual es bien utilizado para los distintos tipos de aprendizaje\r\nSe observa una buena estructura de clase considerando una aula diversificada ,que favorece la participación de todos los estudiantes.'),
(478, '9089119', '15178038', '2024-04-24', '13:25:02', '14:10:02', 20, 32, 1.76, NULL, 3, 'Objetivo: Investigar hazañas y crear un comic con héroe o heroína mapuche.\r\n\r\nSe inicia preparando el clima de aula a través de la organización de sus puestos.\r\n\r\nDocente recuerda contenidos clase anterior y los vincula con el trabajo a desarrollar, realiza preguntas claves y presenta pauta de evaluación para el trabajo, falta verificar su comprensión.\r\n\r\nLa docente desarrolla la clase con factor alegría y se observa motivación de parte de los estudiantes, los que participan respondiendo las preguntas, falta aplicar una estrategia con sin salida o 100%.\r\n\r\nAtiende las dudas de manera individual, y se vincula positivamente con los estudiantes.\r\n\r\nSe observa buen manejo conceptual disciplinar.\r\n\r\nSugerencias:\r\n\r\n\r\nPresentar habilidad a desarrollar como meta compartida.\r\n\r\nEntregar indicaciones claras verificando su comprensión.\r\n\r\nImplementar estrategias como 100% y sin salida evitando las preguntas retóricas, para poder verificar la comprensión.\r\n \r\nTrabajar el uso de la voz implementando estrategias de clima de aula, para mejorar el clima de aula y la escucha activa.\r\n'),
(479, '13769322', '13268741', '2024-05-09', '10:05:00', '11:35:00', 12, 42, 1.48, NULL, 7, '•	Entregar correctamente las instrucciones de la actividad de clases.\r\n•	Moderar los tiempos de clases y realizar el cierre de la actividad.\r\n07/06 Observación nueva clase.\r\n'),
(480, '13567342', '15898402', '2024-05-02', '13:25:00', '14:10:00', 30, 18, 1.8, NULL, 7, 'Profesora muestra buen manejo de grupo.  Muestra un trato cordial con los estudiantes, mantiene una actitud activa y alegre, generando un espacio agradable y de confianza con el curso.\r\n\r\nSe sugiere:\r\n- Encuadre al inicio de la clase, que haga más expedito el generar las condiciones propicias para la clase.\r\n- Generar más espacios de participación para los estudiantes. \r\n- Implementar rutina para verificar la comprensión de instrucciones y/o contenidos.'),
(481, '13567342', '17231028', '2024-05-06', '10:20:00', '11:35:00', 21, 8, 1.52, NULL, 7, 'Profesor mantiene un trato respetuoso con las estudiantes, se muestra paciente ante sus demandas de atención. El material de apoyo es atractivo y de fácil comprensión.\r\n\r\nSe sugiere:\r\n- Evitar las pausas muy largas, que faciliten el que las estudiantes se paren y se puedan generar situaciones de riesgo\r\n- Generar más espacios de revisión de las actividades que realicen, con el fin de verificar el logro de los objetivos planteados, retroalimentar y dar espacio a que las estudiantes puedan completar aquello que les falta.\r\n- Implementar rutina para verificar la comprensión de instrucciones y/o contenidos.\r\n- Utilización del tiempo visible, permitiendo que las alumnas puedan gestionar su tiempo de trabajo.'),
(483, '13769322', '11879515', '2024-05-09', '08:15:00', '09:40:00', 11, 22, 1.44, NULL, 7, '•	Se debe colocar algún material audiovisual.\r\n•	Al utilizar el texto escolar, los niños deben subrayar las ideas importantes y los conceptos que ahí aparece.\r\n•	Al finalizar el contenido, y siempre y cuando se subraye en el libro lo principal, se deberá terminar con un mapa conceptual simple, resumen o cuadro comparativo.\r\n'),
(484, '14273480', '18143931', '2024-05-03', '08:15:05', '09:40:00', 8, 32, 1.77, NULL, 7, 'Observaciones:\r\nLa docente realiza una clase donde se observa una estructura clara.\r\nUtiliza diversas estrategias de clima de aula.\r\nUtiliza recursos educativos lúdicos y significativos.\r\n\r\nAcuerdos:\r\nPromover altas expectativas en los estudiantes, al momento de realizar preguntas.\r\nVerificar comprensión de conceptos, realizando preguntas claves y sin salida por su nombre.\r\nEn el cierre, realizar preguntas asociadas al objetivo, preparar las preguntas.'),
(487, '16896799', '19091055', '2024-05-14', '10:10:00', '11:40:00', 20, 8, 1.5, NULL, 7, 'Se observa un desfase en el periodo de inicio de la clase, por lo que se sugiere respetar los tiempos de incio de la clase y de igual manera optimizar el tiempo en que los estudiantes se disponen a trabajar en la clase. Incio real de la clase 10.23hrs.\r\nSe trabaja en la habilidad de identificar, donde gran parte del curso, la maneja, por lo que responden rápidamente y no existe mayor profundización. ¿Por qué eligen ese objetivo? ¿Que tomaron como evidencia para definirlo?\r\nSe utilizan estrategias de clima de aula como 100%, recordar las normas de manetener una sala limpia, levantar la mano para hablar etc. lo que favorece el espacio para trabajar. Se sugiere revisar otras estartegias para no sobre utilizar el 100%. \r\nSe observa una estructura de clase uniforme para todos los estudiantes, no se observan elementos de diversificación en material, metodología y/o evaluación. ¿Cómo o que podrian haber realizado para agregar elementos que le permitiesen a los estudiantes avanzar en sus aprendizjes, segun los diferentes niveles en los que se encuentran?\r\nSe realiza un trabajo con material concreto (pizarra), con el que todos  los estudiantes participan de las actividades. ¿Que reflexión haces al respecto, tipo de preguntas, retroalimentación realizada, nivel de logro de los estudiantes?\r\nSe sugiere poder trabajar en el cómo se dan a conocer las instrucciones, para optimizar los tiempos y permitir el trabajo autónomo de los estudiantes, utilizar un lenguaje claro y consiso, verificar si se entendieron antes de comenzar la actividad.\r\n\r\n\r\n\r\n'),
(488, '13956828', '20156541', '2024-05-03', '10:47:15', '11:40:01', 15, 8, 1.73, NULL, 7, 'Clase: Tipos de gérmenes.\r\n\r\nProfesora maneja lenguaje adecuado al contexto y siempre desde lo positivo, generando un ambiente agradable de aprendizaje en aula.\r\nEstructura de la clase clara y organizada.\r\nAplica estrategias de clima de aula de su autoría que invita a los estudiantes a mantener la concentración y posterior silencio.\r\n\r\nSugerencia y acuerdo:\r\nRecordar revisar el Manual de estrategias de clima de aula y Rutinas de pensamiento, ya que deben aplicarse en aula.\r\nUtilizar una rutina de pensamiento que potencie la reflexión, enfocada en la destreza a desarrollar en la clase.'),
(489, '13956828', '16155987', '2024-04-09', '08:15:37', '09:45:37', 16, 34, 1.56, NULL, 7, 'Profesora que asume reemplazo de matemáticas.\r\n\r\nEn retroalimentación de la clase observada, se acuerda lo siguiente:\r\n\r\nRevisar Manual de estrategias de clima, para aplicar en clases alguna de ellas.\r\nRevisar las rutinas de pensamiento y escoger, al menos una para insertar en clases con 5° y 6°.\r\n\r\n'),
(490, '13956828', '16155987', '2024-04-09', '14:10:46', '15:35:46', 15, 34, 1.5, NULL, 7, 'Sugerencias y acuerdos:\r\n\r\nRevisar Manual enviado por correo electrónico en relación a estrategias de clima de aula, escoger Estrategias para el inicio y cierre de la clase y aplicarlas en clase.\r\nRevisar Manual enviado por correo electrónico en relación a rutinas de pensamiento escoger una o dos rutinas y aplicarlas en clases.\r\n\r\n'),
(491, '14273480', '10319779', '2024-05-14', '08:40:00', '09:40:00', 6, 38, 2, NULL, 7, 'Observaciones:\r\n- Se observa el momento de la oración y calendario matemático.\r\n- La docnete utiliza estrategias de clima de aul.\r\n- Implementa rutina MAE, con sentido e intención pedagógica en cada momento, reforzando constantemente a los estudiantes y aprovechando al máximo cada instancia.\r\n- Se observa: trabajo de virtud, conceptos de tiempo; ayer - hoy - mañana, meses del año, asistencia, deletrean nombres de ausentes, uso de recta númerica, unidad - decena y centena, problema matemático con sus pasos, tablero del 100, entre otros.\r\n- Se realiza trabajo colaborativo con profesora diferencial, donde los estudiantes refuerzan cantidad de sílabas de palabras, a través de juego motor.\r\n\r\nAcuerdos:\r\n- Continuar realizando trabajo colaborativo con profesora diferencial, al igual que implementando el calendario matemático con significado para los estudiantes.'),
(492, '9089119', '10072654', '2024-05-14', '11:55:32', '13:05:32', 23, 43, 1.8, NULL, 3, 'Objetivo de la clase: Identificar que son las necesidades y su relación con la creación de productos tecnológicos, analizando un servicio de uso cotidiano.\r\n\r\nSe comienza preparando el clima de aula, el que se logra aplicando umbral y estrategia en sus marcas.\r\n\r\nSe inicia con una actividad activa y motivadora en donde las estudiantes escriben en papelitos una necesidad, con el que trabajan durante la clase.\r\n\r\nLa docente presenta el objetivo recordando conceptos previos a través de preguntas con palabras claves, se observa que la gran parte de las estudiantes se adhieren al trabajo.\r\n\r\nParalelamente docente presenta ruta de trabajo que permite explicitar y potenciar el desarrollo de la clase.\r\n\r\nEstudiantes participan activamente y la profesora realiza estrategia sin salida y de tiempo explícito y consensuado, observándose la participación activa, y un clima de aula propicio para el aprendizaje, sin embargo, hay un pequeño grupo de estudiantes que no se adhieren o no cumplen con lo solicitado.\r\n\r\nEn un segundo momento se desarrolla guía donde registran conceptos y aplican lo aprendido, se va revisando y retroalimentando sincrónicamente, sin embargo, se observa que la guía es muy extensa en cuanto al registro de conceptos ya aprendidos, lo que hace a momentos perder la escucha activa y el interés de parte de las estudiantes.\r\n\r\nSe observa una clase bien estructurada con normas claras y buen clima de aula en general, además la docente se vincula positivamente y con factor alegría. \r\n\r\nSugerencias:\r\n\r\n Verificar la adhesión de todas las estudiantes en la clase.\r\n\r\n Diversificar la estrategia de aprendizaje privilegiando actividades de aplicación de los contenidos y las diferencias individuales.\r\n\r\n'),
(493, '9089119', '17899117', '2024-05-09', '08:15:19', '09:15:19', 24, 34, 1.92, NULL, 3, 'Objetivo: Aplicar formula de binomio al cuadrado\r\n\r\nDocente presenta objetivo y ruta de trabajo, falta explicitar la habilidad a desarrollar.\r\n\r\nRecuerda conocimientos previos a través de preguntas con conceptos claves utilizando estrategia sin salida.\r\n\r\nSe realiza ejercitación vinculada a contenido abordado en clase anterior sobre binomio al cuadrado, revisando individualmente y verificando la comprensión. Se aplica estrategia de tiempo consensuado.\r\n\r\nLa docente desarrolla la clase con factor alegría, vinculándose positivamente y fomentando la participación activa.\r\n\r\nSe observa un buen clima de aula, con vinculo positivo entre estudiantes, colaborándose en las tareas a realizar.\r\n\r\nSe observa buen manejo conceptual disciplinar.\r\n\r\nSugerencias:\r\n\r\nImplementar estrategia de clima de aula al iniciar la clase.\r\n\r\nMantener material de trabajo para estudiantes que terminan antes la actividad y así avanzar en su aprendizaje y motivación.\r\n\r\nImplementar una estrategia más activa, que permita administrar la aplicación de los ejercicios para mejorar la retroalimentación de estos.\r\n\r\n\r\n'),
(494, '13956828', '13625118', '2024-05-16', '08:45:00', '09:45:00', 13, 34, 2, NULL, 7, 'Multiplicación:\r\n\r\nProfesor realiza una clase con una estructura clara y coherente al objetivo de aprendizaje.\r\nPone énfasis en la revisión y retroalimentación constante a sus estudiantes.\r\nEl material entregado a los estudiantes para trabajar tiene actividades acordes al desarrollo de la destreza, entregando tb material particular para sus estudiantes con NNEE.\r\nPara el cierre de la clase, usa una rutina de pensamiento, que invita a reflexiona  través de preguntas desafiantes.\r\nLos niños y ni{as se observan motivados, concentrados, respetuosos y participativos.\r\n\r\n'),
(496, '16896799', '16287284', '2024-05-16', '08:15:00', '10:11:00', 24, 34, 1.86, NULL, 7, 'Se menciona que el Objetivo es Resolución de problemas usando términos semejantes, sin embargo, solo resuelven ejercicios de manera directa.\r\nSe organizan los estudiantes por equipos con diferentes niveles de logro.\r\nSe recuerdan conceptos previos sobre la reducción de términos semejantes, lo que favorece el trabajo posterior en grupos.\r\nSe ofrece material que motiva el trabajo y mantiene a los estudiantes interesados en el trabajo.\r\nCerciorarse de que los estudiantes comprenden las reglas. Usar alguna estrategia acorde.\r\nSe realiza una revisión personalizada de los ejercicios, retroalimentando el trabajo de los grupos.'),
(499, '13954385', '18683840', '2024-05-17', '08:30:00', '09:45:33', 7, 34, 2, NULL, 7, 'Muy buena clase, entretenida y el material creado fue muy útil y acorde a las NEE de los Estudiantes\r\nPasearse más seguido por la sala para ver a los alumnos que están al final de esta .\r\nBuena Retroalimentación y pudiste integrar otro aprendizaje con la misma actividad (derecha -izquierda)\r\nCapaz de cambiar la estrategia frente a la misma actividad de Suma\r\nRola activo  presente (débil) , se sugiere agregarlo en más actividades'),
(500, '13954385', '19331947', '2024-05-17', '10:25:00', '11:40:00', 8, 34, 2, NULL, 7, 'Es una clase donde se refleja la codocencia y el trabajo diversificado\r\nEs necesario añadir más preguntas dirigidas para que los alumnos puedan llegar a la respuesta\r\nAumentar a lo largo de la clase el rol activo en los Estudiantes\r\nBuena estrategia al intencionar la participación de los Estudiantes distraídos y mas descendidos\r\nBuen ticket de salida'),
(501, '13567342', '9141113', '2024-05-09', '10:05:00', '10:50:00', 23, 8, 1.81, NULL, 7, 'Profesora muestra buen manejo de grupo y las alumnas responden a los llamados a volver al trabajo, cuando se han desconcentrado.  Constantemente se pasea por la sala, comprobando el avance, aclarando dudas y entregando orientaciones.\r\n\r\nSe sugiere:\r\n- Utilizar estrategia que permita verificar la comprensión de las instrucciones y/o contenidos, reduciendo el tener que detenerse constantemente en los puestos de las estudiantes a aclarar dudas sobre lo que deben hacer.  \r\n- Recurrir a la estrategia de tiempo visible a la hora de asignar tiempo para las actividades, contribuyendo a la autorregulación de las estudiantes, y también a la gestión del tiempo de la clase, evitando extensiones que dificulten la realización del cierre.'),
(502, '13567342', '18764755', '2024-05-10', '12:17:00', '13:25:00', 28, 27, 1.33, NULL, 6, 'Profesora con buen trato hacia los estudiantes, con mucha paciencia, a pesar de las interrupciones y poco avance de los alumnos.\r\n\r\nSe sugiere:\r\n- Utilizar estrategia que permita verificar la comprensión de las instrucciones y/o contenidos, reduciendo el tener que detenerse constantemente en los puestos de las estudiantes a aclarar dudas sobre lo que deben hacer.  \r\n- Recurrir a la estrategia de tiempo visible a la hora de asignar tiempo para las actividades, contribuyendo a la autorregulación de los estudiantes, y también a la gestión del tiempo de la clase. Destinar tiempos definidos con alumnos y verificar avance constantemente.\r\n\r\nAcuerdos:  Poner al día las planificaciones. Utilizar rutinas de clima de aula propuestas en manual entregado.'),
(503, '16896799', '19533614', '2024-05-22', '10:10:00', '10:55:00', 7, 27, 1.69, NULL, 7, 'Se observa un aula de recursos con el estudiante Agustín de primero básico.\r\nSe observa activación de conocimientos previos a partir de un recurso interactivo del interés del estudiante y que lo motiva a involucrarse en la clase.\r\nEl material concreto utilizado para la clase, es acorde a las necesidades e intereses  del  estudiante\r\nEl menor recibe refuerzo positivo de manera constante y el manifiesta que \"está aprendiendo\"\r\nEs importante poder compartir la ruta de trabajo de la clase, enfocándose en el objetivo de ésta y las habilidades a la base. Cobra mayor importancia el trabajo de habilidades en el aula de recursos.\r\nConsiderar una retroalimentación a partir de elementos que permitan al niño acceder a un nivel próximo de logro o de aprendizaje, complementando la información que se entrega. \r\nIncluir una estrategia de evaluación formativa, que permita el trabajo autónomo del estudiante y permita al docente y al estudiante ver el nivel de logro alcanzado. ');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(504, '16896799', '17842898', '2024-05-23', '10:12:00', '11:20:00', 25, 32, 1.85, NULL, 3, 'Se observa unos minutos de retraso en el inicio de la clase, sin embargo, luego se dan las instrucciones y las estudiantes comienzan a regular su conducta para lograr un clima de aula acorde a las necesidades.\r\nLas profesoras comparten estrategias al inicio de la clase, tales como compartir la ruta de la clase y los materiales a utilizar (en sus marcas).\r\nSe utilizan estrategias que favorecen el desarrollo del pensamiento como el cuadro CQA.\r\nLa clase  tiene como objetivo identificar el proceso comunicativo en los medios masivos de comunicación, siendo una clase introductoria a la unidad a trabajar. Se observa coherencia de las actividades con el objetivo a trabajar. \r\nExiste una diversificación del material a utilizar en los diferentes grupos, sin embargo, no se observa diversificación en relación a las características individuales de las jóvenes, ni sus necesidades educativas en particular. \r\n'),
(505, '16896799', '17540502', '2024-05-23', '12:06:00', '13:20:00', 16, 32, 1.84, NULL, 7, 'Se observa el trabajo intencionado del desarrollo del pensamiento con la estrategia Veo, pienso y escribo. Al principio la parte de \"escribo\" estuvo confusa, sin embargo, luego se explica con mayor precisión y los estudiantes logran realizar de manera correcta la actividad. Se sugiere tener mayor claridad, al momento de dar las instrucciones para evitar confusiones en los estudiantes.\r\nNo se observa seguimiento de la ruta de la clase, a pesar  de que las docentes tienen claridad de los momentos y actividades de la clase, no se realiza un seguimiento con los estudiantes.\r\nSe observa una discrepancia entre el objetivo de la clase y las actividades realizadas, puesto que el objetivo era conocer y caracterizar tipos de narradores, sin embargo, las actividades en su mayoría consistían en \"reconocer el tipo de narrador presente a partir de palabras claves, de igual manera, la actividad del cierre con las preguntas no apuntan directamente a evaluar si se logró el objetivo de la clase.\r\nSe trabaja la modalidad de aula diversificada, realizando una actividad diversificada en el desarrollo de la clase, donde se considera el nivel de logro de los estudiantes y se proponen actividades acorde a sus características personas y necesidades educativas especiales. De igual manera, se observa material de apoyo y concreto de calidad.\r\nEn cuanto al clima de aula, hay aspectos a considerar, se observa que todos los estudiantes trabajan en la clase, pero hay constante ruido e interrupciones por parte de los estudiantes. \r\n'),
(506, '14273480', '16059492', '2024-05-14', '08:40:00', '09:40:00', 6, 38, 2, NULL, 7, 'La docente apoya a estudiantes con necesidades educativas permanentes, ofreciendo espacio de aprendizaje, estableciendo y reforzando normas y promoviendo la participación en el calendario matemático.\r\nAcuerdos:\r\n- Continuar colaborando y apoyando a la educadora y profesores de asignatura en el quehacer pedagógico, con todos sus estudiantes.'),
(507, '14273480', '14354406', '2024-04-30', '08:30:00', '09:30:00', 5, 38, 2, NULL, 7, 'La docente apoya el trabajo realizado por jefatura, reforzando normas y promoviendo la participación.\r\nMuestra preocupación por estudiantes que requieren de un mayor refuerzo.\r\n\r\nAcuerdos:\r\n- Reforzar cuidado de pertenencias de los estudiants, dentro y fuera de sala.\r\n- Continuar apoyando a jefatura y profesores de asignaturas en experiencias de aprendizaje y clima de aula.'),
(508, '14273480', '16896118', '2024-05-03', '09:00:00', '09:45:00', 8, 32, 1.88, NULL, 6, 'Observaciones:\r\n- Llega puntual a la clase.\r\n- Coopera con profesora jefe.\r\n- Promueve normas.\r\n\r\nAcuerdos:\r\n- Coopera en la organización del tiempo y del espacio educativo: se solicita ordenar la sala de clases.'),
(509, '14273480', '13103451', '2024-05-15', '14:30:00', '15:00:00', 3, 38, 1.93, NULL, 6, 'Observaciones:\r\n- Se observa calendario matemático.\r\n- La docente realiza: saludo, 5s, días de la semana, asistencia, deletrean nombres de ausentes, meses del año, clima, estaciones del año, revisión actividades del mes.\r\n- Los estudiantes participan en los momentos del calendario, sin embargo, en ocasiones cuesta que hablen con volúmen adecuado o contesten a lo que se les pregunta.\r\n- La docente realiza buenas explicaciones de los momentos del calendario.\r\n-Utiliza 100% y palito preguntón.\r\n\r\nAcuerdos:\r\n- En relación al siguiente indicador: Promueve altas expectativas, hace sentir a los estudiantes que son capaces: generalmente, tiende a responder o decir la palabra para que los estudiantes respondan. Se solicita dar pistas pero dejar que sean ellos los que descubran y puedan llegar a la respuesta. De esta forma, promover altas expectativas en los estudiantes, planteando desafíos.\r\n- Implementar \"sin salida\", para que los estudiantes conozcan a estrategia por su nombre.\r\n- Implementar \"estimación\" cuando se realice el calendario matemático y profundizar en los meses del año, aprovechando el material visual y permitiendo que sean los estudiantes los que reconozcan el mes y las actividades del mismo. Plantear preguntas claves más desafiantes al respecto.\r\n'),
(510, '14273480', '15221803', '2024-05-17', '10:15:00', '11:00:00', 7, 32, 1.95, NULL, 3, 'Observaciones:\r\n- Se observa el inicio de la clase y parte del desarrollo.\r\n- La docente presenta un muy buen manejo de clima de aula y conceptual, al igual que estrategias que potencian el objetivo de la clase.\r\n- Se observa conocimiento de los estudiantes, a través de la participación.\r\n\r\nAcuerdos:\r\n- Implementar sin salida, como parte de los acuerdos.\r\n- Guiar a asistente de aula en el acompañamiento pedagógico a los estudiantes.\r\n'),
(511, '14273480', '14354013', '2024-05-16', '10:15:00', '11:35:00', 10, 34, 2, NULL, 7, 'Observaciones:\r\n- Mantiene su sala ordenada, limpia y con ambientación solicitada.\r\n- Apoya a estudiantes en el aprendizaje.\r\n- Esta atenta  las necesidades de los estudiantes.\r\n- Realiza intervenciones para mantener las normas de la sala.\r\n\r\nAcuerdos:\r\n- Revisar materiales que se ubican arriba de casilleros.\r\n- Continuar apoyando a sus estudiantes en el proceso de aprendizaje, en todas las asignaturas.\r\n- Revisar materiales didácticos: ver su uso en actividades, en conjunto con coordinación para posible redistribución.'),
(512, '14273480', '13132976', '2024-05-16', '14:25:00', '15:05:00', 2, 38, 2, NULL, 7, 'Observaciones:\r\n- Se observa calendario matemático.\r\n- La docente realiza en el calendario lo siguiente: normas 5s, rutina diaria, días de la semana, clima, meses del año, uso recta numérica, estaciones del año, estimación, asistencia del día.\r\n- Se observa avances en el grupo en el clima de aula.\r\n- Existe colaboración con asistente de aula.\r\n- Ofrece material de números para secuencia del 1 al 5.\r\n\r\nAcuerdos:\r\n- Continuar implementando calendario matemático, avanzando en aplicar todos los días,.\r\n- Continuar implementando las normas y estrategias que han funcionado para el clima de aula.\r\n\r\n- '),
(515, '16896799', '15589458', '2024-05-24', '10:15:00', '11:55:00', 19, 34, 1.83, NULL, 7, 'La clase empieza con 10 minutos de retraso, lo que interfiere con el final de la clase, se sugiere aplicar estrategias de clima de aula, para organizar de manera màs ràpida, el inicio de clase.\r\nSe considera positivo el trabajo de inicio de clase con una actividad de \"activaciòn\" que favorece el desarrollo de la atenciòn.\r\nSe observa que se escribe en la pizarra la ruta de la clase, sin embargo, no se socializa con las estudiantes. \r\nSe sugiere realizar una retroalimentaciòn que favorezca el desarrollo del objetivo de la clase. No solo responder bien o mal, es importante llevar a los estudiantes a una zona de desarrollo pròximo.\r\nProcurar manejar los contenidos y conceptos asociados, a la divisiòn, dividendo, divisor, contiene (no me cabe).\r\nSe ocupa la estrategia del tiempo consensuado, lo que permite a las estudiantes trabajar en los tiempos que se esperan a la clase.\r\nSe observa un trabajo por filas, donde cada una de ellas resuelve ejercicios con un grado diferente de dificultad, en cuanto a diversificaciòn tambien se considerael uso de recursos complementarios como apoyo de las tablas de multiplicaer, para estudiantes que lo requieren y el trabajo en un flipbook que motiva a las estudiantes a involucrarse en el trabajo de la clase hasta el final.\r\nEn el cierre de clases, se utiliza ticket de salida con retroalimentaciòn de lo realizado y la estrategia del semàforo para visualizar de manera general el logro del objetivo.\r\nSe sugiere revisar la cantidad de ejercicios en la guìa para lograr cumplir con la ruta de aprendizaje y el tiempo de la clase.\r\n\r\n'),
(516, '13954385', '13134219', '2024-05-24', '10:10:00', '11:37:45', 10, 34, 2, NULL, 7, 'Se comienza recordando las 5s y durante la clase ,se ocupan varias estrategias de clima de Aula lo que favorece el aprendizaje\r\nBuen monitoreo durante las actividades\r\nSe observa planificación en conjunto\r\nEs necesario fomentar el rol activo en clases dando la oportunidad de trabajar de forma autónoma tomando sus propias decisiones.\r\nLa pregunta 4 de metacognición debería profundizarse para que el estudiante se haga cargo de su aprendizaje'),
(517, '13954385', '20154789', '2024-05-23', '14:14:00', '15:33:30', 9, 34, 2, NULL, 7, 'Se comienza recordando las 5s y virtud del Mes\r\nClase didáctica y entretenida.(mucha creatividad para entregar los contenidos)\r\nFalta monitoreo durante las actividades (paseo por sala o puestos de trabajo)\r\nSe observa planificación en conjunto\r\nEs necesario fomentar el rol activo en clases dando la oportunidad que los alumnos trabajen de forma autónoma tomando sus propias decisiones.\r\nLa pregunta 4 de metacognición debería profundizarse para que el estudiante se haga cargo de su aprendizaje.\r\nAl momento que la profesora Olivia hace ejercicio de respiración había un grupo que no estaba atento y las tres educadoras del curso no se dieron cuenta de esto.'),
(519, '16896799', '17224388', '2024-05-27', '08:18:00', '09:45:00', 13, 32, 1.59, NULL, 7, 'La clase empieza a las 9.46 debido a diferentes causas, se consideran unos minutos de lectura silenciosa al inicio de la clase. Profesora diferencial sola en la sala de clases, a cargo de dirigir todas las actividades de la clase.\r\nSe utiliza una estrategia de reforzamiento de conducta a travès de una competencia de filas.\r\nSe presenta la ruta de clase, seria importante hacer participar a un estudiante o dejarla visible para ir chequiando lo que se trabajò.\r\nSe sugiere realizar una retroalimentaciòn con mayor profundidad de los contenidos para que los estudiantes logren avanzar en los conocimientos.\r\nSe sugiere considerando la didàctica del lenguaje, realizar una lectura comprensiva de los textos que se ocupan en la clase, realizar algunas\r\npreguntas relacionadas con la noticia.De igual manera revisar el vocabulario.\r\nCorregir a los estudiantes cada vez que algun compañero de una respuesta y los demàs se rian de ella.\r\nLa estudiante que  no presenta proceso lector adquirido, trabaja en una guia de trabajo de segmentacion silàbica de manera autònoma.(material diversificado)\r\nSe debe revisar la coherencia de la clase en relaciòn al objetivo y las actividades realizadas.\r\n '),
(520, '14273480', '15616161', '2024-05-16', '10:15:00', '11:35:00', 1, 34, 2, NULL, 7, 'Observaciones:\r\nLa docente realiza una clase muy dinámica, con gran sentido pedagógico, promoviendo la participación de los estudiantes y planteando desafíos.\r\nLos estudiantes manejan el contenido y trabajan de forma autónoma.\r\nExcelente clase.\r\nAcuerdos:\r\nCuando aplique sin salida, usar el nombre técnico. Si bien en esta oportunidad no fue necesario nombrar, dada la agilidad de la clase y rapidez de los estudiantes,  es importante para que los estudiantes lo conozca.'),
(522, '18639869', '12604321', '2024-05-27', '14:10:50', '14:55:50', 8, 36, 1.67, NULL, 7, 'Se realiza la observación día lunes 27 mayo a las 14:10, sesión o.2 de programa pasos, unidad introductoria.\r\nAspectos Positivos:\r\nSe observa como algo positivo el hecho de que el Profesor utilice ejemplos de estudiantes y hechos reales que ellos han cometido como algo digno de imitar. Esto puede motivar a los alumnos al mostrarles que sus acciones pueden ser reconocidas y valoradas. La presentación de Power Point utilizada en la clase fue clara y estéticamente agradable, lo cual facilita la comprensión de los contenidos por parte de los estudiantes.\r\nAspectos a Mejorar:\r\nEl momento dedicado a recordar lo visto en clases anteriores fue muy breve. Es fundamental dedicar más tiempo a esta fase para evaluar si los estudiantes realmente recuerdan y comprenden lo trabajado previamente.\r\nLa ficha de trabajo se realizaba en parejas, el Profesor no asigna las parejas, con esto se promueve la autonomía entre los estudiantes. Sin embargo, esto puede generar dificultades para aquellos que tienen problemas para buscar compañero/a. Aunque el profesor estuvo atento a esta situación y ayudó a los estudiantes que quedaron solos, sería recomendable evaluar estrategias para facilitar este proceso. No se logró finalizar la actividad dentro del tiempo asignado. Es comprensible que los 45 minutos destinados para la clase a veces no sean suficientes, pero es crucial siempre dejar un espacio para realizar un cierre que permita consolidar y evaluar lo aprendido. Es importante respetar los tiempos y mecanismos acordados previamente para la preparación de la clase, donde está establecido que las fotocopias o cualquier otro material se debe solicitar con dos días de anticipación, Profesor en esta oportunidad solicita el material el mismo día durante la mañana.'),
(523, '18639869', '17079039', '2024-05-27', '14:55:20', '15:40:20', 10, 36, 1.84, NULL, 7, 'Observaciones del Acompañamiento en la Clase de la Profesora Carolina Farías - Curso 2B, Sesión 1.3 del Programa PASOS\r\nAspectos Destacados:\r\nInicio de Clase con \"Setting\": La profesora comienza la clase encuadrando a los estudiantes mediante una presentación de PowerPoint, donde les recuerda ciertos acuerdos y normas que han establecido juntos para promover la sana convivencia y crear un ambiente óptimo para el aprendizaje. Este encuadre inicial ayuda a establecer expectativas claras y mantener el orden.\r\nConexión con la Realidad: La profesora constantemente relaciona los contenidos de la clase con la realidad de los estudiantes. Les invita a reflexionar sobre sus propias experiencias emocionales y a compartir cómo se han sentido en diferentes situaciones (felices, tristes, etc.). Esto no solo facilita la comprensión de los contenidos, sino que también fomenta la empatía y la autorreflexión entre los alumnos.\r\nApoyo en la Profundización: La profesora ayuda a los estudiantes a profundizar en sus respuestas cuando es necesario, promoviendo un pensamiento más crítico y reflexivo.\r\nAspectos a Mejorar:\r\nUso del Tiempo: Aunque la profesora hace un uso visible del tiempo durante el trabajo en clase, se sugiere que anticipe esta gestión y ayude a los niños a monitorizarlo activamente para que puedan completar las tareas dentro del tiempo asignado. Esto podría incluir recordatorios periódicos para que los estudiantes sean más conscientes del tiempo disponible.\r\nRealización del Cierre: La limitación del tiempo impide que se realice un cierre efectivo de la clase. Es importante que siempre haya un espacio destinado para un cierre que permita a los estudiantes consolidar lo aprendido y expresar lo que se llevan de la sesión. Se sugiere ajustar la planificación para asegurar que se pueda dedicar tiempo suficiente al final de la clase para este propósito.\r\nEstas observaciones destacan las fortalezas de la profesora en la creación de un ambiente de aprendizaje positivo y sugieren áreas de mejora para optimizar la gestión del tiempo y asegurar un cierre adecuado de la clase.'),
(524, '9089119', '10363571', '2024-05-16', '14:55:18', '15:40:18', 26, 42, 1.88, NULL, 7, 'Objetivo de la clase: Reconocer el valor de la dimensión espiritual y religiosa de todo ser humano.\r\n\r\nSe comienza con estrategia umbral, logrando un clima de aula propicio para el aprendizaje.\r\n\r\nDocente entrega instrucciones claras y se recuerdan conceptos claves de clase anterior para preparar el trabajo a realizar, que consiste en preparar en grupos de trabajo un informe sobre la importancia de la dimensión espiritual. Falta verificar la comprensión de las instrucciones.\r\n\r\nDocente se vincula positivamente, con factor alegría, motivando la participación y el trabajo \r\n\r\nMonitorea permanentemente el trabajo y resuelve dudas de manera individual.\r\n\r\nSugerencias:\r\n\r\nImplementar estrategia de tiempo consensuado en este tipo de trabajo.\r\n\r\nVerificar la comprensión de las instrucciones con una estrategia como sin salida.\r\n'),
(525, '9089119', '18389625', '2024-05-16', '11:55:57', '12:45:57', 22, 34, 2, NULL, 3, 'Se comienza recordando conceptos previos a través de preguntas con palabras claves y realizando estrategia sin salida\r\n\r\nSe presenta el objetivo que es: Aplicar las propiedades de las potencias (multiplicación y división)\r\n\r\n\r\nDocente retoma contenido anterior invitando a la pizarra y logrando que los estudiantes se mantengan atentos a las explicaciones.\r\n\r\nEn un segundo momento se realiza guía de aplicación en donde se trabaja cada pregunta de manera sincrónica.\r\n\r\nDocente monitorea el trabajo de manera individual\r\n\r\nSe observa un buen clima de aula propicio para el aprendizaje y la profesora se vincula positivamente y con factor alegría. \r\n\r\nSugerencias:\r\n\r\n      Verificar la adhesión de todas las estudiantes en la clase.\r\n\r\n      Seguir desarrollando estrategias de clima de aula y de desarrollo de pensamiento.\r\n\r\n'),
(526, '9089119', '11972654', '2024-05-24', '08:15:15', '09:15:15', 28, 15, 2, NULL, 3, 'Docente presenta el objetivo: Realizar estrategias de defensa del deporte Hambol\r\n\r\nRealiza presentación de objetivo y entrega instrucciones del trabajo a realizar en sala\r\n \r\nUna vez que se trasladan al gimnasio se explicita estrategia de la clase, generando motivación e interés por parte de los estudiantes quienes se muestran después a participar activamente. \r\n\r\nEn una primera instancia se realiza formación de equipos de defensa y ataque y luego trabajan los movimientos propios del deporte a aprender. El docente se vincula positivamente, incentivando de manera sistemática y con factor alegría, logrando entusiasmo y gran adherencia al trabajo.\r\n\r\nSe observa una clase estructurada con material adecuado y con trabajo en equipo lo que da oportunidad de participación a todos los estudiantes, el docente monitorea y corrige de manera sistemática. Mantiene la participación del 100% de los estudiantes durante la clase.\r\n\r\nObservaciones y sugerencias: \r\n\r\nSe felicita al docente reconociendo una clase activa y bien estructurada con adherencia del 100% de los estudiantes.\r\n\r\nSe sugiere cómo mejora que el traslado de la sala al gimnasio sea de manera más rápida, para aprovechar mejor los tiempos y exigir uso de uniforme del colegio que corresponde a la actividad física.\r\n\r\n'),
(528, '16896799', '16036246', '2024-05-28', '11:59:00', '13:25:00', 14, 32, 1.53, NULL, 7, 'La clase comienza con retraso, debido a que los estudiantes deben ordenar y limpiar la sala, para que tener un espacio propicio para el aprendizaje.\r\nEl objetivo de la clase, es clasificar palabras segùn su acentuaciòn. Se entiende que es una clase donde se refuerzan aprednizajes ya trabajados, ¿cuàl era lo nuevo o el avance propuesto?\r\nNo se observa un trabajo para que los estudiantes se interioricen el objetivo, ni tampoco una ruta de trabajo de la clase.\r\nSe sugiere poder trabajar en la forma de hacer las preguntas o dar las instrucciones, se debe ocupar una economia del lenguaje y utilizar un lenguaje claro y preciso. Evitar preguntas imprecisas (¿què habìamos visto en la anterior?)\r\nDe igual manera, se sugiere utilizar alguna estrategia de clima de aula, 100% cuando se va a dar alguna instrucciòn, u ojos en mi.\r\n¿Què apoyos e otorgan a los estudiantes que presentan mayores necesidades? No se observa material diversificado.\r\nSe valora como positiva la actividad de cierre, donde los estudiantes trabajan de manera autònoma en su mayoria, motivados por el material de apoyo entregado y el refuerzo positivo (estimulo).\r\nSe muestra una clase coherente con el objetivo, realizando actividades acorde durante todo momento.\r\nLa profesora diferencial se muestra preocupada de los estudiantes, monitoreando en todo momento el trabajo de los niños, de manera cercana y cordial. \r\n'),
(530, '18639869', '13276799', '2024-05-28', '11:55:21', '12:40:21', 11, 36, 1.79, NULL, 7, 'Observaciones del Acompañamiento en la Clase de la Profesora Claudia Ramírez - 3° Básico A, Sesión 1.2 del Programa PASOS\r\nAspectos Positivos:\r\nActivación de Conocimientos Previos: La profesora comienza la clase recordando los contenidos vistos anteriormente, lo que activa el pensamiento de los niños sobre lo conversado en sesiones previas. Esto facilita la conexión con el nuevo material.\r\nRetroalimentación Positiva: La profesora refuerza positivamente la mayoría de las interacciones y comentarios de los estudiantes. Este enfoque incluye elogiar a una estudiante que se dedicó a barrer y ordenar los espacios comunes de la sala. ( se sugiere que agregue una anotación positiva en su hoja de vida).\r\nUso del Espacio y Participación Activa: Durante la lección del día, que incluyó la lectura de un cuento, la profesora se mueve por la sala, hace pausas y formula preguntas. Esto mantiene a los estudiantes en una actitud de escucha activa.\r\nLa acción de asignar a una estudiante con más energía y algo disruptiva como ayudante es destacable. Esto satisface su necesidad de movimiento mientras se le asigna una tarea con un objetivo positivo.\r\nAspectos a Mejorar:\r\nSería beneficioso incorporar más recursos interactivos como los \"palos preguntones\" para asignar la palabra. o la técnica \"yo con yo, y luego comparte\" para mantener a todos los estudiantes atentos y activos.\r\nGestión del Tiempo: Es crucial gestionar mejor el tiempo, haciéndolo visible para los estudiantes. Esto puede ayudar a asegurar que se complete la actividad dentro del tiempo de clase, evitando que se lleven tareas incompletas a casa.\r\nEl cierre de la sesión tuvo poco espacio y los estudiantes ya no estaban atentos. Es importante planificar un tiempo adecuado para el cierre que permita consolidar lo aprendido y mantener la atención de los estudiantes hasta el final.'),
(531, '9089119', '19274209', '2024-05-28', '13:25:31', '14:10:31', 28, 32, 1, NULL, 7, 'Docente se encuentra con licencia médica desde el 3 de abril.'),
(532, '9089119', '18356281', '2024-05-28', '13:25:23', '14:10:23', 23, 29, 1, NULL, 7, 'Docente se encuentra con licencia médica por pre y post natal desde septiembre de 2023.'),
(533, '9089119', '17614804', '2024-05-09', '10:10:44', '11:05:44', 21, 27, 2, NULL, 3, 'Objetivo de la clase: To use comparative form of long adjectives to form sentences.\r\n\r\nSe comienza preparando el clima de aula, el que se logra aplicando estrategia en sus marcas.\r\n\r\nLa docente presenta el objetivo recordando conceptos previos a través de preguntas con palabras claves, despertando el interés de las estudiantes.\r\n\r\nEstudiantes participan activamente en el desarrollo de la clase y la profesora realiza estrategia sin salida, observándose la participación activa y un clima de aula propicio para el aprendizaje.\r\n\r\nEn un segundo momento se realiza guía de aplicación de las estructuras aprendidas, se revisa y retroalimenta en la pizarra. A continuación, y como última parte se desarrollan juegos motivadores TICS con la participación de las estudiantes.\r\n\r\nLa docente se vincula positivamente y con factor alegría. \r\n\r\nSugerencias:\r\n\r\n      Verificar la adhesión de todas las estudiantes en la clase.\r\n\r\n      Seguir desarrollando actividades activas participativas.\r\n'),
(534, '9089119', '16139466', '2024-05-24', '11:55:33', '12:35:33', 28, 48, 1.92, NULL, 3, 'Objetivo: Analizar las principales características del movimiento rectilíneo uniforme.\r\n\r\n\r\nSe comienza preparando clima de aula y recordando conocimientos previos a través de preguntas claves, observándose participación activa de los estudiantes.\r\n\r\nDocente logra que los estudiantes se mantengan atentos a las explicaciones y modelamiento de ejercicios que se realizan. \r\n\r\nSe observa gran interés a una pregunta tipo PAES que realiza la docente vinculando la materia a esta prueba, se sugiere realizar más.\r\n\r\nEn una segunda parte los estudiantes aplican lo aprendido, y se observa gran adhesión al trabajo. Docente monitorea de manera individual explicando dudas y verificando avance\r\n\r\nEl clima de aula es propicio para el aprendizaje, y la profesora se vincula positivamente.\r\n\r\nSugerencias:\r\n\r\nFomentar la escucha activa y cuidar el uso de la voz.\r\n\r\nEvitar las preguntas retóricas y aplicar estrategias como sin salida.\r\n\r\nDesarrollar más preguntas tipo PAES considerando que el electivo son estudiantes de 3° y 4° medios.\r\n\r\n'),
(535, '14273480', '19092766', '2024-05-30', '04:31:29', '05:00:00', 2, 31, 1, NULL, 7, 'La docente se encuentra con licencia médica, desde inicio de año hasta la fecha, por lo cual no pudo ser observada.'),
(536, '14273480', '18684795', '2024-05-30', '10:36:59', '11:20:53', 7, 8, 1, NULL, 7, 'La docente se encuentra con licencia médica desde marzo hasta la fecha, por lo cual no pudo ser evaluada.'),
(537, '14273480', '14604335', '2024-05-28', '08:15:00', '09:03:00', 10, 32, 1.9, NULL, 7, 'Observaciones:\r\n-Se observa aplicación de estrategia MAE: Diario de Vida.\r\n- Existe un ambiente acogedor, ordenado y preparado para el aprendizaje.\r\n- Ladocente establece y promueve normas, refuerza positivamente a los estudiantes y explica con claridad.\r\n- Aplica estratgias de clima de aula, tales como: paso a paso o qué hacer, palito preguntón, 100%, tiempo visible.\r\n- Ofrece e intenciona espacio para que los estudiantes lean sus escritos.\r\n\r\nAcuerdos:\r\nEn relación a los siguientes indicadores: Explicita un método o estrategia de aprendizaje que potencia el desarrollo de la destreza y Realiza preguntas claves y/o demostraciones al estudiante promoviendo el logro del objetivo.\r\n- Al momento de realizar la escritura del relato, es importante usar el atril con el fin de que los estudiantes puedan observar la escritura de la docente; direccionalidad, uso de puntuación, reglas para escribir, separación de las palabras, entre otros, para aprovechar al máximo la estrategia utilizada.\r\n- Cuando trabajen vocabulario, usar diccionario o google para leer la definición , después de recoger  los aprendizajes previos de los estuidantes sobre el significado de la palabra.\r\n- Promover que los estudiantes utilicen el llavero con el abecedario y pared de palabras.'),
(539, '17335579', '16758658', '2024-05-23', '08:15:00', '09:25:00', 10, 32, 1.43, NULL, 7, '- Docente de asignatura lidera permanentemente el curso de la clase. No se advierte al momento una planificación conjunta que efectivamente facilite el trabajo de codocencia en el aula. \r\n- Apoyar en la gestión del clima (trabajar instrucciones, normas de convivencia, clima de aprendizaje). \r\n- Diversificar la planificación: -qué tan accesible es el material o recurso utilizado?, incluir rampas cognitivas, incluir opciones que enfaticen ideas principales y que apoyen la memoria y su transferencia (ejemplos, claves explícitas), facilitar opciones para incrementar el interés y la motivación (aplicaciones?), trabajar el esfuerzo y la persistencia (variar nivel de reto, aumentar la atracción de alcanzar el objetivo, feedback referente al dominio). \r\n- Participar activamente en el desarrollo de la clase. \r\n\r\n'),
(540, '17335579', '12264275', '2024-05-24', '11:55:00', '12:45:00', 15, 32, 2, NULL, 3, 'Buen fiato entre ambas docente, se evidencia una clase planificada que efectivamente considera las diversas necesidades del curso. Actividades dinámicas, motivadoras, bien desarrolladas (instrucciones claras, activa participación de los y las estudiantes).\r\nDocente flexible, reacciona permanentemente a las necesidades del curso, actuando con rapidez y eficacia. \r\nSugerencia: cuidar el ritmo de la clase (ansiedad---rapidez). \r\nPermanente apoyo en la gestión del clima de aprendizaje/buena convivencia escolar. \r\n\r\n\r\n'),
(541, '13769322', '10004488', '2024-05-29', '10:05:00', '11:35:00', 11, 58, 1.96, NULL, 7, 'Utilizar el tiempo no visible para determinar los tiempos de trabajo.\r\nConsignar la clase en plataforma lirmi.\r\n'),
(542, '18639869', '13195888', '2024-05-29', '11:55:28', '12:40:28', 17, 36, 1.79, NULL, 7, 'La profesora observa un comportamiento bullicioso entre los estudiantes al comenzar la clase. Ella actúa de manera inmediata, manteniéndose adelante y esperando a que los niños bajen su nivel de energía. Luego les habla, reflejando lo que está ocurriendo y solicitándoles que vuelvan a sus puestos y adopten una actitud adecuada para iniciar la clase. También les pide que guarden los materiales que no corresponden y anuncia que conversará al final con tres estudiantes sobre su conducta en la clase anterior.\r\nUna vez que el ambiente se vuelve tranquilo y los estudiantes responden al encuadre de la profesora, ella presenta el objetivo de la clase y comienza a explicar los contenidos. Se destaca su constante motivación para que los niños mantengan hábitos, como levantar la mano para opinar. La profesora muestra una actitud receptiva al escuchar lo que los estudiantes comentan, lo que refleja en la atención y motivación de los alumnos.\r\nDurante la entrega de la ficha de trabajo, la profesora proporciona instrucciones claras y pertinentes. Mientras los estudiantes trabajan, ella monitorea sus avances. Cuando la conversación de los niños aumenta de volumen, la profesora los reenfoca, solicitando silencio y reiterando que el trabajo es personal. Anuncia un tiempo específico para el trabajo y utiliza un cronómetro para indicar su finalización, lo que permite que los niños completen la actividad dentro del plazo asignado.\r\nDespués del trabajo individual, la profesora brinda un momento para que los estudiantes compartan lo que han escrito. Sin embargo, el tiempo resulta insuficiente para que todos participen. Se sugiere utilizar un método que permita que los niños comenten su trabajo de manera más eficiente, ya que esto podría liberar tiempo para realizar un cierre que evalúe lo aprendido. A pesar de esto, la profesora concluye la clase reiterando la importancia del respeto y asegurándose de que los estudiantes dejen limpio su espacio antes de salir de la sala.'),
(543, '18639869', '18114575', '2024-06-04', '16:10:30', '16:50:30', 3, 36, 1.74, NULL, 7, 'La profesora Jenifer comienza la clase con una estrategia motivadora, utilizando una canción que facilita la transición de los niños del recreo a la actitud de clase. Además, les guía en un ejercicio de respiración para ayudarles a enfocarse. Recuerda las normas de la clase y los niños y niñas las repiten, reforzando así las expectativas de comportamiento.\r\n Antes de iniciar la lección, la profesora repasa lo aprendido en clases anteriores utilizando un apoyo visual. Los niños participan activamente y muestran curiosidad positiva. Durante la exposición, la profesora utiliza técnicas teatrales, diferentes tonos de voz y contacto visual amoroso, lo que crea un ambiente de aprendizaje dinámico y atractivo. La coordinación con su asistente en el aula es notable, y los niños disfrutan de la historia contada. \r\nDurante el trabajo práctico, la profesora proporciona instrucciones claras y luego verifica la comprensión de todos los estudiantes. Utiliza música relajante para mantener un ambiente tranquilo y pasa por los puestos para monitorear el progreso de los niños. Se sugiere que la profesora monitoree el tiempo de manera más visible para ayudar en la gestión del mismo por parte de los estudiantes, lo que podría facilitar la realización de actividades posteriores, como comentarios sobre el trabajo realizado y un cierre adecuado. \r\nEn resumen, la clase de la profesora Jenifer se caracteriza por brindar un ambiente acogedor y participativo, así como por su habilidad para utilizar técnicas creativas y una buena coordinación con su asistente para mantener el interés y la atención de los estudiantes.'),
(544, '13769322', '11879515', '2024-06-04', '14:10:00', '15:40:00', 15, 58, 1.65, NULL, 7, '•	Desarrollar un proyecto que involucre las asignaturas de Taller de Escritura y Taller de Formación Ciudadana a partir del IIº semestre.\r\n•	Crear una pauta de investigación donde los alumnos completen la información necesaria para disertar (estandarizada).\r\n'),
(545, '9089119', '10042509', '2024-06-04', '10:10:13', '10:40:13', 29, 13, 2, NULL, 3, 'Se presenta el objetivo: Transformar un producto para abordar una nueva necesidad según conceptos de sustentabilidad de economía circular.\r\n\r\nSe comienza generando un buen clima de aula a través de estrategia umbral.\r\n\r\nSe recuerdan conceptos previos a través de preguntas con palabras claves y realizando estrategia sin salida.\r\n\r\nDocente retoma trabajo anterior entregando instrucciones claras y logrando que los estudiantes se mantengan atentos y participativos ante las explicaciones.\r\n\r\nEn un segundo momento se retoma trabajo iniciado en clase anterior, en donde se observa el estado de avance y activa adherencia al trabajo\r\n\r\nDocente monitorea el trabajo de manera individual\r\n\r\nSe mantiene un buen clima de aula y el profesor se vincula positivamente y con factor alegría. \r\n\r\nSugerencias:\r\n\r\n      \r\n      Seguir desarrollando estrategias de clima de aula y de desarrollo de pensamiento.\r\n'),
(546, '17335579', '19404965', '2024-06-06', '10:05:00', '09:57:23', 7, 32, 1.33, NULL, 7, 'Observación. Formación siempre antes del ingreso al aula. Implementar estrategias de clima de aula. \r\nSe debe ofrecer a Mateo alguna actividad alternativa relacionada efectivamente con el contenido, asimismo enriquecer su espacio de trabajo (demasiado estímulo sobre la mesa).\r\nCuidar permanente un clima propicio para el aprendizaje, realizar pausas si es necesario y tomar un tiempo para recordar reglas y normas de convivencia. \r\nCorroborar siempre la comprensión de las instrucciones antes de dar inicio a las actividades. \r\n\r\n\r\n\r\n\r\n'),
(548, '14273480', '14209132', '2024-06-04', '08:15:00', '09:45:00', 9, 34, 2, NULL, 7, 'Se observa, durante clases de matemática.\r\nLa profesora participa y coopera en el proceso de aprendizaje de los estudiantes.\r\nAtenta a las necesidades de los estudiantes y dispuesta a apoyar.\r\nMantiene normas, sala ordenada y limpia.'),
(549, '14273480', '14604335', '2024-06-04', '08:15:00', '09:45:00', 9, 34, 1.95, NULL, 7, 'Observaciones:\r\nLa docente realiza una clase estructura, con ruta de aprendizaje que promueve la claridad para los estudiantes, sobre el objetivo y tareas a realizar durante la clase.\r\nPromueve un buen ambiente para el aprendizaje.\r\nOfrece experiencias de aprendizajes lúdicas, concretas y prácticas, donde los estudiantes pueden aplicar sus conocimiento.\r\nRealiza monitoreo constante, fortaleciendo al evaluación formativa.\r\n\r\nAcuerdos:\r\nImplementar sin salida con nombre técnico.'),
(550, '7060271', '16161542', '2024-05-28', '14:55:36', '15:40:36', 2, 32, 1.5, NULL, 7, 'Se realiza actividad en Biblioteca, Lectura en Voz Alta. Cuento extenso para la edad de los estudiantes. Se trabajan las estrategias de cuento pero no están distribuidas adecuadamente en el cuento. El cuento se hace tediosos para los estudiantes y poco a poco van perdiendo la concentración. '),
(551, '7060271', '17079039', '2024-05-28', '10:50:57', '11:35:57', 10, 34, 2, NULL, 7, 'Trabajo de calendario matemático con estrategias MAE, se nota el avance de la docente y de las estrategias con los estudiantes, se nota el trabajo diario ya que los estudiantes conocen la rutina y participan activamente.'),
(552, '7060271', '17082332', '2024-05-28', '09:00:48', '09:45:48', 7, 34, 1.85, NULL, 7, 'Trabajo sistemático, calendario matemático con cumplimiento de todos los pasos , trabajo organizado y continuo. Felicitaciones por la incorporación de las estrategias MAE en tan poco tiempo. Niños atentos, trabajo organizado. Se notan grandes avances en la profesora,'),
(554, '14273480', '15221803', '2024-06-04', '11:55:00', '12:40:00', 7, 34, 1.95, NULL, 7, 'Observaciones:\r\nDocente realiza clase de repaso de asignatura de matemática, tanto por el horario como el periodo de clases.\r\nRealiza una clase donde se observa una estructura clara, utilizando lenguaje matemático e intenciona preguntas para revisar los aprendizajes de los estudiantes,\r\nSe observa un buen clima de aula, donde los estudiantes participan y se observa conocimiento.\r\n\r\nAcuerdos:\r\nImplementar \"sin salida\", con nombre técnico.\r\nImplementar tiempo visible.'),
(555, '7060271', '15408841', '2024-05-28', '08:15:16', '09:00:16', 8, 34, 1.95, NULL, 7, 'Preocupación constante por los estudiantes, mantiene el orden y atención de los niños y niñas, mediadora frenete a los conflictos en sala. Niños inquietos, se sugiere buscar estrategias de refuerzo positivo para lograr que estén atentos durante la clase'),
(556, '7060271', '26323365', '2024-05-28', '10:05:21', '10:50:21', 9, 34, 2, NULL, 7, 'Trabajo calendario matemático. Estudiantes concentrados y organizados, se nota el trabajo diario ya que los estudiantes conocen la rutina. Se dan instrucciones claras de la actividad a realizar. '),
(557, '7060271', '12604359', '2024-05-28', '10:50:00', '11:35:00', 10, 34, 2, NULL, 7, 'Se observa un curso atento y concentrado, hay buena dinámica de clase, sala ordenada y limpia. La asistente participa activamente durante la clase. Existe monitoreo constante del trabajo de los estudiantes. se corrige en silencio, logrando la atención del curso'),
(558, '7060271', '11224381', '2024-05-28', '09:00:32', '09:40:32', 7, 34, 2, NULL, 7, 'Mantienen una mirada sobre el grupo curso, atenta a las necesidades de los niños y niñas, sala bien dispuesta y ordenada. Contribuye al orden de los espacios de la sala. Corrige en silencio de manera de no interrumpir la atención de los estudiantes'),
(559, '7060271', '12604321', '2024-05-28', '08:15:21', '09:00:00', 8, 34, 1.63, NULL, 7, 'Calendario matemático, se trabaja la estrategia pero se sugiere mayor estructura de la presentación ya que se requiere una continuidad de un paso a otro. Los niños conocen la rutina lo que manifiesta un trabajo continuo dentro de la rutina de inicio de la clase de matemática. '),
(560, '7060271', '12958246', '2024-05-28', '10:05:07', '10:50:07', 9, 34, 2, NULL, 7, 'Sala ordenada y buena disposición de los espacios. Colabora constantemente en el apoyo a la profesora para que los estudiantes ¿estén prestando atención y participen de la clase. Corrige en silencio. Se mantiene activa durante los momentos de la clases. '),
(561, '13769322', '13268741', '2024-06-07', '14:10:00', '15:40:00', 16, 42, 1.42, NULL, 7, 'Se conversa con la docente sobre:\r\n•	La clase había sido un acuerdo de la observación anterior, por ende estaba avisada con un poco menos de un mes.\r\nRevisar previamente el material para desarrollar sus clases, incluyendo los implementos tecnológicos que tiene la sala (si están funcionando)\r\nMantener guías de trabajo, comprensiones de lecturas fotocopiadas para utilizarlas cuando exista un percance en el transcurso de la clase.\r\n'),
(563, '13769322', '13061665', '2024-06-06', '10:05:00', '11:35:00', 15, 1, 1.74, NULL, 7, 'ACUERDOS – COMPROMISOS  - METAS\r\nOrganizar la clase en grupos con el compromiso de que no levantarse tanto del puesto.\r\nLeer el manual de autoaprendizaje de Ligia para implementar, poco a poco, algunas estrategias que pueden ser útiles en su clase.\r\n\r\n'),
(564, '18639869', '16161640', '2024-06-04', '14:55:46', '15:40:46', 18, 36, 0.95, NULL, 7, 'Sesión 2,8 de la unidad \"yo y los demás\" del programa PASOS de orientación PASOS: Al llegar al pasillo fuera de la sala está sucia con papeles de colación y otros residuos. Este desorden se refleja en la actitud de los estudiantes dentro del aula. Al entrar a la sala, los estudiantes mantienen un nivel de ruido inapropiado para el ambiente de clase.  El profesor demora unos minutos en abordar esta situación, como estrategia procede a recordar a los y las estudiantes la visita anterior de la coordinadora académica, quién fue a conversar con ellos sobre las dificultades de comportamiento que han estado teniendo como curso, los niños no toman en serio esta intervención del profesor, y señalan ser un curso que se porta bien. \r\nA pesar del ambiente, el profesor intenta iniciar la lección recordando los contenidos anteriores pero el ruido persiste. Los y las estudiantes conversan, hacen sonidos con botellas y lápices, esto es permanente. Profesor continua, y comienza a dictar la lección del día, a pesar de que el ambiente aún no es apto para el aprendizaje. \r\nSe observan continuas faltas de respeto, hacia el profesor y entre los niños y niñas. Hay estudiantes que mientras el profesor habla se están peinando, riendo, otros conversan sobre videojuegos, muchos se mueven por la sala sin permiso, comen, juegan con autitos, agua.\r\nLa falta de normas claras y la percepción de que todo está permitido dificultan la dinámica del aula. \r\nEl tema de la clase tiene que ver con el bullying, tema importante y relevante, pero los estudiantes no lo toman en serio debido al ambiente descontrolado del aula. El profesor intenta continuar con la planificación presentando un video, pero el ruido y la falta de atención impide que los niños y niñas pongan atención.  Cuando les solicita opiniones los estudiantes no esperan su turno, ni levantan la mano, si no que gritan sus respuestas. Posterior a esto el Profesor entrega una ficha de trabajo, pero los niños no atienden a las instrucciones, se entrega la ficha y quedan en trabajo en parejas, el ambiente se torna aún más desordenado y ruidoso, profesor no logra reducir el ruido de manera efectiva. \r\nNo se realiza un cierre adecuado de la sesión. Los estudiantes continúan con las percusiones en las mesas y desorden. Suena el timbre, niños de la sala contigua ingresan, aumentando el caos.\r\nRecomendaciones: \r\nEs fundamental establecer y reforzar normas claras desde el inicio de la clase. Esto incluye gestionar el nivel de ruido y el comportamiento dentro del aula de manera consistente.  Si es que es necesario retrasar el paso de contenidos, se debe hacer, pero la clase no deberá coexistir en un ambiente de caos y desorden. Debemos priorizar desde el inicio que los niños y niñas respondan al encuadre inicial.\r\nSe sugiere utilizar estrategias variadas y efectivas para mantener el orden, como por ejemplo: \r\n1. \"Yo con yo, luego comparte\", esta estrategia permite que los y las estudiantes reflexionen individualmente y luego compartan sus pensamientos con un compañero, para que finalmente lo hagan con toda la clase. \r\n2. \"Manos arriba, al lado\"\r\n3. Formar a los estudiantes al entrar y salir de la sala. \r\n4.Es importante manejar las disrupciones de manera efectiva, asegurándose de que los estudiantes entiendan las consecuencias de su comportamiento. \r\n5.Usar señales visuales, auditivas y recordarlas durante el transcurso de la clase.\r\n6.Enseñar y practicar técnicas de respiración y relajación para ayudar a los y las estudiantes a autorregularse, reducir ansiedad y estrés. \r\n\r\nSiempre reservar tiempo para un cierre adecuado que permita consolidar lo aprendido y evaluar las comprensión de la clase. En estos casos, donde la clase no pudo seguir su curso de buena manera, el cierre puede ser destinado para conversar de lo ocurrido, invitar a reflexionar y verbalizar lo que se espera de ellos como curso para una siguiente oportunidad. '),
(565, '18639869', '16404386', '2024-06-07', '11:55:55', '12:40:00', 16, 36, 1.68, NULL, 7, 'Observaciones del Acompañamiento en la Clase de Orientación - Sesión 1.3 del Programa PASOS\r\nAspectos Positivos:\r\nAl ingresar a la sala, los estudiantes comprenden inmediatamente la transición del recreo al ambiente de aprendizaje, guardando silencio y ubicándose en sus puestos.\r\nEl profesor utiliza diversos recursos como los \"palitos preguntones\" para garantizar la participación de todos. Además, siguiendo las sugerencias de la planificación PASOS, trae un peluche como elemento lúdico para dar turnos, lo cual añade un elemento de diversión y estructura a la actividad.\r\nLa sesión trata sobre la autoestima y la identificación de cualidades positivas en sí mismos. Los estudiantes trabajan en un organizador gráfico para plasmar estas cualidades.\r\nEl profesor se acerca a los estudiantes que tienen dificultades para reconocer características positivas en ellos mismos, brindando apoyo personalizado. Esto muestra una atención individualizada y una preocupación genuina por el bienestar emocional de los estudiantes.\r\nA pesar de que la clase se extendió un poco más allá del tiempo estimado, los estudiantes se muestran respetuosos y escuchan la conclusión de la clase con atención.\r\nAspectos a Mejorar:\r\nSe sugiere la implementación de un método de tiempo visible, como un reloj o temporizador, para ayudar a gestionar mejor el tiempo y asegurar que todas las actividades y el cierre de la clase se realicen dentro del tiempo estimado. Esto es especialmente importante para mantener la estructura y el ritmo de la lección.\r\nEs importante continuar con actividades que fomenten la autoestima y el reconocimiento de cualidades positivas. Podría ser útil incorporar actividades grupales donde los estudiantes se den retroalimentación positiva entre ellos, para fortalecer la comunidad y el apoyo mutuo.\r\nEstas observaciones resaltan la efectiva gestión del aula y el uso de recursos didácticos por parte del profesor, al tiempo que sugieren pequeñas mejoras para optimizar el uso del tiempo y seguir fomentando un ambiente de aprendizaje positivo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(566, '18639869', '17801292', '2024-06-06', '15:55:05', '15:30:37', 1, 36, 1.94, NULL, 3, 'La profesora inicia la clase con una canción, lo que ayuda a los y las estudiantes a comprender la transición entre una clase y otra. Además, los invita a respirar y relajarse antes de comenzar, creando un ambiente propicio para el aprendizaje.\r\nComienza recordando lo visto en clases anteriores con apoyo visual y una cajita, lo que enriquece el material del programa PASOS y facilita la conexión con los contenidos previos.\r\nProcede a leer lo que una estudiante escribió junto a su familia en un cuaderno, como parte de una dinámica en la que, después de cada clase de orientación, un estudiante lleva el cuaderno a casa para contar sus tradiciones familiares. Esto promueve la participación familiar y fortalece la comunidad escolar. Comenta y refuerza positivamente a la estudiante que compartió su tradición, lo que fomenta la autoestima y la motivación.\r\nAl iniciar la lección del día y contar la historia del espejo, la profesora usa distintos tonos de voz y realiza contacto visual con los y las estudiantes, manteniendo su atención y motivación.\r\nEntrega instrucciones claras para la actividad y proporciona música relajante para ayudar a los estudiantes a concentrarse. Trabaja directamente con un estudiante con necesidades especiales, mientras su asistente ayuda a los demás, asegurando que toda la clase reciba el apoyo necesario.\r\nLa llegada del inspector general para invitar al curso a participar en actividades de aniversario interrumpió la clase e impidió la finalización de la actividad. \r\nRecomendaciones:\r\nEstablecer una comunicación previa con el equipo de gestión para planificar las intervenciones externas, asegurando que no interfieran con el desarrollo de las clases.\r\nSeria bueno incorporar más prácticas de mindfulness de manera regular, como la respiración profunda y la relajación guiada, para ayudar a los estudiantes a desarrollar habilidades de autorregulación emocional.\r\nEstas observaciones y recomendaciones están diseñadas para fortalecer las prácticas efectivas ya implementadas por la profesora, y para ofrecer estrategias que puedan mejorar aún más la gestión del aula y la experiencia de aprendizaje de los estudiantes.');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(567, '18639869', '19404149', '2024-06-07', '13:25:12', '14:10:13', 14, 36, 1.63, NULL, 7, 'Observaciones del Acompañamiento en la Clase de Orientación - Programa PASOS\r\nLa profesora comienza la clase solicitando a los estudiantes que recojan la basura a su alrededor, se pongan el delantal o cotona y saquen sus materiales de orientación. Esto ayuda a crear un ambiente limpio y ordenado, y refuerza la importancia de seguir normas y lineamientos hasta que se generen hábitos.\r\n\r\nEntrega el objetivo de la clase de manera clara, lo cual orienta a los estudiantes sobre lo que se espera lograr durante la sesión.\r\nSolicita que los estudiantes recuerden levantar la mano para opinar y hablar, estableciendo un ambiente de respeto y orden.\r\nDurante el desarrollo de la clase, entrega fichas de trabajo y da instrucciones claras sobre cómo completarlas. Proporciona tiempo visible para cada ficha, lo que ayuda a los estudiantes a gestionar su tiempo de manera efectiva y mantenerse enfocados en la tarea. Según las sugerencias del programa de orientación PASOS, envía una parte de la actividad como tarea para realizar en familia, fomentando la participación de los padres y el refuerzo del aprendizaje en casa.\r\nLa profesora se muestra atenta a lo que ocurre en toda la sala, lo que permite detectar y atender rápidamente cualquier necesidad o problema que surja entre los estudiantes.\r\nAspecto a Mejorar: Es importante dejar un tiempo suficiente al final de la clase para realizar un cierre adecuado. Esto permite consolidar los aprendizajes, responder preguntas y asegurar que los estudiantes comprendan y reflexionen sobre lo que han aprendido.\r\nSe sugiere asegurarse de realizar un seguimiento de las tareas enviadas para el hogar, proporcionando retroalimentación y reconociendo el esfuerzo de los estudiantes y sus familias.\r\nImplementar estas estrategias puede ayudar a mejorar la eficacia de la clase, asegurando que los estudiantes no solo comprendan el contenido sino que también desarrollen hábitos positivos y reciban el apoyo necesario tanto en el aula como en el hogar.'),
(568, '18639869', '11879515', '2024-06-07', '14:10:12', '14:55:12', 15, 36, 2, NULL, 7, 'La profesora inicia la clase con una introducción motivante sobre la importancia del espacio de orientación, lo cual establece un tono positivo y receptivo para el aprendizaje.\r\nConsulta a los y las  estudiantes si recuerdan lo visto en clases anteriores y les ayuda a recordar, lo cual refuerza la continuidad y conexión de los contenidos.\r\nLa profesora entrega los contenidos con una actitud y energía positivas, lo cual se contagia a los estudiantes. Se nota que disfrutan de la clase y están motivados. Conecta el tema del día con la realidad, compartiendo anécdotas personales relevantes, lo que facilita la comprensión y el interés de los estudiantes.\r\nUtiliza un cronómetro para gestionar el tiempo de manera efectiva, asegurando que todas las actividades se desarrollen dentro del tiempo previsto.\r\ninicialmente usa un corazón de peluche para dar la palabra, pero al notar que los estudiantes se avergüenzan, cambia a una pelota más neutra prestada por un estudiante. Esta flexibilidad y adaptación son destacables, y los estudiantes disfrutan de la dinámica.\r\nAl entregar la ficha de trabajo, se acerca a los estudiantes para apoyarlos personalmente, lo que demuestra atención individualizada y apoyo constante.\r\nGenera un buen cierre, dando espacio para que los estudiantes aporten y sella la clase con la frase motivadora: \"Soy la profesora de uno de los mejores cursos del colegio.\" Esto refuerza la autoestima y el sentido de pertenencia de los estudiantes.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(569, '18639869', '18447397', '2024-06-07', '14:55:12', '15:40:12', 12, 36, 1.89, NULL, 7, ' La profesora está haciendo un esfuerzo consciente para manejar eficazmente la transición entre clases y mantener la atención de los y las estudiantes. Es importante reconocer el desafío que enfrentan los estudiantes al cambiar de una materia a otra, especialmente al final del día, Profesora les permitirles un breve descanso, dando permiso para ir al baño y luego realiza una rutina para prepararlos para la siguiente clase, esto ayuda a minimizar las distracciones y a que se centren en el nuevo contenido. \r\nProfesora comienza recordando lo visto anteriormente, pregunta a niños y niñas, ellos contestan asertivamente. Luego comienza con la lectura de un cuento, actividad dada por la planificación PASOS, para esto solicita \"actitud de cuento\", que guarden silencio, guarden materiales, espera que todos logren la conducta esperada para empezar. La lectura de cuentos parece ser una actividad que motiva a los y las estudiantes, les mantiene interesados en el aprendizaje. Las pausas y las preguntas durante la lectura son estrategias efectivas para fomentar la participación y mantener la atención de los estudiantes.\r\nLa planificación sugiere una actividad con cartulinas y materiales, Profesora simplifica aquella actividad pero de todas formas logra los objetivos. Les da las instrucciones, escribe ejemplos en la pizarra, usa temporizador,  logrando dar espacio para que niños y niñas comenten sus trabajos y realizar un cierre.\r\n\r\n\r\n\r\n\r\n'),
(570, '14273480', '15616161', '2024-06-04', '14:15:00', '15:00:59', 10, 34, 2, NULL, 1, 'Observaciones:\r\n- Se observa el inicio de la clase.\r\n- La docente realiza una clase organizada, con utilización de diversos recursos y ofrece espacio práctico para el aprendizaje a sus estudiantes.\r\n- Se destaca la promoción de altas expectativas.\r\n\r\nAcuerdos:\r\n- Continuar realizando clases con la organización presentada.\r\n- Aplicar rutinas de pensamiento, cuando corresponda.\r\n'),
(571, '14273480', '18143931', '2024-06-04', '13:30:00', '13:00:00', 8, 34, 1.72, NULL, 2, 'Observaciones:\r\n- Se observa el desarrollo de la clase de matemática, clase de refuerzo.\r\n- En general, se observa un buen clima de aula.\r\n- Los estudiantes participan y resuelven ejercicios de forma individual.\r\n\r\nAcuerdos:\r\n- Implementar estrategias tales como: sin salida y tiempo visible, haciendo un hábito de trabajo, tanto para ella como para los estudiantes.\r\n- Utilizar las 5s de forma conciente: si bien se utilizan para la disciplina y funciona, es importante que, por ejemplo: cuando se realicen preguntas claves a los estudiantes, realmente soliciten la palabra para contestar.\r\n- Realiza preguntas claves que promuevan las altas expectativas y, a su vez, favorezcan el aprendizaje de los estudiantes: durante la clase realizo pregunta muy amplia: \"¿está claro?, pero esta no permite verificar si los estudiantes realmente comprenden. A su vez, aprovechar el error como parte del aprendizaje, para lo cual la docente debe detenerse y lograr que el estudiante lo descubra.'),
(572, '14273480', '16896118', '2024-06-04', '13:30:00', '14:00:00', 8, 34, 1.9, NULL, 2, 'La docente es observada durante el desarrollo de la clase de matemática.\r\nColabora con los aprendizajes de los estudiantes y normas de la sala.\r\nSe observa sala más ordenada.\r\n\r\nAcuerdos:\r\n- Intervenir espontáneamente en el refuerzo pedagógico de los niños/as, colaborando en el proceso pedagógico de sus estudiantes, en espacial apoyando a los más descendidos.'),
(573, '11537827', '19533887', '2024-06-04', '14:10:52', '15:40:52', 18, 22, 1.89, NULL, 7, 'Muy buena clase con un buen ritmo y un buen clima de aula.\r\n\r\nSe recomienda que la actividad utilizada sea parcializada para lograr que los estudiantes puedan completar en su mayoría.  \r\n\r\nMuy buena clase.  '),
(574, '13567342', '18448695', '2024-06-06', '12:03:00', '13:00:00', 25, 15, 1.75, NULL, 6, 'Profesora se muestra cercana y respetuosa con las estudiantes, manteniendo un trato agradable que facilita una buena comunicación con éstas.  Muestra disposición a escucharlas y llegar a acuerdos, así como tranquilidad a la hora de tener que explicar y aclarar dudas.\r\nEn general, las alumnas responden a las indicaciones de la profesora, realizando los ejercicios que esta les solicita.  Sin embargo, requiere de una supervisión constante para mantener esta actitud, de otra manera comienzan a distraerse, dejan de realizar los ejercicios indicados y algunas se dirigen a lugares donde profesora deja de tener control (alumnas en patio 3 donde está el otro curso).  Se sugiere contar con actividades alternativas al momento de tomar evaluaciones pendientes, así como entregar responsabilidades a estudiantes que contribuyan al desarrollo de una clase efectiva y dentro del espacio establecido.'),
(575, '13567342', '18760120', '2024-06-04', '12:05:00', '13:25:00', 24, 15, 1.79, NULL, 6, 'Profesora muestra buen manejo de grupo. Y que muestra una preocupación constante de incorporar a los estudiantes a las actividades a realizar, utilizando diversas estrategias.\r\nEn general, gran parte del curso participa activamente de la clase, pero hay un grupo de alumnos que se resta de las actividades.  El curso es complejo disciplinariamente, en el que hay un grupo disruptivo que tiende a realizar ejercicios de manera más violenta, sin medir el daño que puede provocarle a los compañeros y el material.  Se sugiere el monitoreo constante y buscar mecanismos que permitan reducir estas conductas riesgosas.'),
(576, '13567342', '15405993', '2024-06-05', '10:35:00', '11:35:00', 23, 42, 1.75, NULL, 6, 'Profesora que mantiene una actitud cercana y respetuosa hacia las estudiantes, favoreciendo un clima agradable al interior de la sala, en donde las estudiantes se ven invitadas a participar activamente.  Se sugiere aprovechar esta cercanía para desafiarlas a enfrentarse a situaciones o cuestionamientos que promuevan la reflexión y la asimilación más profunda del contenido.\r\nEn cuanto al espacio físico, es necesario establecer acuerdos y fortalecer el seguimiento de normas con las estudiantes que asegure contar con las condiciones propicias para el aprendizaje, sin distractores (como el realizar actividades anexas a la clase).'),
(577, '13567342', '19405021', '2024-05-09', '12:19:00', '13:25:00', 23, 34, 2, NULL, 6, 'Profesora con un buen manejo de grupo, pese a las interrupciones de dos estudiantes, mantiene la calma y los corrige con respeto.  Se muestra cercana y cariñosa con los estudiantes, generando un espacio de confianza para que estos puedan hacer sus consultas o participar.  La clase es desafiante y motivadora, entregado ejercicios que los estudiantes deben desarrollar, haciéndoles consultas constantemente y orientándolos a cuestionarse sus respuestas o planteándoles otros escenarios.\r\nUna sugerencia sería agilizar el proceso de revisión inicial, pues se invierte mucho tiempo en ello.'),
(578, '13567342', '18761755', '2024-05-10', '12:17:00', '13:25:00', 28, 27, 1.38, NULL, 6, 'Profesora con buen trato hacia los estudiantes, con mucha paciencia, a pesar de las interrupciones y poco avance de los alumnos.\r\n\r\nSe sugiere:\r\n- Utilizar estrategia que permita verificar la comprensión de las instrucciones y/o contenidos, reduciendo el tener que detenerse constantemente en los puestos de las estudiantes a aclarar dudas sobre lo que deben hacer.  \r\n- Recurrir a la estrategia de tiempo visible a la hora de asignar tiempo para las actividades, contribuyendo a la autorregulación de los estudiantes, y también a la gestión del tiempo de la clase. Destinar tiempos definidos con alumnos y verificar avance constantemente.\r\n\r\nAcuerdos:  Poner al día las planificaciones. Utilizar rutinas de clima de aula propuestas en manual entregado.'),
(579, '13567342', '17456104', '2024-06-06', '10:45:00', '11:35:00', 22, 34, 1.8, NULL, 6, 'Profesora presenta una clase atractiva y dinámica, lo que demuestra preparación previa.  Los estudiantes se ven motivados a participar y responder a los desafíos que les plantea la docente.\r\nSe realizan actividades cortas, que ayuda a mantener la atención de los estudiantes y realizar revisiones constantes.\r\nBien el trabajo de tutorías en la revisión, pero debe ser más supervisado.  Algunos estudiantes esperan que sus compañeros les den la solución.\r\nSe evidencia la necesidad de hacer más constante el monitoreo del avance de los estudiantes, no desde la pizarra y vinculado a la revisión (que se hace), sino que se sugiere realizar recorridos más frecuentes por los puestos con el fin de identificar a alumnos que no avanzan de manera autónoma y esperan la resolución de los compañeros y la docente en la revisión final.\r\nSe sugiere la utilización constante de rutinas de aula que contribuyan a bajar el nivel de ruido de la sala y que los estudiantes se mantengan en sus puestos.'),
(580, '13567342', '13368129', '2024-04-16', '10:24:00', '13:35:00', 23, 27, 1.5, NULL, 6, 'Profesora mantiene un trato agradable con las estudiantes y se muestra atenta a sus consultas.  El material utilizado es atractivo y logra captar la atención.\r\nSe sugiere utilizar estrategias que permitan mantener esta atención y que favorezca la participación y comprensión de todas.\r\nTambién se recomienda trabajar con las estudiantes en generar las condiciones físicas necesarias para el inicio de la clase, por ejemplo: indicando bajar las mochilas de la mesa, supervisar que todas cuenten con los útiles necesarios para trabajar y que mantengan su espacio limpio.'),
(581, '18639869', '10004488', '2024-08-30', '13:25:49', '14:10:49', 13, 36, 2, NULL, 7, 'Observaciones del Acompañamiento en la Clase de Orientación - Programa PASOS\r\nSe destaca el uso de recurso concreto y práctico, como el sonido de una campana, para evitar elevar la voz y repetir instrucciones. Este recurso es efectivo, ya que los estudiantes lo reconocen como una señal clara de silencio y orden.\r\nLa planificación anticipada de la profesora es destacable, ya que tenía el espacio físico arreglado con anterioridad. Esto permitió realizar la actividad sugerida en la planificación PASOS sin perder tiempo de clase, asegurando que los estudiantes pudieran desplazarse libremente por la sala.\r\nAl comenzar la lección, la profesora se toma un tiempo para recordar los contenidos anteriores y da espacio para que los estudiantes comenten y revisen el trabajo realizado en casa con sus cuidadores principales.\r\nSe recomienda que la profesora mencione distintas figuras cuidadoras (tíos, abuelas, etc.), no solo mamá y papá, para reconocer la diversidad en la realidad de los estudiantes y evitar herir sensibilidades.\r\nSe percibe que el curso tiene normas y hábitos bien interiorizados, ya que los estudiantes levantan la mano para hablar y respetan los turnos, lo que contribuye a un ambiente de aprendizaje positivo.\r\nLa profesora hace una conexión con contenidos de ciencias naturales para explicar la actividad, lo cual facilita la comprensión al activar y aplicar conocimientos previos.\r\nAunque la actividad propuesta implicaba mucho movimiento, los estudiantes respetaron las instrucciones y disfrutaron de la dinámica, lo que demuestra un buen control de la clase.\r\nAl finalizar la clase, la profesora agradece a los estudiantes por compartir sus ideas y anticipa lo que se trabajará en la próxima sesión. Además, refuerza positivamente la participación de todos, lo cual es clave para mantener la motivación y el compromiso.\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(582, '13769322', '18447397', '2024-09-03', '08:15:00', '09:20:00', 12, 32, 1.96, NULL, 7, 'Realizar un visto en los cuadernos cuando se finalice alguna actividad de copiar y/o desarrollar alguna guía para supervisar el trabajo de los alumnos (as)\r\nSe felicita a los profesores por el buen manejo en sala donde se nota su coordinación previa a las clases.\r\n'),
(583, '18639869', '26323365', '2024-09-04', '09:50:10', '10:35:10', 9, 36, 1.79, NULL, 7, 'La profesora comienza la clase solicitando a sus estudiantes una actitud de escucha y respeto, utilizando métodos como las \"manos arriba\", los cuales resultan efectivos. La lección se centra en las emociones y la intensidad con que se sienten, en una escala del 0 al 2. Durante toda la clase, la profesora proporciona refuerzo positivo a quienes participan, aunque se torna complejo que todos puedan hacerlo. Se sugiere que la profesora se apoye en sistemas aleatorios, como los \"palitos preguntones\", para garantizar que todos los estudiantes sientan que tienen la misma posibilidad de contribuir y ser escuchados. Es notable la amplia y asertiva información que los niños y niñas tienen sobre las emociones y sus significados. Ocurre un momento especial y alegre cuando, al hablar del amor, la clase espontáneamente comienza a cantar una linda canción sobre el tema. La profesora permite que los estudiantes disfruten de este espacio de expresión. Dado que el tiempo resulta insuficiente, se recomienda el uso de un cronómetro visual que ayude tanto a la profesora como a los estudiantes a gestionar mejor el tiempo durante la clase.'),
(584, '13769322', '13276799', '2024-09-03', '14:10:00', '15:40:00', 13, 32, 1.5, NULL, 7, 'Se solicita a la docente planificar la clase organizando los tiempos de trabajo de los alumnos.'),
(585, '13769322', '19404149', '2024-09-05', '08:15:00', '09:40:00', 11, 34, 1.93, NULL, 7, 'Indicar, al inicio de la clase, solo lo necesario para desarrollar las actividades\r\nDesarrollar el lenguaje matemático en los estudiantes nombrando los conceptos correspondientes.\r\n'),
(586, '13769322', '18448344', '2024-09-09', '14:10:00', '15:40:00', 15, 15, 1.72, NULL, 7, 'Entregar en sala indicaciones claras sobre lo que realizará en la clase y donde deben permanecer los alumnos ya que al estar en patio, los estudiantes se dispersaron por el colegio.'),
(587, '13769322', '20326728', '2024-09-10', '08:15:00', '09:40:00', 16, 22, 1.5, NULL, 7, 'Entregar las instrucciones claras al inicio de la clase en cuanto a materiales y tiempos.\r\nDesarrollar una clase más participativa, donde pueda realizar preguntas e interactúe más en revisión de tareas y actividades desarrolladas con los estudiantes\r\n'),
(588, '13956828', '10016368', '2024-10-02', '00:00:25', '13:25:25', 17, 32, 1.88, NULL, 7, 'Excelente organización de la clase.\r\nPresentación de material audiovisual favorable en beneficio del logro del objetivo.\r\n\r\nProfesora con excelente manejo de grupo.\r\nTrabaja constantemente estrategias de clima de aula para que el ambiente sea propicio para el aprendizaje.\r\n\r\nSe destaca la participación activa de los estudiantes en la clase.\r\n\r\nACUERDOS:\r\nComo son muchos los estudiantes que quieren participar, se puede generar una estrategia donde 2 niños por columna contesten una pregunta, luego a la pregunta siguiente sean 2 estudiantes diferentes y así fomentamos la participación activa y organizada, evitando que se repitan los estudiantes.\r\n'),
(589, '13956828', '19533887', '2024-10-02', '10:15:14', '23:40:00', 17, 22, 1.48, NULL, 7, '\"Etapa política salvador Allende\"\r\n\r\nProfesora presenta un buen material audiovisual que beneficia el trabajo en aula de los estudiantes, sin embargo la letra es muy pequeña.\r\nSugiero que aumente el tamaño de la letra del ppt.\r\n\r\nSUGERENCIAS Y ACUERDOS\r\nDeben fortalecerse las estrategias de clima de aula, para que el ambiente que se genera en la sala de clases sea propicio para el aprendizaje.\r\nAlgunas estrategias importantes y von las que ya contamos como ciclo, las cuales deben observarse en la clase son 5S, estrategias de clima de aula variadas que aparecen en el Manual CES.\r\nProfesora aplicará algunas de estas estrategias en la próxima clase, para ver su efectividad. Previo a esto, compartiremos con otras profesoras del curso, para que indiquen cuáles son las estrategias que dan mayor resultado con el curso y aprovechar esta experiencia positiva.\r\n\r\nRespecto a las estrategias para el buen desarrollo del proceso enseñanza - aprendizaje, repasaremos algunas de Desarrollo de pensamiento en conjunto.\r\n\r\n\r\n'),
(590, '14273480', '18684795', '2024-10-03', '02:00:08', '03:37:08', 7, 1, 1, NULL, 7, ''),
(591, '17335579', '16758658', '2024-10-08', '08:15:00', '09:20:00', 10, 34, 1.2, NULL, 7, '- Cumple rol de supervisión y acompañamiento. Acude a los bancos comprobando el trabajo y apoyando su ejecución. \r\n- Miley y Benjamín requieren de apoyos adicionales para desarrollar las actividades planificadas. \r\n\r\nAcuerdo: desarrollar la actividad de cierre '),
(592, '13954385', '13633226', '2024-09-02', '10:12:00', '11:40:00', 11, 32, 1.9, NULL, 7, 'Intencionar en sus estudiantes preguntas desafiantes para que puedan crear su propio aprendizaje \r\nBuen trabajo colaborativo, siempre pensando en las características de sus estudiantes para generar aprendizajes significativos.'),
(595, '17335579', '19756902', '2024-10-15', '08:15:00', '09:25:00', 9, 34, 1.29, NULL, 7, 'Preparar cuidadosamente el material que será trabajado por los estudiantes. Corregir los errores de manera anticipada. \r\nImplementar material concreto para el desarrollo de operaciones básicas. Ejemplo: unidades de medida, bloques de encaje, masas play-dooh.\r\nOptimizar el tiempo. Implementar estrategias para distribuir los desafíos. \r\nInstrucciones: requisitos ECOS: específicas (qué debe hacer) concretas (descripción de lo que se espera), observables (visible), secuenciadas (pasos). Siempre comprobar la compresión. \r\nUtilizar un lenguaje simplificado: evitar el discurso innecesario. \r\nEstablecer con claridad el rol dentro del aula. Esta es una sugerencia que se repite en las retroalimentación de los acompañamientos. \r\n'),
(596, '13954385', '19331947', '2024-10-04', '12:00:12', '13:28:00', 12, 32, 1.9, NULL, 7, 'Compartir con los estudiantes la estructura de la clase antes de comenzar las actividades, corroborando la comprensión de las instrucciones y estableciendo normas de convivencia claras y consistentes.\r\nbuen trabajo colaborativo y manejo de los contenidos '),
(598, '17335579', '14003208', '2024-10-16', '08:15:00', '09:40:00', 14, 34, 1.62, NULL, 7, 'Procurar no interrumpir la clase al ingresar. Saludar después de que los estudiantes terminen la actividad inicial (lectura silenciosa u otra).\r\nClima de aula. El llamado de atención como único recurso no está funcionando. ¿El estudiante sabe con precisión lo que se espera de él?\r\nEvitar el castigo. \r\nSupervisar de manera efectiva el trabajo de todos los estudiantes. La atención está centrada en filas específicas, quedando otras fuera de la visión del docente. Revisar la ubicación de los estudiantes en el aula. \r\nLas actividades son coherentes con el objetivo de la clase, no obstante, la adherencia del curso es baja.\r\nInstrucciones. Claras, concretas, breves. '),
(599, '13954385', '19533614', '2024-10-17', '10:20:00', '11:55:00', 8, 34, 2, NULL, 7, 'Aula de Recurso: Material adecuado y entretenido\r\nretroalimentación ,refuerza positivamente \r\ninstrucciones claras y precisas '),
(600, '13954385', '16036246', '2024-10-10', '08:30:00', '09:45:00', 14, 32, 1.9, NULL, 7, 'Es necesario compartir la ruta de Aprendizaje a los estudiantes para poder anticiparlos al aprendizaje \r\nPromover preguntas de rol activo ,donde sus alumnos hagan su propio aprendizaje \r\nBuen manejo de contenidos \r\nbuen líder dentro de la sala \r\nbuena llegada con los estudiantes '),
(601, '13954385', '18683840', '2024-09-24', '15:30:00', '16:15:00', 3, 31, 2, NULL, 7, 'Separa las actividades en pequeños pasos, favoreciendo la valoración de los progresos de todos \r\nfortalecer la codocencia en el progreso de las situaciones de aprendizaje\r\n\r\n'),
(602, '13954385', '18069116', '2024-09-24', '16:15:00', '16:50:00', 1, 31, 1.95, NULL, 7, 'Se sugiere participación más activa frente al curso para mantener una comunicación fluida  con el docente de aula.\r\nConsidera las características de sus estudiantes para la planificación del aula '),
(603, '11537827', '17899117', '2024-10-10', '08:15:33', '09:00:33', 24, 34, 1.78, NULL, 7, 'Felicitaciones por la estrategia utilizada en clase\r\nSe ve a los estudiantes motivas en la actividad \r\nLa evaluación formativa muy buena y didáctica, falto enfatizar la instrucción y objetivo de la actividad. \r\nPor Mejorar \r\nFalto especificar objetivo y habilidad \r\n\r\nLa actividad de activación de conocimiento falto retroalimentar el objetivo o contenidos que se refuerzan. que se está prendiendo. \r\n\r\nLa evaluación formativa \r\n\r\n '),
(604, '13954385', '20154789', '2024-10-15', '10:10:00', '11:40:00', 9, 32, 1.86, NULL, 7, 'Es capaz de flexibilizar la programación didáctica \r\nPrograma actividades de diversa complejidad \r\ngenera un buen ambiente en sala \r\npotenciar las actividades con respecto a la diversidad de sus estudiantes '),
(605, '14273480', '12701348', '2024-10-14', '09:00:00', '09:40:00', 4, 15, 1.76, NULL, 7, 'Fortalezas:\r\n- Recoge aprendizajes previos de los estudiantes.\r\n- Se observa una organización de la clase, donde los estudiantes tienen adquirida la rutina establecida.\r\n- Da a conocer el objetivo, explicando los conceptos a trabajar.\r\n- Implementa estrategias para el orden y la escucha activa.\r\n- Los estudiantes participan de la experiencia, realizan trabajo entre pares.\r\n\r\nAcuerdos próximas clases:\r\n- Utilizar las 5s para establecer orden y promover la escucha activa de los estudiantes.\r\n- Implementar \"sin salida\" u otro para verificar las instrucciones y/o comprensión de contenidos, durante los diferentes momentos de la clase.\r\n- Gestionar el tiempo de la clase para realizar el cierre, retomando el objetivo de la clase.\r\n- Intencionar preguntas asociadas con el logro del objetivo, donde los estudiantes puedan pensar y responder, no sólo un si o no.\r\n\r\nMuy buena clase!'),
(606, '14273480', '14609696', '2024-10-14', '09:00:00', '09:40:00', 4, 15, 2, NULL, 7, 'Fortalezas:\r\n- Participa de experienca de aprendizaje, apoyando al docente de asignatura.\r\n- Establece normas en la sala y las promueve de forma constante.\r\n-Atenta a necesidades u otros, de sus estudiantes.\r\n- Preocupada del orden y limpieza de su sala.\r\n\r\nAcuerdos:\r\n- Preocuparse de ir sacando aquel material, trabajos de los estudiantes u otros, que ya hayan pasado de fecha de aplicación, por ejemplo: casa de pentecostes, difusión de actividades, otros. \r\n'),
(607, '14210475', '15589458', '2024-10-17', '08:30:00', '09:50:00', 21, 29, 1.95, NULL, 7, 'Durante la clase utiliza recursos didácticos bien diseñados y pertinentes a las necesidades educativas y a los objetivos que se esperan lograr. Utiliza diversos formatos de aprendizaje. Programa actividades de diversa complejidad para trabajar el mismo objetivo, que se pudieron implementar de modo simultáneo en la clase.\r\nLas guías de trabajo son diversificadas.\r\nExcelente co-docencia con profesora de lenguaje, desarrollando la clase entre ambas. Usó diferentes estrategias de enseñanza.\r\nGeneró un ambiente de respeto, aceptación y apoyo, dónde todas las alumnas pudieron sentirse valoradas y respetadas. Realiza el objetivo de la clase, ruta de aprendizaje y metacognición.'),
(608, '14210475', '19091055', '2024-10-17', '10:30:00', '11:40:00', 20, 34, 1.95, NULL, 7, 'Durante la actividad, la profesora diferencial secuencia las actividades en pequeños pasos, favoreciendo la valoración de los progresos de todos.\r\nConsideró distintas formas de agrupamiento de estudiantes, como estrategia organizativa en el aula inclusiva, que permitió interactuar de distintas maneras y con compañeros diversos, con variedad de roles y funciones en los tipos de agrupamiento.\r\nExcelente co-enseñanza con profesora de matemática.  Se observó el objetivo de la clase, ruta y metacognición. Adaptó recursos y materiales de acuerdo a las características de sus estudiantes.'),
(609, '14210475', '16287284', '2024-10-15', '08:15:00', '09:45:00', 23, 34, 1.95, NULL, 7, 'Utiliza recursos didácticos bien diseñados y pertinentes a las necesidades educativas y a los objetivos que se esperan lograr. Actividad lúdica, a través del juego de dominó, los estudiantes desarrollan ecuaciones, con ejercicios matemáticos.\r\nConsideró agrupamiento de los estudiantes, como estrategia organizativa en el aula inclusiva, que permitió interactuar de diferentes maneras y con diversos compañeros.\r\nPromovió el aprendizaje cooperativo entre los pares, a través de ejemplificar los ejercicios a sus compañeros de grupo.\r\nExcelente co-enseñanza con profesora de asignatura.'),
(610, '14210475', '18069762', '2024-09-30', '11:55:00', '13:25:00', 22, 29, 2, NULL, 7, 'Docente que adapta recursos y materiales, usando diferentes estrategias de enseñanza y pertinentes a las necesidades educativas. Inclusión de todos los estudiantes.\r\nCrea un ambiente de aceptación y apoyo donde todos se sienten valorados y respetados.\r\nPropone una diversidad de estrategias para motivar el acceso, la participación y las oportunidades de aprendizaje.\r\nConsidera distintas formas de agrupamiento de estudiantes en el aula, como estrategia organizativa en un aula inclusiva, la cual permitió interactuar de diferentes maneras y con compañeros diversos.'),
(611, '14210475', '13135675', '2024-10-08', '11:55:00', '13:25:00', 29, 29, 1.9, NULL, 7, 'Secuencia las actividades en pequeños pasos, favoreciendo la valoración de los progresos de todos los grupos de trabajo.\r\nUtiliza recursos didácticos bien diseñados y pertinentes a las necesidades educativas y a los objetivos que se esperan lograr.\r\nConsidera distintas formas de agrupamiento de estudiantes en el aula como estrategia organizativa en el aula inclusiva, que permitió interactuar de distintas maneras y con compañeros diversos, con variedad de roles y funciones en los tipos grupos.\r\nEn esta clase, los estudiantes desarrollaron la capacidad reflexiva.\r\n'),
(612, '9089119', '18389625', '2024-10-17', '13:25:37', '14:10:37', 26, 34, 2, NULL, 7, 'Objetivo: Reconocer la forma canónica de una función cuadrática y la variación de parámetros.\r\n\r\nSe comienza preparando clima de aula con instrucciones claras que se entregan mediante estrategia de expectativas registradas en PPT, prosigue con actividad de motivación lúdica en donde los estudiantes deben encontrar figura diferente en lámina proyectada, logrando activar la atención y el interés.\r\nA continuación, la docente realiza actividad socioemocional en donde los estudiantes se identifican eligiendo una lámina que exprese su estado emocional.\r\n\r\nComienza la clase presentando ruta de trabajo y revisando conocimientos previos a través de preguntas claves y juego a través de Kahoot con alta participación de los alumnos, sin embargo, se observan estudiantes que no se adhieren al trabajo.(4)\r\nRealiza estrategias 100% con algunos estudiantes más descendidos y se modela en la pizarra.\r\n\r\nEn la segunda parte de la clase aplican lo aprendido en guía de trabajo.\r\n\r\nSe observa una clase estructurada con material motivador y con factor alegría.\r\n\r\nSugerencias:\r\n\r\nAplicar estrategias para el logro de la adhesión de todas las estudiantes al trabajo de la clase.\r\n\r\nSeguir desarrollando estrategias innovadoras que impacten en el aprendizaje y logro del objetivo.\r\n\r\n'),
(613, '9089119', '17614804', '2024-10-17', '10:10:20', '10:55:20', 21, 27, 1.96, NULL, 3, 'Objetivo de la clase: To introduce unit 4 through a Reading activity\r\n\r\nDocente inicia presentando el objetivo y promueve un clima de aula que resguarda durante todo el desarrollo de la clase, creando un ambiente propicio para el aprendizaje.\r\n\r\nIntroduce el tema explicando e invitando a la reflexión con preguntas claves, las estudiantes se muestran participativas e interesadas en las actividades propuestas.\r\n\r\nSe realiza lectura de parte de varias estudiantes en voz alta y se va analizando por párrafo, verificando así la comprensión, sin embargo, en momentos se pierde la escucha activa.\r\n\r\nSe realiza estrategia sin salida para la lectura, no así en las preguntas claves.\r\n\r\nEn la segunda parte de la clase resuelven Quiz sobre el artículo analizado, aplicando en este momento estrategia de tiempo consensuado\r\n\r\nSe observó una clase planificada con material adecuado, trabajaron sincrónicamente y con oportunidad de emitir opiniones en un contexto de respeto ante las reflexiones propias de la clase. \r\n\r\nLa docente se vincula positivamente y con factor alegría. \r\n\r\nSugerencias:\r\n\r\n      Verificar la comprensión de todas las estudiantes.\r\n\r\n      Evitar preguntas retóricas.\r\n'),
(614, '9089119', '15176982', '2024-10-14', '10:10:23', '11:10:23', 20, 8, 2, NULL, 3, 'Objetivo de la clase: “Comprender la teoría de las placas tectónicas y la deriva continental mediante la observación de videos”\r\n\r\nSe inicia preparando clima de aula a través de estrategia umbral y limpieza de la sala logrando que los estudiantes se dispongan a la escucha activa.\r\n\r\nLa docente presenta el objetivo explicitando la habilidad y realizando preguntas de entrada, que permiten un diagnóstico formativo sobre el manejo conceptual de los estudiantes y motivar sobre el tema a tratar.\r\n\r\nLa docente verifica la comprensión utilizando estrategias como sin salida y 100%, además de gestionar el tiempo durante el desarrollo de la clase.\r\n\r\nSe apoya la clase con PPT y videos que se van analizando \r\n\r\nEl clima de aula se mantiene propicio durante todo el acompañamiento y la docente se vincula positivamente con los estudiantes.\r\n \r\nSugerencias: \r\n\r\nImplementar estrategia para poder verificar la comprensión de las estudiantes más descendidas.\r\n\r\nSeguir implementando estrategias con uso de herramientas Tics.\r\n\r\n'),
(615, '9089119', '12978138', '2024-10-08', '14:55:56', '15:30:56', 21, 42, 1.88, NULL, 3, 'Tema: La historia más bonita del mundo\r\n\r\nObjetivo de la clase: Reconocer la historia de Jesús a través de una manualidad\r\n\r\nSe prepara el clima de aula para realizar trabajo comenzado en clase anterior.\r\n\r\nDocente les recuerda trabajo a realizar que consiste en la construcción de una pulsera en que las cuenta son los hitos más importantes de la vida de Jesús, una escritura donde cuentan la historia y un contenedor para regalarla posteriormente.\r\n\r\nDurante el proceso las estudiantes van recordando los hitos que habían sido revisados en clase anterior\r\n\r\nEn general las estudiantes se adhieren activamente al trabajo, sin embargo 4 estudiantes no lo realizan por excusarse de sus materiales.\r\n\r\nProfesora se vincula positivamente, con factor alegría, motivando el que hacer del trabajo.\r\n\r\n Sugerencias:\r\n\r\nPresentar el objetivo reforzándola habilidad y lo que se desea lograr.\r\n\r\nVerificar la comprensión y aprendizaje del objetivo en este tipo de trabajos para que no se pierda en el hacer de la manualidad.\r\n'),
(616, '9089119', '19425852', '2024-10-08', '13:25:30', '14:10:30', 27, 22, 1.92, NULL, 7, 'Objetivo de la clase: Analizar actuales tensiones en torno a riqueza y pobreza en Chile\r\n\r\nDocente inicia preparando un buen clima de aula, propicio para el aprendizaje y que se mantiene durante toda la clase.\r\n\r\nAl presentar el objetivo explicita la habilidad a desarrollar.\r\n\r\nEntrega instrucciones claras sobre el trabajo a realizar durante la clase reforzando algunos conocimientos previos.\r\n\r\nRealiza un desarrollo expositivo claro con apoyo de PPT y registra en la pizarra un esquema de síntesis.\r\n\r\nMantiene la escucha activa e interés de parte de las estudiantes potenciando la reflexión en torno al tema y su activa participación.\r\n\r\nSe vincula positivamente con las estudiantes, con factor alegría.\r\n\r\nVerifica la comprensión realizando preguntas claves de manera general al curso.\r\n\r\nSugerencia de trabajo:\r\n\r\n\r\n Evitar las preguntas retóricas e implementar rutina o estrategia que permita verificar la comprensión de todos los estudiantes, como sin salida o 100%.\r\n \r\nSe observa una clase bien estructurada con normas claras y buen clima de aula, por lo que se insta al profesor a seguir desarrollando sus clases y seguir incorporando herramientas tics.\r\n\r\n\r\n'),
(617, '9089119', '15192979', '2024-10-01', '10:10:12', '10:50:12', 29, 4, 2, NULL, 3, 'Objetivo de la clase:  Evaluar la aplicación de contenidos de Biología Celular, a través de la construcción de juegos didácticos, fomentando el trabajo colaborativo\"\r\n\r\nDocente inicia preparando el clima de aula que se mantiene durante todo el periodo y organizando los grupos de trabajo, quienes desarrollan la actividad.\r\n\r\nEntrega instrucciones claras y precisas sobre el trabajo a realizar, que consiste en que los estudiantes desarrollan la actividad de coevaluación de juegos didácticos realizados por sus compañeros en clase anterior.\r\n\r\nSupervisa el trabajo monitoreando cada grupo, verificando la comprensión y vinculándose positivamente con las estudiantes, con factor alegría.\r\n\r\nSe observa un trabajo autónomo que permite a los estudiantes realizar una evaluación con críticas constructivas hacia los juegos realizados por otros compañeros.\r\n\r\nSugerencias:\r\n\r\nUtilizar estrategias de optimización del tiempo en clases.\r\nIncorporar herramientas tics para este tipo de trabajo.\r\n\r\n'),
(618, '9089119', '16139466', '2024-10-07', '08:15:29', '08:50:29', 23, 20, 1.81, NULL, 3, 'Objetivo: Analizar experimentalmente las propiedades de la luz como la reflexión y refracción\r\n\r\nSe comienza preparando clima de aula y recordando indicaciones de trabajo experimental a realizar.\r\n\r\nDocente logra que las estudiantes se mantengan atentas a las explicaciones, sin embargo, falta verificar la comprensión de estas.\r\n\r\nEl clima de aula es propicio para el aprendizaje, y la profesora se vincula positivamente.\r\n\r\nDocente monitorea de manera individual explicando dudas y verificando avance, sin embrago hay grupos que no cuentan con todo el material lo que baja la exigencia y velocidad de la actividad, lo anterior lleva a que estudiantes no se adhieran al trabajo.\r\n\r\nSugerencias:\r\n\r\nCuidar el uso de la voz.\r\n\r\nPlanificar este tipo de actividad resguardando que las estudiantes puedan adherirse a pesar de que falte algún material en específico, diversificando la experiencia de aprendizaje.\r\n\r\nNo olvidar la entrega del objetivo al inicio de la clase explicitando la habilidad a desarrollar y verificar la comprensión de las instrucciones con estrategia sin salida.\r\n\r\n'),
(619, '9089119', '19334195', '2024-10-07', '11:55:09', '12:40:09', 25, 34, 1.88, NULL, 3, 'Objetivo: Aplicar conceptos y formulas relacionadas con los elementos de la función cuadrática, a través de distintos ejercicios prácticos\r\n\r\nSe comienza con estrategia de clima de aula logrando que este sea propicio para la enseñanza.\r\n\r\nSe entrega ficha de inicio con autoevaluación diagnóstica y las estudiantes se muestran muy participativas\r\n\r\nVerifica la comprensión a través de estrategia sin salida \r\n\r\nEn el desarrollo de la clase se utiliza estrategia innovadora de trabajo en parejas a través de set con definiciones de apoyo, el que utilizan para desarrollar ejercicios del tema\r\n\r\nDocente se vincula positivamente y promueve la motivación por el trabajo que se realiza sistemáticamente.\r\n\r\nMonitorea el trabajo y responde de manera clara y precisa a las consultas realizadas, sin embargo, existen 4 estudiantes que no logran adherirse al trabajo por falta de interés.\r\n\r\nSugerencias:\r\n\r\nPresentar el objetivo explicitando la habilidad, intencionándola como meta compartida con los estudiantes\r\n\r\nPromover la escucha activa\r\n\r\nEvaluar tiempo invertido en la estrategia a desarrollar antes de implementarla\r\n\r\nUtilizar estrategia de gestión del tiempo\r\n\r\n'),
(620, '9089119', '20255628', '2024-10-09', '08:15:32', '09:20:32', 20, 34, 1.81, NULL, 3, 'Objetivo: Reducir expresiones algebraicas aplicando la jerarquía de las operaciones, mediante una actividad llamada domino algebraico\r\n\r\nSe comienza preparando clima de aula y presentando el objetivo, enfatizando la habilidad y recordando conocimientos previos.\r\n\r\nComparte ruta de trabajo con los estudiantes lo que potencia el desarrollo de la clase\r\n\r\nDocente logra que los estudiantes se mantengan atentos a las explicaciones, sin embargo, falta verificar la comprensión de estas a través de estrategias como sin salida.\r\n\r\nEl clima de aula es propicio para el aprendizaje, y la profesora se vincula positivamente.\r\n\r\nDocente monitorea de manera individual explicando dudas y verificando avance, sin embrago hay estudiantes que no logran terminar el trabajo.\r\n\r\nSugerencias:\r\n\r\nCuidar el volumen del micrófono ya que se torna muy invasivo.\r\n\r\nEvitar preguntas retóricas para verificar la comprensión, potenciar estrategia sin salida.\r\n\r\nUtilizar estrategia de gestión del tiempo\r\n\r\n'),
(621, '11537827', '16036651', '2024-10-09', '15:40:05', '10:34:05', 13, 29, 1.92, NULL, 7, 'Excelente trabajo \r\n   \r\nAspecto a Mejorar: \r\n\r\nPlanificar los cuentos con todas las estrategias de comprensión y trabajarlas en forma espontáneas. \r\nRealizar una planificación cada 15 días para realizar un trabajo más sistemático. '),
(622, '11537827', '17614827', '2024-10-09', '08:15:13', '09:45:13', 12, 29, 1.93, NULL, 7, 'Excelente clima de aula\r\nHay orden en la presentación del trabajo \r\nHace participar a los estudiantes en forma equitativa \r\nBuen libro seleccionado\r\nAspectos a Mejorar \r\n Organización espacial que permita favorecer la atención de todos los estudiantes\r\nActivar conocimientos previos y automonitoreo \r\nUbicar las estrategias de comprensión lectora en forma más visibles dentro de la sala.    \r\n\r\n\r\n \r\n '),
(623, '11537827', '18813869', '2024-10-09', '11:55:24', '13:25:24', 11, 8, 1.93, NULL, 7, 'Excelente clima de aula \r\nHay Orden en la presentación del trabajo \r\nAplica a una asignatura de ciencia relacionando el cuento con el contenido -FELICITACIONES  \r\nMuy bien planificada la estrategia \r\n\r\nPor Mejorar \r\nOrganizacion espacial para lograr mejorar la atención de los estudiantes \r\nUtilizar la estrategia de monitoreo para corroborar la comprensión. \r\nvisualizar el cuento con sus vivencias, permite mejorar la comprensión. '),
(624, '14273480', '13310869', '2024-10-15', '10:20:00', '11:00:00', 4, 35, 1.75, NULL, 7, 'Fortalezas:\r\n- Manejo pedagógico y disciplinar.\r\n- Clase organizada y estructurada.\r\n- Los estudiantes participan de la clase, demostrando sus aprendizajes.\r\n- Juega con los estudiantes, utilizando el juego como estrategia de aprendizaje.\r\n- Es respetuoso con los estudiantes, promueve virtudes y corrige el error de forma positiva.\r\n\r\nAcuerdos proximas clases:\r\n- Utilizar estrategias de clima de aula, 5S y \"sin salida\" de forma sistemática para ofrecer una mejor comprensión de instrucciones y favorecer la escucha activa entre pares y adultos.\r\n- Cierre: recordar revisar el objetivco de la clase con los estudiantes. \r\n- Se sugiere utilizar el pizarrón, marcando el paso a paso de las experiencias de aprendizaje y, en ocasiones, ofrecer otros espacios de organización de los estudiante, generando un espacio de encuentro entre ellos.\r\n'),
(625, '11537827', '10016368', '2024-10-09', '10:10:52', '11:40:52', 17, 29, 1.92, NULL, 7, 'Excelente Clima de aula\r\nHay un orden en la presentación del trabajo    \r\nMuy buena panificación de la estrategia de comprensión lectora \r\nPor mejorar \r\nOrganizacion espacial que permite generar mejor atención de los estudiantes\r\nConocimientos previos que ayude a contextualizar la historia y comprensión\r\nMonitoreo de la comprensión de lo que se está contando \r\nUbicar las estrategias en forma más visible para los estudiantes. \r\n\r\n'),
(628, '17335579', '19404965', '2024-10-23', '10:05:00', '11:35:00', 7, 34, 1.9, NULL, 7, 'Obs. Clima de aula. \r\nUso de lenguaje claro, concreto. \r\nSupervisión estratégica. '),
(629, '13769322', '20326728', '2024-10-24', '14:10:00', '14:30:00', 18, 22, 1.42, NULL, 7, 'Docente debe dar las instrucciones claras al inicio de la clase; monitorear su cumplimiento e iniciar la actividad.\r\nDocente debe “evitar” llamar la atención en voz alta, sino que debe aplicar estrategias distintas (conversadas en la retroalimentación) la próxima vez que se observe clase.\r\nSe observará clase la próxima semana en otro curso.\r\n'),
(630, '13769322', '16161640', '2024-10-15', '10:05:00', '11:35:00', 15, 42, 1.88, NULL, 7, 'Desarrollar el cierre de la clase.\r\nSe felicita al profesor por el trabajo realizado, más aún por llevar material para aquellos alumnos que no lo trajeron, logrando así un buen desarrollo de la clase.\r\n'),
(631, '13769322', '16161640', '2024-10-15', '10:05:00', '11:35:00', 15, 42, 1.88, NULL, 7, 'Desarrollar el cierre de la clase.\r\nSe felicita al profesor por el trabajo realizado, más aún por llevar material para aquellos alumnos que no lo trajeron, logrando así un buen desarrollo de la clase.\r\n'),
(632, '13769322', '11879515', '2024-10-25', '08:15:00', '09:40:00', 16, 58, 1.52, NULL, 7, 'Preparación de la clase entregando: instrucciones claras, modelando lo que deben realizar los alumnos (ejemplos de afiche)\r\nCambiar la fecha de entrega del trabajo para 1 semana más y ahí poder monitorear el avance del trabajo grupal en sala. \r\nAvisar, a través de una comunicación, que la evaluación debe ser desarrollada en sala.\r\n'),
(633, '14273480', '15178747', '2024-10-15', '13:30:00', '14:00:00', 1, 38, 1.82, NULL, 7, 'Fortalezas: (se observa el trabajo inicial, MAE)\r\n- La docente mantiene y promueve un buen clima de aula, propicio para el aprendizaje.\r\n- Manejo disciplinar y metodología para implementar la experiencia de aprendizaje.\r\n- Implementa estrategias de clima de aula.\r\n- Promueve la participación de sus estudiantes.\r\n- Utiliza modelo instruccional.\r\n\r\nAspectos a mejorar próximas clases:\r\n- Implementar: sin salida, tiempo visible en las diferentes experiencias de aprendizaje.\r\n- Preparar materiales con antelación, en conjunto con asistente de aula.\r\n- Profundizar el objetivo de la clase, en el cierre.'),
(634, '14273480', '9288148', '2024-10-15', '13:29:00', '14:00:00', 1, 38, 2, NULL, 7, 'Fortalezas:\r\n- La docente apoya a los estudiantes y educaddora, en todo momento de la clase, promoviendo normas, guiando el aprendizaje y realizando intervenciones atingentes.\r\n- Mantiene espacio físico limpio, ordenado y evitando riesgos\r\n- Atenta a estudiantes con necesidades educativas.\r\n\r\nAspectos a mejorar próximas clases:\r\n- Continuar promoviendo normas e interacciones afectivas y basadas en el respeto entre sus estudiantes.\r\n'),
(635, '13769322', '20326728', '2024-10-30', '08:15:00', '09:40:08', 15, 22, 1.52, NULL, 7, 'Debe indicar, en sus diapositivas o pizarra, claramente a los alumnos (as) que deben copiar en sus cuadernos.\r\nContinuar trabajando en las instrucciones al inicio de la clase.\r\nIndicar tiempo visible en los momentos de la clase en que los alumnos deben trabajar en forma autónoma\r\n'),
(636, '14273480', '16137474', '2024-10-30', '11:25:00', '12:00:00', 4, 31, 2, NULL, 7, 'FORTALEZAS: Estrategia MAE; conciencia fonol´pgica y poesía, (en este caso fue una leyenda)\r\n- Realiza juegos de conciencia fonológica con los estudiantes.\r\n- Leen el abecedario.\r\n- Realiza observaciones que promueven las altas expectativas de sus estudiantes.\r\n- Monitorea y realiza preguntas atingentes a sus estudiantes y desafiantes.\r\n- Mantiene y promueve un buen clima de aula.\r\n\r\nACUERDOS:\r\n- Continuar aplicando las diferentes  estrategias MAE, con sus pasos y/o aspectos importantes de cada una.');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(637, '18639869', '12604321', '2024-11-11', '14:36:13', '14:10:13', 8, 36, 1.84, NULL, 7, 'El profesor Cristian Musri inicia la clase con una frase motivadora: \"Todos somos buenos en algo, y cuando reconocemos en lo que somos buenos, comenzamos a amarnos y a sentirnos mejor\". Esta frase establece el enfoque de la sesión en el valor personal y la importancia de la autoestima. Para captar la atención de los estudiantes y fomentar su participación, el profesor introduce una actividad con una \"caja sorpresa\", una caja grande de cartón decorada que genera entusiasmo entre los estudiantes. El profesor menciona que los estudiantes que demuestren buen comportamiento tendrán la oportunidad de acercarse a descubrir el contenido de la caja. Durante la clase, el profesor utiliza LOS recursos disponibles que entrega el programa SENDA, incluyendo el cuadernillo, video y un recurso interactivo, complementados con una presentación en PowerPoint que refuerza visualmente el contenido. Esta combinación de materiales permite un desarrollo del tema dinámico y atractivo, manteniendo la atención de los estudiantes y promoviendo una comprensión más profunda del concepto de autoestima. Los estudiantes participan activamente en la clase, y la atmósfera general es de entusiasmo y alegría. Uno por uno, los estudiantes se acercan para descubrir el contenido de la caja, en compañía del profesor, quien les dedica un momento especial a cada uno. El contenido de la caja revela un espejo, que refleja al estudiante en el rol de \"el mejor estudiante del curso\", reforzando así su autoestima y haciéndoles sentir valorados. La expectativa de \"ganarse\" la oportunidad de ver el contenido de la caja motiva a los estudiantes a mantener un buen comportamiento, creando un ambiente disciplinado pero ameno. La presencia y participación activa de la asistente de aula permiten una atención más personalizada a los estudiantes y facilitan el desarrollo de la actividad. Las mesas organizadas en grupos de cuatro promueven la interacción y el trabajo en equipo, lo cual fortalece la cohesión entre los estudiantes. El profesor dedica tiempo para conversar con cada estudiante antes de que miren el espejo, resaltando características positivas de cada uno. Esto crea una conexión emocional y un refuerzo positivo que potencia la autoestima de los estudiantes.'),
(638, '13954385', '14210475', '2024-11-13', '10:10:00', '11:35:00', 14, 34, 2, NULL, 7, 'Fomentar el rol activo en su estudiante \r\ndesarrollar habilidades de pensamiento critico\r\nincrementar motivación y autonomía en su estudiante '),
(639, '13769322', '13195888', '2024-11-13', '10:05:00', '11:25:00', 16, 32, 2, NULL, 7, 'Mantener la planificación al día en la plataforma LIRMI.\r\nSe felicita a la profesora porque la clase se realiza en forma organizada y aprovechando todos los tiempos; además se hace ver el buen trabajo que realiza junto a la educadora diferencial.\r\n'),
(640, '13954385', '13134219', '2024-11-08', '10:10:00', '11:36:34', 10, 34, 2, NULL, 7, 'Excelente clase, alumnos entretenidos, motivados.\r\nProfesora creo un ambiente de aceptación, respeto y apoyo donde todos se sintieron valorados \r\nUtilizó diversos formatos de Aprendizaje ,activo conocimientos previos.\r\nTrabajo colaborativo de codocencia donde ambas guiaron la clase de manera interactiva ,sin pasarse a llevar, mediaron el aprendizaje en igualdad de rol.\r\n\r\n'),
(641, '14273480', '19092766', '2024-11-14', '13:54:14', '14:39:14', 1, 1, 1, NULL, 7, ''),
(642, '18639869', '19756598', '2024-11-15', '16:10:40', '16:50:40', 1, 36, 1.63, NULL, 7, 'La sesión de la profesora en la etapa 2.5 del programa PASOS tiene como objetivo que los niños comprendan el concepto de trabajo en equipo y su importancia. Para iniciar, realizó una transición efectiva desde el recreo hacia la clase utilizando una canción que ayudó a los estudiantes a enfocarse en el nuevo contexto. Los dispuso en un semicírculo, lo cual facilitó el contacto visual entre ellos y con la pantalla donde proyectó un video de percusión. Esta actividad inicial incentivó a los niños a imitar sonidos con manos y pies, promoviendo la coordinación y el trabajo colaborativo de forma lúdica. Posteriormente, se llevó a cabo una actividad más dinámica, una \"carrera de tres pies\", en la que algunos estudiantes participaron de manera activa. Para garantizar la equidad en la participación, se sugiere el uso de estrategias como los palitos preguntones, permitiendo que la selección de los participantes sea al azar y asegurando oportunidades equitativas para todos. Un aspecto a mejorar es dedicar un momento al inicio para recordar las normas de la clase, lo que podría contribuir a un mejor manejo del grupo. Además, sería beneficioso incluir un espacio explícito para verificar si los estudiantes comprendieron el objetivo de la sesión, reforzando así el aprendizaje.'),
(643, '18639869', '10004488', '2024-11-15', '13:25:36', '14:10:36', 13, 36, 1.95, NULL, 7, 'La profesora llevó a cabo la primera sesión del programa SENDA, centrada en los temas de diversidad y empatía mediante la actividad \"En tus zapatos\". Inició explicando a los estudiantes el propósito del programa y los objetivos de la clase, integrando los recursos sugeridos, como el cuadernillo de SENDA, video y recurso interactivo. A pesar de que la jornada presentaba desafíos particulares, como las despedidas de los IV medios que generaron un ambiente emocional diferente, y las complicaciones tecnológicas fuera de su control, la profesora gestionó la sesión con efectividad. Además, enfrentó la dificultad de estar recién operada, lo que afectó su comodidad al hablar, pero esto no disminuyó la calidad de su interacción con los estudiantes. Los niños y niñas respetaron las normas del aula y respondieron adecuadamente a las correcciones de conducta, las cuales la profesora expresó de manera asertiva, contribuyendo a un ambiente de aprendizaje positivo. A pesar de los obstáculos, se logró desarrollar una buena clase que fomentó la participación y el respeto mutuo.'),
(644, '9089119', '20154755', '2024-10-09', '10:10:19', '10:40:19', 23, 29, 1.96, NULL, 3, 'Objetivo de la clase: Aplicar conocimientos adquiridos acerca del texto argumentativo\r\n\r\nDocente inicia preparando el clima de aula, el que se mantiene durante el trabajo.\r\n\r\nComienza con revisión de conocimientos previos verificando la comprensión a través de estrategia sin salida.\r\n\r\nEntrega instrucciones claras y precisas respecto a la actividad que consiste en una evaluación de análisis de un ensayo en parejas quienes se apoyan en resúmenes realizados en clase anterior por ellas.\r\n\r\nSupervisa el trabajo monitoreando cada grupo, verificando la comprensión y vinculándose positivamente con las estudiantes.\r\n\r\n Se observa en la sala material de apoyo entregado por la docente (Infografía con pasos de análisis y creación de textos argumentativos)\r\n\r\nSugerencias:\r\n\r\nAl presentar el objetivo destacar la habilidad a desarrollar como meta compartida\r\n\r\nAnalizar si evaluación en parejas retroalimenta sobre el aprendizaje individual de las estudiantes, según el tema abordado.\r\n'),
(645, '9089119', '19648228', '2024-10-08', '11:55:02', '12:40:02', 24, 29, 1.84, NULL, 3, 'Objetivo de la clase: “Recordar los elementos básicos de los textos argumentativos”\r\n\r\nDocente inicia con estrategia que prepara un buen clima de aula, propicio para el aprendizaje y que se mantiene durante toda la clase.\r\n\r\nAl presentar el objetivo explicita la habilidad a desarrollar que es resumir y sintetizar.\r\n\r\nEntrega instrucciones claras sobre el trabajo a realizar durante la clase reforzando algunos conocimientos previos.\r\n\r\nRealiza un desarrollo expositivo claro y registra en la pizarra un esquema que sintetiza los temas a repasar.\r\n\r\nVerifica la comprensión realizando preguntas claves y supervisando la escritura que van desarrollando.\r\n\r\nSe dirige a los estudiantes por su nombre y se vincula positivamente con ellos, con factor alegría.\r\n\r\nNo se observa que la actividad realizada desarrolle la habilidad por parte de los estudiantes.\r\n\r\nSugerencias:\r\n\r\nEvitar las preguntas retóricas para verificar la comprensión de todos los estudiantes.\r\n\r\nPotenciar la participación activa de los estudiantes.\r\n\r\nUtilizar material de apoyo como el texto del estudiante, u otro, en este tipo de actividad.\r\n'),
(646, '9089119', '15177877', '2024-10-17', '08:15:46', '09:00:46', 26, 27, 1.96, NULL, 3, 'Objetivo: Identify vocabulary and grammar structures  \r\n\r\nSe inicia con la preparación de clima de aula el que se mantiene durante todo el acompañamiento\r\n\r\nPresenta el objetivo, falta explicitar la habilidad a desarrollar.\r\n\r\nMantiene la escucha activa e interés de parte de los estudiantes, varios realizan lecturas en voz alta potenciando su activa participación.\r\n\r\nMonitorea el trabajo que deben realizar en el cuaderno aclarando dudas. \r\n\r\nEn un segundo momento los estudiantes deben aplicar lo aprendido en hoja de ejercicios gramaticales, la que realizan en un tiempo consensuado.\r\n\r\nSe observa una clase preparada y con materiales adecuados (hoja de ejercicios, PPT).\r\n\r\nSe vincula positivamente con los estudiantes y con factor alegría.\r\n\r\nSugerencias:\r\n\r\n      \r\nPresentar ruta de trabajo para potenciar el desarrollo de la clase, intencionado como meta   compartida.\r\n\r\nExplicitar la habilidad del objetivo a trabajar como meta compartida.\r\n\r\n'),
(647, '9089119', '10072654', '2024-10-08', '10:10:19', '10:50:19', 29, 12, 1.96, NULL, 3, 'Objetivo de la clase:   Realizar plano de planta de una habitación, aplicando escala de reducción.\r\n\r\nUtiliza estrategias de clima de aula para crear un ambiente de trabajo, entrega instrucciones claras y comparte pauta de evaluación.\r\n\r\nRecuerda el objetivo, falta potenciar la habilidad que se está abordando; y presenta ruta de trabajo mostrando los pasos a seguir durante la clase y el avance que se espera que logren\r\n\r\nRecuerda conceptos previos a través de preguntas con palabras claves, y realiza modelaje con trabajo avanzado\r\n\r\nSe observa alta participación y adherencia al trabajo.\r\n\r\nEn un segundo momento desarrollan individualmente el trabajo, docente monitorea el avance y resolviendo dudas de manera clara y vinculándose positivamente\r\n\r\nSugerencias:\r\n\r\nPotenciar el desarrollo de la habilidad como meta compartida al inicio de la clase\r\n\r\nSe observa una clase bien estructurada con normas claras y buen clima de aula, por lo que se insta a la profesora a seguir desarrollando sus clases e ir incorporando herramientas tics.\r\nDocente comenta que en próximo trabajo incorpora tics porque los estudiantes realizan plano de maqueta en computador calculando la escala y diseñando para luego realizarla manualmente.\r\n \r\n\r\n'),
(648, '9089119', '13312214', '2024-10-14', '11:55:55', '12:35:55', 29, 41, 1.92, NULL, 3, 'Objetivo: Explicar ácidos y bases a través de modelos matemáticos.\r\n\r\nSe inicia preparando clima de aula a través de estrategia umbral, logrando que los estudiantes se dispongan a la escucha activa.\r\n\r\nLa docente presenta el objetivo explicitando la habilidad y recuerda conceptos previos, realizando preguntas claves sobre la aplicación del contenido, sin embargo, estas son retóricas por lo que cuesta verificar el nivel de aprendizaje de todos los estudiantes.\r\n\r\nRealiza modelaje del contenido que deben aplicar, y en una guía resuelven problemas a través de ejercicios revisados.\r\n\r\nEn varios momentos relaciona los ejemplos con preguntas PAES, atrayendo la atención de los estudiantes, sobre todo de cuartos medios.\r\n\r\nLa docente monitorea el trabajo individual respondiendo preguntas y aclarando dudas\r\n\r\nEl clima de aula se mantiene propicio durante todo el acompañamiento y la docente se vincula positivamente con los estudiantes.\r\n\r\nSugerencias:\r\n\r\nImplementar estrategias como 100% y sin salida evitando las preguntas retóricas, para poder verificar la comprensión.\r\n \r\nImplementar estrategias de clima de aula que mejoren la escucha activa.\r\n\r\n'),
(649, '9089119', '10387845', '2024-10-30', '08:35:40', '09:40:40', 21, 35, 1.96, NULL, 6, 'Objetivo: Ejecutar instrumentalmente taller musical a través del trabajo con los instrumentos musicales\r\n\r\nDocentes se observa buen clima de aula, manteniéndose normas claras que se mantienen durante toda la clase\r\n\r\nRealiza preguntas claves motivando e invitando a la participación activa, realizando un análisis de  la partitura e invitando a descubrir a que zona geográfica pertenecía el taller a través del ritmo\r\n\r\nRealiza 100% \r\nRealiza sin salida\r\n\r\nDespués del análisis realizan la practica en los instrumentos de manera individual con la ayuda del modelamiento de la profesora, a medida que transcurre la práctica se van agregando figuras musicales\r\n\r\nSe va avanzando en la dificultad de la práctica, logrando que muchas estudiantes descubran el patrón rítmico tocado por un estudiante en el bombo.\r\n\r\nLas estudiantes participan en la práctica activamente y la profesora va reforzando los conceptos sistemáticamente a través de preguntas claves \r\n\r\nDocente monitorea permanentemente y se vincula positivamente con todas las estudiantes\r\n\r\nSe cierra la clase a través de la pregunta qué se les hizo más complicado o más fácil en la ejecución de la partitura, y finalizan tocando todas juntas la melodía completa, lográndose así el objetivo\r\n\r\nAcuerdos:\r\n\r\nImplementar estrategias de talleres musicales contextualizados al interés de los estudiantes, y de acuerdo a los objetivos del nivel.\r\n\r\nSe felicita a la docente porque se observó una clase preparada, con material adecuado, motivando a los estudiantes a adherirse al trabajo.\r\n\r\n\r\n'),
(650, '9089119', '16274647', '2024-11-12', '10:15:47', '10:50:47', 25, 29, 1.92, NULL, 3, 'Objetivo de la clase: Redactar un texto periodístico basado en entrevista realizada en proyecto interdisciplinario con asignatura de orientación.\r\n\r\nEsta clase se enmarca en una salid pedagógica realizada por estudiantes de segundos medios a dos universidades en donde deben realizar entrevistas a estudiantes de carreras d su interés\r\n\r\nDocente inicia preparando el clima de aula la que se mantiene durante toda la clase acompañada.\r\n\r\nSe comienza recordando la salida pedagógica, dando oportunidad a que las estudiantes cuenten su experiencia de manera crítica y reflexiva, resulta muy positiva la conversación observándose alta motivación por la actividad. Relatan desde los aspectos positivo, negativos siendo capaces darles un sentido a sus proyectos de futuro y expectativas de continuidad de estudios.\r\n\r\nEntrega instrucciones claras sobre el trabajo a realizar en parejas y presenta pauta de evaluación la que genera poder recordar conceptos claves y aclara dudas.\r\n\r\nSe observa una clase con material adecuado y muy bien planificada\r\n\r\nSe vincula positivamente con las estudiantes, con factor alegría.\r\n\r\nSe observa activa participación de docente PIE.\r\n\r\nSugerencias.\r\n\r\nAnte trabajos prácticos presentar ruta de trabajo de la clase con tiempo visible y consensuado de manera de generar un trabajo sincronizado de parte de los estudiantes.\r\n\r\nSe felicita a docente por el éxito del proyecto interdisciplinario el que se realizará anualmente con el propósito de generar expectativas para la educación superior.\r\n'),
(651, '18639869', '17801292', '2024-11-18', '14:10:58', '14:55:58', 1, 36, 1.95, NULL, 7, 'La profesora Francesca inició su clase en la alfombra, revisando el calendario con sus estudiantes y anticipándoles las actividades del día, lo que ayudó a generar un ambiente de estructura y claridad. Posteriormente, realizaron un ejercicio de respiración para favorecer la calma y la concentración, y se dispusieron en semicírculo para escuchar acerca del tema de la clase y ver un cuento. La sesión, parte del programa PASOS, se enfocó en enseñar a los niños y niñas la importancia de usar \"mi gran voz\" para expresar lo que no les gusta. La profesora comenzó con la pregunta \"¿Qué es la voz?\", promoviendo la participación activa de los estudiantes. Mantuvo siempre un tono amable y cariñoso, reforzando positivamente cada interacción, lo que motivó a los estudiantes a responder de manera asertiva.\r\n\r\nComo parte de la sesión, la profesora incluyó un juego que ayudó a los niños y niñas a comprender mejor la importancia de \"nuestra voz\" . También presentó tres fichas clave: \"para\", \"no me gusta que\" y \"por favor\", que los estudiantes utilizaron para practicar el uso de su gran voz en situaciones relacionadas con experiencias propias y del curso. Este enfoque permitió conectar el aprendizaje con la realidad de los estudiantes, haciéndolo más significativo.\r\n\r\nLa actividad culminó con la realización de un dibujo relacionado con lo aprendido. Durante esta etapa, la profesora supervisó el trabajo individual, reforzando los avances de cada estudiante. A lo largo de toda la clase, se mantuvo un clima óptimo de respeto y colaboración, reflejando un ambiente seguro y propicio para el aprendizaje.'),
(652, '18639869', '26323365', '2024-11-15', '14:55:18', '15:40:18', 9, 36, 1.74, NULL, 7, '\r\nLa profesora Heydi llevó a cabo la sesión 2 del programa SENDA, titulada \"Una rabia que no daña\". Inició recordando las normas de la clase, lo que favoreció un ambiente estructurado y propicio para el aprendizaje. Durante la sesión, utilizó como recurso principal el cuadernillo del programa, pero no incorporó el video ni las actividades interactivas, que son elementos esenciales para el desarrollo integral de estas lecciones, ya que el cuadernillo debe funcionar como un complemento, no como el eje principal.\r\n\r\nLa temática de la clase, centrada en la gestión de la rabia, fue abordada invitando a los estudiantes a conectar la lección con sus experiencias personales, lo cual es una estrategia adecuada siempre que se maneje con sensibilidad. Sin embargo, es importante destacar que se debe tener especial cuidado de no exponer a aquellos estudiantes con mayores dificultades emocionales o que no hayan manifestado voluntariamente su interés en compartir. Además, mencionar situaciones de compañeros ausentes puede generar estigmatización o incomodidad en el grupo, afectando negativamente la dinámica de la clase. Es recomendable fortalecer el uso de recursos interactivos del programa para promover un aprendizaje más dinámico y ajustado a los objetivos establecidos, además de garantizar un manejo seguro al tratar temas sensibles en el aula.'),
(653, '13954385', '17540502', '2024-10-22', '10:10:24', '11:40:25', 16, 32, 2, NULL, 7, 'La profesora fomenta el pensamiento crítico en el aula mediante preguntas que invitan a los estudiantes a reflexionar, analizar y evaluar diversas situaciones o conceptos. Esta estrategia permite que los estudiantes desarrollen habilidades de razonamiento y profundicen en su comprensión del contenido.\r\nLas clases son dinámicas y participativas, lo que hace que el proceso de aprendizaje sea entretenido e interactivo. Se utilizan diversas metodologías que involucran a los estudiantes activamente, creando un ambiente motivador y de constante intercambio de ideas.'),
(654, '13954385', '19386893', '2024-10-14', '08:15:00', '09:45:00', 18, 32, 1.95, NULL, 7, 'Se sugiere promover el pensamiento critico y metacognición En conjunto, estas dos habilidades fortalecen la capacidad de los estudiantes para enfrentar situaciones complejas de manera más flexible y eficiente, mejorando su desempeño académico y su preparación para el mundo laboral y personal. El fomento de estas competencias no solo beneficia a los estudiantes en su etapa educativa, sino que también les prepara para ser pensadores críticos y creativos a lo largo de toda su vida.'),
(655, '18639869', '18114575', '2024-11-19', '16:10:56', '16:50:56', 3, 36, 2, NULL, 7, '\r\nLa profesora inició la clase con una dinámica lúdica para facilitar la transición del recreo a la sala de clases, invitando a los niños a entrar como conejitos y a las niñas como mariposas. Esta estrategia favoreció un ambiente de calma y disposición positiva. Una vez dentro, realizaron un ejercicio de respiración que ayudó a centrar la atención de los estudiantes. Posteriormente, la profesora dio la primera instrucción: formar un semicírculo. Los niños y niñas lograron organizarse de manera autónoma y con entusiasmo, mostrando interés por agradar a su profesora.\r\n\r\nYa sentados, cantaron una canción que marcó el inicio formal de la lección. La profesora recordó las normas del aula y repasó los contenidos previos antes de presentar el título y objetivo de la clase: \"Mi gran voz\". La sesión mantuvo un ambiente positivo, con los estudiantes atentos y motivados, reflejando una conexión sólida entre la profesora y su grupo. En general, fue una clase bien estructurada que logró captar y mantener el interés de los niños y niñas.'),
(656, '13769322', '10004488', '2024-11-20', '10:05:00', '11:35:00', 11, 58, 1.92, NULL, 7, 'Trabajar en normalización del curso'),
(658, '18639869', '15086447', '2024-11-21', '10:05:39', '10:50:39', 4, 36, 1.78, NULL, 7, 'La profesora inició la clase dando una instrucción clara: \"Llego a la sala y me siento\", dirigida a los estudiantes que venían del baño tras lavarse las manos y la cara posterior al recreo. Para lograr que todos cumplieran esta instrucción, utilizó una estrategia efectiva, felicitando individualmente a quienes cumplían con la conducta esperada. Este enfoque positivo destaca como una buena práctica, ya que fomenta la motivación en lugar de resaltar las conductas incorrectas.\r\n\r\nTras este inicio, recordó las normas de la clase, presentó el objetivo del día y comenzó la lección, centrada en el tema de la familia. Usó un PPT proporcionado por el programa PASOS para mostrar los diferentes tipos de familias, lo que sirvió como introducción para la actividad principal: presentar a sus familias a través de fotos que los estudiantes habían traído desde casa. Durante el desarrollo de la clase, implementó estrategias para mantener la atención, como la imitación de movimientos con las manos y gestos faciales, logrando recentrar a los estudiantes cuando era necesario.\r\n\r\nAntes de pasar a la segunda actividad —dibujar y decorar su familia en una ficha con forma de casita, también proporcionada por PASOS—, la profesora invitó a los estudiantes a participar en una dinámica de \"gira y discute\", en la cual compartieron con sus compañeros información sobre con quiénes viven, qué les gusta de sus familias y por qué son especiales. Durante el trabajo individual, la profesora ambientó el aula con música tranquila, generando un clima relajado y propicio para la creatividad.\r\n\r\nEn general, la clase estuvo bien estructurada, con un enfoque positivo y estrategias adecuadas para mantener la atención y el compromiso de los estudiantes.'),
(660, '18639869', '19404149', '2024-11-21', '10:50:00', '11:35:08', 14, 36, 1.74, NULL, 7, 'La profesora inició su clase de manera puntual, recordando los contenidos de sesiones anteriores, lo que facilitó que los estudiantes conectaran con el tema del día. Los estudiantes participaron activamente desde el inicio, y la profesora implementó estrategias efectivas para mantener la atención, como solicitar movimientos simples (poner las manos en la cabeza, hombros, etc.), las cuales fueron recibidas de manera positiva por los alumnos.\r\n\r\nAl comenzar la lección, la profesora comunicó claramente el objetivo de la clase y presentó un video del programa SENDA. Posteriormente, formuló preguntas para comprobar la comprensión del contenido y pasó a trabajar el recurso interactivo de la sesión. Durante esta actividad, los estudiantes participaron por turnos; sin embargo, ante la impaciencia de algunos por participar, la profesora utilizó los \"palos preguntones\", logrando que la participación se percibiera como justa y manteniendo el orden y la motivación del grupo.\r\n\r\nTras finalizar el recurso interactivo, la profesora optó por pasar un video correspondiente al módulo siguiente. Si bien esta decisión buscó enriquecer la clase, se sugiere profundizar previamente en los temas del módulo en curso antes de avanzar a otros. Para ello, el cuadernillo virtual de SENDA ofrece material complementario que puede ser útil para consolidar los aprendizajes de cada sesión.'),
(661, '18639869', '17816865', '2024-11-21', '09:00:21', '09:40:21', 6, 36, 1.95, NULL, 7, '\r\nLa profesora comenzó la clase en la alfombra, aprovechando el segundo bloque para activar los cuerpos de los estudiantes con una dinámica de aplausos, saltos y otros movimientos. Una vez finalizada esta actividad, los organizó en semicírculo y captó su atención mediante un juego de imitación, lo que ayudó a preparar el ambiente para la lección.\r\n\r\nLa sesión inició formalmente con una canción que parece ser parte de la rutina habitual, lo que dio continuidad al trabajo del programa PASOS que han desarrollado durante el año. Antes de introducir el tema del día, la profesora realizó un repaso de los contenidos anteriores, destacando que los estudiantes muestran familiaridad y entusiasmo por el programa.\r\n\r\nEn esta ocasión, se dio inicio a una nueva unidad, y la profesora explicó claramente en qué consistiría, generando interés y motivación entre los estudiantes. Durante toda la clase, se observó un clima de aula positivo, con estudiantes atentos, motivados y siguiendo las instrucciones. Además, hubo un trabajo coordinado y eficiente con la asistente de aula, lo que facilitó el desarrollo fluido de las actividades.\r\n\r\nEn general, fue una sesión bien estructurada, con estrategias adecuadas para captar y mantener la atención, y con un enfoque en el aprendizaje activo y motivador.'),
(662, '14210475', '17842898', '2024-11-21', '15:00:00', '16:20:00', 25, 34, 2, NULL, 7, '- Definen grupos de trabajo.\r\n- Repaso de contenidos.\r\n- Clase lúdica y se observa participación de parte de las alumnas.\r\n- Preguntas de desafío.'),
(663, '18639869', '18447397', '2024-11-18', '11:55:56', '12:40:56', 12, 36, 1.74, NULL, 7, '\r\nLa clase de la profesora Ivonne tiene lugar inmediatamente después del recreo, lo que genera ciertas dificultades para que los estudiantes adopten una actitud óptima al inicio de la lección. Para facilitar esta transición, se podría implementar una estrategia sencilla y efectiva para estudiantes de tercero básico, como realizar una breve actividad física guiada (por ejemplo, estiramientos o movimientos sincronizados) que permita liberar energía y preparar a los estudiantes para concentrarse en la clase.\r\n\r\nLa estrategia de la profesora consistió en pedir a los mismos estudiantes que recordaran y comentaran las conductas esperadas al ingresar a la sala, priorizando un enfoque positivo que resalta lo que se espera en lugar de centrarse en lo que no se ha logrado. Además, dedicó unos minutos a repasar acuerdos previos establecidos como curso, reforzando el sentido de pertenencia y responsabilidad compartida.\r\n\r\nLa actividad principal comenzó con la entrega de fichas en forma de puzzle con la imagen de un cerebro. Los estudiantes trabajaron en grupos para armarlo y, posteriormente, la profesora les pidió reflexionar sobre las dificultades, facilidades y estrategias de coordinación que emplearon durante el ejercicio. Durante la actividad, la profesora mostró un interés constante en el proceso, monitoreando los avances grupo por grupo y ofreciendo apoyo cuando fue necesario.\r\n\r\nComo aspecto a mejorar, sería importante asegurarse de que los objetivos y temas de la clase queden claramente explicados desde el inicio, y que los estudiantes puedan demostrar, al finalizar, su comprensión y aprendizaje.'),
(665, '18639869', '13276799', '2024-11-22', '15:02:04', '15:47:04', 11, 36, 1.84, NULL, 7, '\r\nLa profesora Claudia inicia su clase recordando lo trabajado previamente, estableciendo una conexión con los contenidos anteriores. Para introducir la sesión del día, escribe en la pizarra la palabra empatía y pregunta a los estudiantes si recuerdan su significado. A partir de las respuestas de cada niño y niña, construyen juntos el concepto, fomentando la participación y el aprendizaje colaborativo.\r\n\r\nAprovechando el enfoque en la empatía, la profesora guía una reflexión sobre un evento ocurrido ese mismo día, en el que algunos estudiantes aparentemente se burlaron de un compañero por expresar sus sentimientos y entregar un regalo a otra compañera. Aunque el estudiante afectado se encontraba en el aula de recursos en ese momento, la discusión permitió abordar la importancia de comprender y respetar los sentimientos de los demás, utilizando la situación como un ejemplo práctico para el tema de la clase.\r\n\r\nLa actividad continúa con la lectura de un cuento proporcionado por el programa PASOS, seguido de una ficha de trabajo en parejas. La profesora monitorea activamente los avances, brindando apoyo y asegurándose de que todos los estudiantes comprendan y participen en la tarea.\r\n\r\nEn cuanto a las necesidades individuales, la profesora permite que un estudiante con necesidad de movimiento permanezca de pie y realice otras actividades que lo mantienen tranquilo. Aunque a simple vista puede parecer desconectado de la clase, esta estrategia asegura su regulación y bienestar. Para gestionar el tiempo, utiliza un cronómetro visible que ayuda a los estudiantes a estructurar su trabajo y cumplir con las tareas asignadas dentro del tiempo establecido.\r\n\r\nLa clase se desarrolla en un ambiente reflexivo y participativo, destacando la habilidad de la profesora para integrar contenidos relevantes con situaciones reales del curso y responder a las necesidades específicas de sus estudiantes.'),
(666, '18639869', '16404386', '2024-11-22', '11:55:04', '12:40:04', 16, 36, 1.83, NULL, 7, 'Ingresé a la sala con un desfase de unos minutos. Al entrar, observé al profesor guiando una reflexión con los estudiantes, quienes estaban dispuestos a escuchar y participar, manteniéndose ordenados. Posteriormente, el profesor escribió en la pizarra el título \"Hoy: Dejando huellas\", conectando el tema de la clase con la reciente despedida de los estudiantes de IV Medio, logrando relacionarlo de manera significativa con las experiencias del curso.\r\n\r\nA continuación, explicó una dinámica basada en un PPT del programa PASOS. En esta actividad, se presentaban distintas situaciones y los estudiantes debían deliberar si estas correspondían, no correspondían, o podían mediarse y conversarse. Los estudiantes se mostraron atentos y participativos durante toda esta etapa.\r\n\r\nDespués, el profesor organizó a los estudiantes en grupos de cuatro y les entregó fichas del programa PASOS para que trabajaran en equipo. Durante esta actividad, monitoreó los avances por puestos, brindando ayuda para resolver dudas y asegurándose de que los grupos comprendieran las tareas asignadas.\r\n\r\nEl profesor anticipó que la próxima sesión estará conectada con la clase de hoy, lo cual es positivo para dar continuidad y propósito al aprendizaje. Sin embargo, el cierre de la clase quedó algo ajustado debido a falta de tiempo, lo que puede ser un área a optimizar en futuras sesiones. A pesar de esto, la clase se mantuvo con un clima positivo y los estudiantes mostraron compromiso con las actividades propuestas.'),
(667, '13769322', '19973514', '2024-11-20', '08:15:00', '09:40:00', 17, 27, 1.2, NULL, 7, 'Leer el libro de autoaprendizaje de Mº Ligia\r\nObservar clase de la Profesora Sonia Soto martes 26 en 6ºA.\r\n'),
(668, '13769322', '11845380', '2024-11-21', '08:20:00', '09:20:00', 12, 35, 2, NULL, 7, 'Se felicita al docente por el trabajo realizado en clases; por el conocimiento de los niños y el cómo lo demuestran.'),
(669, '13769322', '18448344', '2024-11-27', '10:30:00', '10:50:00', 17, 15, 1.29, NULL, 7, 'Realizar una clase más organizada en cuanto al trabajo en aula; a) Solicitar la sala de computación para la investigación del tema  b) Entregar una guía con preguntas para que todos los estudiantes tengan la misma información con diferentes temas deportivos c) Solicitar biblioteca o trabajar en sala en la confección de la cartulina para la presentación (antes de eso mostrar ejemplos) d) Quedarse con las trabajos de los alumnos que lo terminaron para evitar olvidos y/o extravíos.'),
(670, '13769322', '19973514', '2024-11-27', '11:55:00', '09:17:21', 14, 27, 1.36, NULL, 7, 'Trabajar las instrucciones en el curso / Entregarlas cuando el curso esté en silencio\r\nDesarrollar estrategias de focalización para focalizar la atención de los niños.\r\n'),
(671, '13567342', '18761755', '2024-11-22', '10:07:00', '10:43:00', 25, 27, 1.64, NULL, 3, 'Fortalezas:\r\n- Buen trato con las estudiantes.\r\n- Mantiene una actitud relajada frente a situaciones complejas.\r\n- Hace cumplir la norma al solicitar ir a buscar pase a las estudiantes atrasadas.\r\n\r\nAreas de mejora:\r\n- Mantener planificaciones al día (25/10).\r\n- Definir los tiempos en conjunto con los estudiantes. Uso de tiempo visible.\r\n- Cuidar los tiempos que se establecen y cumplirlos.\r\n- Revisar las instrucciones con la participación de las estudiantes.\r\n- Mayor supervisión, recorriendo por la sala (varias estudiantes usan celular).\r\n\r\nDurante la clase se observó que las estudiantes trabajaban de manera constante y con interés en la actividad de elaboración del afiche.  Sin embargo, el avance limitado, probablemente por la necesidad de mayor orientación en la organización de las ideas o en la gestión del tiempo.  Por esto, sería valioso reforzar estrategias que ayuden a agilizar el proceso creativo y fomentar una planificación más eficiente para alcanzar los objetivos propuestos dentro del tiempo disponible.'),
(672, '13567342', '10521666', '2024-11-18', '11:58:00', '12:40:00', 21, 58, 1.76, NULL, 3, 'Fortalezas:\r\n- Buen manejo del contenido y del grupo curso.\r\n- Establece diálogo con las estudiantes.\r\n\r\nÁreas de Mejora:\r\n- Evitar prolongar demasiado los tiempos de diálogo, ya que no todas las estudiantes participan, dedicándose a hacer cosas que no se vinculan a la clase.\r\n- Promover que las estudiantes escriban sus respuestas, lo que contribuye a que se centren en el tema de la clase.  Definiendo tiempos para cada actividad.\r\n- Mantener planificaciones al día.\r\n\r\nDurante la clase se observó que una gran parte del tiempo estuvo centrada en la exposición del profesor, complementada por preguntas dirigidas a las alumnas.  Aunque algunas participaron activamente y demostraron interés, otras se desconectaron de la actividad, mostrando comportamientos como conversar, usar el celular o incluso dormir.\r\nEsto sugiere la necesidad de diversificar las estrategias, incorporando dinámicas participativas o actividades que fomenten una mayor interacción y compromiso por parte de las estudiantes.  Con esto se podrá lograr mayor involucramiento y atención durante la clase.'),
(673, '13567342', '15898402', '2024-11-18', '10:10:00', '10:50:00', 1, 29, 1.8, NULL, 3, 'Fortalezas:\r\n- Mantiene trato amable con los estudiantes.\r\n- Vincula lo cotidiano con el contenido.\r\n\r\nÁreas de mejora:\r\n- Delimitar tiempos de la clase.\r\n- Fomentar la participación de los estudiantes.\r\n- Control de las actividades anexas de los estudiantes.\r\n- Tomar curso a tiempo.\r\n\r\nDurante la clase se observó que la dinámica estuvo mayormente centrada en la exposición de la docente, con poca instrucción por parte de las estudiantes, aunque el ambiente fue cordial y respetuoso.  La entrega de trabajos revisados y las indicaciones para continuar demuestra una buena organización y seguimiento del proceso de aprendizaje. Sería recomendable incorporar estrategias más participativas  que fomenten la intervención de los estudiantes.'),
(674, '13567342', '18760349', '2024-11-18', '15:00:00', '15:40:00', 21, 34, 1.72, NULL, 7, 'Fortalezas:\r\n- Mantiene un trato respetuoso con las estudiantes.\r\n\r\nÁreas de mejora:\r\n- Rutinas de clima de aula. Determinar las condiciones para iniciar la clase. Respetar turnos de participación.  \r\n- Control del avance de las estudiantes. Aumentar la cantidad de ejercicios.  Delimitar los tiempos de la clase.\r\n\r\nDurante la clase se destacó la buena disposición de la docente para guiar a las estudiantes y atender consultas.  Sin embargo, se observó un ambiente de mucho ruido, que dificulta el desarrollo de la actividad, lo que obliga a repetir constantemente el objetivo o preguntas.  Esto limitó el tiempo dedicado a la ejercitación, un aspecto clave para reforzar los contenidos.  Sería valioso implementar estrategias de manejo de aula que reduzcan las interrupciones y optimicen el tiempo disponible, promoviendo un entorno más propicio para el aprendizaje y la práctica efectiva de los ejercicios.'),
(675, '13567342', '18448695', '2024-11-19', '15:44:00', '16:10:00', 25, 15, 1.78, NULL, 2, 'Fortalezas:\r\n- Trato cercano con las estudiantes.\r\n- Se genera un ambiente de respeto y colaboración.\r\n\r\nÁreas de mejora:\r\n- Velar por los tiempos, el proceso de evaluación es lento.  Sería conveniente establecer un tiempo límite.\r\n- Velar por que el traslado hacia el gimnasio sea más expedito, evitando que queden estudiantes rezagadas.\r\n- Recordar uniforme de Educación Física.\r\n- Coordinar uso del Gimnasio.\r\n- Mantener planificaciones al día.\r\n\r\nDurante la clase se evidenció un genuino interés por parte de las estudiantes en la evaluación de pilates y en la presentación de sus propuestas.  Este enfoque participativo es muy positivo para su aprendizaje y compromiso con la actividad.  Sin embargo, el ritmo de avance fuel algo lento, lo que podría atribuirse a la necesidad de una mayor estructura o claridad de las instrucciones.  Una sugerencia sería implementar estrategias que optimicen el tiempo y guíen a las estudiantes en la organización y ejecución de las propuestas, sin perder la motivación.\r\n'),
(676, '13567342', '18760120', '2024-11-19', '14:56:00', '15:38:00', 26, 15, 1.8, NULL, 3, 'Fortalezas:\r\n- Buen manejo de grupo. Alumnos responden a lo solicitado por la docente, evidenciando confianza y cercanía.\r\n- Se nota un ambiente motivador.\r\n\r\nÁreas de mejora:\r\n- Monitorear los traslados, para evitar rezagados, agilizando el proceso.\r\n- Supervisión de estudiantes que se mantienen al margen de la clase (pocos), procurar insertarlos.\r\n- Definir actividades, tiempos y consecuencias antes de salir de la sala.\r\n\r\nDurante la clase se observó un alto nivel de participación e interés por parte de los estudiantes en la actividad de fútbol.  Sin embargo, se mostraron impacientes por iniciar el juego, lo que llevó a que los ejercicios de calentamiento no se realizaron de manera completa.  \r\nSería recomendable enfatizar en la importancia del calentamiento como parte fundamental del rendimiento y la prevención de lesiones, así como reforzar el respeto mutuo y la disciplina durante la clase.'),
(677, '13567342', '12268200', '2024-11-18', '08:19:00', '09:00:00', 28, 29, 1.79, NULL, 3, 'Fortalezas:\r\n- Mantiene una actitud positiva frente a los estudiantes.\r\n- Uso de un lenguaje cercano y motivador.\r\n\r\nÁreas de mejora:\r\n- Mantener planificaciones al día.\r\n- Monitorear el trabajo de los estudiantes. Trabajo con grupo disruptivo.\r\n- Definir tiempos de trabajo.\r\n\r\nDurante l clase se presentó una explicación clara sobre el trabajo de análisis crítico a realizar, lo cual es fundamental para guiar a los estudiantes en la actividad.  Sin embargo, se observó una falta de compromiso parte de algunos de ellos, quienes no revisaron el documento proporcionado y usaron el celular con fine ajenos a la tarea asignada. Esto generó que en esos grupos no se evidenciara avances.  Sería útil incorporar estrategias que promueven mayor participación de los estudiantes, así como también, aseguran la lectura de la obra señalada.'),
(678, '13567342', '17456104', '2024-11-18', '10:50:00', '11:35:00', 27, 34, 1.96, NULL, 6, 'Fortalezas:\r\n- Se evidencia interés de los estudiantes.  La clase es motivadora.\r\n- Buen manejo del contenido.\r\n- Es clara en su explicación.\r\n\r\nÁreas de mejora:\r\n- Mantener el foco de todos los estudiantes puesto en la clase.\r\n- Orientar cierre hacia la metacognición.\r\n- Reorganizar la distribución del espacio, para evitar distracciones.\r\n\r\nDurante la clase se observó un enfoque motivador al utilizar la planilla con datos de los propios estudiantes, lo que generó interés y conexión con la actividad.\r\nSi bien el grupo se mostró interesado en el trabajo, se identificaron algunos estudiantes con un avance más lento, lo que podría deberse a dificultades en el manejo del programa o a la acumulación de retrasos en clases anteriores.  Sería conveniente implementar estrategias de apoyo diferenciado, por ejemplo, definiendo claramente la forma de apoyo del compañero que asume rol tutor hacia el final de la clase, monitoreando su forma de trabajo.'),
(679, '13567342', '13368129', '2024-11-18', '09:00:00', '09:40:00', 19, 27, 1.54, NULL, 6, 'Fortalezas:\r\n- Trato cordial con las estudiantes. Se evidencia cercanía.\r\n- Preocupación por buscar material atractivo para la clase.\r\n\r\nÁreas de mejora:\r\n- Monitoreo de los avances y del comportamiento de las estudiantes.\r\n- Rutinas de clima de aula. \r\n- Asegurar el silencio para la entrega de instrucciones y verificar su comprensión.\r\n\r\nDurante la clase se evidenció la buena disposición de la docente para mantener un buen trato con las estudiantes y guiar su trabajo; sin embargo, el alto nivel de ruido afectó la dinámica de trabajo.  Las instrucciones no fueron escuchadas con claridad por todas las estudiantes, y no se verificó su comprensión, lo que resultó en avances muy desiguales o falta de progreso en algunos casos.  Además, la ausencia de monitoreo constante, dificultó el seguimiento del trabajo.  Sería conveniente implementar estrategias para mejorar el control del grupo, como establecer normas, verificar la comprensión de instrucciones antes comenzar y realizar un monitoreo más cercano, para garantizar un progreso más uniforme.'),
(680, '13567342', '9141113', '2024-11-18', '15:45:00', '16:30:00', 27, 54, 1.88, NULL, 6, 'Fortalezas:\r\n- Buen manejo de grupo, lo que se manifiesta en un clima de aula propicio para el aprendizaje.\r\n- Se evidencia un trato amable y cercano con los estudiantes.\r\n\r\nÁreas de mejora:\r\n- Implementar estrategias que eviten el abuso en el uso de la IA.\r\n- Asignar actividades anexas a aquellos que ya finalizaron su trabajo.\r\n- Mantener planificaciones al día.\r\n\r\nDurante la clase, se evidencia un clima de clase agradable, donde tanto los estudiantes como la docente se muestran cómodos.\r\nTodos los estudiantes se encuentran trabajando.'),
(682, '9089119', '17223013', '2024-11-12', '11:55:28', '12:35:28', 27, 18, 1.96, NULL, 3, 'Objetivo de la clase:\r\n\r\nComprender y analizar la teoría de las ideas de Platón, para comprender su influencia en las ciencias contemporáneas.\r\n\r\nDocente inicia presentando el objetivo enfatizando la comprensión de la teoría de las ideas con motivación a través de una imagen invitando a la reflexión, logra que las estudiantes participen activamente, sin embargo 3 estudiantes no logran adherirse a la escucha activa participando débilmente. \r\n\r\nRealiza preguntas claves y presenta ruta de trabajo lo que potencia el logro del objetivo\r\n\r\nSe observa un buen clima de aula el que se mantiene durante todo el acompañamiento.\r\n\r\nUtiliza estrategia 100% invitando a las estudiantes a la permanente reflexión con ejemplos de la cotidianeidad.\r\n\r\nSe observa a la docente alegre, transmitiendo motivación hacia la asignatura y demostrando buen manejo disciplinar. \r\n\r\nSugerencias:\r\n      \r\nImplementar estrategia innovadora con uso de tics.\r\n\r\nVerificar que todos los estudiantes estén adheridos al trabajo, realizando estrategia sin salida a las estudiantes desatentas.\r\n'),
(683, '9089119', '19334195', '2024-11-08', '08:45:53', '09:30:53', 25, 34, 2, NULL, 3, 'Objetivo: Resolver problemas contextualizados y no contextualizados para preparar evaluación a través del juego.\r\n\r\nLa clase comienza organizando el espacio, preparando el clima de aula y entregando materiales para actividad a desarrollar\r\n\r\nEntrega instrucciones claras y se realiza una competencia en equipos que participan activamente, siguiendo los pasos presentados por la docente. \r\n\r\nSe observa alta participación y motivación. El juego da oportunidad para que demuestren lo que saben y también, para que aprendan lo que no está claro, ya que tiene un momento en que se debe explicar a la compañera las dudas o correcciones para poder ser presentada a la competencia.\r\nLa estrategia utilizada en el juego resulta exitosa dando la oportunidad de participación a todas y lográndose el objetivo de este.\r\n\r\nLa docente retroalimenta después de cada ejercicio de la competencia, falta que las estudiantes expliquen sus respuestas para que evalúen sus errores.\r\n\r\nSe realiza tiempo consensuado, y la actividad se desarrolla con buen ritmo de trabajo permitiendo así realizar una buena cantidad de ejercicios.\r\n\r\nLas estudiantes tienen un minuto para reflexionar acerca de la respuesta, que da la que está de turno promoviendo así la alta participación y motivación.\r\n\r\nLa docente demuestra factor alegría motivando así el gusto por la asignatura.\r\n\r\nSugerencias:\r\n\r\nSe felicita a la docente ya que logra realizar una práctica sugerida desarrollando las sugerencias realizadas en acompañamiento anterior que son:\r\n\r\nPresentar el objetivo explicitando la habilidad, intencionándola como meta compartida con los estudiantes\r\n\r\nPromover la escucha activa\r\n\r\nEvaluar tiempo invertido en la estrategia a desarrollar antes de implementarla\r\n\r\nUtilizar estrategia de gestión del tiempo\r\n\r\n'),
(684, '9089119', '20255628', '2024-11-07', '10:30:51', '11:30:51', 20, 34, 1.88, NULL, 2, 'Objetivo: Resolver problemas aplicando proporcionalidad directa e inversa.\r\n\r\nSe comienza preparando clima de aula y presentando ruta de trabajo con las actividades a desarrollar. Entrega instrucciones claras.\r\n\r\nAl avanzar en las actividades los estudiantes expresan dudas las que la docente va aclarando en la pizarra, se retroalimentan las respuesta, pero aun así hay estudiantes que no se adhieren al trabajo.\r\n\r\nIntroduce mediante ejemplos los que presenta en PPT realizando estrategias sin salida, 100% y tiempo consensuado\r\n\r\nLa estrategia consiste en una competencia en equipos los que participan activamente. Se observa que falta escucha activa y ritmo en la actividad, lo que en desconcentra a un grupo de estudiantes.\r\n\r\nLa docente se vincula positivamente, escuchando y monitoreando el trabajo.\r\n\r\nAcuerdos:\r\n  \r\nSe incentiva a la docente a seguir trabajando las sugerencias de acompañamiento anterior las que fueron trabajadas durante esta clase:\r\n\r\nCuidar el volumen del micrófono ya que se torna muy invasivo (no se usó y fue positivo)\r\n\r\nEvitar preguntas retóricas para verificar la comprensión, potenciar estrategia sin salida. (se observó avance en esta práctica)\r\n\r\nUtilizar estrategia de gestión del tiempo (se realiza la estrategia)\r\n\r\nSugerencias próxima clases:\r\n\r\nUtilizar estrategia que promueva la escucha activa.\r\nDar la oportunidad a los estudiantes de modelar sus ejercicios para detectar errores y asi mejorar los procesos de retroalimentación\r\n\r\n'),
(685, '9089119', '18389625', '2024-11-15', '08:15:33', '09:20:33', 26, 34, 1.88, NULL, 6, 'Objetivo: Comprender y aplicar las razones trigonométricas.\r\n\r\nPrepara clima de aula, ordenando la sala y entregando las normas como escucha activa y uso de celulares.\r\n\r\nRecoge opiniones sobre prueba SIMCE la cual rindieron el día anterior, realizando así una reflexión que permite retroalimentar a la docente sobre algunos temas abordados en la signatura.\r\n\r\nSe inicia la clase con una motivación con juego lúdico compartido en el PPT, se presenta la ruta de trabajo con los momentos de la clase y el objetivo, falta destacar la habilidad a desarrollar.\r\n\r\nSe recuerdan conocimientos previos con ayuda en PPT, y con preguntas claves.\r\n\r\nRealiza estrategia sin salida, sin embargo, también se realizan muchas preguntas retóricas impidiendo verificar la comprensión de parte de todos los estudiantes.\r\n\r\nSe observa una clase con factor alegría, falta desarrollar la escucha activa por parte de un gran número de estudiantes, quienes interrumpen perdiendo la continuidad de la actividad.\r\n\r\nEn la segunda parte se realiza ejercitación la que en principio la dicente explica y modela en la pizarra, los estudiantes trabajan en sus cuadernos\r\n\r\nSugerencias:\r\n\r\nImplementar estrategia para activar la escucha activa, con un clima de aula propicio para el aprendizaje y adhesión al trabajo de parte de todos los estudiantes.\r\n\r\nDesarrollar estrategias innovadoras que impacten en el aprendizaje y logro del objetivo.\r\n\r\n\r\n');
INSERT INTO `observacion` (`OBS_ID`, `FUN_RUN`, `OBS_FUN_OBSERVADO`, `OBS_FECHA`, `OBS_HORA_INICIO`, `OBS_HORA_FIN`, `OBS_CURSO`, `OBS_ASIGNATURA`, `OBS_NOTA`, `OBS_ASISTENCIA`, `OBS_MOMENTO`, `OBS_COMENTARIO`) VALUES
(690, '14273480', '14604335', '2024-11-26', '08:20:00', '09:40:00', 9, 34, 1.95, NULL, 7, 'Observaciones:\r\nClase organizada, pensada en la participación de todos los estudiantes.\r\nActivación de conocimientos previos.\r\nInstrucciones claras, utilización de paso a paso.\r\nEstrategias de clima de aula que promueven el aprendizaje.\r\nReconocimiento del error como parte del aprendizaje.\r\nLenguaje propositivo.\r\nInstalación de grupos de trabajo.\r\n\r\nAcuerdos:\r\nUtilizar material concreto más especifico, pensando en aquellos estudiantes que se les hace más difícil la comprensión.\r\n'),
(692, '14273480', '15616161', '2024-11-21', '10:17:00', '11:35:00', 10, 32, 1.95, NULL, 7, 'OBSERVACIONES:\r\n- Clase organizada, con sus 3 momentos.\r\n- Docente aprovecho todo momento para generar aprendizaje.\r\n- Realiza excelentes preguntas, promoviendo diferentes habilidades.\r\n- Promueve la participación de todos sus estudiantes.\r\n- Excelente clima de aula.\r\nACUERDOS:\r\n- Intencionar y explicitar las estrategias de compresión lectora, al momento de la lecturacompartida.\r\n- Para monitorear el aprendizaje de todos, ofrecer unos minutos a cada estudiante para querespondan de forma individual y después revisar en forma grupal..'),
(693, '14273480', '14604335', '2024-10-29', '08:15:00', '09:00:39', 9, 32, 1.95, NULL, 3, 'OBSERVACIONES:\r\nBuen clima de aula.\r\nEstrategias aplicadas de forma sistemática.\r\nAcoge acuerdos anteriores.\r\nUso de preguntas orientadores en diario de vida.\r\nImplementa estrategia según orientaciones dadas en capacitación.\r\n\r\nACUERDOS:\r\nTrabajar palabras de uso frecuente.\r\nUtilizar mano preguntona de forma visible.'),
(694, '11537827', '16036651', '2024-12-27', '10:25:57', '11:10:57', 13, 29, 2, NULL, 7, 'Excelente Trabajo \r\n\r\nRECONTAR: es recordar los hechos acontecidos desde el inicio por parte de los niños. Cuanto es un cuento con libro, se hace en lo posible con las imágenes. En este caso como era una hoja escrita con 2 imágenes, se recuerdan las ideas en forma cronológica que han sucedido hasta el momento en que se decide recontar. Generalmente se hace antes del climax. \r\nSECUENCIAR: es nombrar 3 o 4 hechos acontecidos en cualquier parte del cuento. Puede hacerse durante o al final.		\r\n'),
(695, '11537827', '17647933', '2024-10-29', '08:15:47', '09:40:47', 17, 1, 1.78, NULL, 7, 'Se debe aplicar estrategias de clima de Aula (5S) \r\n\r\nLas actividades deben tener una gradualidad de complejidad para lograr el aprendizaje de todos los estudiantes.\r\n\r\n'),
(696, '11537827', '17899117', '2024-11-14', '11:17:40', '08:39:40', 7, 34, 2, NULL, 7, 'Se felicita por su trabajo \r\n\r\nSeguir implementando nuevas estrategias.\r\nSeguir con el trabajo colaborativo con otras areas\r\n  '),
(697, '11537827', '18143931', '2024-11-13', '08:15:54', '09:42:55', 8, 29, 1.92, NULL, 7, 'Seguir implementando estrategias de rutinas de pensamiento.\r\nRealizar los cierres de las actividades para hacer la retroalimentación de lo aprendido por los estudiantes\r\nHacer más protagonista a los estudiantes de sus propios aprendizajes.   '),
(700, '11537827', '18143931', '2024-11-29', '11:15:23', '09:06:23', 8, 34, 1.96, NULL, 7, 'Se felicita por su trabajo y relación co estudiante que hace que la clase sea motivadora.\r\nGenerar preguntas más desafiantes a los estudiantes para sean generador de su propio aprendizaje\r\nSeguir trabajando en nuevas estrategias innovadoras que permitan generar aprendizajes significativos.'),
(701, '14273480', '15221803', '2024-11-21', '08:15:00', '09:35:00', 7, 34, 1.79, NULL, 7, 'OBSERVACIONES:\r\n- Se observa un buen clima de aula donde la docente utiliza estrategias adquiridas por los estudiantes.\r\n- En general, se observa una buena clase, donde la docente: da a conocer el objetivo de la clase, lo trabaja con los estudiantes y lo retoma en el cierre, también monitorea el trabajo de los estudiantes, explica de forma clara las instrucciones.\r\n\r\nACUERDOS:\r\n- Recordar la importancia de verificar la comprensión de las instrucciones con sin salida u otra estrategias.\r\n- Promover la participación de los estudiantes, a partir de la implementación de estrategias que permitan verificar: la comprensión de instrucciones,  de contenidos o incluso monitorear sus saberes, permitiendo que no solo los estudiantes mas aventajados respondan. Para ello, se puede usa pizarras, ticket de salida y/o potenciar el trabajo en duplas o pequeños grupos.\r\n- Ofrecer un tiempo para que los estudiantes respondan y luego corroborar en forma grupal.\r\nTodo lo anterior contribuye a promover las altas expectativas de todos los estudiantes.'),
(702, '14273480', '14354013', '2024-11-26', '11:55:00', '12:40:00', 10, 34, 1.91, NULL, 7, 'Observaciones:\r\nSe observa un buen trabajo en el aula, apoyando a los estudiantes y organizando el espacio educativo.\r\n\r\nAcuerdos:\r\nIntervenir y/o apoyar a los estudiantes en el proceso pedagógico, en especial apoyando a los estudiantes que mas lo necesitan.'),
