(720, '13769322', '13268741', '2025-03-17', '10:05:00', '11:45:00', 16, 42, 1.27, NULL, 7, 'Entregar correctamente las instrucciones al inicio de la clase, lograr captar la atnción de los estudiantes y lograr un mayor entendimiento de las actividades que deben trabajar.\r\nFormular preguntas más asertivas para lograr profundizar el contenido.'),
(722, '13769322', '19404149', '2025-03-18', '08:17:00', '09:40:00', 13, 34, 1.92, NULL, 7, '•	Realizar los ejercicios del libro y copiar su resultado.\r\n•	Lograr silencio para el trabajo en clases.\r\n•	Debido a la falta del cuadernillo de ejercicios, se enviarán a multicopiar hojas del cuadernillo de años anteriores.\r\n'),
(723, '13769322', '16292602', '2025-03-19', '11:55:00', '12:40:00', 13, 1, 1.23, NULL, 7, '•	Mejorar la instrucción al inicio de la clase o bien al explicar la actividad.\r\n•	Organizar de mejor forma la clase, marcando un buen inicio con instrucciones claras para que luego los estudiantes puedan desarrollar un buen trabajo en la clase.\r\n'),
(724, '13769322', '19757467', '2025-03-17', '08:15:00', '09:40:00', 16, 22, 0.96, NULL, 7, '•	Trabajar en la correcta entrega de instrucciones.\r\n•	Mejorar la estructura de la clase.\r\n•	Ver una clase de otro docente para conocer el trabajo de otro docente. (planificado por la coordinadora)\r\n***Se conversa con la profesora sobre cómo debe abordar los problemas de convivencia en el cuso.\r\n'),
(725, '13769322', '9962597', '2025-03-26', '08:15:00', '09:40:00', 15, 34, 1.65, NULL, 7, '•	Realizar el cálculo mental en forma más breve y precisa (tiempo visible)\r\n•	Revisión de tarea que se envían la clase anterior (en pizarra y cuaderno de los estudiantes, puede ser con la ayuda del PIE)\r\n'),
(726, '13769322', '19757467', '2025-03-28', '08:15:00', '09:40:00', 17, 22, 1.16, NULL, 7, '•	Debe realizar el hoy visible para los estudiantes\r\n•	Entregar de manera correcta las instrucciones de las actividades verificando, a través de preguntas a los estudiantes si se comprende lo que deben realizar.\r\n•	Proyectar el texto del estudiante en las clases.\r\n'),
(727, '13769322', '13268741', '2025-04-02', '08:20:00', '09:40:00', 18, 42, 1.12, NULL, 7, '•	Rezar, de pie, y asignar un calendario mensual de oraciones por niño para la clase\r\n•	Reforzar los rituales de las lecturas bíblicas y apropiarse del contenido.\r\n\r\nSe solicita a la docente que repita su clase, según la retroalimentación realizada.\r\n'),
(728, '7060271', '15086447', '2025-04-07', '08:00:00', '09:00:00', 4, 32, 1.78, NULL, 7, 'Acompañamiento momento del calendario. Inicio  de la jornada.\r\nFelicitaciones por el avance de los estudiantes. Curso ordenado, conoce la rutina de trabajo.\r\nSe acuerda intencionar el deletreo de los nombres de los estudiantes ausentes.\r\nExcelente manejo de grupo. Felicitaciones.'),
(729, '7060271', '16758069', '2025-04-07', '08:00:00', '09:00:00', 4, 32, 1.82, NULL, 7, 'Presente durante todo el momento del acompañamiento. Atenta a las becesidades de los estudiantes. Se sugiere aprenderse la canción de la oración. Atenta al desarrollo de la actividad. Sugiero acercarse a los estudiantes que deben poner atención, no nombrarlos desde lejos. Se sugiere algún tipo de incentivo de comportamiento para el moemnto de la alfombra.'),
(730, '7060271', '17816865', '2025-04-09', '08:00:00', '09:00:00', 5, 32, 2, NULL, 7, 'Se observa finalización de actividad de inicio. Para iniciar de manera puntual, deja a 6  estudiantes terminando a cargo de la asistente, se observa rigurosidad en la instrucción. Implementar algún tipo de motivación para los estudiantes más lentos. Se sigue un rutina ordenada, los estudiantes entienden la rutina. Existe orden y si es necesario se interrumpe para fortalecer las normas. \r\nSugerencias, motivar que de a poco se hagan responsables de mostrar sus comunicaciones. COmenzar la jornada con la oración para dar continuidad con los atrasados. Dias en el colegio: comprobar la cantidad de unidades y decenas. '),
(731, '7060271', '12605223', '2025-04-09', '08:00:00', '09:00:00', 5, 32, 2, NULL, 7, 'Atenta a las necesidades de los niños, receptiva y eficiente. Se sugiere estar atenta a las ubicaciones d elos estudioantes en la alfombra, corregir de manera silenciosa a los estudiantes en la alfombra. Felicitaciones por la eficiencia demostrada durante la observación'),
(733, '14273480', '9288148', '2025-04-01', '14:14:00', '14:25:30', 1, 11, 2, NULL, 2, 'Participa y apoya a los estudiantes de forma espontánea, estando atenta a las necesidades de cada estudiante.\r\n\r\nACUERDOS:\r\n- Realizar intervenciones lingüísticas, permanentemente, desde el nivel pedagógico, independiente del proceso de observación en aula que se este realizando.'),
(734, '14273480', '15178747', '2025-04-01', '14:15:00', '14:25:30', 1, 11, 2, NULL, 2, 'OBSERVACIONES.\r\n- Se observa el desarrollo de la clase, siendo esta la rutina de trabajo inicial y lectura independiente.\r\n- Utiliza paso a paso escrito y con pictogramas en pizarra. Recuerda constantemente los pasos con los estudiantes, reforzando y verificando la comprensión de las instrucciones.\r\n- Monitorea a todos los estudiantes y refuerza positivamente.\r\n\r\nACUERDOS:\r\n- Implementar tiempo asignado o visible.\r\n- Implementar tarjetas para rutina de lectura independiente, esto considerando que los estudiantes no poseen la cultura de la lectura y es necesario intencionar y motivar.'),
(735, '13769322', '18447397', '2025-04-09', '10:05:00', '11:35:00', 14, 32, 1.73, NULL, 7, '•	Elegir a un jefe de fila para que verifique que todos copien; y premiar a la fila.\r\n•	Regalo Lector / Solicitar cambio de horario por historia – para asistir 2 horas a biblioteca / realizar actividades más atractivas y que cumplan con el objetivo de la clase.\r\n\r\n** Coordinación enviará material las primeras clases para realizar el regalo lector y posteriormente lo enviará la docente.\r\n'),
(736, '11537827', '14622138', '2025-04-01', '12:00:45', '12:40:45', 18, 22, 1.85, NULL, 7, 'Se observa un buen clima de aula y rutinas claras \r\nMaterial acorde a los objetivos de las clases, especifica claramente la habilidad a desarrollar durante la clase.\r\n\r\nSe debe mejorar \r\nPotenciar la comprensión lectura utilizando estrategias más guiada con los estudiantes     \r\nUtilizar estrategias para dar instrucciones claras, precisas y con tiempos consensuados para una actividad.  '),
(737, '11537827', '13625118', '2025-04-10', '08:15:31', '09:40:31', 1, 34, 1.96, NULL, 7, 'Felicitaciones una clase ordenada, con una buena estructura\r\nSe hace visible la habilidad y se refuerza al estudiante durante toda la clase.  \r\nUn buen manejo diciplinar \r\nSe sugiere trabajar los tiempos más marcados ante pequeñas actividades, para no dar tiempo que propicien a desconcentrarse del trabajo. \r\nTrabajar vocabulario para enriquecer el aprendizaje. \r\n'),
(738, '11537827', '18149632', '2025-04-10', '12:00:12', '13:00:12', 15, 1, 1.67, NULL, 7, 'Se visualiza un buen clima de aula y de trabajo de los estudiantes. Refuerza las 5s y maneja estrategias para generar silencio. \r\nSe sugiere mejorar: \r\nMejorar\r\nLa asignación de tiempo para las actividades \r\nLa retroalimentación de los procesos de los trabajos (monitoreo), que pasa con los que están sin material o no está el compañero de trabajo. \r\nLas instrucciones ante de comenzar a trabajar (objetivo de la clase, no del proyecto completo)'),
(739, '9089119', '17614804', '2025-04-08', '08:15:50', '09:00:50', 22, 23, 1.96, NULL, 3, 'Objetivo de la clase: To use grammar structure to form sentences.\r\n\r\nDocente inicia preparando el clima de aula que se mantiene durante todo el periodo, con estudiantes atentos y adheridos al trabajo.\r\n\r\nEntrega el objetivo y ruta de trabajo recordando conocimientos previos \r\n\r\nA través de PPT presenta vocabulario sobre aparatos tecnológicos antiguos y su evolución, logrando la atención e interés de los estudiantes \r\n\r\nVerifica la comprensión a través de preguntas claves y vinculándose positivamente con los estudiantes. \r\n\r\nSe observa alta participación al momento de practicar a través de ejercicios orales, sin embargo, hay estudiantes que no responden activamente.\r\n\r\nAcuerdos:\r\n\r\nUtilizar estrategias como sin salida para verificar la comprensión y asegurar la participación de todos los estudiantes.\r\n'),
(740, '9089119', '19425852', '2025-04-10', '13:25:41', '14:10:41', 30, 14, 1.84, NULL, 7, 'Objetivo de la clase: Analizar los desafíos de una sociedad democrática actual\r\n\r\nDocente inicia preparando el clima de aula, a través de preguntas de conocimientos previos\r\n\r\nPresenta el objetivo y palabras claves respecto al tema como probidad y pluralismo\r\n\r\nSe realiza un desarrollo expositivo claro con apoyo de PPT desarrollando en la pizarra un esquema conceptual.\r\n\r\nSe vincula positivamente con las estudiantes, con factor alegría promoviendo la reflexión e interés de los estudiantes, sin embargo, hay un número significativo que conversan y no se adhieren a la actividad\r\n\r\nVerifica la comprensión realizando preguntas claves de manera general al curso y ticket de salida que comparten oralmente.\r\n\r\nSugerencia de trabajo: \r\n\r\n Evitar las preguntas retóricas e implementar rutina o estrategia que permita verificar la comprensión de todos los estudiantes, como sin salida o 100%.\r\n\r\n Utilizar estrategias que desarrollen la escucha activa\r\n\r\n'),
(741, '9089119', '17223013', '2025-04-03', '10:10:57', '11:00:57', 21, 43, 1.84, NULL, 3, 'Objetivo: Investigar y recopilar información sobre un parque nacional o reserva natural de Chile a través de diversas fuentes con el fin de elaborar un informe escrito que aborde sus características climáticas, geográficas, culturales, biológicas y turísticas.\r\n\r\nSe comienza preparando clima de aula, recordando a los estudiantes normas de disciplina y logrando preparar un ambiente propicio después de resolver situación de desregulación emocional de una de las estudiantes, lo que llevo a comenzar más tarde.\r\n\r\nSe presenta el objetivo y se entregan las instrucciones.\r\n\r\nDocente logra que las estudiantes se mantengan atentos a las explicaciones y se organizan de manera autónoma en parejas de trabajo.\r\n\r\nLa profesora se vincula positivamente y mantiene a la mayoría de los estudiantes atentos e interesados.\r\n\r\nDocente monitorea de manera individual explicando dudas y verificando avance, sin embrago hay parejas que no logran adherirse al trabajo activamente.\r\n\r\nSugerencias:\r\n\r\nPlanificar este tipo de actividad resguardando que las estudiantes puedan adherirse activamente, intencionando las parejas de trabajo.\r\n\r\nUtilizar estrategias como tiempo consensuado y ruta de trabajo.\r\n\r\n'),
(742, '9089119', '20154755', '2025-04-10', '08:15:13', '09:05:13', 25, 29, 2, NULL, 3, 'Objetivo: Analizar la obra “El túnel” de Ernesto Sabato considerando los conflictos centrales. \r\n\r\nDocente prepara el clima de aula el que se mantiene durante todo el periodo.\r\n\r\nPresenta el objetivo y comienza motivando a través de preguntas claves invitando a la reflexión\r\n\r\nDesarrollan tres preguntas en donde se debe argumentar, profesora consensua el tiempo y verifica la comprensión.\r\n\r\nLa profesora se vincula positivamente y mantiene a la mayoría de los estudiantes atentos e interesados, monitoreando de manera individual explicando dudas y verificando avance.\r\n\r\nAcuerdos:\r\n\r\nImplementar estrategias para determinar el propósito de las preguntas, de manera que el estudiante cuente con una herramienta que le permita, tanto descubrir los distractores en cómo encontrar la respuesta correcta.\r\n\r\nUtilizar ruta de trabajo\r\n\r\n\r\n'),
(743, '9089119', '10744011', '2025-04-01', '10:10:57', '10:45:57', 23, 60, 1.47, NULL, 3, '\r\nObjetivo de la clase: “Definir el concepto de inteligencia artificial, identificando sus principales características y diferenciándola de otras formas de tecnología, para comprender su relevancia en el mundo actual.”\r\n\r\nDocente inicia la clase con conocimientos previos acerca de conceptos claves de IA, motivando con la imagen de una noticia al respecto, los estudiantes emiten juicios respecto a la aseveración “la IA es un insulto a la vida misma”\r\n\r\nPromueve un clima de escucha activa a través de preguntas claves, observándose un grupo de estudiantes muy participativos, sin embargo, hay varios estudiantes que no participan de la actividad.\r\n\r\nResponde las dudas de manera clara, promoviendo la comprensión del contenido.\r\n\r\n\r\n\r\nSugerencias:\r\n\r\nSe conversa y reflexiona con el docente acerca de diversas estrategias que puede ir utilizando, se dejan los siguientes desafíos para un próximo acompañamiento:\r\n\r\nPresentar el objetivo de aprendizaje al inicio de la clase junto a una ruta de trabajo\r\n\r\nImplementar estrategia de clima de aula al inicio procurando un ambiente limpio y ordenado\r\n\r\nIntencionar preguntas a los estudiantes, verificando la comprensión.\r\n'),
(744, '9089119', '19334195', '2025-04-15', '11:55:12', '12:40:12', 29, 39, 1.91, NULL, 3, 'Objetivo: Retroalimentar evaluación de medidas de tendencia central y análisis de gráficos\r\n\r\nDocente inicia la clase entregando evaluaciones.\r\nLos estudiantes revisan su evaluación de manera individual y comparten resultados, la docente retoma las preguntas más descendidas y se revisan en la pizarra, realizando preguntas con estrategia sin salida.\r\n\r\nLa profesora va explicando y respondiendo dudas, se vincula positivamente y mantiene a la mayoría de los estudiantes atentos e interesados, sin embargo, hay un grupo de estudiantes que no participan activamente, no se comprueba si estos estudiantes aprendieron\r\n\r\n\r\nRelaciona algunas de las preguntas con preguntas PAES, atrayendo la atención de los estudiantes, sobre todo de cuartos medios, se sugiere realizar esta estrategia sistemáticamente\r\n\r\nPasan a la pizarra a demostrar sus estrategias de resolución cuando la profesora pregunta por las que utilizaron.\r\n\r\n\r\nAcuerdos :\r\n\r\nNo olvidar Implementar estrategias de clima de aula que mejoren la escucha activa.\r\n\r\nComenzar con una actividad como una autoevaluación sobre que tuvo mayor dificultad para ellos y entregar evaluaciones mientras el estudiante trabaja autónomamente.\r\n\r\nTomar la retroalimentación como una actividad muy importante por tanto tener una estrategia armada, por ejemplo: proyectar la prueba en la televisión, e ir revisando todos juntos de manera de que se interesen y se den cuenta de sus errores\r\n\r\nEn la próxima prueba  volver a aplicar preguntas más descendidas.\r\n'),
(745, '13769322', '13276799', '2025-04-15', '08:22:00', '09:40:00', 11, 32, 1.88, NULL, 7, '•	Una vez posterior al saludo y antes del “hacer ahora” la docente debe aplicar estrategias “en sus marcas”\r\n•	Solicitar las copias necesarias a Coordinación para aquellos estudiantes que no traen su texto escolar.\r\n\r\n** Se felicita a la docente por la clase ya que estuvo bien realizada. (planificación de una afiche)\r\n'),
(746, '11537827', '13625118', '2025-04-15', '10:10:23', '10:55:23', 14, 34, 1.67, NULL, 7, 'Debe mejorar las secuencias de las actividades para dar más ritmo a la clase \r\nTener actividades para los estudiantes NEE de acuerdo a su nivel de aprendizaje. '),
(747, '9089119', '17899117', '2025-04-15', '10:10:09', '11:05:09', 21, 34, 1.96, NULL, 3, 'Objetivo: Retroalimentar desarrollo de guía de operatoria con números racionales.\r\n\r\nSe comienza iniciando con preparación de la sala (limpieza) generando un clima de aula propicio, el que se mantiene durante todo el periodo.\r\n\r\nDocente comienza revisando conocimientos previos y entregando el objetivo de la clase.\r\n\r\nRealiza estrategia sin salida, logrando la participación de los estudiantes y reforzando conceptos claves.\r\n\r\nSe vincula positivamente y los estudiantes se muestran interesados y participativos.\r\n\r\nSe revisa guía de trabajo detectando errores y aclarando dudas\r\n\r\nSe realizan ejercicios con ejemplos de la vida real\r\n\r\nSe observa estudiantes que pierden la concentración a medida que se avanza en la explicación en la pizarra.\r\n\r\nAcuerdos:\r\n\r\nEntregar ruta de trabajo entregando así la estructura de la clase\r\n\r\nImplementar Estrategia activa participativa como kahoot\r\n\r\nSe concuerda en que la estrategia utilizada sobre visualizar el error fue positiva y reforzó el contenido y aclaro dudas, se seguirá implementando \r\n\r\n'),
(748, '9089119', '20255628', '2025-04-15', '13:25:05', '14:10:05', 19, 34, 1.88, NULL, 7, 'Objetivo de la clase: Realizar adiciones de números enteros\r\n\r\nDocente inicia reforzando conocimientos previos y aclarando dudas.\r\n\r\nSe observa estudiantes participativos y atentos, utiliza estrategia 100%, vinculándose positivamente con los estudiantes\r\n\r\nSe consensua el tiempo para desarrollar distintas guías de ejercitación, lo que ayuda a mantener un trabajo activo.\r\n\r\nDocente monitorea el trabajo y aclara dudas de manera individual a estudiantes más descendidos\r\n\r\nSe observa un buen ritmo de trabajo de los estudiantes, ya que se adhieren al trabajo propuesto avanzando rápidamente para terminar la guía, la cual autoevalúan corrigiendo sus respuestas \r\n\r\nEl clima de aula se mantiene durante el periodo, sin embargo, hay estudiantes más descendidos que les cuesta seguir el ritmo de trabajo.\r\n\r\nSugerencia de trabajo: \r\n\r\nPresentar al inicio el objetivo orientando el desarrollo de la clase y promoviendo la participación como meta consensuada.\r\n\r\nVerificar la comprensión y realizar estrategia con los estudiantes que se detectan descendido en el aprendizaje, se acuerda realizar grupo homogéneos para poder atender a través de codocencia a los más descendidos cuando se realice este tipo de trabajo.\r\n'),
(750, '14273480', '14604335', '2025-04-15', '11:55:15', '12:40:15', 7, 32, 1.95, NULL, 3, 'Observaciones.\r\n- Se observa la utilización de diferentes estrategias de clima de aula, donde la docente promueve, permanentemente, el respeto de las normas.\r\n- Destaca la promoción de un clima de aula que sea propicio para el aprendizaje donde los estudiantes se sientan cómodos, seguros y confiados, dispuestos al error como un aprendizaje.\r\n\r\nAcuerdos para la mejora:\r\n- En relación a la verificación de la comprensión de conceptos enseñados, se solicita implementar estrategias que permitan a la docente verificar el aprendizaje de todos. A su vez, esto promoverá la participación de todos. Ejemplo: al momento de escribir la palabra inolvidable o seleccionada, ofrecer el espacio para que todos vayan escribiendo o cuando se solicita buscar palabras u objetos que inicien con la letra P, entregar una pequeña guía donde puedan marcar los objetos, de tal forma que realicen un trabajo individual y luego compartan. \r\n- Realizar preguntas de comprensión de la lectura y valorativas.\r\n- En lectura del ABC, poner atención en letras que tiene mas de 1 sonido.'),
(753, '14273480', '15221803', '2025-04-09', '08:15:39', '08:37:39', 1, 32, 1.9, NULL, 7, 'Observaciones:\r\n- Se observa un buen clima de aula, donde la docente implementa diversas estrategias que  favorecen la escucha y promueven el aprendizaje.\r\n- La clase cuenta con los distintos momentos, ofreciendo estrategias de aprendizaje que permitir el logro del objetivo.\r\n- Se destaca el cierre de la clase donde la docente retoma el objetivo, solicitando una tarea especifica y asociada directamente con este.\r\nAcuerdos de mejora:\r\n- Utilizar tiempo asignado y sin salida para permitir que los estudiantes tomen conciencia del tiempo para cada tarea de la clase y promover la participación y atención de todos.\r\n- Para verificar la comprensión de conceptos durante los diferentes momentos de la clase, se solicita implementar el uso de cuaderno o pizarra u otra estrategia que promueva la participación de todos y que, a su vez, le permita verificar que todos han comprendido el contenido. Esto promueve la diversificación del trabajo en aula y la participación de todos los estudiantes. Ejemplo: que todos escriban 1 sustantivo en su cuaderno, luego comparten o al termino de la clase, usar un ticket de salida donde pueda medir que todos aprendieron sobre los sustantivos comunes.'),
(754, '14273480', '14354013', '2025-04-15', '11:55:02', '12:40:02', 7, 32, 2, NULL, 3, 'Observaciones:\r\n- Se observa una sala ordenada y limpia.\r\n- La docente monitorea a los estudiantes y esta atenta a los estudiantes, reforzando y apoyando a la profesora jefe.\r\n\r\nAcuerdos de mejora:\r\n- Velar porque cuando los estudiantes asistan al baño, sean solo 2, 1 niño y 1 niña, para evitar que salgan constantemente.\r\n. Promover la autonomía de los estudiantes.');
